322	Beat the heat with a bowl of gazpacho	42	beat-heat-bowl-gazpacho	680		Gazpacho, or cold tomato soup, is an easy-to-make recipe thats perfect for the summer. Although the dish originated in Spain, there are slight variations of the recipe in countries around the world.\r\n\r\nI decided to go with a quick and easy version of the recipe. It requires minimal ingredients that are  cheap to purchase at any grocery store.  The necessary cooking materials are present in most student kitchens.\r\n\r\n<strong>Ingredients</strong>\r\n\r\n<ul><li>6 plum tomatoes, chopped</li>\r\n\r\n<li>4 green onions, chopped</li>\r\n\r\n<li>1/2 large cucumber, peeled and chopped</li>\r\n\r\n<li>1 red bell pepper, seeded and chopped</li>\r\n\r\n<li>1/2 cup water</li>\r\n\r\n<li>2 tablespoons vinegar</li>\r\n\r\n<li>2 tablespoons olive oil</li>\r\n\r\n<li>salt and pepper to taste</li></ul>\r\n\r\n<!--image:"gazpacho2"-->\r\n\r\n<strong>\r\n\r\nDirections</strong>\r\n\r\nCombine the tomatoes, green onions, cucumber, bell pepper and water in a blender; blend until smooth. Add the vinegar and olive oil; blend again until well mixed. Season with salt and pepper to serve.\r\n\r\nPreparation time: 15 to 20 minutes\r\n\r\n<!--image:"gazpacho1"-->\r\n\r\nMy biggest challenge making gazpacho was making sure that everything fit into my food processor without spilling over. Overall, this recipe is not all that difficult to make, which means its perfect for any student whos tight on money and time. Plus, its also healthy and refreshing.\r\n\r\nAs delicious as gazpacho is, be forewarnedits not very filling. Some recipes recommend dipping bread or tortilla chips in it, which would make it a simple and satisfying snack on a hot summer day. Try it the next time youre looking for something delicious during a heat wave, or if you find theres an unexpected abundance of tomatoes.\r\n\r\n<em>Source: http://allrecipes.com/recipe/quick-and-fresh-gazpacho/detail.aspx </em></em>	t	t	2011-08-05 18:26:51-04	2011-08-05 17:49:18-04	2011-08-05 17:49:18-04	t
321	Fad diets and weight-loss myths	41	fad-diets-and-weight-loss-myths	528		When it comes to losing weight, there seems to be a focus on upheaving daily diet routine in exchange for instant results. The summer season seems like the perfect time to experiment, but before you clear your fridge of bread, beware that some major diet fads are based on fiction and can even inhibit proper nutrition.\r\n\r\nI spoke to Queens Peer Health Outreach Coordinator Beth Doxsee to get the skinny on how five major diet trends affect the maintenance of a healthy diet.\r\n\r\n<strong>Eating every three hours</strong>\r\n\r\nThis trend encourages people to eat every three hours to keep their metabolism constantly at work, thus effectively burning calories at all times. According to Doxsee, there is value to this trend because when ravenous, people dont always make the wisest food choices.\r\n\r\nGrabbing a simple sugar, such as a granola bar or cookie, will cause your energy levels to peak and then crash, she said.\r\n\r\nEating snacks throughout the day will prevent your hunger from overwhelming you.\r\n\r\nYou have to be careful to watch your portion sizes and be careful of what youre eating, Doxsee said, adding that an ideal snack would include a complex carb, a fruit or vegetable and a source of protein. Each breaks down at a different rate, providing lasting energy and preventing hunger from setting in before mealtime.\r\n\r\n<strong>Stop eating at 7 p.m.</strong>\r\n\r\nMany people believe that after 7 p.m. your metabolism ceases to burn calories effectively. According to Doxsee, this is a total myth. Some people may be encouraged to stop eating at 7 p.m. because at night time, snacking happens for the wrong reasons like tiredness or boredom.  \r\n\r\nSince students have such irregular schedules that see them up at all hours of the night, waking up late in the day or playing intramural games at 10 p.m., they need to fuel their bodies when they need to, even if it is late at night, she said.\r\n<strong>\r\nFasting or cleansing to jumpstart weight-loss</strong>\r\n\r\nThere are many things wrong with these diets, Doxsee said.\r\n\r\nWhen you fast, you are putting your body into starvation mode, she said, adding that your metabolism will slow down because your body doesnt know when it will get food again.\r\n\r\nYou may see initial weight loss, but your metabolic rate will stay low even once you start eating again. \r\n\r\nAlso, denying yourself the calories you need prevents your whole body from carrying out its basic tasks. \r\n\r\nYour body and brain are constantly at work in some way. Your body needs calories to function properly, Doxsee said.  \r\n\r\nAnyway, there are more effective ways to rid the body of toxins and speed up metabolisms, such as exercising.\r\n\r\n<strong>Eating a low-fat diet\t</strong>\r\n\r\nMany people follow a low-fat diet plan believing that if you consume fat, it will be stored as fat. Doxsee said this isnt necessarily true and fats are essential to a healthy diet.\r\n\r\nWe need fat to transport vitamins and nutrients, she said, adding that its actually not about what you eat, but how much.  No matter what you consume, be it fat or something else, you will store fat and put on weight if you take in more calories daily than you need.\r\n\r\nShe said low-fat versions of foods are often more processed and artificial, which isnt good for our bodies. One key factor is distinguishing between saturated and unsaturated fats.  The intake of saturated fats, found in red meat and products such as butter and cheese needs to be limited while  unsaturated fats, found in nuts, seafood and avocado are generally healthy.  \r\n\r\n<strong>Eating a low-carb diet</strong>\r\n\r\nThe Atkins diet made low-carb diets a popular, advising that carbohydrates be avoided so that bodies burn fat instead of carbohydrates. About 55 to 60 per cent of your daily caloric intake should come from carbs, Doxsee said.\r\n\r\nCarbohydrates are our brain food. You may see initial weight loss by cutting carbs, but there are negative side effects that may include headaches or loss of concentration."\r\n\r\nCarbohydrates store more water than other macronutrients, which is why you may feel more bloated after eating them. However, our bodies need water and carbs actually help with hydration.\r\n\r\nSome low-carb diets even go so far as discouraging certain fruits and vegetables, which are important sources of vitamins, minerals and fibres that shouldnt be left out of any diet.\r\n\r\nDoxsee said its important to warn students against stressing or obsessing over their diets as it can be time consuming and distracting.\r\n\r\nSchool is stressful enough. Dont put additional pressure on yourself to follow a perfect diet. \r\n\r\nAlthough it may sound like a clich by now, everything in moderation really does seem to be the key.\r\n\r\n	t	t	2011-07-28 09:08:51-04	2011-07-28 09:02:58-04	2011-07-28 09:02:58-04	t
320	Making the most of a summer paycheque	38	making-most-summer-paycheque	589		When I was hired for my first-ever summer job, I was excited at the prospect of being able to accumulate savings. Despite my best efforts, checking my balance online has become a cringe-worthy routine. Between summer sales, weekend trips and margarita nights, I seem to be burning through my paycheques.\r\n\r\nAccording to Alison Stolz, a financial advisor at TD Canada Trust in Kingston, saving money during the summer doesnt have to be hard.\r\n\r\nI think that as a student youre so busy during the school year you dont notice that you stick to more of a budget, she said, adding that when you have more time to spend money, budgeting just seems harder.\r\n\r\nHere are some of her tips for students looking to give their bank accounts a boost.\r\n\r\n<strong>Preauthorized transfers</strong>\r\n\r\nIts easy to set up automatic, preauthorized transfers from a chequing account to a savings account. Money can be transferred monthly, every few weeks or using any other time frame.\r\n\r\nIf its an automatic transfer, its going to be sent to your savings account no matter what you have going on, Stolz said.\r\n\r\nAnother option is to set up your account so that with every debit transaction, money is automatically transferred to your savings. It can be as little as 50 cents but it will add up.\r\n\r\n<strong>Look at the small things</strong>\r\n\r\nIf youre going to buy a five dollar coffee every day, thats really going to add up, Stolz said. \r\n\r\nLooking at the little things you spend money on and cutting back on them will make a big difference.\r\n\r\n<strong>Be realistic</strong>\r\n\r\nEven though the summer season presents more opportunities to go out to restaurants and bars, its important to know when you wont be able to splurge, Stolz said. \r\n\r\nThis may be difficult, especially during the summer. Thats why physically budgeting where your money needs to go will help.\r\n\r\n<strong>Make a physical budget</strong>\r\n\r\nTaking the time to write down a physical budget of how much money needs to go towards certain expenses such as utilities and groceries will help you figure out how much money you have leftover to play with.\r\n\r\n You really realize where your money is going, Stolz said.\r\n\r\n	t	t	2011-07-28 08:55:42-04	2011-07-28 08:49:11-04	2011-07-28 08:49:11-04	t
317	Spring Reunion at Fort Henry	35	spring-reunion	589		<em>Journal</em> photographer Asad Chishti was at at the Spring Reunion event, Queen's at the Fort on May 28.\r\n\r\n<!--image:"spring-reunion"-->\r\n\r\n<!--image:"spring-reunion2"-->\r\n\r\n<!--image:"spring-reunion3"-->\r\n\r\n<!--image:"spring-reunion4"-->	t	t	2011-06-04 17:02:44-04	2011-06-04 16:52:57-04	2011-06-04 16:52:57-04	t
319	Where have all the people gone?	38	where-have-all-people-gone	528		Whether its a job, courses or the desire to continue living independently, there are plenty of incentives to remain in Kingston for summer. \r\nSpending summer here makes you feel like a real Kingstonian. But as your steady circle of friends from Queens dwindles and the campus depopulates, the time can initially be hard to fill. Here are the ways I hope to branch out this summer:\r\n\r\n<strong>Become a Kingston connoisseur</strong>\r\n\r\nGain a familiarity with the city that only summer leisure time can bring. Try every patio, sushi spot and boutique so that you can be the local expert when your friends return. I plan to hop on 1,000 Islands Cruises Discovery Cruise and become an expert on Kingstons history. It may seem random, but Im sure this information will come in handy during small talk. \r\n\r\n<strong>Host a party</strong>\r\n\r\nOther people will likely be looking for something to do and for other people to do it with. Having a party is the perfect way to pass the time and let different groups of friends mingle. Pretty soon youll have a whole network of summer friends.\r\n<strong>\r\nCatch up with old acquaintances</strong>\r\n\r\nIf youre here, this has probably happened to you already. Strolling down Princess Street, you bump into an old pal from first year who you wish you hadnt lost touch with. If you both express interest in hanging out, follow through! Youll have all summer to catch up and re-establish those old friendships. Invite them to your aforementioned party. \r\n\r\n<strong>Make friends with locals</strong>\r\n\r\nMake an effort to get to know your neighbours, your co-workers or friendly acquaintances. Theres a whole untapped network of people who have nothing to do with Queens and are sure to enrich your summer experience. \r\n\r\n<strong>Events in Kingston you dont want to miss</strong>\r\n\r\nDoors Open Kingston  (June 18)\r\n\r\nTake a peek at some of Kingstons fine establishments, including Agnes Benidickson House, HMCS Cataraqui at Kingstons naval reserve, Kingston Police Headquarters and the Shoal Tower National Historic Sites. No excuses for missing this oneits free. \r\n\r\nKingston Jazz Festival (June 23-25)\r\n\r\nThe Grand Theatre, the Mansion and Confederation Park will play host to world class jazz musicians. Be sure to enhance your appreciation of jazz by checking out the festival. \r\n\r\nMovies in Kingstons Market Square (starting June 24)\r\n\r\nMovies will be playing on many Thursday nights at dusk in the Market Square on a 24 by 40 foot inflatable screen. \r\n\r\n<em>For more information on these events, visit downtownkingston.ca.</em>\r\n	t	t	2011-06-04 17:01:19-04	2011-06-04 16:47:56-04	2011-06-04 16:47:56-04	t
315	Relevant is relative 	33	relevant-is-relative	643		By Holly Tousignant, Supplements Editor\r\n\r\nOn Nov. 3, 2009, the <em>Journal</em> published an article I wrote called <a href="http://www.queensjournal.ca/story/2009-11-03/news/destigmatizing-mental-health-issues/">Destigmatizing mental health issues</a>. This story was not about a specific student event or activity that had happened on campus; rather, it was about the stigma surrounding mental illness in general and the effect that stigma has on Queens students. In the comment section, several readers thanked the <em>Journal</em> and the very candid interviewee featured for raising such an important, relevant issue. I also received personal messages on Facebook saying the same thing. \r\n\r\nIm not exactly sure what the motion passed by Assembly means by student activities and events, but I would guess that this article wouldnt make the cut.<!--more-->\r\n\r\nOn Mar. 26, 2010 another piece was published called <a href="http://www.queensjournal.ca/story/2010-03-26/news/talking-hybrid-learning-models/">Talking hybrid learning models</a>, also written by myself. The story, written as part of news special project for that year, was about the models of virtualization that were proposed by the Principals Taskforce on Virtualization. I dont think the content of this story would fall under the student events and activities category either, but I would dare anyone to argue that proposed changes to the way classes are taught isnt of the utmost relevance to students. In writing that story, I had the opportunity to educate students on an issue most of them likely knew very little about. \r\n\r\nThese are just two of the many pieces I have written in my nearly three years working at the <em>Journal</em>, first as a contributor, then as Assistant News Editor and now as Supplements Editor. I have also written stories about the Israeli/Palestinian conflict, racist assaults on West Campus, the stress of first year, the adaptive technology centre and the closure of Kingstons prison farms. Are any of these stories directly about student activities and events? Perhaps not, but I do think theyre some of the most thought-provoking, relevant pieces Ive had the privilege of working on. Not just to me, but to the student body as a whole.  \r\n\r\nI am proud of the work I have done at the <em>Journal</em>, not simply because I think it has served me well, but because I believe the stories I have been a part of have been of genuine interest to students. My stories have stirred passion, anger and debate in students. You dont debate about things that dont deeply interest you. \r\n\r\nI think if you were to ask the members of Assembly who voted for the motion to pass, they would not disagree that what I have said is true. But they might ask what the harm is in simply taking a look at the statistics. \r\n\r\nAs others have said before me, there is no harm in this. The harm comes from the AMS, the corporation that funds the <em>Journal</em>, being the ones to facilitate this audit. As others have also mentioned, there is still no real harm so long as the AMS doesnt plan on implementing changes based on their findings. But if this is not the intention, why waste the time and resources to do the audit at all?  \r\n\r\nHeres what I honestly think will come out of this if the motion isnt overturned: the data will create a stir for a day or so, then it will get stuffed in a drawer somewhere and forgotten about, in which case it will have been a mere waste of time. Of course, theres also the chance that the results will get blown out of proportion, influencing how future editors do their job. Many #teamjournal critics Ive come across dont understand what would be so bad about the <em>Journal</em> changing their practices based on the results of the audit. I hope they keep those attitudes in mind when the <em>Journal</em> is being pressured to write about faculty bake sales and car washes over mental health issues, academic planning and other important topics. \r\n\r\nSo please, come out to the AMS AGM and vote to reverse the motion. Not just because it will make my life easier or even because its the right thing to do, but because next year when you open up the paper, I can guarantee youll want to be reading the stories editors are capable of coming up with free from AMS influence. \r\n	t	t	2011-04-14 08:29:25-04	2011-03-21 23:44:38-04	2011-03-21 23:44:38-04	t
314	Understanding implications 	33	understanding-implications	643		By Clare Clancy, News Editor\r\n\r\nHearing the words Queens Journal and content spoken about together in an AMS assembly discussion shocked me. My shock turned to disbelief when, following this discussion, AMS assembly passed a motion which mandates the Media Services Director to provide an analysis of <em>Journal</em> content quantifying articles that directly address student activities and events. \r\n\r\nTwo years ago, I worked as an Assistant News Editor for the <em>Journal</em>, and during that time attended countless AMS assemblies. In my year of reporting on student government happenings, I never heard a single discussion like this.<!--more-->\r\n\r\nThere is a good reason it was never brought up, and that is editorial autonomy. The <em>Journal</em>s content is something chosen by the editors of the <em>Journal</em> and no one else. This is of paramount importance to anyone who values the aim of a newspaper and its ability to hold people and institutions accountable. When a student politician causes controversy or when people ask us not to write a story because of its heated nature, <em>Journal</em> staff members continue to report, aware that at the end of the day, what goes in the paper is up to us. No, the motion doesnt directly address editorial autonomy but  it does have implications for the future of <em>Journal</em> content.\r\n\r\nThe motion brought forward at assembly is disturbing for many reasons. First, if an analysis is  conducted, what percentage of content relating directly to student activities and events will be deemed acceptable? What does this mean? Does this mean that stories relating to Queens clubs are to be thought more valuable than those relating to the Kingston community? \r\n\r\nPersonally, I thought coverage of the Kingston mayoral elections was one of the most important things in the <em>Journal</em> this year. While it wasnt a student-run activity or event, the results of our municipal elections directly impact Queens as a community within Kingston. We have an obligation to inform students of changes in local politics which impact their daily lives and Queens as a whole.  \r\n\r\nIt is possible that with information from this audit available, future editors of the <em>Journal</em> will be pressured to live up to a certain percentage. As one of two incoming Editors in Chief, I find this a scary thought.\r\n\r\nSecond, the motion asks the AMS Media Services Director to perform an analysis that is virtually impossible and will lead to flawed results. The information collected will not be helpful in any way. How do you decide if something falls under the umbrella of a student activity or event? For example, incoming AMS Academic Affairs Commissioner Mira Dineen was interviewed for an article about poverty in Kingston on Jan. 18. She is a student who co-authored a book on the subject, but the focus of the article was on poverty in the surrounding community. Was this an important and worthwhile story? Absolutely. Does the article relate to a student activity? Im unsure. It relates to one students activity. How many students need to be part of the activity for it to be counted? My point is that the <em>Journal</em> writes for the Queens community and we know our readers interests. After all, we are students too. I think the time and resources of the Media Services Director can be  better spent elsewhere.\r\n\r\nThe third issue I have with this motion is that I dont believe its stated intention. We all know information for the sake of information isnt the real reason the motion was brought forward. There are those who believe <em>Journal</em> content to be questionable at times. I will say that despite what many readers might think, <em>Journal</em> staff  are open to criticism and we are aware that mistakes are made. It is for this reason that in policy we print clarifications and corrections. After all, we are student journalists and we are learning our trade. That said, there are avenues available to address the concerns of the only people we really care about: our readers. Part of <em>Journal</em> policy includes publishing letters to the editor, seeking out opinion editorial pieces from members of the Queens community and holding open editorial boards each semester. If that isnt enough, we make ourselves available through every medium possible. Whether its having an open door policy at the Journal House, being available through social media like Twitter and Facebook or emailing one of the two dozen addresses on the <em>Journal</em> website (section specific for convenience), we accept and encourage open dialogue with readers.\r\n\r\nIf you are still reading this blog post, let me say there is one redeemable quality of the motion. I appreciate the amendment made by Media Services Director Sarah Kwong. I am relieved that she removed other media services like CFRC and QTV from the motion, which originally mandated all AMS media to be audited. No  media service which values editorial autonomy should be subjected to the same ridiculous notion of content analysis as the <em>Journal</em> is now. \r\n\r\nWhat worries me the most is that the people who voted for this motion, those on AMS assembly who said let us collect information for informations sake, are unaware of the true implications  their decision holds.\r\nInfringement on editorial autonomy has to begin somewhere. I think AMS assembly members who voted in favour of  this motion should reconsider what it means for the future of the <em>Journal</em> and Queens community at large. 	t	t	2011-04-14 08:29:40-04	2011-03-20 22:21:44-04	2011-03-20 22:21:44-04	t
313	An open letter to members of the AMS	33	an-open-letter-to-members-of-the-ams	643		By Jessica Fishbein, Assistant News Editor\r\n\r\nAbout this time last year, defying all my cautious optimism and wildest expectations, I was hired as an Assistant News Editor for the Journal. This continues to baffle me and I am eternally grateful to Tyler Ball and Rachel Kuper for taking a gamble and giving me this opportunity, given the fact that I had no prior experience writing for the <em>Journal</em>. \r\n\r\nI think at this point it is fair to say that this job has changed my life.<!--more-->\r\n\r\nThis year, I have been given a chance to explore new opportunities I had never known existed. This experience has allowed me to hear the views of some of the most intelligent people I have ever had the privilege of meeting, let alone working with, in my life. It has made me confident in my own abilities and made me realize, as clich as it is, that with hard work and determination, what I want to do with my life is within my grasp.\r\n\r\nPerhaps the most rewarding part of my job, however, is how much it has opened my eyes to new issues; issues that I wasnt aware of before and wouldnt have known about if this job werent available to me. Apparently, having the ability to learn so much about a wide range of new things is one of the best parts of being a journalist, and from my experience I can now 100% agree. By nature we dont know everything, so we get to learn all that we can from our interview subjects, who are the real experts.\r\n\r\nI seriously believe that if this motion is passed, the incoming News Editor's experience at the <em>Journal</em> will have the possibility of being severely restricted, and other students will not be lucky enough to have the same experience as I did. \r\n\r\nI respect what the AMS does and have nothing but reverence and astonishment at the amount of time and effort that is put in by its dedicated staff into all of its important initiatives and endeavours. I wholeheartedly support the sentiment that students deserve to know about the happenings within the AMS and faculty societies.\r\n\r\nHowever, if the motion is passed, I fear that the incoming Assistant News Editors learning experiences could be much more limited to only reading about happenings within the AMS. \r\n\r\nPerhaps what everyone fails to realize is that News only receives so much space in the newspaper. There are other things students undeniably want and should be able to read about, such as Editorials, Dialogue, Arts and Entertainment, and much more.\r\n\r\nWhat were to happen if we were given a quota on how much to report on AMS and faculty societies that we would have to fill? What would happen if there were potentially bigger issues facing students that we wouldnt be able to report about, because it didnt fall into one of these quota categories? Would these sections listed above no longer exist?\r\n\r\nMy worries lie in what the implications of such a survey could be. It makes me wonder why the AMS wants to conduct a report on our content, if or how this report will be analyzed, and what actions will be taken after this analysis? In my mind, presentation of such content will undoubtedly lead to the analysis of such content, and there is no way an analysis will remain unbiased.\r\n\r\nI truly believe there is cause for worry because naturally, there are intentions behind everythingno data is collected just for the sake of collecting data. Why would this action be pointless?\r\n\r\nMore importantly, how are we supposed to remain unbiased as a newspaper if our publisher is telling us what we have to write about?\r\n\r\nNot to be dramatic, but the fact that the AMS is attempting to remove this component is almost like censoring what we choose to write about.\r\n\r\nIt shows an inherent lack of trust from the student government to allow student journalists to do our job.\r\n\r\n(I also find it personally offensive that I am not given this trust by my student representatives when I have sat for eight consecutive hours at AMS Assemblies listening to them debate issues in order to objectively report on it for students.)\r\n\r\nRoberta Bondar, Paul Martin, Emily Haines, Bedouin Soundclash - these are just a few of the prestigious people my colleagues have had the chance to interview, due to the Journals editorial autonomy.\r\n\r\nIf the AMS deems after this audit that faculty societies are more important for students to read about, not only will student journalists be unable to have these amazing opportunities afforded to them, readers will also lose out.\r\n\r\nAt the end of the day we are a newspaper run by students. Myself and my fellow Assistant News Editors, Katherine-Fernandez Blance and Labiba Haque can only be physically responsible for covering so many events, and thus have to help make the decisions of what makes the paper each issue. It is natural for people to wish to read about what serves their own self-interestseven if it does speak to a sense of entitlement about what people deem is relevant to studentsbut not everyone is going to be happy 100% of the time. \r\n	t	t	2011-04-14 08:29:50-04	2011-03-20 02:28:36-04	2011-03-20 02:28:36-04	t
312	Strength in numbers 	33	strength-in-numbers	643		By Katherine Fernandez-Blance, Assistant News Editor\r\n\r\nI recently conducted a survey of all the articles I had ever written for the Queens Journal. This wasnt done to pad my ego, but rather in light of the motion passed at AMS assembly that will now require the incoming Media Services Director to undergo a similar assessment of all of the <em>Journal</em>s content, correlating percentages to coverage of student events and student activities.  \r\n\r\nI write this article fully condemning the motion and the rationale of those who helped it pass. The results of my survey did not shock me, but for those who are for the collection of data in this manner, please read on to enlighten yourself as to why this is a motion that will waste resources, hinder editorial autonomy, and prove entirely irrelevant to the student body. \r\n\r\nIve written for the <em>Journal</em> for the past two years. Because my stories have been predominantly for the News section, that is where my numbers are based. I only analyzed my own articles because I lacked the time to do the same for others in the News section.  <!--more-->\r\n\r\nSince I started in 2009, I have written 52 stories. By even skimming through them, I found that 48% are immediately directly related to student events or activities. This was obvious by looking at the title of the article in most cases. \r\n\r\n9.6% dealt with issues that affected members of the administration, 7.7% dealt with news on a more local or provincial scale, and 3.8% (two articles) focused on professors winning awards. \r\n\r\nThe way the <em>Journal</em> is run isnt always the most transparent and I believe that this is where a lot of the confusion and anger stems from. In the News section, once a month we write three or four articles for the Campus Catchup section. These short articles relate to occurrences that are happening at other Canadian universities. 13.5% of my articles fell into this category. \r\n\r\nThe <em>Journal</em> is one of the few student newspapers in Canada that doesnt regularly report on events at other universities. We like to keep our content focused on issues that directly affect Queens Students. The articles written in Campus Catchup do not involve Queens activities or events, but as the writers, we believe that they are of both interest and relevance to students since many of the issues addressed can have national implications for postsecondary institutions as a whole. \r\n\r\nThe final area that my articles fell into (17% of them) was gray. This is the crux of the matter in practical terms. Does an obituary of a student fall under student activity? How about Islamic history month, which many Queens students participated in in October, though the month was part of a national movement? The registrars office forcing some engineering students to pay extra tuition wasnt an event undertaken by students, but it was an activity that effected students. \r\n\r\nWhere do you draw the line?\r\n\r\nCollecting these results took me the better part of an hour. Translate that into a survey of every section from every issue for a year. This has never been part of the Media Services Directors portfolio, so where will this extra time come from and where will resources have to be drawn from? \r\n\r\nIs it realistic to assume the Director will be pouring through every article written for the <em>Journal</em> in the past year? If not, will they have to search for buzzwords like student or event and then tally everything up? What happens to articles in the gray area, like I have mentioned above? \r\n\r\nI am trying to appeal to you from a practical perspective, so I will only touch on editorial autonomy. \r\n\r\nPlease think about this motion with some common sense. Once all the data is analyzed, where do we go from there? If the <em>Journal</em> is found to have less than an ideal percentage of content that focuses on student events and activities, will we be recommended to improve this? Who will decide what the appropriate percentage is? \r\n\r\nYou dont have to be involved in the <em>Journal</em> at all to realize what this motion implies. It is NOT up to the AMS to decide our content, but with this motion, those who support it are treading a very fine line. \r\n\r\nThe information we present in each issue is not inaccessible. You can see in every issue for free, online or in print, where your student dollars are going towards. We arent trying to hide anything, but this motion is. \r\n\r\nPlease consider the implications of this motion. If its a waste of time, why do it? If its not, what precedent will this set? \r\n\r\n<strong>Vote to reverse this motion at the AMSs AGM: Tuesday March 22nd, 8:30pm, Ban Righ Dining Hall. Vote for common sense, and for your campus newspaper. </strong>\r\n \r\n	t	t	2011-04-14 08:30:04-04	2011-03-19 20:44:26-04	2011-03-19 20:44:26-04	t
311	Interfering and delegitimizing	33	interfering-and-delegitimizing	643		By Andrew Stokes, Copy Editor\r\n\r\nInitially, the AMS motion to audit the <em>Journal</em> didnt worry me. It mandates Media Services Director Sarah Kwong to ...conduct an analysis of the content of AMS media during the current academic year and to subsequently report on the percentage of content that directly addresses student activities and events.\r\n\r\n\tThis motion is seemingly benign: it appears to be a fact-finding missionknowledge for knowledges sake. However, upon further consideration of the issue I changed my mind. My belief that it was a simple study without policy implications was nothing short of nave. <!--more-->\r\n\r\n\tThere are only a few potential outcomes and none are desirable. First of all: the analysis is conducted and the <em>Journal</em> is found to be relevant to student life. In this case the audit was a waste of time, and there are no repercussions beyond lost time, energy and resources. The second outcome is that the <em>Journal</em> is found to report a percentage of news addressing student activities and events that is insufficient, and in this case there is no sequential action taken (again, an apparent waste of time, energy, etcetera). The third outcome is that the <em>Journal</em> is found to be insufficient and the AMS subsequently suggests or mandates that the Journal report more about student issues.\r\n\r\n\tThe trouble with the latter outcome is that it infringes on the<em> Journal</em>s right to editorial autonomya constitutionally guaranteed right. \r\n\r\n\tLosing autonomy is a serious problem that completely delegitimizes this publication and by association, our school. Editorial autonomy, in short, is a publications right to be free from interference. This includes the content and stories reported, as well as the stances taken on whatever issues are editorialized. \r\n\r\n\tThis motion does not directly remove the <em>Journal</em>s right to autonomy, but it lays the groundwork whereby this autonomy could be eroded, and perhaps removed one day. \r\n\r\n\tIts a matter that concerns all members the Queens body; a frequent publication that reports the relevant goings on and holds elected officials accountable is a fundamental piece of a healthy democratic environment, including a university. \r\n\r\n\tThis is not a personal matter; its ideological. A publication is only responsible to its readers, and their concerns can be voiced in a way that is constructive, not damaging. There is an entire section of the paper dedicated to Dialogue, and criticism is welcome, as it helps point the direction in which the <em>Journal</em> can grow and improve. \r\n\r\n\tOur publication is not beyond reproach, but to question the relevance of our content is a slight to the entire operation. One need look no further than the front page to see stories that address student activities and events. The issue on March 18 features stories regarding Queens response to the tragic earthquake and tsunami in Japan, student governments responses to the rector controversy and success of the womens hockey team, to name a few.  \r\n\r\n\t The potential that has the <em>Journal</em> worried is if we as a whole are refused the right to report on these events and instead report what the AMS decides for us. \r\n\r\n\tWe are a relatively small operation with limited resources, but we welcome criticism. If you feel that we missed an important event, or that our coverage was in some way lacking, please let us know. When the readers want improvement, we will endeavor to improve; after all, we want to report the stories that matter to you.	t	t	2011-04-14 08:30:19-04	2011-03-19 13:58:33-04	2011-03-19 13:58:33-04	t
303	Sports - CIS Hockey Saturday	35	hockey-saturday	502		The action was fierce this evening at the Waterloo Memorial Recreational Complex as the Gaels faced off against the powerful Marlets squad. The underdog Gaels fought a hard battle but were unable to fend off the powerful McGill offence. \r\n\r\nThe following images are from the Gaels' 3-1 loss to the McGill Marlets.\r\n\r\n<!--image:"gaelswhockey2-2"-->\r\n\r\n\r\n<!--image:"gaelswhockey2-3"-->\r\n\r\n\r\n<!--image:"gaelswhockey2-4"-->\r\n\r\n\r\n<!--image:"gaelswhockey2-5"-->\r\n\r\n\r\n<!--image:"gaelswhockey2-6"-->\r\n\r\n\r\n<!--image:"gaelswhockey2-7"-->\r\n	t	t	2011-04-03 13:02:19-04	2011-03-12 22:47:45-05	2011-03-12 22:47:45-05	t
318	Shaping up for summer	32	shaping-summer	528		Summer sees a surge of people wanting to amp up their fitness routine. Whether its to look good lounging by the pool or to fulfill aspirations of outdoor adventure, summer offers unique opportunities for exercise. Here are four activities for summer fitness that are far from routine.\r\n\r\n<strong>Outdoor boot camp</strong>\r\n\r\nBoot camp showcases interesting and varied outdoor exercise. Boot camp can be understood as full-body functional, exercise-based circuit training. According to instructor Pam Fountas, boot camps push people to physical extremes that cant be reached in a solo workout.\r\n\r\nShort intervals and circuits make boot camp time-effective and challenging. Changing environmental factors are an added plus.\r\n\r\nFountas said the results are more than just physical.\r\n\r\nAt the end of the day, pushing yourself to physical limits translates into other aspects of your life. Not only does it burn calories, it builds confidence as well.\r\n\r\n<em>Pam Fountas is the instructor of Limitless Living Boot Camp 4 Women. Spaces are still available Mondays and Wednesdays at 6:30 p.m. Email pam_fountas@hotmail.com for details. </em>\r\n<strong>\r\nKayaking</strong>\r\n\r\nIt isnt necessary to travel to cottage country to enjoy the pleasures of paddling through the water. Get a view of Kingstons waterfront via kayak. Coordinating muscles in the upper-body, abdominal region, hips and legs, makes kayaking an especially effective workout. Whether you want to go for an intense high-powered trip or a leisurely paddle, set your own pace.\r\n\r\n<em>Ahoy Rentals at 23 Ontario Street offers kayaking, sailing, canoeing and cycling as recreational options. Visit ahoyrentals.com to find out about rentals, rates and hours.</em>\r\n\r\n<strong>ARC fitness classes </strong>\r\n\r\nThe ARC still provides creative exercise options in the summertime. A number of new classes have been added through the Fitness and Wellness program.\r\n\r\nPiloboxing combines high-energy boxing movements with Pilates toners, making for a high-intensity workout. Hoop Dance offers a workout for your core, wrists and shoulders. A program called Recreational Fitness and Games has also been introduced where participants can choose games to play each week. Options include floor hockey, European handball or basketball.\r\n\r\n<em>To check out classes, fees and packages, visit gogaelsgo.com. </em>\r\n\r\n<strong>Running outdoors</strong>\r\n\r\nHeres another simple way to enjoy Kingstons waterfront while getting some exercise. Grab some friends and try out the Beat Beethoven Run Event on June 5. People will have the chance to run a 4km or 8km track in the city while the Kingston Symphony plays Beethovens music. Runners are challenged to complete the running course before the 50 minutes of music is up. If runnings not your thing, just grab a gelato and watch--you can always pretend you finished early!\r\n\r\n<em>Visit beatbeethovenkingston.com for more information.</em>	t	t	2012-05-15 09:21:41.184442-04	2011-06-04 16:58:22-04	2011-06-04 16:58:22-04	t
309	Arbitrary and frightening	33	arbitrary-and-frightening	643		By Lauri Kytmaa, Assistant Sports Editor\r\n\r\nComing in as the Assistant Sports Editor for the 2010-2011 staff of the Queens Journal I had no intention of getting involved in any sort of political debate. A recent motion issued by the AMS assembly has changed that.\r\n\r\nThe motion requires the Media Services Director (Sarah Kwong) to conduct an analysis of the content of The Queens Journal during the current academic year and to subsequently report on the percentage of content that directly addresses student activities and events. \r\n\r\nThe passing of such a motion is both arbitrary and frightening. It is arbitrary because we are the Queens student newspaper.<!--more-->\r\n\r\n From the front page of the News section to back of the Postscript the paper is made by students to be read by students. There is hardly any material that doesnt relate in some way to the campus community. News is strictly oriented to Queens campus activities, administration and student life.  Features are just the same. Opinions and Letters (now Dialogue) are chiefly written by students not on the <em>Journal</em> Editorial Board, Arts focuses on the Kingston happenings, Sports are entirely isolated to the Queens Gaels and Postscript too is totally focused on campus life. \r\n\r\nSadly it seems that the members of the AMS body have failed to pick up a copy of the Journal in recent history. Percentage of content that directly addresses student activities and events what the hell does that even mean? Is a 95% good enough? \r\n\r\nYet this motion is frightening because it may represent a first step in undermining the freedom of the press for the Universitys most prominent paper. The AMS may further begin to infringe on the editorial freedom of the paper. By making judgements on what stories should be covered and which ones should be omitted the AMS would take a disturbingly totalitarian control over a body that they should have no control over. \r\n\r\nA good paper derives from creativity and freedom to discuss what an editorial board thinks needs to be discussed. Constantly double checking with a third-party would cripple the <em>Journal</em>s ability to produce a good product. It would take longer to make sure things were allowed to be written and even longer in bitter debate.\r\n\r\nMy jaded view on political bodies has only grown as a result of this process. It appears that the AMS cannot find anything better to do than arbitrarily strip the power of the schools student paper. Im sure there are more pressing matters at hand.  	t	t	2011-04-14 08:30:30-04	2011-03-18 20:23:37-04	2011-03-18 20:23:37-04	t
310	Arcane obstructions	33	arcane-obstructions	413		Dear Journal staff,\r\n\r\nThere's been a lot of confusion about what happened on Thursday at AMS Assembly. This is my attempt to lay it all out for you guys.\r\n\r\nFirst, some background. The AMS has a very basic behind the scenes relationship with the Journal. Basically, the AMS is the Journal's publisher, and so we have to be financially accountable to them. This is why we have J-Board and why we can't spend all of our budget on beer.\r\n\r\nParallel to that, we are afforded editorial autonomy. The only buzzwords we like; this basically means we can write whatever we want.\r\n\r\nWe also have the mandate to provide meaningful journalism experience for our volunteers, that's you guys. John Stackhouse told us that at least 10-12 people in the Globe newsroom are Journal alumni. Not bad for a school with no formal journalism program.\r\n\r\nAt AMS Assembly three weeks ago (before reading week) Victoria Pleavin, EngSoc president, drafted a bunch of motions, one for every commissioner and director of the AMS. These range from institutionalizing faculty rivalries to getting the MAC to conduct a campus-wide housing survey. \r\n\r\nShe wanted to come to Assembly "with a pile of motions to fix many of these problems and more since clearly it's not going to be done with any sort ofinitiative of this executive." Some of them may have been great ideas, if brought to Assembly with some forethought and consultation with those involved. Her motion relating to the Journal had neither.<!--more-->\r\n\r\nThe motion for Sarah Kwong, Media Services Director read:\r\n\r\n"That AMS Assembly directs the Media Services Director to conduct an analysis of the content of AMS media during the current academic year and to subsequently report on the percentage of content that directly addresses student activities and events."\r\n\r\nBecause of all these motions, they didn't get to ours until the next Assembly, on Thursday night. Sarah had "AMS media" changed to just "The Queen's Journal", which I supported because it's more honest. We all know who Ms. Pleavin is really after.\r\n\r\nIt's a grudge. In her statement to Assembly on Feb. 3rd Ms. Pleavin lied and said we ignored the requests of the EngSoc Chief Returning Officer by releasing their election results early. There were no such requests and I have emails to prove it. I'm extremely offended by this, because the writers that worked very hard all election night don't deserve to be slandered.\r\n\r\nMs. Pleavin, in explaining her reasons for the motion, said that engineering students are unfairly represented in the Journal. However, if she looked she would notice we don't really cover any ofthe faculty societies' events that often. It's not out of malice, but that other things take precedent and that we don't receive many requests for publicity from faculty societies.\r\n\r\nSo, on Thursday night I got up and tried to defend the Journal. I said all those things in the first four paragraphs and how they relate to our coverage: We cover a wide variety of things to provide good experience for our writers and provide a paper students actually want to read so we can sell ads to cover our costs and be financially accountable to the AMSthe only thing they should care about. This is why we have more than just a News section.\r\n\r\nBut, the majority of Assembly's members stood up and said things along the lines of "I think it would be good to have this data" without knowing the specifics of the AMS-Journal relationship. I'm disappointed that some of those representatives that are familiar didn't speak up and help clear the air. I also had much more to say when the motion was called to question, cutting off the speakers list. Talk about a dysfunctional body.\r\n\r\nThere's a reasonable discussion there about our coverage and faculty societies. Perhaps there's more we could be doing about fac socs, but they don't communicate with us about stories nor do they cooperate with us when we do want to write something. It's a two-way street. Ms. Pleavin has been notoriously impossible to contact this year. If you won't talk to us, why should we care about your initiatives?\r\n\r\nI don't have a problem with someone doing a study of the Journal's content. Ms. Pleavin could do one herself by bringing up the Journal website and counting articles that address "student activities and events". The percentage that do would probably surprise her.\r\n\r\nThe point is that the directive is coming from the AMS, a purely governmental component of the corporation that publishes the Journal. They have no place talking about the Editorial content ofthe Journal, as written in their constitution, even for an analytical purpose.\r\n\r\nIt sets a dangerous precedent. If you have a room full of egotistical, self-important politicians talking about assessing the Journal, who says they can't start talking about it more? I strongly believe that the Journal's autonomy and effectiveness to report will not be lost in one big fight with the AMS, but inch-by-inch, behind the scenes.\r\n\r\nThis is why we need to speak out. I want anyone involved with the Journal, or who cares aboutthe Journal, to write a blog post about why this motion effects how you do your job. Emotionally, mentally. Does it make you second guess writing about something or someone?\r\n\r\nWe need to talk to our friends about it. If they ask you questions, try to answer them or show them this post. If they are dismissive, tell them to look at some other campus newspapers in Canada. They will find that Queen's students are lucky they have the Journal, despite all our critics.\r\n\r\nThe Journal is an institution of almost 139 years. It's bigger than the sum of it's parts, so we all need to step up and contribute to that sum. We're so lucky to have a staff that cares so much and takes so much time out of their lives to create each issue. Without you I would have no reason to be mad, because there would be no Journal. Speaking out from multiple perspectives will strengthen our cause.\r\n\r\nSend your posts to me at this address or to Terra at journal_blogs@ams.queensu.ca.\r\n\r\nTyler Ball\r\nEditor in Chief\r\nThe Queen's Journal	t	t	2011-04-14 08:31:11-04	2011-03-18 17:04:56-04	2011-03-18 17:04:56-04	t
308	Extend and reciprocate	33	extend-and-reciprocate	643		By Catherine Owsik, Copy Editor\r\n\r\nI came into the Journal this year with little knowledge of the paper, the process and especially the people involved. After a couple training sessions and editorial boards I felt perfectly at ease and soon enough we all became more than colleagues, we became more like teammates  unfortunately its starting to look like we actually have an opposing team to band against. \r\n\r\nI guess I came into the position with a bit of a nave outlook, when I heard there was tension between various groups and the Journal I thought it couldnt be true, it mustve been a thing of past years. Im sad to say that since then my opinion has changed, and the recent motion brought towards the AMS from Victoria Pleavin has just reinforced this.<!--more-->\r\n\r\nMy realization of a bias against the Journal began when I helped cover the AMS elections by attending an AMS election party. For the most part everyone was kind and friendly, and it felt wonderful to share the nerves and excitement with such a large group of people, but there were a couple instances where this wasnt the case.\r\n\r\nEarly on in the night I was approached by a man and after he had finished introducing himself he asked what I was doing with a pad of paper in my hand, Oh Im here from the Journal , and before I could even finish introducing myself he had cocked his body back with a look of disgust. Really? I was so surprised with his reaction that I went straight out with it and asked him why he didnt like the Journal  And he had no answer. He sputtered about some past event that he clearly had no real opinion of and then walked away. \r\n\r\nThis same situation happened again during the night, just with a different person who was even more abrupt and rude. Ive got to say that it wasnt so much that my feelings were hurt as that I was just in awe that someone would take their friend-of-a-friends opinion of the Journal so much to heart that they would be rude to a complete stranger. \r\n\r\nThe recent motion brought to AMS Assembly reminds of that night. There is no reason why the content we published throughout the year should be investigated; the Journal is an informative publication that relays content to students and faculty that they would actually enjoy to read.\r\n\r\nThe way I see it, the only difference between our layout and a national newspaper is the absence of a cartoon section  which (if Im allowed a bit of a joke) is why the Golden Words is on campus. Its really unfortunate that some personal grudges are growing out of hand to the point of questioning our content and legitimacy. \r\n\r\nWhat problem do people really have with the Journal? And to those who do, wouldnt you like these problems addressed? All I can think of is that if nobody can say anything then there is just going to be a growing animosity between groups in the school that will be passed on from year to year, quickly losing the why.\r\n\r\nAt the <em>Journal</em> we pride ourselves in being a student-run publication and it is really unfortunate to see our editorial autonomy being questioned like this by fellow students. I would like to start seeing a change away from this cycle of grudges, if we extend an arm to faculty societies and ask for your opinion and help, I hope to get a response.	t	t	2011-04-14 08:31:24-04	2011-03-18 13:59:51-04	2011-03-18 13:59:51-04	t
306	Late goal wins bronze for Gaels	33	late-goal-wins-bronze-for-gaels	595		<!--image:"gaelswhockey3-1"-->\r\n\r\nThe Golden Hawks dominated their regular season match-ups with the Gaels including a particularly painful 8-1 loss in January. But this years Queens Gaels dont roll over; a big factor in their competing in the CIS Championship. The Gaels battled hard in the bronze medal game coming out on top with a late goal by defender Kerstin van Bolderen. \r\n\r\nLaurier pressured early in the first but with a flurry of penalties called, both teams were left to fend off man advantages. The Golden Hawks had a huge advantage with a five-on-three after interference penalties were called first on forward Brittany McHaffie and then defence Kerstin van Bolderen. Gaels held off the Laurier power play amounting to a momentum swing for Queens. A quick opportunity by Kench and a Thomson shot that went off the post were two of the Gaels better chances in the period. The Gaels ended the period with 12 shots on net to Lauriers nine. \r\n\r\nPenalties took over the second period with the Gaels and Golden Hawks taking four each.  In one of the more intense moments of the period, Laurier was rewarded a penalty shot; their second in the playoffs against the Gaels, dating back to their OUA semifinals. Dodd-Moher, who has been one of the Gaels strongest players all tournament, shut down the Laurier player. The Gaels play during their second period did not create as many opportunities with only four shots on net. \r\n\r\nWith no score going into the third, both teams had an air of desperation in their play knowing that whoever scores first could have the winning goal. With penalties less of an issue in the third, the Gaels and Golden Hawks had a fierce battle exchanging opportunities throughout the 20 minutes. \r\n\r\nvan Bolderen converted a pass by Kench with less than two minutes to play in the game. The lone goal of the game would stand and Queens would go home with the bronze medal in their first CIS finals tournament in Queens history.\r\n\r\n<em>For full coverage, pick up an issue of the Journal on Friday. </em> \r\n	t	t	2011-04-03 13:01:16-04	2011-03-14 02:42:33-04	2011-03-14 02:42:33-04	t
305	Bronze no cake walk for Gaels	33	bronze-no-cake-walk-for-gaels	595		<!--image:"gaelswhockey2z"-->\r\n\r\nThe Gaels playoff season has been called miraculous. A winning streak that ended yesterday after beginning in January, a record of 5-1 after being scored on first and an improbable (and well publicized) six overtime marathon game that contributed to their first OUA title. The Gaels (and those who have watched them) know that they deserve to be here; they earned their berth and theyve battled against the best for it. \r\n\r\nThe Gaels have faced tough competition on their run; defeating the Guelph Gryphons and the Laurier Golden Hawks, both nationally-ranked teams. The Alberta Pandas were defending CIS champions and the Gaels took them out in a shootout. \r\n\r\nIntimidation and pressure wont faze these Gaels. They believe in the power of their team.\r\n\r\nGoaltender Mel Dodd-Moher has stood tall time and time again in net for the Gaels. Her play against the McGill Martlets proved that there was no luck in her success against OUA competition. Skill and confidence have proven her to be one of the best goaltenders of the tournament. \r\nThe strong presence of veteran line Liz Kench, Becky Conroy and Kelsey Thomson create an impact every time theyre on the ice. Whether it be with their talented stick-handling or their physical presence, this line asserts itself against any competition.\r\n\r\nThe McHaffie twins have been the most visible presence in the playoffs especially coming off the OUA postseason where they scored winning goals in the Laurier and Guelph series. \r\n\r\nAlthough Queens defeated Laurier to advance to the OUA finals, the Gaels will not overlook the consistently powerful Golden Hawks team. Laurier swept the Gaels in their regular season series including a particularly painful 8-1 loss in January. \r\n\r\nTo put the Laurier team into perspective Justin Fauteux, Sports Editor at the Cord (Lauriers student newspaper) wrote, This season was a bit of a strange one for the Laurier Golden Hawks. For starters, they lost three games, which is more than they lost in the previous two seasons combined. Adding to the strangeness, he said, was that Queens was able to sweep them in the postseason.\r\n\r\nLaurier boasts one of the most impressive goaltenders in the country in Liz Knox. Reigning CIS player of the year, Knox has a 20-2 record with five shutouts to lead the OUA. The Gaels will have to work to create opportunities against her.\r\n\r\nThe Gaels will be in a battle for bronze Sunday against a talented Laurier squad. Their run is not miraculous and their underdog status has only acted as encouragement for the team. Queens will be on the ice tomorrow looking to prove themselves as they have time and time again this year. \r\n	t	t	2011-04-03 13:01:24-04	2011-03-13 03:53:03-04	2011-03-13 03:53:03-04	t
304	Queen's underdogs can't kill McGill	33	queens-underdogs-cant-kill-mcgill	595		<!--image:"gaelswhockey2-1"-->\r\n\r\n<em>The Queen's Journal's Kate Bascom, Justin Tang and Lauri Kytomaa are in Waterloo, Ontario this weekend, covering the Gaels' bid for the CIS championship.</em>\r\n\r\nBy Lauri Kytmaa\r\nAssistant Sports Editor\r\n\r\nThe Queens Gaels finally met their match on Saturday as they faced up against the number one seed McGill Martlets in the second game of the CIS round-robin. While the story of the postseason for the Gaels had been resilience under deficits, there would be no coming back against the Martlets who have yet to lose a game in 26 games this season. Nevertheless the Gaels put up a valiant effort against the Goliath that has outscored its opponents 94-25, falling 3-1 in regulation.\r\n\r\nThe Martlets opened up the scoring quickly in the first period suggesting that the game could very well spiral out of the Gaels control. A penalty on Queens defenceman Katie Duncan just 55 seconds into the period provided McGill just the room it needed to slide a puck under goaltender Mel Dodd-Mohers pads and take a one to nothing advantage. \r\n\r\nThe first strike failed to deter the Gaels as they battled back and forward Kelsey Thomson scored an unassisted goal 9:34 into the period. The score was tied at the end of the first but other statistics still suggested a discrepancy: for one the shots were 16-7 in favour of McGill.\r\n\r\nPenalty calls certainly factored into this difference between the teams. In the first period the Gaels took four infractions while the Martlets took three, but in the second only the Gaels would be called on violations. McGill was able to take the lead on a power play 5:30 into the second frame. The goal provided them just the surge of momentum they needed to break things up. Under three minutes after this go-ahead goal was scored, they potted another goal to take a 3-1 lead over the Gaels. \r\n\r\nAs the second period approached its close, even more disheartening signs showed for the Gaels. With 2:42 left in the period, Thomson, the teams lead scorer in the regular season, was hit with a puck and stumbled limply to the bench. She would return to the game but her speed seemed to take a hit for the rest of the game. Also about a minute after Thomson fell down, a McGill player checked forward Brittany McHaffe straight into the boards from behind, right in front of the referee: no call.  \r\n\r\nThe Gaels entered the third period with a two-goal deficit. Because each of the Gaels playoff games had come after trailing at some point in the game, head coach Matt Holmberg said the team couldnt help but feel that they could do it again.\r\n\r\nIts funny were down 3-1 against McGill and the teams still quietly confident, he said. Weve just done it so many times. We just knew that were still in this, we still have a shot at this right to the last second. \r\n\r\nThe teams tempo was there, but they were simply outmatched by a confident McGill team. The physicality flared up for the Gaels. Holmberg said that the physicality was part of the plan all along.\r\n\r\nI think that it was a part of our game plan to get on them physically, he said. Obviously we werent trying to do it to take a penalty but we certainly wanted to let them know that we were there and try to get in their face a little bit.\r\n\r\nYet sustained time in the Martlets zone was hard to come by: the game ended 3-1, giving the Gaels their first loss of the 2011 playoff run. Gaels captain Michelle Hunt said that the Gaels didnt leave anything on the table.\r\n\r\nLosing is always disappointing but we gave it our all. I think overall our team played really well, she said. Theyre a great team. Theyre number one in the country. We had a game plan and I think we stuck to it. It was difficult with the penalties we had because they have a great power play.\r\n\r\nTheir 1-1 CIS round-robin record will send them to the bronze medal game at 4:00 p.m. Sunday where they will face the Laurier Golden Hawks for the sixth time this season. Their last meeting was in the OUA semi-final where the Gaels swept them in two games that both went to double overtime. A win tomorrow could provide a bronze-lining for the Gaels OUA banner season.\r\n\r\nIts awesome especially for Queens, Hunt said. We gave it our all out there so we cant take anything away from that. Its been a great season.\r\n\r\n<em>Please visit <a href="http://www.queensjournal.ca/blogs/Rejects/2011/03/hockey-saturday/">The Rejects Blog</a> for more photos from Justin Tang at the CIS Championships.</em>\r\n	t	t	2011-04-03 13:01:33-04	2011-03-13 03:10:31-04	2011-03-13 03:10:31-04	t
301	Sports - CIS Hockey Friday	35	hockey-friday	502		Kate Bascom, Lauri Kytomaa and I are in Waterloo, Ontario, covering the Queen's Gaels at the CIS Women's Hockey Championship. We'll be reporting daily on the team's progress through the round-robin tournament, with tweets, text and images. \r\nThe following photos are from the Gaels' 2-1 shootout victory over the Alberta Pandas.\r\n\r\n<!--image:"gaelswhockey1"-->\r\n\r\n\r\n<!--image:"gaelswhockey3"-->\r\n\r\n<!--image:"gaelswhockey4"-->\r\n\r\n<!--image:"gaelswhockey5"-->\r\n\r\n<!--image:"gaelswhockey7"-->\r\n\r\n<!--image:"gaelswhockey6"-->\r\n\r\n\r\n\r\n<em>For Kate Bascom's story on the game, please visit <a href="http://www.queensjournal.ca/blogs/headline/2011/03/gaels-beat-pandas-in-waterloo/">Gaels beat Pandas in Waterloo</a>.</em>\r\n\r\nMore to come from all of us in Waterloo!	t	t	2011-04-03 13:02:33-04	2011-03-11 23:50:06-05	2011-03-11 23:50:06-05	t
300	Gaels beat Pandas in Waterloo	33	gaels-beat-pandas-in-waterloo	595		<!--image:"gaelswhockey2"-->\r\n\r\n<em>The Queen's Journal's Kate Bascom, Justin Tang and Lauri Kytomaa are in Waterloo, Ontario this weekend, covering the Gaels' bid for the CIS championship.</em>\r\n\r\nThe Gaels played their first game of the CIS championship round-robin Friday afternoon against the Alberta Pandas. The Gaels grabbed their first lead in the playoffs with a goal by forward Liz Kench but the Pandas came back to tie the game in the second. The game was won in a shootout. Forward Kelsey Thomson was the lone scorer. \r\n\r\nHead coach Matt Holmberg said the Gaels started the game a little bit nervous.\r\n\r\nIt was our first championship playing against the defending champions, he said. Maybe there were some nerves. As we calmed down and weathered the storm, particularly after we got that goal we realized that we were in this game and we had a chance to win it. \r\n\r\nThe Gaels are playing in a round-robin format the championship. Their pool includes the Alberta Pandas and the McGill Martlets. Queens has faced neither team and prepared for the tournament by focusing on their own game. \r\n\r\nWe decided that the best thing to do in our scenario is to do nothing different, Holmberg said. Try to do everything exactly the same or as close to the same as weve been doing during this streak. Just stick to the routine.\r\n\r\nThe game went to overtime after Alberta scored on a five-on-three in the second period. With that tying goal, the Gaels were heading to their sixth straight game to go beyond regulation. The Gaels had only been involved in four shootouts during the regular season, coming out on top only once.\r\n\r\nWe do practise shootouts for fun every week, Holmberg said. With the way that Mels been playing and with the shooters that we have, we were pretty optimistic that wed have a good result.\r\n\r\nHolmberg went with his fifth-years, forwards Liz Kench, Becky Conroy and Thomson, in the shootout. \r\n\r\nTheyre the vets, he said. Youve got to go with the players that got us here ... Those three have been a part of this team for five years and have been producing amazing numbers and they want to go. They want the opportunity to end the game. \r\n\r\nGoaltender Mel Dodd-Moher faced 35 shots from Alberta and shut down all three Pandas in the shootout. She said the Gaels faced a different style of play from competition outside the OUA.\r\n\r\nDefinitely a different calibre, she said. They had a lot of good shots, a lot of nice plays ... Most of us were pretty excited just because in the OUA you only play 10 teams or so. It was nice to switch it up.\r\n\r\nThomson remarked on the Gaels penchant for marathon games this postseason and the switch to a shootout.\r\n\r\nWe were obviously a little nervous, she said. Were used to playing a couple periods of overtime and the shootout kind of forced it but its okay, it came out in our favour.\r\n\r\nThomson, who scored the winner in the shootout, said her shot against the Alberta goaltender was a bit lucky. \r\n\r\nI was coming down and I usually deke but I looked up and the goalie was so far back in her net that I just kind of flipped it in the last second, she said. It happened to kind of go off her shoulder and top corner.\r\n\r\nThe Gaels face the McGill Martlets tomorrow at 4 p.m.\r\n\r\n<em>Please visit <a href="http://www.queensjournal.ca/blogs/Rejects/2011/03/hockey-friday/">The Rejects Blog</a> for more photos from Justin Tang at the CIS Championships.</em>\r\n\r\n\r\n	t	t	2011-04-03 13:02:47-04	2011-03-11 23:30:52-05	2011-03-11 23:30:52-05	t
299	AMS Assembly Live Blog	33	ams-assembly-live-blog	413		Tonight we'll be live-blogging AMS Assembly where a motion will be tabled to place Rector Nick Day on a referendum ballot to be impeached.\r\n\r\n<iframe src="http://www.coveritlive.com/index2.php/option=com_altcaster/task=viewaltcast/altcast_code=f6dd6043f5/height=550/width=450" scrolling="no" height="550px" width="450px" frameBorder ="0" allowTransparency="true"  ><a href="http://www.coveritlive.com/mobile.php/option=com_mobile/task=viewaltcast/altcast_code=f6dd6043f5" >AMS Assembly Live Blog</a></iframe>	t	t	2011-04-03 13:05:47-04	2011-03-10 19:53:07-05	2011-03-10 19:53:07-05	t
298	Rector Round-up	33	rector-round-up	413		<img src="http://www.queensjournal.ca/media/stories/v138/i21/v138i21day.jpg" />\r\n\r\nJust in case you haven't been paying attention to what's happened this week in campus politics (and how could anyone blame you), there's been quite the stir over Rector Nick Day.\r\n\r\nLet's recap. \r\n\r\nOn Remembrance Day last November Day made <a href="http://www.queensjournal.ca/media/stories/Rector_Remembrance_Day.pdf">this speech</a>, a somewhat <em>alternative</em> interpretation of a Remembrance address. To summarize it, he began with a salute to his veteran grandfather and then branched out to a number of different topics including the US government's support of Pinochet's regime in Chile, civilian casualties in Iraq, the Rwandan genocide and the "injustice of desecrating Palestinian Towns".\r\n\r\nObviously, reactions were divided. Some supported Day for putting the spotlight on these issues and speaking his mind, but mostly the response was negative. Maclean's <a href="http://oncampus.macleans.ca/education/2010/11/11/queens-remembrance-day-soapbox/">posted a criticism of the speech on their On Campus blog</a> and Queen's Israel on Campus <a href="http://www.scribd.com/doc/42386769/Queens-Israel-on-Campus-Statement-re-Nick-Day-s-Remembrance-Day-Remarks">released a rebuttal</a>.\r\n\r\nA motion was tabled that night at AMS Assembly to censure Day for using his position to speak personal views that don't represent his constituency. <a href="http://www.queensjournal.ca/story/2010-11-12/news/rector-reprimanded/">The motion passed 14-10 with 11 abstentions.</a>\r\n\r\nThat motion was brought to Assembly by Craig Draeger as a student-at-large. Draeger is also a leader of the Campus Conservatives (and an editor here at the <em>Journal</em>), who have led the latest charge against Day.\r\n\r\nThis week, after Michael Ignatieff <a href="http://www.liberal.ca/newsroom/news-release/statement-liberal-leader-michael-ignatieff-israeli-apartheid-week/">denounced Israeli Apartheid Week</a>, Nick Day wrote a letter in response, and <a href="http://www.rabble.ca/news/2011/03/response-michael-ignatieff-his-statement-about-israeli-apartheid-week">posted it on the ultra-liberal Rabble.ca</a>.\r\n\r\nThis time it's not just a censure<a href="http://www.facebook.com/permalink.php?story_fbid=10150414629045375&id=657890374">it's an impeachment</a>.\r\n\r\n<!--image:"nickday-craigfbook"-->\r\n\r\nThe <a href="http://fullcomment.nationalpost.com/2011/03/09/rector-of-queens-university-celebrates-israeli-apartheid-week-declares-israel-guilty-of-genocide/">National Post</a> and <a href="http://oncampus.macleans.ca/education/2011/03/09/queens-rector-abuses-his-title-in-letter-to-ignatieff/">Maclean's</a> posted criticisms. Facebook and Twitter are ablaze. There's even a <a href="http://nickdazesweater.tumblr.com/">Tumblr blog</a> attempting to make a meme out of it:\r\n\r\n<!--image:"nickday-meme"-->\r\n\r\nRumour has it, a motion will be brought to Assembly tonight by the above parties to hold a referendum to impeach Day. Also, the <em>Journal</em> has learned that Day won't be attending tonight's Assembly.\r\n\r\nBut none of this compares to <a href="http://twitter.com/#!/queensprincipal/status/45913541835894784">being called to the Principal's office</a>.\r\n\r\n<!--image:"nickday-woolf"-->\r\n\r\n<strong>UPDATE (4:30 p.m.)</strong>: Ontario MPP Steve Clark called on John Milloy, minister of Training, Colleges and Universities to condemn Day's actions during question period at Queen's Park today.\r\n\r\n<blockquote>QUESTION PERIOD.  MARCH 10, 2011\r\nMr. Steve Clark: My question is for the Minister of Training, Colleges and Universities.\r\n\r\nYesterday, Nick Day, a student representative at Queen's University used his position as rector to accuse Israel of committing genocide against Palestinians in a letter attacking your own federal leader. Will you condemn the comments of Mr. Day in writing in a letter to the chancellor and the board of trustees of Queen's University?\r\n\r\nHon. John Milloy: All members realize that on university campuses it's about finding a balance. We want to find a balance between the safety and security of students, along with providing an environment where individuals and groups can participate in debate and discussion on a wide range of issues that you and I may not agree with.\r\n\r\nEarlier this year, as members know, the Legislature condemned anti-Semitism on our university campuses, especially in the form of Israel anti-apartheid week. Jewish students, as well as faculty, must be able to live, work and study at our universities without fear of discrimination or hatred and I know that all our institutions work hard to create that balance.\r\n\r\nThe Speaker (Hon. Steve Peters): Supplementary?\r\n\r\nMr. Steve Clark: Minister, you talk about us not agreeing, this House unanimously approved a motion by my friend, the member for Thornhill, to ban the prejudicial term Israeli Apartheid Week. All members of this House stood to condemn the word apartheid for what it is: hate-filled.\r\n\r\nNow a student representative is not only using the term, but accusing Israel of genocide in a letter to your own federal leader. Will you, along with the Minister for Immigration and Citizenship, condemn the actions of Mr. Day in a letter to the chancellor and the board of trustees? Will you do it?\r\n\r\nHon. John Milloy: Again, our government remains committed to fighting discrimination in all its forms. We have spoken out against anti-Semitism. We have very strong ties to the state of Israel. The Premier, of course, led a mission there earlier last summer.\r\n\r\nThis is about balance ...\r\n\r\nL093-1115-10 follows\r\n\r\n[Hon. John Milloy]\r\n\r\n... discrimination in all its forms. We have spoken out against anti-Semitism. We have very strong ties to the state of Israel. The Premier, of course, led a mission there earlier last summer.\r\n\r\nThis is about balance. This is about campuses maintaining the right of students and faculty to have discussions about issues that the member or I or anyone in this House may not agree with, and at the same time protecting the rights of students to be able to study in safety. It is a matter of finding that balance.\r\n\r\nI know from my regular meetings with university and college presidents that they work very hard to maintain that balance, and I have every confidence that these institutions will continue to provide the necessary environment for debate and discussion, and also for the safety and security of students.\r\n</blockquote>\r\n\r\n<strong>UPDATE (5:20 p.m.)</strong>: After meeting with Nick Day this afternoon, Principal Woolf <a href="http://www.queensu.ca/principal/news/rectorday.html">posted the following on the Principal's News page</a>.\r\n\r\n<blockquote>\r\n\t<h4>Meeting with Rector Day</h4>\r\n\r\n\tMarch 10, 2011\r\n\r\n\tThis afternoon, I met with Rector Nick Day to express my concerns about an open letter he wrote earlier this week to the federal Liberal party leader. He wrote the letter as Rector, and not as an individual citizen.\r\n\r\n\tThe University's position is that this was inappropriate.\r\n\r\n\tThe views in the letter are not the issue - agree or disagree, he is entitled to them - it's the context in which he communicated his personal opinion.\r\n\r\n\tMr. Day's views do not and should not be seen as being representative of those of the University or Queen's students.\r\n\r\n\tThe university has been contacted by students, alumni, and others, who believe Mr. Day should no longer have the privilege of holding this office.\r\n\r\n\tAs a student-elected representative, the Rector is answerable to Queen's student body. The issue is being discussed tonight at AMS Assembly.\r\n\r\n\tI take this situation very seriously and I will be monitoring developments. In our conversation, I asked Rector Day to consider the impact of his actions and take steps to separate his personal views from the university position he currently holds. I am hopeful he will do so immediately.\r\n\r\n\tDaniel Woolf\r\n\t</blockquote>	t	t	2011-04-03 13:05:51-04	2011-03-10 16:26:39-05	2011-03-10 16:26:39-05	t
297	"We All Want to Be Young": Generational Multimedia	33	we-all-want-to-be-young-generational-multimedia	643		"We All Want to Be Young" is the work of BOX1824, a Brazilian research company, who carried out a qualitative examination of the distinct qualities which divide each generation of youth. \r\n\r\n<em>Written and directed by Lena Maciel, Lucas Liedke and Rony Rodrigues. </em>\r\n<code>\r\n<object width="400" height="225"><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="movie" value="http://vimeo.com/moogaloop.swf?clip_id=16638983&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=1&amp;color=00ADEF&amp;fullscreen=1&amp;autoplay=0&amp;loop=0" /><embed src="http://vimeo.com/moogaloop.swf?clip_id=16638983&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=1&amp;color=00ADEF&amp;fullscreen=1&amp;autoplay=0&amp;loop=0" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="400" height="225"></embed></object>\r\n</code>\r\n\r\nThis week, the Journal's Postscript editor Kelly Loeper wrote about stereotypes faced by today's youth in <a href="http://www.queensjournal.ca/story/2011-03-04/postscript/era-ego/">"The era of the ego"</a>.	t	t	2011-05-28 19:23:03-04	2011-03-04 10:54:10-05	2011-03-04 10:54:10-05	t
295	Musings on a revolution: A teach in on the Egyptian Revolution in brief 	33	musings-revolution-teach-egyptian-revolution-brief	643		By Katherine Fernandez-Blance\r\nAssistant News Editor\r\n\r\nIts hard to sleep when theres a revolution going on, appears to be the sentiment echoed by many of us. I probably know equal numbers of people who were glued to their seats watching Al Jazeeras live streaming that I do students who never bothered to inform themselves about the quick unraveling of the Egyptian revolution. \r\n\r\nLuckily, as Queens students, we are blessed with the ability to learn and question from some of the greatest thinkers of our university, and we have the choice of whether or not to remain ignorant about the state of global affairs. \r\n\r\nDana Olwan, professor of gender studies and Arabic, took this opportunity to put together a teach-in styled panel on Feb. 17th for students and professors alike to come together and learn about the Egyptian Revolution from six different angles.\r\n\r\nTeach-ins are educational forums, held at times of political need and urgency. They combine academic and activist speakers, Olwan said. The first time I attended one waswhen people were organizing against the U.S. invasion of Afghanistan and I learned a lot. \r\n\r\nOlwan said that she transformed her dining room into an Al Jazeera news headquarters over the past 14 days, and that the turnout at the Teach-in was a testament to how much our community sees itself as part of a larger society and world at large. \r\n\r\nThis is the first event Ive ever organized where people say their coming on Facebook and actually show up, this is an important moment, she said. \r\n\r\n The event, held in Chernoff Hall had people cramming into the aisles and standing in the back, unable to find seats at one of the most interesting and well-put together panel discussions I have attended at Queens. What follows is a condensed version of the main points of discussion amongst the six panelists. \r\n\r\nMohamed Bayoumi: Introduction to the Revolutions causes\r\n\r\nMohamed Bayoumi, professor emeritus of electrical and computer engineering began the panel with discussions of the reasons behind what he described as a revolution of massive proportions.\r\n\r\nIt is the third major revolution worldwide in terms of numbers, after the French and Russian, but it is the first nonviolent revolution, Bayoumi said. It is proving that non-violence can achieve resultsit can topple a dictator and get rid that regime.\r\n\r\nBayoumi outlined what he felt were some of the major grievances Egyptians had suffered with for over 30 years prior to Feb. 11th. \r\n\r\nHe said that Egypts emergency rule which essentially allows the government the right to charge or detain anyone they wish was one problem, which still hasnt been addressed by the nations current military rule. \r\n\r\nRigged elections, curtailed freedoms such as the censorship of the media, and corruption were also areas Bayoumi said caused intense discontent among the Egyptian population.\r\n\r\n[There were screwed priorities] with 1.4 million people working for the police. The money for security was way more than that for health and education, Bayoumi said, adding that because most of the government had been controlled by business men, the majority of the population had not been properly served by governmental policies. \r\n\r\nBayoumi also criticized Mubarek and his regime for blindly following the American government, and for acting as a proxy nation for other governments to bring prisoners to be tortured. \r\n\r\nThe objective of the revolution can be summed up in three words: freedom, dignity and social justice. These are three areas that the current regime has failed miserably at, Bayoumi said. \r\n\r\nKhaled Shaeen: Dates of note\r\n\r\nKhaled Shaheen acted as both a moderator of the panel and spoke about the timeline of events leading up to the Egyptian Revolution, as well as the Tunisian Revolution and further uprisings in other areas of the Arab world. \r\n\r\nParticular dates of interest were 1996 when Al Jazeera was formed, which Shaheen indicated was a strong shift away from state controlled media, as well as 2003 where the US invasion of Iraq created large anti-war protests throughout Egypt, though Mubarek was viewed as being aligned with US policy. \r\n\r\n2004 saw the first protests in Egypt calling an end to Mubareks reign, and the next year marked the rise of the Egyptian blogosphere, as well as Egypts first multi-party election, which was rigged in Mubareks favour. \r\n\r\nShaheen said that the next years saw accelerating protests from labor unions and ordinary citizens, and in June 2010, Egyptian blogger Khaled Saeed was killed, allegedly by Egyptian police.  Facebook movements followed, as did the Tunisian Revolution of January 14th. \r\n\r\nEgypt is a young population suffering from a lack of freedom and a lack of economic opportunity, Shaheen said. \r\n\r\nAdnan Hussain: The legacies of the 50s and 60s\r\n\r\nAdnan Hussain, professor of Islamic world history spoke next, and said that it was important to realize that the reasons for the revolution extended further than 30 years. \r\n\r\nThere are unfinished legacies that are being approached in new and dramatic ways, Hussain said, referring primarily to the rise of the third world consciousness that occurred during the 1950s and 60s period of decolonization. \r\n\r\nHussain pointed to social and land reform as well as economic development as areas of a social agenda that sparked hope in the newly independent regions.\r\n\r\nThe popular mobilizations behind this were very quickly marginalized. It was a top down revolutionary moment that quickly turned into a repressive state, he said. \r\n\r\nHussain contrasted this era with the present one in which there have been no clear leaders of the Egyptian revolution. He said that the people have realized that they dont actually need the state, or at least the regime any more. Also unusual is the lack of Islamism in the movement. \r\n\r\nIts not to say that Egyptian people are any less piousbut the idea that Islam as the discourse for political solution has been resolved as obsolete for political events, Hussain said. \r\n\r\nAriel Salzmann: Global solidarity for Egypts youth \r\n\r\nProfessor Ariel Salzmann of Islamic and world history spoke about the need for global solidarity with the Egyptian people.\r\n\r\nThe eyes of the entire world are looking, this event is not confined to the Middle East, Salzmann said. \r\n\r\nMany of the panelists pointed out that the revolution has been a youth lead movement, and Salzmann said that this coincides with a global underclass.\r\n\r\nTheyre looking to a future that doesnt exist[the Revolution] has been a coming togetherwith a youthful face that speaks across the globe, Salzmann said, adding that its important to remember that the strikes post-Revolution have not let up. \r\n\r\nA single spark can light a prairie fire, Salzmann quoted. \r\n\r\nNasser Saleh: A revolution through Twitter, Facebook and Google\r\n\r\nNasser Saleh, an Egyptian who wrote his masters thesis on the role if information communication technology and democracy in the Middle East talked on the important role social media played in the Egyptian Revolution. \r\n\r\nHe displayed examples of Egypts state run media blatantly misrepresenting the reality of the revolution. Tahir Square at 9:45pm was shown to be peaceful and beautiful on state run television, meanwhile news coverage on networks like Al Jazeera and the BBC showed the reality of the protests. \r\n\r\nMost interestingly, Saleh posed the question of whether a revolution can be tweeted. A Facebook event calling for the revolution on Jan. 25th was created and had almost 100,000 people respond as attending. \r\n\r\nA Google map was linked to the group to show meeting places all over Egypt, and a Google document was created [to list the necessary logistics] necessary to bring about change, Saleh said. After the Revolution, a Google forum was created to discuss the future of Egypt.\r\n\r\nI dont know how many revolutions in the world already had a date and time, Saleh said. \r\n\r\nMohammed Abdou: Where next? \r\n\r\nMohammed Abdou, a phd candidate and self-described Muslim anarchist was notably more critical about the results of the Revolution than his co-panelists. \r\n\r\nIts not about seizing power, its about knowing what to do with the power seized after, Abodu said, arguing as an anarchist against the nation state. \r\n\r\nAbodu was critical of the idea of democracy being implemented in the country, concerned with it existing as a Western import, a concept that he said has clearly been ineffective in our own society. He said that so long as a modern nation state exists within capitalism, equality cannot be achieved. \r\n\r\nAbodu posed more questions than answers in his discussion, asking what the political and ethical commitments the post-Revolutionary movement will base itself on. \r\n\r\nI think its an incredible time to be alive, but its a time to be very cautious as welltheres a degree of intellectualism thats somewhat missing from the conversation, Abodu said. Its our responsibility over here to try and establish and assist one another transnationally in our struggles because we seriously do have common struggles, and we cant do it alone.\r\n\r\nDana Olwan: Revolutionary fear, and why we need to fight it\r\n\r\nDana Olwan, the final panelist, spoke on fear being the underlying emotion behind the revolution.\r\n\r\nWe [in the West] hoped but did not believe that the revolutionaries of Tahir square would succeed, Olwan began.\r\n\r\nShe said that fear on the conservative end primarily concerned the impact the revolution would have on Western foreign policy, particularly neoliberal economics, adding that it was important to realize who our fear served and what it served.\r\n\r\nTo fear the Egyptian revolution today is to signal to Egyptians that their lives are less important than yours and mine, Olwan said, calling for solidarity instead of fear of what a couple weeks or months of uncertainty would cause Egypt. \r\n\r\nTo fear it is to subscribe to the idea that certain humans are destined to live under tyrannical rule, while others can pursue equality and democracy, she concluded. \r\n\r\n\r\nFor full audio coverage of this Teach-In, see:  http://radio613.wordpress.com/2011/02/18/a-teach-in-on-the-egyptian-revolution/	t	t	2011-05-28 19:24:16-04	2011-02-25 21:04:08-05	2011-02-25 21:04:08-05	t
