263	Starfish	32	starfish	548		Its about three AM, and theres someone in your bed.\r\nMaybe youre dating this person.\r\nMaybe you dont even know their name.\r\nMaybe youre both covered in sweat and an inch-thick coating of cranberry sauce.\r\nIn any case, who they are--or how they got there--is none of my business.\r\nMy question is: are they staying the night?\r\n\r\nIve never known one topic to be as immediately divisive as the question of sleeping over--or not.\r\nSome of my friends refuse to share a mattress with anyone, under any circumstances. For them, the thought of even the largest shared bed evokes only nightmarish memories of hogged blankets, unforgiving elbows and snoring that resurrected Christ.Their partners--long-term or otherwise--have to acknowledge that under no circumstances will there be big-spooning, little-spooning, or any other spoon-related configuration. \r\nIn short, theyre <i>forked</i>.\r\n\r\nI guess its one thing to have a serious issue with sharing a bed under any circumstances. \r\nBut I find it pretty troubling that some people use this as an excuse to get themselves out of seeing someone once the sun is up--let alone actually having a conversation. \r\nHow is skulking home in the small hours of the morning any less of a walk of shame than doing so the next day? Some people go the other way entirely. For them, sharing a bed--for the whole night--is the main event, and its at least as important as anything else they might be doing with someone in that overnight timeframe. \r\n\r\nCall me old-fashioned, but I think its nice that some people still appreciate physical proximity in the simplest sense. I have great empathy for these people. Trying to find someone for a sleep-over, not pillow talk is a time-consuming process, and its one fraught with difficulties. When youd prefer a shared bed, having all the space you want sometimes feels like too much space entirely. \r\n\r\nThe best way to sleep if youve got your bed to yourself is to take up all the available space. Spread out as far as you can with each limb, and reach for every corner--in a starfish shape. If the whole bed is yours, why share?My friends find this immensely comforting. Theres something gratifying about the knowledge that the whole bed is yours, that you can have all the blankets and pillows, and that your snoring--if you are so afflicted--will offend no one. \r\n\r\nFor maximum hedonism, try doing this face down. Suddenly, it feels like youre sinking into a giant, cushiony embrace--its really quite marvellous. I call this the bed starfish, and Ive never heard anyone say anything negative about it. \r\nTired of sleeping on your side, on one side of your bed?\r\n<b>Starfish</b>.\r\nFed up with the sense of empty space in your box-spring?\r\n<b>Starfish</b>.\r\nNeed to find an echinoderm that can regenerate limbs?\r\n<b>Starf</b>--you get the idea.\r\n	t	t	2011-04-03 17:38:58-04	2010-10-23 17:26:27-04	2010-10-23 17:26:27-04	t
261	Mayoral Debate Live-Tweet Recap	33	mayoral-debate-live-tweet-recap	413		Here's a recap of the <em>Journal's</em> coverage of tonight's Mayoral Debate in Grant Hall.\r\n\r\n\r\nThe Journal will be tweeting updates from tonight's mayoral debate, beginning any minute now in Grant Hall.\r\n\r\nPrincipal Woolf, the AMS exec and most of AMS council are in attendance.\r\n\r\nAttendance is approximately 120 people.\r\n\r\nBarrie Chalmers "I'm not a politician, I'm a business man, and I'd like to take a business approach."\r\n\r\nMark Gerretsen says his campaign based on economic, cultural, societal and environmental sustainability.\r\n\r\nJohn Last says he wants to "create a link between the city and the university is not so adversarial."\r\n\r\nRob Matheson says he is concerned about past promises relating to the Memorial Centre and it's replacement.\r\n\r\nGerretsen: "There are some student behavior problems that we see in this community" he wants to create a committee to tackle these issues.\r\n\r\n"Social media to reach put to young people and keep them engaged."\r\n\r\nHe wants to meet with AMS and student leaders on a "regular scheduled basis."\r\n\r\nLast: An "attitude adjustment" may be necessary. "You need a reason for people to go to that Facebook page."\r\n\r\nMatheson: "It's imperative that we incorporate citizen input" not only at election time and regardless of age.\r\n\r\nChalmers: "There are so many bylaws on the books that are not being enforced." and that the city its own "worst enemy" re: Aberdeen.\r\n\r\n"Don't expect city hall and the councillors to do what you want then to do." Students need to provide input.\r\n\r\nNext question is in regard to diversity and making Kingston a more attractive destination for aboriginal and international students.\r\n\r\nLast: "How do we keep students here?" Supporting the arts community.\r\n\r\nLavalley: Make it easier for groups to hold public events like a parade. "Make it more accessible to showcase their lifestyle."\r\n\r\nMatheson: "Ever since I got to council I've been pushing to hold a multicultural festival like the one we just held."\r\n\r\nChalmers: "We have a very small group of diverse people in the city and we need to expand that group."\r\n\r\n"We need to bring more jobs to retain these students."\r\n\r\nGerretsen: "I think Kingston is a very diverse city."\r\n\r\nHe cites the recent 211 service and the necessity to make services available, as valuable assets for new Kingstonians.\r\n\r\nMatheson: "More cultural input" from aboriginal community.\r\n\r\ninclusion?\r\nNext question re: Gerretsen pltfrm: Why Is social inclusion measured by the city via crime rates? How does the city ensure social\r\n\r\nGerretsen: "There are difficulties with respect to measuring it" and that the city needs to develop a system of measuring inclusion.\r\n\r\nMatheson: "there's a differed dynamic in every group and we as a city need to be inclusive" especially with mental issues and age issues.\r\n\r\nQuestion for Ben Hartley, AMS VP-Operations: "Will you commit to having online voting at least available for the next election?"\r\n\r\nMatheson: Council is already working on it, he also wants preferential voting.\r\n\r\nGerretsen, Lavalley, Last and Chalmers also agree.\r\n\r\nLast: Every student will pay for Internet access. Caveat: security.\r\n\r\nQ from  Safiah Chowdhury, AMS President: How do you deal with the growing student population in Kingston?\r\n\r\nMatheson: Improve public transit and infrastructure, provide housing and especially affordable housing.\r\n\r\nM: Lakefront bike path.\r\n\r\nChalmers: We need better transportation. "are getting limited with what we can do inside the student area" need to make housing off-campus\r\n\r\nGerretsen: Promote density. Will save the downtown core.\r\n\r\nGerretsen: transit possibilities: Express routes and build based on "want" in addition to necessity.\r\n\r\nLast: "density is the answer downtown."\r\n\r\nLavalley: Were losing amenities in the downtown core. Ie No Frills. Amenities encourage students to move closer to core.\r\n\r\nQ: "Point out a unique quality that make them the ideal candidate for the position."\r\n\r\nChalmers: Independent business man and "I don't owe any special interest groups in this city anything."\r\n\r\nGerretsen: Bring new jobs. Kingston is booming in the renewable energy sector.\r\n\r\nGerretsen: make recycling available to all and build more sports facilities.\r\n\r\nLast: Youth.\r\n\r\nLavalley: Experience living paycheck to paycheck in Kingston, under the poverty line.\r\n\r\nMatheson: "anybody who knows me wouldn't call me politician" and seeing the need for change in the government.\r\n\r\nMatheson: Citizen involvement and taking the input of neighbors.\r\n\r\nGerretsen: Cites his "controversial" Lake Ontario Park plan and his ability to get 12 out of 13 councilors to agree on it.\r\n\r\nQuestion about attracting jobs.\r\n\r\nGerretsen: Bringing the jobs, something KEDCO can't do on their own.\r\n\r\nMatheson: Grow the talent we have within the city, to attract employers.\r\n\r\nChalmers: "We need more than just jobs, we need careers." can't just advertise, we need to "step out" and incentivize.\r\n\r\nQuestion about Aberdeen. What are your ideas to resolve the issue?\r\n\r\nLast: An attitude needs to be pushed farther into the ground. If we have Homecoming, we will have celebration.\r\n\r\nLast: More resources like Red Hats to ensure it's safe.\r\n\r\nGerretsen: Were not giving the students enough to do. Would support a sanctioned event perhaps "on the scale of bluesfest"\r\n\r\nMatheson: We have to provide a "carrot and the stick methodology" and allow alternative events.\r\n\r\nChalmers: We need to work with the schools. Find a place to help welcome students to the city.\r\n\r\nChalmers: "Aberdeen wouldn't have happened if we stepped on it the beginning."\r\n\r\nGerretsen: This is not a new problem. We need to continue enforcement and the cancellation, because of the dwindling numbers.\r\n\r\nQuestion: say one good thing about another candidates platform.\r\n\r\nLavalley and Matheson agree on transportation.\r\n\r\nMatheson and Chalmers agree on the "direct line" approach to citizen engagement.\r\n\r\nChalmers: It would be unfair to pick only one, says they agree on a lot.\r\n\r\nGerretsen: I agree with the three younger candidates platforms based on sturdent awareness.\r\n\r\nLast: Matheson is the right person for transportation and Chalmers is valuable as an outsider, like himself.\r\n\r\nQuestion from Ben Hartley on behalf of Brandon Sloan: How do we preserve Queen's tradition of non-academic discipline.\r\n\r\nMatheson: NAD is valuable and utilized when legal action isn't deemed sufficient.\r\n\r\nChalmers: thinks fines are suitable and the University should not step in.\r\n\r\nGerretsen: The university should definitely step in. Most students would take a public intoxication ticket and "frame it on their wall"\r\n\r\nLast: RMC is an example of effective discipline, not that Queen's should take that lead but they should exercise student policing.\r\n\r\nLast: Students feel a kind of immunity when living in he student community.\r\n\r\nLavalley: Queen's should stick to their guns. Ultimately s legal issue.\r\n\r\nQuestion from  Safiah Chowdhury: given students' unique needs, what in your platform relates to them and why vote for you?\r\n\r\nChalmers: Once Queen's students are here, they have rights as citizens. Other citizens have poor views on students.\r\n\r\nBut they need to step up too and show that their not "bad people" and we need to look at things in a different light.\r\n\r\nGerretsen: we need to engage students in the process and use students to deliver the message back to the student body.\r\n\r\nLast: My entire platform relates to students. There won't be a change in behaviour until students get involved.\r\n\r\nLavalley: We need to be grabbing students out of their seats and asking them what they want from their community.\r\n\r\nMatheson: Engage our youth in the process of developing their dreams and aspirations for the community. Change our thinking.\r\n\r\nQuestion about improving cityofkingston.ca\r\n\r\nGerretsen: Establish a mayoral Twitter and Facebook to enable input from citizens.\r\n\r\nLast: "I grew up in a town of 500 people in Nova Scotia that had a better website than Kingston."\r\n\r\nLavelley: Put the city plans at the forefront and create a blog.\r\n\r\nMatheson: It should be more interactive and more usable. Live streaming of council meetings.\r\n\r\nChalmers: Totally different change. Sections for each counsellor, ability to make comments on upcoming decisions.\r\n\r\nQuestion: Clear distinction between political content and government. Live stream meetings.\r\n\r\nQuestion: Kingston is the second worst run magazine according to Maclean's.\r\n\r\nLast: more transparency and accountability.\r\n\r\nLavalley: the council spends too much time in minutiae.\r\n\r\nMatheson: important that Kingston have a full-time mayor to deal with issues personally.\r\n\r\nQuestion about prison farms: Why no voice from local representation?\r\n\r\nLavalley: participated in protests. Unfortunately out of jurisdiction.\r\n\r\nLast: it happened at a higher level. However just because it's outside of citys hands, doesn't mean we can't be vocal.\r\n\r\nGerretsen: Great opportunity if the city can take over land and use that land for educating young people.\r\n\r\nChalmers: Some outcry from the city might have helped.\r\n\r\nQuestion: Gerretsen, would you be a full-time mayor?\r\n\r\nMatheson: Yes I will be a full-time mayor, at every meeting.\r\n\r\nChalmers: Need to work with staff.\r\n\r\nGerretsen: Yes I will be a full-time mayor, creating consensus.\r\n\r\nLast: Yes, going from a "$10.25 an hour job, I wouldn't do too bad with $86,000"\r\n\r\nLavalley: Will continue schooling but devote the proper time.\r\n\r\nClosing statements: Matheson: Think globally, act locally. These are trying times and this election is important.\r\n\r\n"I'll be the leader that can bring people together." We have to think outside the box.\r\n\r\nLavalley: I'm in this race to represent a group of people who don't necessarily speak up. I speak because I have passion for these issues.\r\n\r\nLast: By coming to the debate you haven't engaged, you need to ask us questions and see our answers. You have to be involved.\r\n\r\nStudents need to vote. "They never do and it's infuriating."\r\n\r\nGerretsen: We need to figure out together how to tackle future challenges.\r\n\r\nChalmers: I'm not a politician, I'm a business man. We need a business approach to running this city. Take the consideration of all.\r\n\r\nWe are all shareholders in the city, that's the accountability and transparency. Residents need to step up and voice their opinions.\r\n\r\nThat's it for the Mayoral Debate. Look for a full story in the Journal next week.	t	t	2011-04-03 17:00:45-04	2010-10-08 01:27:37-04	2010-10-08 01:27:37-04	t
290	Election Confetti	33	election-confetti	643		<strong>By Carlee Duchesne, Advertising Representative </strong>\r\n\r\nYear after year, three-letter acronym after three-letter acronym, the AMS elections take over not only the minds of the Queen's student population, but also their hallways.\r\n \r\nI don't know when it started, but handing out small leaflets with your team's name and the three inspirational words that envelop your campaign has definitely become the trend. Personally, I don't find small, brightly coloured handouts informative or persuasive, and if anything I think they can be conceived as more annoying than helpful. Our current world is filled with alternative routes of advertising and information sharing, many of which don't rely on the mass consumption of paper (the majority of which end up on the ground or shoved in between chairs in the lecture halls). So then, why do these teams feel the need to ambush your fellow peers as they make their way to and from class?\r\n \r\nYesterday I was walking back from class through Mac-Corry, minding my own business, talking on the phone when I was approached by a team (no need to reveal which one, since they all seem to have the same tactics) who decided that relaying their information to me was more important than my phone call. This information was deemed so necessary that they were willing to bypass actually handing it to me (which implies consent on my part) and instead shoved their leaflet between my hand and my phone. So I was left, slightly dumbfounded, walking through campus still talking on the phone and now with the added joy of a leaflet precariously sticking to the side of my head.\r\n \r\nI am all for self-promotion and having actually read some platforms from candidates in various positions I think that there are some great leaders and really wonderful ideas out there. However, just as you would probably be annoyed if someone on the street was shoving copies of their newspaper into your hand as you made your way through downtown, some of us are annoyed by the incessant need for you to get your colourful piece of paper into our hands while we are casually making our way to class.\r\n \r\nIf we are interested in learning more about your campaign, we will come talk to you at your booths and if we seem uninterested then don't take it personally, we probably have a lot of other things on our mind. There are many other avenues available where I can educate myself on your campaign platform, your goals and your promises - so please save me, and the environment, and stop with the election confetti. \r\n\r\n\r\n<em> Do you have something to say about the 2011 AMS elections? Email journal_blogs@ams.queensu.ca to see it published in The Headline.  </em>	t	t	2011-04-03 17:07:40-04	2011-01-31 14:08:47-05	2011-01-31 14:08:47-05	t
289	AMS President & CEO Debate Live Blog	33	ams-president-ceo-debate-live-blog	413		<iframe src="http://www.coveritlive.com/index2.php/option=com_altcaster/task=viewaltcast/altcast_code=6637247559/height=550/width=450" scrolling="no" height="550px" width="450px" frameBorder ="0" ><a href="http://www.coveritlive.com/mobile.php/option=com_mobile/task=viewaltcast/altcast_code=6637247559" >AMS President & CEO Debate Live Blog</a></iframe>\r\n\r\nOur Live Blog coverage of the AMS President & CEO debate begins today at 7 p.m. EST.	t	t	2011-04-03 17:00:24-04	2011-01-26 20:07:05-05	2011-01-26 20:07:05-05	t
288	Video Overload	33	almost-hypnotizing	684		This year's AMS executive election is beginning to look more like a battle of the videos. <a href="http://www.voteces.com/" target="_blank">Team CES</a> (Morgan Campbell, Ashley Eagan, Kieran Slobodin) posted another campaign video earlier today. \r\n\r\n<iframe title="YouTube video player" class="youtube-player" type="text/html" width="450" height="365" src="http://www.youtube.com/embed/tEYrXa0atjw" frameborder="0" allowFullScreen></iframe>\r\n\r\nI'm all for incorporating different types of media into a campaign strategy, but when it comes to creativity and content, I have yet to be impressed by what either team has offered.\r\n\r\n<a href="http://www.youtube.com/watch?v=Vpii6H4eU6o" target="_blank">Team SDL's "Must be SDL" musical parody</a> tells me absolutely nothing about their platform or the qualifications of the candidates. <a href="http://www.youtube.com/watch?v=ssuuN6rKonc"  target="_blank">Team CES's photo montage</a> is a touch more creative, but still lacks any real informative content. And their latest creation is so repetitive it's borderline annoying.\r\n\r\nAt the very least, if I'm going to spend three minutes of my time watching all of these videos online, they better be entertaining. Watch Mike Moll, UBC's AMS presidential candidate, in his <a href="http://www.youtube.com/watch?v=bZfOVfvaPsI" target="_blank">brilliant parody of the famous Old Spice commercials</a>. Or the impressive show of support in <a href="http://www.youtube.com/watch?v=1gr2zjwdm5I" target="_blank">Emily Rowe's video</a> for her presidential campaign at the University of Western Ontario (she later on went to win by a landslide). \r\n\r\nGranted, student leader hopefuls at other schools may be able to benefit from established film programs or more technical resources. But the examples put forth by Mike Moll or Emily Rowe make Team CES and Team SDL's efforts look amateurish in comparison. \r\n\r\nDon't make videos for the sake of having one. Make a video if you have something to communicate and you can use the technology effectively to do so. Frankly, I think the effort and time that was spent putting these videos together would have been better allocated to other elements of the campaign. \r\n\r\nThere are five days left in the campaign period. Let's hope the next Youtube link from either of the teams proves me wrong. \r\n	t	t	2011-04-03 17:07:12-04	2011-01-26 19:28:15-05	2011-01-26 19:28:15-05	t
248	Slammed! By Catriona Ward Sell	27	slammed-by-catriona-ward-sell	456		<!--image:"slam"-->\r\nIm Harry Giles. And I hate my cock.\r\n\tThe words which heralded my entrance into slam poetry were certainly memorable. Encouraged by St Andrews Universitys creative writing club to attend, I couldnt help feel slightly out of place as I was confronted by a guy rapping about a turbulent relationship with his genitalia. In fact, I had remembered uncomfortably, the main lure for me was that a fantastic American comedy quartet promised to perform during the interval.\r\n\tI am pleased to say that my opinion of slam poetry has developed positively since then - both because of, and beyond, the next 2 minutes of Harry Giles rap. Recently asked the question of what is a poetry slam?, I failed to come up with a concrete definition. It is competitive poetry. Each competitor has a set time in which to perform - usually, around three minutes. Often, the winner of each round is determined by a team of judges and the audience. The finalists get to participate in a slam off, scoring points for writing, performance, and audience reaction. During my short time as a slam poet, I have heard many different styles of slam poetry: from students with beautifully polished lyrics incorporating lighting and music, to Rapunzel Wizard - a man with a foot-long beard, who waddled on stage, squatted down, and rapped about constipation. Neither won. The champion was a balding businessman who simply announced his titles and read. His poems were powerful. He spoke of war and oil in the first two, before changing his tone to hilariously - but friendlily - mock rappers. Having brought along what must have been most of his colleagues to cheer him on, they raised the roof, securing his path to victory. \r\n\tSlam poets generally perform their own material, though it is not unknown to borrow anothers work. Classic works, such as John Donnes sonnets, have been given great voices in public performance. The freedom to passionately express oneself has led to the slams involvement in political and civil rights movements. Often, it is not the most elaborate performance which creates the winning piece, but the truth, passion or humour of the writing. Members of the audience may be selected to act as impartial judges, although the crowds reaction always sways the voting. When it gets down to the final round, the audience alone may become the judge, with a show of hands or secret vote determining the winner.  \r\n\tWith an active creative writing scene at Queens, the slam should naturally be brought to Kingston. On the 26th of March, the Grad Club is hosting its first poetry slam. Hosted by Jill Battson, this will not be a gentle ease into the shallow waters of Slam Poetry. It will feature a performance by The Sharp Tongues (a slam team from Toronto), Lara Bozabalian (an international slam competitor and author of The Cartographers Skin), Krystle Mullin, and Amanda Hiebert. To top off the night, the public are invited to compete in a slam for a monetary prize (and significant boasting rights). For those not wishing to compete, audience participation is guaranteed - in voting, judging, cheering, finger-snappingand possibly to join the poets in propping up the bar afterwards.\r\n\tYou are thus invited to sharpen your writing skills, polish your performance, and gather your screaming fans to descend upon the Grad Club. Whether you want to rap, guitar in hand, to start a civil rights movement, read from the page, or just listen to the poets perform, it promises to be a great night. Hopefully, as at St Andrews, such a night will kick off a permanent and exciting Slam tradition here. And although it may not be wrapped up with lines quite as emphatic as Harry Giles and I just want a fuck, but by penis - he wants love, it will be a memorable night. Come join in?\r\nFind us on facebook: http://www.facebook.com/event.php?eid=417902978676&ref=ts#!/event.php?eid=347792346625&ref=ts\r\nPoetry Slam: Hosted by Jill Battson, featuring The Sharp Tongues, Lara Bozabalian, Krystal  Mullin, and Amanda Hiebert. 26th March 2010, 7pm, Grad Club (on the corner of Union and Barry). Entrance fee: $5. Boasting rights of the winner: priceless.\r\n	t	t	2011-04-03 17:04:31-04	2010-03-26 15:04:08-04	2010-03-26 15:04:08-04	t
285	Who casts the first stone...	33	who-casts-the-first-stone	413		<iframe title="YouTube video player" class="youtube-player" type="text/html" width="450" height="283" src="http://www.youtube.com/embed/Vpii6H4eU6o?rel=0" frameborder="0" allowFullScreen></iframe>\r\n\r\nAMS Elections haven't really begun until the parody videos are posted to YouTube. <a href="http://www.votesdl.com">Team SDL</a> has posted a lively parody of Cee-Lo Green's ubiquitous hit "Fuck You".\r\n\r\nAs for <a href="http://www.voteces.com/">Team CES</a>? Don't expect a competing musical romp, as said <a href="https://twitter.com/#!/voteces/status/29591842622283776">on Twitter</a>:\r\n\r\n<!--image:"headline-voteces-twitter"-->	t	t	2011-04-03 17:00:38-04	2011-01-24 14:38:15-05	2011-01-24 14:38:15-05	t
284	Antigone reborn	27	antigone-reborn	643		I fear the adaptation of classic work to modern theatre. Too often, the morality of a traditional script is lost in wayward attempts at making contemporary that which was not written to be.\r\n\r\nVagabond Theatres Antigone quelled any fears I had on the issue. I was immediately swept by a stellar cast in which no actor lacked presence or punch. Antigone, a Sophoclian tragedy, tells the story of a whimsical young woman pushing against her royal roots in civil unrest. The princess is perturbed by her brothers recent death, and stubborn in defying the King Creons orders to forget wholly of such loss. The play ends miserably, with the death of Antigone and her fianc Haeman, a testament to misguided happiness and powers corruption. \r\n\r\nRuth Goodwin, who acts the title role, filled each scene with well-executed passion and a natural innocence. Goodwins facial expressions from furrowed brow to wide-eyed wonderment were perfectly characteristic of Antigones free-spirited nature.  Quick-witted articulation made Goodwin a standout even among the talented cast. From  the height of tension to lowest lovers cradle, the chemistry between Goodwin and her on-stage love, Ryan Armstrong, is spell-binding. Armstrong further flexes his acting chops in the performances climax, a moment of electrifying passion and anger. \r\n\r\nOne-man chorus Graham Bonville also stood out for his well-timed narration of Antigone. Adrian Young, who acts as the conflicted King Creon, made the script come to life with a hearty voice, punctuated by sweeping hand gestures and great facial expressions. \r\n\r\nIt must be said that the venue posed some obvious issues in Antigone. Hosted in the basement of Princess Streets The Mansion, the cramped bar was difficult to disguise as theatre. Lines of candle-lit mason jars framed a gothic-style brick wall this lighting initially cast a soft glow over each scene, but soon came to cause issue when characters were blocked in dark corners. When cast members held candles deliberately, a symbol of each character coming to life, the lighting was effective. Otherwise, it cast shadows onto faces which require extra light to be effective. As a technical detail, heavier makeup would perhaps have helped to distinguish expression. \r\n\r\nDirector Nathaniel Fried described his venue as being an exciting challenge, and it is clear that his efforts best utilized a difficult choice for theatre. The performance was meant to be an intimate cast-audience experience, but became difficult when the audience was required to move room-to-room for some scenes. The transitions were well orchestrated by Bonville, but it was distracting to move during such an enthralling show. Notably, the cast worked very well with audience members and moved nimbly around people sitting on set.\r\n\r\nAn extremely well-acted performance which flawlessly adapts classic script to modern society, Antigone left me emotionally absorbed in each characters theatrical world. It is a winter must-see for fans of classical theatre.\r\n\r\n<strong>Antigone runs January 21-23, 28-30, 2011 in The Mansion Wine Cellar at 506 Princess St.</strong>	t	t	2011-04-03 17:09:34-04	2011-01-23 18:31:26-05	2011-01-23 18:31:26-05	t
283	Features - Recycling Ride-along	35	features-recycling-ridealong	502		There are only a few things nowadays that might compel me to wake up before the crack of dawn and venture out into a snowstorm. A very unique photo assignment had me rolling out of bed at a quarter to six and fumbling for my warmest clothes and a mug of tea on the morning of January 12, 2011. \r\n\r\nA garbage truck ride-along had been an idea that Features Editor Jake Edmiston and I had mulled over. With the story now a reality, I knew this assignment would either yield some interesting images or be a complete bust. \r\n\r\nI had several concerns, one of which was the amount of light. With a 6:15 a.m. wake-up time and sunrise at 7:39 a.m., I was worried that I would be shooting in pitch-blackness. The elements and the cold would also be a concern, since I would spend most of my time trudging through the snow beside the truck. I laid out my camera gear, extra sweaters, and set three alarm clocks. And despite my desire for sleep, my excitement kept me lying awake for longer than I would have liked. \r\n\r\nThe Ghetto was stirring slowly in the grey light by the time I returned home, utterly frozen and with a greater appreciation for the work that garbage and recycling collection workers do. I uploaded my images and promptly got back into bed, knowing that I had at least one image that I could be proud of. In retrospect, the assignment went quite well and I had several keepers.\r\n\r\nHere they are:\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2011/01/garbage-1-justin-tang.jpg" width="400" height="266" alt="garbage1"> \r\nWaste collection personnel replace a garbage bin as snow continues to fall in Kingston. I fortuitously shot this image from the foyer of my home while waiting to rendezvous with Jake and our assigned recycling truck. Despite waking at 6:00 a.m., it would be an hour before we would meet. Playing the waiting game is incredibly difficult when it is both so early and so cold. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2011/01/garbage-2-justin-tang.jpg" width="400" height="266" alt="garbage2"> \r\nKyle Hannah empties a grey bin into his recycling truck at Johnson Street and Division Street on January 12, 2011. My worries about light were quelled: streetlights, a bright work light on the truck, and the hazy purple dawn sky provided enough light for an even exposure (1/80th at f/2.8, ISO 4000). \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2011/01/garbage-3-justin-tang.jpg" width="400" height="266" alt="garbage3"> \r\nKyle Hannah drives through a deserted intersection at Brock and Alfred Street on his recycling route through the Queens Student Ghetto in Kingston. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2011/01/garbage-4-justin-tang.jpg" width="400" height="266" alt="garbage4"> \r\nWinter trash collection brings its own challenges. Snow banks along the curbs present another obstacle as Hannah leaves the warmth of his cab to reach another set of recycling bins.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2011/01/garbage-5-justin-tang.jpg" width="400" height="266" alt="garbage5"> \r\nSnow batters Kyle Hannahs face as he continues along his route down Albert Street Wednesday morning. The last two images are very similar and were shot seconds apart yet I cant decide which I like more. I love the swirling snow in the first image; however, Hannahs clear facial expression and positioning give the second photo more context.  \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2011/01/garbage-6-justin-tang.jpg" width="400" height="266" alt="garbage6"> \r\n\r\nI parted ways shortly before 8:00 a.m., as the Student Ghetto began to wake. Jake, having spent most of his time in the cab, continued the ride-along with Hannah while I returned home to thaw out. If you havent yet checked out the new Journal layout or read Jakes article, I would encourage you to do so. Special thanks to Kyle Hannah of the City of Kingston for being such a great subject and not objecting to the camera that was clicking in his face for an hour.\r\n\r\nAs always, theres more to come on The Rejects. \r\n\r\nStay warm.	t	t	2011-04-03 17:08:33-04	2011-01-23 03:39:16-05	2011-01-23 03:39:16-05	t
282	The hidden gem of the limestone	27	the-hidden-gem-of-the-limestone	693		<!--image:"monuments-and-statues"-->\r\n\r\nGuitars can melt faces, but cellos melt hearts. This seems to be the driving force behind the Kingston-based band Monuments and Statues, a group that shirks the traditional rock ensemble for the likes of the banjo, cello and some excellent harmonies. \r\n\r\nThe five-piece group is comprised of Queens students of the past and present, one of which is a psychology masters student and three of which are studying geology. While this certainly means they love rock(s), they strive for a sound that is more eclectic; a hybrid of pop, folk, classical and carrying undertones from whatever other genres they see fit. \r\n\r\nGeoff Reith, one of the Monuments three vocalists and their sole banjoist is also responsible for the bulk of the songwriting. He creates the skeleton of the songs, and says that the band collaborates to flesh out the rest of the song as they rehearse. \r\nBecause of our unusual instrument combinations its hard to say that we sound like any one particular band or sound. We try to create each song as its own unique piece, and because of this our songs tend to be very diverse, he said.  \r\n\r\nThis is substantiated by their lyrics that circulate around story-telling. Fictional places and events are often evoked, and you may notice a song about a ghost.\r\n\r\nInstead of being confined to a set genre, their style evolved out of our  common goal of writing music that is both fun and intriguing, the band said.\r\n\r\nMonuments and Statues recently released their four song EP <Welcome to the Undertow> for free from their website. The album has served to expand their audience and because of the small monetary investment involved in its recording, they decided to make it available for listening for no extra cost.\r\n\r\nWith the support of the Kingston-based YGK records, the band is hoping to release a full-length album in the near future. Hoping for some studio time, the band will incorporate new material and fine-tune some of the songs theyve been performing for years. \r\n\r\nThe band last recorded in a studio when they contributed a track to <Shelter Me>, a CD that fundraised for the Kingston Humane Society. \r\nBesides recording, theyve also had a steady presence playing shows in and around the Queens campus.\r\n\r\n Our first show was at Bar-None, (now The Spot) and we opened for one of our favourite bands, Mother Mother.  The Mansion and Clark Hall have [also] been very good to us, and we have had many good shows at both of those places, they said.\r\n\r\nMonuments has also played at the Wolfe Island Music Festival and will attest that they had a lot of fun.\r\n\r\nThis is not to say that Monuments and States are all about having fun and putting on a great sonic show; another facet of their performance is fashion, and at a performance they once took a break between songs to debate the merit of jeggings.\r\n\r\nWhen the subject was broached, Geoff gave a thoroughly contemplated answer.\r\n\r\n On one side you have the jean purists who will insist that pants should be completely in-elastic, whereas on the other hand one could argue that jeggings combine the unique comfort and style of leggings with the time-honoured visual aesthetic of denim, he explained.\r\nThese wise words were contrasted with their preference of peanut butter over jelly. \r\n\r\nIn todays hyper-allergenic world, it can be used both as a weapon and a delicious source of protein, they said. \r\n\r\nIf you like catchy songs, stretchy denim and a fun time, come see them play. Even someone deathly allergic to peanuts will have to admit that theres some inexplicably sexy about a girl playing cello. \r\n\r\n<strong>Monuments and Statues play tonight at Clark Hall Pub along with Bravestation and Dora Alexander. The free show starts at 9:00 p.m.</strong>\r\n	t	t	2011-04-14 08:17:18-04	2011-01-20 19:18:38-05	2011-01-20 19:18:38-05	t
281	Masterful Mikado	27	masterful-mikado	691		<strong>By Caroline Garrod, Staff Writer</strong>\r\n\r\nQueens Musical Theatres (QMT) production of <em>The Mikado</em> opened on Wednesday and was every inch the glorious comic masterpiece that Gilbert and Sullivan originally imagined.\r\n\r\n W.S. Gilbert and Arthur Sullivans 1885 masterpiece, <em>The Mikado</em> tells the story of the love between Nanki-Poo, the undercover son of the Emperor of Japan (also known as The Mikado), and Yum-Yum, the lovely young ward of the Lord High Executioner, Ko-Ko. Their love story is complicated by Ko-Kos desire to marry Yum-Yum himself, and the fact that Nanki-Poo is already engaged to a woman who he loathes. Gilbert and Sullivan set the play in Japan so as to make fun of contemporary England; the resulting play has very little to do with Victorian Japan, but very much to do with Victorian England. The entire performance buzzed with the sort of lively, spirited comic energy that a Gilbert and Sullivan musical demands. The orchestra was equally excellent; their beautiful music complemented the show impressively. The cast is to be commended for their dedication to hamming it up, even in mid-song and for their careful enunciation of Gilberts clever words. Alana Sargeant is adorable as the sweet eyelash-batting Yum-Yum, and Carl Jackson was deliciously droll as Poo-Bah, the pompous cartoon of Victorian aristocrats. Katie Hinchcliffes powerful voice lends great majesty to the cartoonish Katisha and Andrew Frasers sappy facial expressions brought Nanki-Poo to life. The true star of the show was Peter Nielsen, who was completely delightful as the drippy, self-satisfied Ko-Ko. His physical realization of the character was impressive: it was impossible not to laugh as he flipped and flopped across the stage and contorted his face in exaggerated expressions. His Ko-Ko was every inch the cowardly, blustering bureaucrat that he should be. \r\n\r\nHis delivery of the List Song (As Someday It May Happen) was the undeniable highlight of the show. The song, (which lists societal offenders who never would be missed), was modernized to great affect, and included such offending personages as fist bumpers, Homecoming vomiters, Justin Biebers hairstylist, the current government and the staff of The Queens Journal. The modernized song was met with much laughter and was a great decision on behalf of director Matt Stewart and the rest of the crew. The delicate origami-esque set provided the perfect cartoonish, Oriental flavour to Gilbert and Sullivans anachronistic, romanticized Japan. The costumes were also excellent, contributing to the Oriental aesthetic without hindering the actors.\r\n\r\n Despite the plays 19th century origin, and QMTs traditional interpretation of it, <em>The Mikado</em> is as fresh and witty as it was 126 years ago. One would never know that this production is by a university musical theatre group, as the performance is as polished and the cast as skilled as any professional theatre company. This play is recommended to any fan of musicals, QMT, the witticisms of George Bernard Shaw, Oscar Wilde and P.G. Wodehouse, or anyone who is simply looking for some cheap entertainment. \r\n\r\n<strong><em>The Mikado</em> is playing tonight and tomorrow at 2 p.m. and 8 p.m. at the Grand Theatre. Tickets are $25 for adults and $18 for students.</strong> 	t	t	2011-04-03 17:15:53-04	2011-01-15 15:00:09-05	2011-01-15 15:00:09-05	t
280	Less to Study, More to Gain?	33	less-to-study-more-to-gain	643		<!--image:"studying"-->\r\n\r\nWelcome back to the grind, folks. The sort of student happiness brought about by this period of low scholastic demand is already beginning its decline in preparation for midterms, coming just around the corner. Zenhabits, a popular blog for holistic lifestyle, recently published a post discussing alternative study habits for the university student. Guest writer Scott H Young (http://www.scotthyoung.com/blog/) addressed the effectiveness of his own study habits, some that would send any avowed Staufferite into academic shock. Young claims that his five simple study tactics have fared well for his A to A+ average in university, but the risky method has all sorts of keener alarm bells sounding off in my brain. \r\n\r\nAs I am a poster child for classical study methods read, write, review, repeat Youngs rapid-learn style could not be more opposite to my own. He uses cognitive psychology to back his theories of effective learning, structured by five suggestions for study time: metaphors and analogy; visceralization; the 5-year old method; diagramming; and storytelling to remember numbers and facts. The system is based entirely upon Youngs key principle of connection over memorization. That is, bringing ideas together to form a cohesive whole instead of memorizing different concepts independently of the other. \r\n\r\nChildren are imaginative, creative and, in many ways, the epitome of this rapid learning strategy. Maybe its the current school system, or maybe its just a consequence of growing up, but most people eventually suppress this instinct.\r\nThe sad truth is that the formal style of learning, makes learning less enjoyable. Chemistry, mathematics, computer science or classic literature should spawn new ideas, connections in the mind, exciting possibilities. Not only the right answers for a standardized test.The irony is that maybe if that childlike, informal way of learning came back, even just in part, perhaps more people would succeed on those very tests. Or at least enjoyed the process of learning. - Scott H Young in <a href="http://www.zenhabits.net/ace-exams/">How I was Able to Ace Exams Without Studying</a>.\r\n\r\n<em>Have you tried a method similar to Youngs and was it effective? Comment below with thoughts on these study tactics or other alternative suggestions. </em>\r\n\r\n\r\n	t	t	2011-05-28 19:26:33-04	2011-01-14 08:58:43-05	2011-01-14 08:58:43-05	t
279	Huckleberry Finn to be censored in new edition	36	huckleberry-finn-be-censored-new-edition	643		<img src= "http://www.queensjournal.ca/media/stories/v138/i0/mark-twain.jpg" alt ="Mark Twain"/>\r\n\r\nTen days ago the literary world was sent reeling over an announcement by NewSouth Books that Mark Twains Huckleberry Finn would see censorship in its newest edition. The word nigger, used 219 in the novel, will be replaced with slave. Alan Gribben, English department head at the Auburn University, put forward the idea to censor Twains classic so that it could be more readily accepted in schools across America. NewSouth hopes to have the censored editions printed for distribution by next month. See the full article <a href= "http://www.publishersweekly.com/pw/by-topic/industry-news/publisher-news/article/45645-upcoming-newsouth-huck-finn-eliminates-the-n-word.html">here</a>.\r\n\r\nJournal staffers weigh in on NewSouths bold move below. Thoughts? Join the discussion by leaving a comment. <!--more-->\r\n\r\nOne issue I have with the replacement of what is obviously an offensive and derogatory word is the historical ramifications of changing an important piece of literature. Would the replacement of the word "nigger" with "slave" mean that students might fail to understand the racism of the time depicted in Huckleberry Finn? It may be that censored editions of the book mask the important lessons to be learned from reading the original version.\r\n\r\n-<strong>Clare Clancy</strong>, News Editor\r\n\r\nReplacing this word with another would place the historical context into a different perspective for readers. Readers who might want to read it, assuming historical accuracy, will not get the original perspective that the author intended. Changing the words would change the author's writing itself. It would be like taking the original version of Anna Karenina and changing the descriptive words used which were intended to be read in a particular way. It would also be changing the artistic intention of the author.\r\n\r\n-<strong>Labiba Haque</strong>, Assistant News Editor\r\n\r\nWhile I understand the merit of wanting classroom novels to be clean of such language, I question whether a move such as this could prove an even greater hindrance in students learning experience. How would a teacher present modified literature while speaking on the cultural, historical and social context in which it was written? Would an instructor address the replaced word, or would students be left unaware that there is a small piece of this literary work missing? It is an unfortunate thought that students may see a single word stand out more prominently than the bounty of genius which surrounds it in Mark Twains writing.\r\n\r\n<strong>Terra-Ann Arnone</strong>, Web and Blogs Editor\r\n\r\nEverything I could possibly say is <a href="http://tumblr.seoulbrother.com/post/2638856023/nigger">said better here</a>.\r\n\r\n<strong>Tyler Ball</strong>, Editor in Chief \r\n\r\nTo move away slightly from the literary or philosophical implications of changing the language, I'd like to examine this action's significance in the political-institutional realm. Specifically, I'd like to juxtapose it with another act of censorship, in order to try and gain some perspective. \r\n\r\nThe Canadian Broadcast Standards Council (CBSC) recently banned the Dire Straits song "Money For Nothing" from airing on Canadian radio stations, due to the repeated use of the word "faggot." \r\n\r\nhttp://www.thestar.com/entertainment/music/article/922477--money-for-nothing-ruling-makes-waves-on-radio\r\n\r\nI think it's necessary to draw a distinction between censorship that seeks to reduce choice and restrict public access to something (the CBSC ruling) and censorship that seeks to increase access to something by offering an altered version. \r\n\r\nAnd that's exactly what it's being presented as, an alternative: ' "I'm hoping that people will welcome this new option, but I suspect that textual purists will be horrified," [Gribben] said.' \r\n\r\nThe PW article states that the first NewSouth edition will print 7,500 copies, and makes no mention that any specific school district has requested it for use in the classroom. \r\n\r\nThose who oppose this edition's publishing have been steeping their arguments with the implication that it reduces choice. While it's clearly a case of censorship (the ethics of which are highly debatable), I'm not convinced that it reduces freedom for consumers to access the unaltered version, or that Twain's literary integrity is facing an existential threat.\r\n\r\n<strong>Craig Draeger</strong>, Opinions and Letters Editor\r\n	t	t	2011-04-03 17:15:30-04	2011-01-14 08:57:46-05	2011-01-14 08:57:46-05	t
278	Sports - Waterpolo	35	sports-waterpolo	502		The OUA Waterpolo championships were held at the ARC Pool on November 26th to 28th, 2010. The weekend looked to be incredibly busy for Journal photographers since Queens was fielding both mens and womens teams and the Athletics Department, as hosts of the tournament, had asked the Journal to provide photography for the bronze and gold games. I had never been to a waterpolo game, let alone covered one. I wasnt sure what to expect.\r\n\r\nI quickly learned that waterpolo is a game of contrasts. The game is immensely physical, with hands and limbs frequently colliding and heads being pushed underwater. Most sports matches are quite noisy, with the shouts of athletes and the encouragement of spectators forming a cacophony.  Waterpolo is quiet, except for the constant splashing of water and piercing whistle blasts from referees. There is little yelling, little speaking, and very little celebration from the athletes at the end of plays: polar opposite from the womens volleyball matches I covered the day before. \r\n\r\nI covered the Gaels mens team in their attempt to make the finals and the womens team in their drive for a bronze medal, as well as the women's gold medal game between Carleton and the University of Toronto. \r\n\r\nHere are my rejects from the OUA Waterpolo Championships. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/12/waterpolo3-justin-tang.jpg" width="400" height="266" alt="Waterpolo 3"> \r\nMcMasters Bryn Sutherland defends the ball from Queens player Judith Weist in the OUA bronze medal game on November 28th, 2010. The angles of the outstretched arms show the high level of physical agility that waterpolo players possess; the text on the ball is a nice touch. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/12/waterpolo6-justin-tang.jpg" width="400" height="233" alt="Waterpolo 6"> \r\nThe Toronto Varsity Blues score a goal against the Queens Gaels mens waterpolo team on November 27th, 2010. The Gaels lost 23-0 to the Varsity Blues, eventually being eliminated from the tournament by the Western Mustangs later in the afternoon. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/12/waterpolo2-justin-tang.jpg" width="400" height="266" alt="Waterpolo 2"> \r\nGaels head coach Don Duffey reacts as the womens team regroups following the end of the third quarter of the OUA bronze medal game. The Gaels were defeated 12-0 by the McMaster Marauders to finish fourth in the tournament. Duffey also led the Gaels mens team to a fifth place in the mens division. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/12/waterpolo1-justin-tang.jpg" width="400" height="315" alt="Waterpolo 1"> \r\nKaitlyn Sennema is congratulated by Carleton head coach Steve Baird as the Ravens celebrate their OUA championship win. Sennema was one of four Ravens named to the all-star team for her performance in the tournament. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/12/waterpolo5-justin-tang.jpg" width="400" height="266" alt="Waterpolo 5"> \r\nThe Carleton Ravens cheer as they celebrate a 9-7 win and an OUA championship victory over the Toronto Varsity Blues in the womens gold medal match on November 28th, 2010. Coaches and team staff leapt into the pool to join the athletes in celebrating. Their outpouring of emotion was refreshing and very different from the tacit nature of the match. \r\n\r\n<br>\r\nThat's it for now! Stay tuned for more The Rejects over the break, as I reflect on my photo assignments from the first half of Vol 138. Happy holidays!\r\n	t	t	2011-04-03 17:34:08-04	2010-12-24 04:07:26-05	2010-12-24 04:07:26-05	t
277	Sports - Women's Soccer	35	sports-womens-soccer	502		The Gaels womens soccer team was the lone Queens varsity team left in any of the OUA playoffs. I wanted to cover the gold medal game but had been assigned to shoot the Liberal Party nominations at the K-Rock Centre. I still wanted to catch any part of the game if I could: this was a gold medal game and the stakes were high. High stakes typically means high emotions, which increases the chances for interesting photos.\r\n\r\nBy the time I arrived at Richardson Stadium, there were only a few minutes left in regulation time and the Gaels were now down a point. I snapped off a few frames, and the referees whistle marked the end of the game.\r\n\r\nWith a 1-0 final score and such evenly matched teams, the matchs story might have been less about the action on the field than what happened after the game. \r\n\r\nHeres my take on winning and losing at the OUAs.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/soccer1-justin-tang.jpg" width="400" height="266" alt="Soccer 1"> \r\nQueens defender Mikyla Kay regroups with her teammates as the Laurier Golden Hawks celebrate their OUA Championship win. I like the black and white version better than the colour. I feel that it adds a little more grittiness to the image. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/soccer2-justin-tang.jpg" width="400" height="266" alt="Soccer 2"> \r\nMidfielder Melissa Jung walks off the field following the Gaels 0-1 loss to the Laurier Golden Hawks. I covered a few games this year; Jung was a key player and always played with gut and passion. It was no surprise to me that she was emotional about the games outcome.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/soccer3-justin-tang.jpg" width="400" height="121" alt="Soccer 3"> \r\nThe Laurier Golden Hawks celebrate following their 1-0 win against the Queens Gaels. Laurier was able to score in the 78th minute; the lone goal would be enough to carry the Golden Hawks to an OUA Championship.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/soccer4-justin-tang.jpg" width="400" height="266" alt="Soccer 4"> \r\nThe Golden Hawks reach for the OUA Championship trophy as the sun sets at Richardson Stadium on November 7, 2010. As the top two teams in the OUA, the  Golden Hawks and Gaels qualified to compete at the CIS National Championships in Prince Edward Island and would resume their fierce rivalry the following weekend.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/soccer5-justin-tang.jpg" width="400" height="268" alt="Soccer 5"> \r\nQueens striker Jacqueline Tessier returns to the dressing room alone at Richardson Stadium following the OUA medals and awards ceremony. Tessier, who led the country in number of goals scored, was awarded Most Valuable Player for the OUA East region for her efforts.\r\n\r\n\r\nThe number one ranked Gaels demonstrated their prowess the following weekend at Nationals, eventually defeating the Laurier Golden Hawks with an ironic 1-0 victory in overtime to take the CIS National Championships. Jubilation and devastation. Flipsides. Thats what sports is all about.\r\n\r\nIm only disappointed that I wasnt able to shoot the CIS game. There would have been some very different expressions on those faces.\r\n\r\nMore tk	t	t	2011-04-03 17:34:35-04	2010-11-29 23:00:00-05	2010-11-29 23:00:00-05	t
276	Current - Civic Remembrance Day Ceremony	35	current-remembrance-day	502		I attended the Civic Remembrance Day ceremony in Kingston, Ontario on November 11th by Barrie and King Streets. Christine, the Journals Photo Editor, was covering the on-campus ceremony so I decided to go and make a few photos for myself.\r\n\r\nRemembrance Day is interesting in Kingston because of its large military population. Ive never seen such a long parade of Canadian service-people and cadets. I always try to attend Remembrance Day ceremonies and I was happy to have attended this one.\r\n\r\nHere are my photos from the Kingston Civic Remembrance Day ceremony as well as the Canadian Forces March-off:\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/remembrance1-justin-tang.jpg" width="400" height="266" alt="Remembrance Day 1"> \r\nI attended the ceremony held at the Cenotaph at King and Barrie. The reflection of this monument in the mud reminded me of my time visiting war memorials in Belgium and France. I remember the stark white monuments contrasting against green grass and mud.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/remembrance2-justin-tang.jpg" width="400" height="266" alt="Remembrance Day 2"> \r\nFlag-bearers march by the shores of Lake Ontario in the Armed Forces march-off following the Civic Remembrance Day Ceremony. I love the interplay of shadows here.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/remembrance3-justin-tang.jpg" width="400" height="266" alt="Remembrance Day 3"> \r\nAn elderly Kingstonian watches from her front door as Cadets march along King Street. Over two hundred members of the Canadian Forces and cadets attended the Kingston march-off.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/remembrance4-justin-tang.jpg" width="400" height="268" alt="Remembrance Day 4"> \r\nLt.-Col James McKay stands at attention while army cadets look on. The Canadian Forces continued their Remembrance Day celebrations at the Monument to the Fallen Soldier in City Park in Kingston, Ontario.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/remembrance5-justin-tang.jpg" width="400" height="192" alt="Remembrance Day 5"> \r\nMembers of the Canadian Army remove their berets in preparation for the playing of O Canada at the Canadian Forces Remembrance Day ceremony.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/remembrance6-justin-tang.jpg" width="400" height="153" alt="Remembrance Day 6"> \r\nAs a photographer, I often hope for the moment when everything simply comes together. This, unfortunately, is not an often occurrence for me, yet I feel like it did in the frame above. Cropping and flipping this image produces a picture that I feel is much more powerful than the original. \r\n\r\nMore tk	t	t	2011-04-03 17:34:55-04	2010-11-29 14:13:42-05	2010-11-29 14:13:42-05	t
275	Politics - Kingston Mayoral Elections	35	politics-mayoral	502		I had the privilege of covering the municipal elections in Kingston on October 25th, 2010 with the Journal. I was assigned to cover the goings-on at City Hall, where Mark Gerretsen  would be likely be stationed. When I arrived, it became clear that City Hall was a hub: candidate Rob Matheson was there and candidate Barrie Chalmers would also make an appearance later.\r\n\r\nFrom the archives, here are my Rejects from the Kingston Mayoral Elections:\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/mayoral1-justin-tang.jpg" width="400" height="266" alt="Mayoral1"> \r\nThe votes were still being counted as we arrived at City Hall. As we searched for the appropriate entrance, I snapped off a shot of duffels of what are presumably paper copies of votes being taken through the West doors.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/mayoral2-justin-tang.jpg" width="400" height="601" alt="Mayoral2"> \r\nOutgoing Kingston Mayor Harvey Rosen watches as the votes to determine his successor are tallied in real-time. Around a hundred people gathered in at the Memorial Room of City Hall over the course of the evening to watch the election results come in.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/mayoral3-justin-tang.jpg" width="400" height="266" alt="Mayoral3"> \r\nHaving already won a majority of the votes by 9:30pm, Mark Gerretsen is welcomed as Kingstons new Mayor. Here, Gerretsen ponders questions from local media. \r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/mayoral4-justin-tang.jpg" width="400" height="266" alt="Mayoral 4"> \r\nMayor-elect Mark Gerretsen shares a laugh with CBCRadio and FM96 while partner Kate Bogle looks on.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/mayoral5-justin-tang.jpg" width="400" height="266" alt="Mayoral 5"> \r\nBarrie Chalmers answers questions from the Whig-Standard and the Journal. His defeated expression shows the strain of a long campaign and the pain of an unfavourable outcome.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/mayoral6-justin-tang.jpg" width="400" height="266" alt="Mayoral 6"> \r\nGerretsen and Bogle leave City Hall to join the campaign teams celebrations at Portsmouth Olympic Harbour. I was hoping for more of a media throng as Gerretsen left, however, he departed with little fanfare. I still managed this unique image of Gerretsen speaking to a supporter as he left the building.\r\n\r\nThats it for now but theres more on tap 	t	t	2011-04-03 17:35:06-04	2010-11-29 11:42:22-05	2010-11-29 11:42:22-05	t
274	Sports - Football	35	sports-football	502		In homage to the Queens football team who, as the defending Vanier Cup champions, were knocked out of the OUA playoffs in their first round, well dip into the archives and look at the photos from their last home game on October 23, 2010.\r\n\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/queens-gaels-football-2-justin-tang.jpg" width="400" height="310" alt="Queen's Football 2"> \r\n\r\nOver the last couple years, Ive moved away from simply trying to capture the action (the ball in the players hands, the tackle, the touchdown) to trying to find emotion. This is quite challenging. I think this photo hits the mark here. We see York QB Nikolas Cortou trying to defend his possession in vain, while Queens linebacker Sam Sabourin is going in for the kill.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/queens-gaels-football-1-justin-tang.jpg" width="400" height="498" alt="Queen's Football 1"> \r\n\r\nIm a little sad we didnt run this one. Weve got faces, weve got the ball (in the frame and in the Gaels hands), weve got emotion, and action. Zoom in and go down to the detail: York wide-receiver Jonathan Jupers open-mouthed grimace stands in sharp contrast to Queens receiver Giovanni Apriles steely expression.\r\n\r\n<p></p><img src="http://www.queensjournal.ca/media/content/2010/11/queens-gaels-football-3-justin-tang.jpg" width="400" height="601" alt="Queen's Football 3"> \r\n\r\nThe York Lions fell to the Gaels 52-14 in this game at Richardson Stadium. The pain of a winless season is clearly etched on rookie quarterback Lashane Oldacres face. His thousand yard stare and slumped posture show his resignation in yet another defeat. We didnt - and wouldnt - run this photo: the subject isn't a Gael. As a campus newspaper, we need to report on our athletes first. Sadly, this leaves little room for images like this, even though this side of the story is the the flipside to the Gaels dominant victory.\r\n\r\nThanks for reading! More to come	t	t	2011-04-03 17:35:20-04	2010-11-27 19:20:09-05	2010-11-27 19:20:09-05	t
273	Welcome	35	welcome	502		My name is Justin Tang and I am a photographer. This year, I am serving as the Assistant Photo Editor at the Queens Journal, following two years as a staff photographer.\r\n\r\nIve worn many hats in the seven or so years Ive called myself a photographer. Ive done sports, events, portraits, and even one wedding. Newspaper photography, although it can comprise any of these elements, is an entirely different animal. Why? Two words: real estate. There just isnt enough of it to be able to print every relevant photo - or <em>any</em> irrelevant photo.\r\n\r\nAs a result, newspaper photography strips a story down to <em>the</em> key image or <em>the</em> key moment, and those alone. Dont get me wrong: these are important images. They are necessary for us to tell the story accurately within the context of the paper. But theyre not the whole, complete story. And that is what I want to show with this blog.\r\n\r\nThis blog is entitled The Rejects to showcase the photographs that dont tell <em>the</em> story. The photos that arent prototypical. The photos that break the rules and therefore dont make the paper.\r\n\r\nI hope to also use this blog as a launching pad for different projects. Documentary-style projects. Mixing stills with audio, and maybe - just maybe - video. I want to look at some of the selects, the ones that made the cut, and dissect them. And I want to frame all of this through my philosophy of photography and my journey with the Journal.\r\n\r\nIm excited.\r\n	t	t	2011-04-03 17:35:33-04	2010-11-24 13:00:00-05	2010-11-24 13:00:00-05	t
244	Songs For Spring	27	songs-for-spring	456		<!--image:"spring"-->\r\nBetween melting and freezing\r\nThe souls sap quivers. There is no earth smell\r\nOr smell of living thing. This is the spring time\r\nBut not in times covenant.\r\n<em>T.S. Eliot </em>\r\n\r\nFor some reason <a href="http://www.youtube.com/watch?v=GjyZ6B7mC-w&feature=related">this song</a> always reminds me of spring. I think a friend made me a mixed-tape one March and since then I cannot think of a more fitting tune for my favourite season. I love when things melt, when maple syrup flows like milk and honey and when the repressed twenty-somethings of Kingston shed their knits and go buck wild. In short, Ive got Spring fever. Here are some tunes to get you started in your own spring playlist. Say good riddance to winter and post some songs if Ive forgotten any! \r\n\r\n1.\tAnnunalsSpringtime\r\n2.\tBelle and SebastianAsleep On A Sunbeam\r\n3.\tBelle and SebastianSong For Sunshine\r\n4.\tCaribouSundialing\r\n5.\tThe ConcretesSunbeams\r\n6.\tDirty ProjectorsTemecula Sunrise\r\n7.\tFrom Bubblegum To SkyEven The Sunbeams\r\n8.\tHerman DuneWhen The Sun Rose Up This Morning\r\n9.\tJason CollettIll Bring The Sun\r\n10.\tThe LucksmithsT-Shirt Weather\r\n11.\tM.WardHere Comes The Sun Again\r\n12.\tThe Magnetic FieldsLove Goes Home To Paris In The Spring\r\n13.\tNick DrakeSaturday Sun\r\n14.\tOf MontrealOur Spring Is Sweet Not Fleeting\r\n15.\tSergeantSunshine\r\n16.\tStereolabCellulose Sunshine\r\n17.\tTom WaitsYou Can Never Hold Back Spring\r\n18.\tTune-YardsSunlight\r\n19.\tTV On The RadioStaring At The Sun\r\n20.\tThe WeakerthansSun In An Empty Room\r\n\r\n 	t	t	2011-04-03 17:04:54-04	2010-03-22 22:06:35-04	2010-03-22 22:06:35-04	t
272	A Modest Proposal	34	modest-proposal	582		I've been thinking a lot about names recently. You see, I never liked my own name very much. For one thing, it has no history or special meaning to anyonemy mother picked it out of an issue of TV Guide. It also doesn't command any respect, or at least I wouldn't respect someone named Craig. \r\n\r\nMost importantly, I don't associate with it. When I think of myselfwhat I've done, who I amI certainly don't think, "that's Craig."\r\n\r\nI don't even really know how to say it. A number of years ago, someone asked me if it was pronounced "Cr-egg" or "Cr-ay-g," and I had no idea what to tell them. I still don't. \r\n\r\nBecause of this disdain, I do everything possible to avoid it. I cringe when I have to identify myself on the phone, or when I'm meeting someone for the first time.\r\n\r\nI don't even like saying other people's names, since I irrationally assume they must dislike their name too. So I guess I've been projecting my own neuroses on other people.\r\n\r\nTo get around this problem, I typically address people by their chosen title"Professor Jones," or "Doctor Johnson"or by the rather anonymous "sir," or "ma'am."\r\n\r\nBut what about people who don't identify with a profession or a sex? What should I call them?\r\n\r\nAnd that got me thinking: isn't the world full of labels? We try so hard to eliminate the racial slurs and hurtful epithets, but what about the rest of our society's labels? \r\n\r\nWe're pigeonholed by our job, our social roles, and yes, even our names. Why should anyone have these brandings thrust upon them?\r\n\r\nAnd so I offer a modest proposal: that we completely do away with the practice of giving our children letter-based names, and instead bestow them with numbers.\r\n\r\nWhat better way to do away with the privileged advantages some people possess? Numbers are completely neutral, and would put everyone on an equal playing field!\r\n\r\nThat's right, everybody can have their very own, perfectly unique number. And since there are less than 7 billion people in the world, that means we'd only have to go to 10 digits for each individual. Most of us are perfectly capable of remembering ten-digit phone numbers, so why not ten-digit people numbers?\r\n\r\nIt's even better than our current system, because with numbers, no two people in the whole world need have the same name. So for instance, I might be 3,694,092,784. Or maybe 4,739,206,437. Who knows?!\r\n\r\nOf course, this would need to be phased in over a generation or two. But I'll be doing my part; my first-born son will be named 6,936,273,019. What do you think? Does it sound too ethnic?	t	t	2011-04-03 17:36:03-04	2010-11-23 11:21:24-05	2010-11-23 11:21:24-05	t
270	The Myth of Moderation	34	myth-moderation	582		I really dislike rallies. I've never participated in oneand I have no plans to startbut the idea turns me off. I'm always told of the value of social assembly in a democratic society, yet I'm challenged to find the meaningful results of peaceful demonstration (at least since 1980). But regardless of the method's efficacy, it's just not my scene.\r\n\r\nSo maybe I'm biased, but I really wasn't impressed by last weekend's "Rally to Restore Sanity." Jon Stewart announced the proposed rally on the September 16th episode of his Daily Show, in response to the August 28 "Restoring Honor rally" hosted by Glenn Beck.\r\n\r\nThe stated purpose of the rally was to give a voice to the politically disenfranchised centre, those without extreme political views. However, this goal requires further examination. I'm always sceptical of those who claim to be moderates, or above the political fray. \r\n\r\nI'm not saying Stewart himself is intentionally malicious, and I entirely agree that the American political discourse is controlled by loud-mouth entertainers, but Stewart fails to realize that he is part of that very problem. \r\n\r\nTo quote Dick Armey, "I was quite amused at watching the national comics stand up and decry with such sincerity that which they do every day on their shows. I thought it was so remarkable: 'I want you all in America to stop acting like we do on our show every night with our militant vilification of everyone with whom we have a disagreement.' "\r\n\r\nFurthermore, the title of "moderate" can occasionally act to disguise ulterior motives, be they merely partisan or actually dangerous. For example, Yusuf Islam (formerly Cat Stevens), performed a rendition of "Peace Train" at the event.\r\n\r\nIt's quite fitting that they chose a man like Islam to perform, because he perfectly demonstrates the threat posed by the guise of political moderation. For all his songs about love and peace, he is a man who has demonstrated a devotion to hatred and violence. \r\n\r\nHere's a <a href="http://www.youtube.com/watch?v=2-wjxwpvqps/">video</a> of Islam on British television in 1989 voicing his support for the assassination fatwa issued against Salman Rushdie.\r\n\r\nThe best part is where he says he'd prefer to burn "the real thing" than merely an effigy of Rushdie.\r\nAnd here's a <a href="http://standpointmag.co.uk/node/3551/">collection</a> of related statements from Islam and Rushdie since that event.\r\n\r\nOf course, this is not to say that everyone at the rally was evil, mean-spirited, or dangerous. Only a very small portion of them were deranged, I'm sure. But that doesn't diminish the danger posed by the myth of moderation.\r\n\r\nAnd that's what it is: a myth.\r\n\r\nMost figures in history, from tyrants of antiquity to hot-air buffoons of modern times, have fancied themselves to be moderates. The political spectrum is a social construct, and as such, individuals have license to construct it as they please. \r\n\r\nSo saying you're a moderate is at best meaningless, and at worst illusory. There are many "moderates" who harbour views way outside the political mainstream, who've been able to hide behind their chosen label.\r\nIt's a disingenuous label, and it allows its adherents to claim immunity from criticism. This is a legitimate threat. \r\n\r\nWe all know to fear the guy yelling about tax slavery and holding a placard of President Obama with a Hitler-stache, but at least he's honest about his views. We also need to fear the guy who tells who he's a "moderate," sings you a song about peace, and then goes on to talk about lynching "blasphemous" authors and stoning adulterous women.\r\n\r\nWorse still are those who inflexibly cling to the label so to draw others into their field of gravity. \r\nThink about it, because you probably know somebody like this. I'm talking about the guy who rationalizes all his political views, regardless of where they fall on the spectrum, as "moderate." That's Jon Stewart.\r\nSo why does he cling so adamantly to the idea of political moderation?\r\n\r\nI have a theory I'm fleshing out: the political left would prefer a convivial system of cooperation and discussion, while the right would prefer an adversarial system of disagreement and forced compromise. The left like to call theirs the "moderate" approach, because it gives the appearance of civility. Given this assumption, we can see why most, if not all, of those calling for a "restoration of sanity" are tacit, if not vocal leftists.\r\n\r\nJon Stewart's disdain for adversarial politics is well documented. Take, for instance, this famous <a href="http://www.youtube.com/watch?v=aFQFB5YpDZE/">clip</a> which led to the eventual cancellation of the CNN program "Crossfire:"\r\n\r\nHe tells the hosts their show is "hurting America." His complaints about the show's vapid and reductionist nature is entirely justified, but watch closely and you'll see that his concern is not merely with the nature of the game, but the game itself. That is, he doesn't like the idea of the left-right divide. \r\n\r\nUnfortunately, he's winning the battle. His ideal of a convivial, cooperative system appeals to many people disillusioned with the current state of affairs in the American political discourse. But they're merely trading one flawed system for another.\r\n\r\nIn all my affection for the adversarial system of government, I realize that it's not without faults, but it's still the best system ever devised, and I have no confidence in a non-adversarial system. And the adversarial system doesn't have to be dominated by the Glenn Becks or Keith Olbermanns of the world.\r\n\r\nCall me an idealist, but I believe in an adversarial system that works within a framework of civil discourse; a system that doesn't rely on taking to the streets, burning effigies, or painting vile caricatures to discern sound governance. It's a system to which any other would pale in comparison. \r\n\r\nJon Stewart's version of moderation only serves to remove all the substance from the political discourse. I don't mean to say that he doesn't have a role to play in that discourse, but we must realize Stewart's rhetoric about moderation is often as empty as that from those on the left or the right. This self-styled messiah of the American political system, isn't. \r\n\r\nDon't get me wrong, I have no problem with the "sanity" he's talking about: the thoughtful evaluation of conflicting ideas in a civil context, but trying to push everybody to the "centre" causes more harm than good. \r\n\r\nMaking everyone a moderate doesn't solve anything; it takes the essence out of the political milieu and reduces the debate to the lowest common denominator. I sympathize with the message of sanity (or Stewart's conception of it), but he loses all credibility to me by melding it with political moderation.\r\n\r\nI think we should take seriously Stewart's message about raising the discourse of politics, but we must jettison the empty rhetoric about moderation and moving beyond partisan politics, because the concept of political moderation is at best a misnomer and at worst a guise for ulterior motives. \r\n\r\nOr maybe I'm wrong about everything I just said. But if you think I am, you should tell me so. Don't be afraid to disagree, to tell me I'm wrong. In short, don't be a moderate. \r\n<i>How else will we ever know if I'm right or wrong?</i>	t	t	2011-04-03 17:37:14-04	2010-11-04 11:56:38-04	2010-11-04 11:56:38-04	t
268	Overheard: Reasons Not to Vote	32	overheard-reasons-not-vote	643		<p>Why not?</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/ballot-image.jpg" width="450" height="350" alt="Ballot">\r\n\r\nToday is the final voting day for Kingston municipal elections. These past weeks of campaigning and debates have sparked heated conversation on campus but left others uninterested in the democratic process. \r\nHere are some overheards about why:\r\n\r\nGirl in Mac-Correy Cafeteria to friend:\r\n"I would vote, but it's just so complicated."\r\n\r\nGirl walking on University with friend:\r\n"My polling station is the Athletics and Recreation Centre. Didn't they tear that down last year?"\r\n\r\nGuy outside of Kingston Memorial Centre (voting station), with female friend:\r\n"They made me walk all the way here? I don't even want to vote now."\r\n\r\nGuy at Johnson and University:\r\n"Fuck voting! Fuck the system!"\r\n\r\n<b>Heard something else about the municipal elections? Leave a comment below.</b>	t	t	2011-04-03 17:39:19-04	2010-10-25 15:25:26-04	2010-10-25 15:25:26-04	t
325	Fun fuel up	42	fun-fuel	528		Great for breakfast or as a snack, smoothies are a students best friend as prep time is short and ingredients need not be complicated. No matter your palette preferences, theres a recipe for everyone.\r\n\r\n<strong>Health nut</strong>\r\n\r\nHealthy eating enthusiast Ola Mirzoeva, Comm 12, blends unusual but highly beneficial ingredients to get the most out of her smoothies.\r\n\r\n-1/2 cup blueberries\r\n\r\n-1 banana\r\n\r\n-3 leaves of kale or another dark leafy green with the hard spines removed\r\n\r\n-2/3 tablespoons of hempseed hearts\r\n\r\n-1 teaspoon of dulse (seaweed flakes)\r\n\r\n-3/4 cups water or enough to blend smoothly\r\n\r\n<strong>Sweet tooth</strong>\r\n\r\nCandy-lover Erin Dodds, ArtSci 12, enjoys this. Adjust thickness and this recipe can be enjoyed as frozen yogurt.  \r\n\r\n-1/2 of a frozen banana\r\n\r\n-1/2 cup frozen raspberries\r\n\r\n-1 cup of vanilla yogurt\r\n\r\n-A splash of orange juice\r\n\r\n-A splash of milk\r\n\r\n-Oatmeal to add thickness as desired\r\n\r\n<!--image:"sweet-tooth"-->\r\n\r\n<!--image:"sweet-tooth2"-->\r\n\r\n<!--image:"sweet-tooth3"-->\r\n\r\n<strong>Choco lover</strong>\r\n\r\nThis is a healthy way to satisfy your chocolate cravings. Allrecipes.com features this frozen treat. Indulge by topping with whipped cream and chocolate sauce.\r\n\r\n-1 banana\r\n\r\n-1 tablespoon chocolate syrup\r\n\r\n-1 cup milk\r\n\r\n-1 cup crushed ice\r\n\r\n<strong>Protein fiend</strong>\r\n\r\nSubstitute your usual protein shake for a fruit-filled smoothie. Tastes great and includes nutrients. Menshealth.com recommends this banana treat as a post-workout snack.\r\n\r\n-1 banana\r\n\r\n-1/2 cup low-fat vanilla yogurt\r\n\r\n-1/8 cup frozen orange juice concentrate\r\n\r\n-1/2 cup milk\r\n\r\n-2 teaspoons whey-protein powder\r\n\r\n-6 ice cubes, crushed \r\n\r\n<strong>Low sugar</strong>\r\n\r\nThis recipe is from smoothieweb.com.\r\n\r\n-1 nectarine\r\n\r\n-3/4 cup light (reduced sugar) fat-free peach frozen yogurt (equal to one individual container of yogurt)\r\n\r\n-1/2 cup Pine-Orange-Guava juice\r\n\r\n-1/2 cup of sugar-free lemonade\r\n\r\n-1 packet sweetener or 2 teaspoons of sugar\r\n\r\nAll recipes can be adjusted to achieve desired texture and taste.  \r\n	t	t	2011-09-19 15:42:57.893923-04	2011-09-19 15:42:57.889015-04	2011-09-19 15:42:57.889015-04	t
266	Currant Agenda	32	currant-agenda	643		<p>Black Currant (Tea Store; 241 Princess Street, Kingston)</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/black-currant.jpg" width="450" height="350" alt="Black Currant Tea">\r\n\r\n\r\nType: Flavoured black\r\nIngredients: Unlisted. I see black (orange pekoe grade) tea leaves and lilac coloured flowers (from the black currant). \r\n\r\nServing size: One tea spoon to one full mug water.\r\n\r\nRaw aroma: Sweet and earthy. Light smell of herb.\r\n\r\nBrewing aroma: Pure black tea.\r\n\r\nSteeping time: Seven minutes.\r\n\r\nTip: Many like to enjoy a black or green tea without the natural caffeine. To decaffeinate a pot, use multiple steeps. In the first, put in just enough water to bury the leaves, and let it steep for about a minute (nearly 80% of the caffeine in tea is released during this time). Toss the tea, and steep using the same leaves again. This will produce a much less caffeinated cup. The more this is done, the less caffeine remains in the brew. However, that also goes for flavour. To retain natural taste, only do this once or twice. \r\n\r\nThe now green-yellow brew has a great first sip. Its light and tastes faintly of jam, with no bitter aftertaste (characteristic of black tea without honey or sugar). While the currant isnt a strong note, it relieves my palate of any harsh black flavours. I taste the Earthy aroma of its brew a few sips in. Finishing the cup leaves me awake and alert, caffeines doing its job. \r\n\r\nI would recommend this as a quick, morning, out-the-door brew. While not entirely flavourful, the Black Currant tea doesnt require any additives to neutralize bitter flavours. It also didnt beg a long steep (I steeped my second cup for ten minutes and found no profound difference in taste). \r\n\r\n<b>Verdict</b>: 6.5/10	t	t	2011-04-03 17:39:14-04	2010-10-24 13:31:02-04	2010-10-24 13:31:02-04	t
241	Artist in Profile with Afterparty	27	artist-in-profile-with-afterparty	456		<!--image:"afterparty"-->\r\n<strong>1. Who are you?</strong>\r\n\r\nI am 1/6th of the Toronto based band "disco-punk" Afterparty, my name is\r\nKeith Heppler and I play the drums. The band has been around since 2006,\r\nwhen keyboardist Idan Erez met our lead singer Kristina B. at a party. The\r\ncurrent line up of the band has been in place for about a year.\r\n\r\n<strong>2. What do you do?</strong>\r\n\r\nAll we try to do is make the music we all want to hear and be the band we all would want to see. We all come from diverse musical backgrounds and we throw them all in a blender, turn it up and turn it on.\r\n\r\n<strong>3. Where can someone find you?</strong>\r\n\r\nwww.myspace.com/afterpartyretro www.afterpartyband.com\r\n\r\n<strong>4. Where do you live and work and why?</strong>\r\n\r\nThe band is officially based out of Toronto Ontario, which is were we all wound up and found each other. But I don't think any of us were actually born in Toronto. Idan is from Israel, Juan is from Juarez Mexico, our new guitar player Josh is from Alberta, Ben is from Caledonia, Kristina grew up in Newmarket and Im from Waterloo. As far as working most of us don't anymore, maybe an odd job here and there but the band takes up the majority of our time and energy.\r\n\r\n<strong>5. When did you start making music together?</strong>\r\n\r\nThat's a tricky one. Afterparty has been around in some form since about\r\n2006, when Idan and Kristina started writing songs together. I auditionedabout a year ago and Juan started playing guitar with us around then. So we did it as a foursome until about a month ago when we added Ben and Josh to help thicken up the sound live for all the shows we will be doing in support of our debut album "The Army You Got" in stores March 30,2010 on Sound of Pop Records.\r\n\r\n<strong>6. How would you describe your music? </strong>\r\n\r\nBlondie meets the Clash in rehab.\r\n\r\n<strong>7. What inspires you? </strong>\r\n\r\nI get inspired by anyone out there doing their own\r\nthing. I'm not impressed by people lost in trends, people who are so hip\r\nit hurts. It's pretty easy to separate the trendsetters from the\r\nfollowers.\r\n\r\n<strong>8. What's the nicest things someone has said you to after a show?</strong>\r\n\r\nKristina once told me I smelt good.\r\n\r\n<strong>9. What's the worst thing someone has said to you after a show?</strong>\r\n\r\n"I need you guys to settle your bar tab."\r\n\r\n<strong>10. What are your current obsessions?</strong>\r\n\r\nI can only speak for myself but I am really into the new Jay Malinowski\r\nrecord. I've also probably worn out all of my Nirvana records by playing\r\nthem so much.\r\n\r\n<strong>11. When someone says "Kingston" you think...</strong>\r\n\r\nI've been lucky enough to play in Kingston a few times with a few\r\ndifferent acts. The one thing that always sticks out in my mind is how\r\ncrazy your frosh week gets. I've never seen anything like it, it was\r\nawesome.\r\n\r\n<strong>12. What are you currently working on?</strong>\r\n\r\nWe are constantly on tour in support of our new record "The Army You Got", which is available March 30th,2010 on Sound of Pop Records. Besides playing tons of shows, promoting the record we are starting to write some new songs as a six piece and trying to push our sound forward. Other than that we all love a good party!\r\n\r\n<strong>Afterparty play Clark Hall Pub tonight! </strong>	t	t	2011-04-03 17:05:01-04	2010-02-18 16:00:46-05	2010-02-18 16:00:46-05	t
240	Breaking up is hard to do: Watching 500 Days of Summer on V Day	27	breaking-up-is-hard-to-do-watching-500-days-of-su	554		<em>Note: This was written while watching <strong>500 Days of Summer</strong> for the first time. What follows in an exercise in indulgent diarrhea, an outlet for the angst of experiencing the fantasy of one's past in film form, and a way to type away the twitchiness evoked by Summer's feminine wiles. </em>\r\n<!--image:"tom-and-summer"-->\r\n\r\n\r\nIt's hard to follow up Emily's <a href="http://www.queensjournal.ca/blogs/limelight/2010/02/epitaph-for-my-heart/">quintessential Valentine's Day post</a>.  A list of perfect sad-sack songs for the bitter Singletons (as Bridget Jones would have put it) among us is appreciated by anyone who's ever had a F-ck Valentine's Day toast. Personally, the V Day hate has never really resonated with me - single or coupled, it's just another day, and unless you work in retail or a restaurant, it's pretty easy to avoid.   I wish I could say it was due to a conscious choice to eschew heteronormative capitalist bullshit, but really it's just because I'm usually unemployed and make for an almost embarrassingly low-maintenance girlfriend.\r\n\r\nBut today I rolled out of bed at 4pm on February 14th to 500 Days of Summer playing in my living room. And let me tell you, watching the calculatedly quirky montages of the two delicate leads does little to soothe the disaffected soul.  \r\n<!--more-->\r\n\r\n\r\nA lot of ink has been spilled and bandwidth used by musings about this film, much of which analyses how Zooey Deschanel's character fits into the <a href="http://en.wikipedia.org/wiki/Manic_Pixie_Dream_Girl">Manic Pixie Dream Girl</a> archetype (which I'll hopefully cover on this blog in the near future - for now, the quintessential coverage is found on the<a href="http://www.avclub.com/articles/wild-things-16-films-featuring-manic-pixie-dream-g,2407/"> A.V Club</a>, <a href="http://jezebel.com/5033744/manic-pixie-dream-girls-are-the-scourge-of-modern-cinema">Jezebel</a>, <a href="http://tvtropes.org/pmwiki/pmwiki.php/Main/ManicPixieDreamGirl">T.V Tropes</a>, and, in my opinion, <a href="http://www.eyeweekly.com/film/film/article/71567">Eye Weekly</a>.)  But watching this movie on the most whined about manufactured holiday of the year has a special tinge of melancholy to it. \r\n\r\nI almost wish I could say that watching 500 Days of Summer was painful because it reminded me of the excessively emotional boys in my past (which is... also true...) but most of the pain is derived from breaking up with the culture worshipped in the movie. \r\n\r\nFrom the cringe worthy "Oh em gee, we both listen to the <strong>Smiths</strong>!!!111" elevator dialogue, to the male lead's adorable butchering of <strong>Pixies</strong>'  classic Here Comes Your Man, to the Feist and Spektor tracks slipping in as backtracks to post coital cuddle sessions, 500 Days of Summer reminds of my youthful 'innocence' and folly. Back when <strong>Garden State</strong> was my favourite move, back when <strong>The Shins</strong> and <strong>Belle & Sebastian </strong>were fresh, back when I only knew five people at my high school who watched <strong>The Wedge</strong> and they all bad skin and early curfews. \r\n\r\n Before I realized that everything in this niche is insufferably cliche, before I realized how commodified the aesthetic is, before anyone I knew had clued in to how the music and it's associated scene is often just a shrine to the excess and privilege in our lives, back when we thought we were so different and original.  before the Sarah Harmer line,<em> "we always thought that we were different, and we know now that we weren't"</em> felt personal. Before quoting song lyrics to describe your own internal landscape felt adolescent, because so were we.\r\n\r\nThis is a mopey self-indulgent lost love letter to a world that never was, but hey, isn't that what Valentine's Day is all about? \r\n\r\nI feel sorry for the friends with whom I'm watching with. First of all because I'm typing this throughout the whole thing (I needed some sort of outlet for the angst!) and secondly because I'm moaning in pain everytime a song I loved came on, making snarky comments anytime some archetypal <strong>Under the Radar</strong> or <strong>Filter</strong> magazine aesthetic was shown, and scoffing whenever Tom fulfills the post-<strong>Perks of Being a Wallflower</strong> flavour of misunderstood. \r\n\r\nI'm pretty sure for them it's like watching a love story with someone who has been burned a few too many times. Instead of being betrayed by a person or, like Tom, ideas of true love, I, and I'm assuming some of you, have been betrayed by, the subculture, the aesthetic, the music, the movies, the books, the blogs... the.... scene?\r\n\r\nI broke up with the scene over two years ago now, before we even really got together.  When you're sitting in your bedroom reading blogs and webcomics to CDs you bought on a trip to Buffalo in a tshirt you got at a show on a trip to Toronto (fulfilling every lost lonely girl suburban cliche while you're at it!) you're not really in any scene per se other than the one on the internet and in your imagination. When you're finally away from the curfews and mall culture, the scene really isn't all it's cracked up to be.  It's full of vapidity, self-importance, cocaine and appropriation and exploitation, rich kids who pretend to be poor, exclusionary sneers and self-conscious smiles. \r\n\r\nOn Valentine's Days of the past I could easily excuse any singledom with a simple <strong>Hold Steady </strong>line about a girl who sang, "I'm saving myself for the scene."\r\n\r\nBut there's not really a scene worth saving yourself for. So hit the bottle, hit the club, and be open-minded when you're wandering around Metro at 2 a.m.  \r\n\r\nIf watching 500 Days of Summer has taught me anything, it's that <strong>Hornby's</strong> classic oft-quoted line, "It's no good pretending any relationship has a future if your record collections disagree violently, or if your favorite films wouldn't even speak to each other if they met at a party" is not very true at all.  Which, was, of course, the moral of <strong>High Fidelity</strong>, but most rock snobs conveniently forget that, choosing instead to live by the first hundred pages of the book. \r\n\r\nWell, the movie's over now, so I'm out. Until next year, and its inevitable nostalgia for another bad cultural relationship...	t	t	2011-04-03 17:06:46-04	2010-02-14 22:56:08-05	2010-02-14 22:56:08-05	t
269	To market to market: curried carrot and turnip soup	42	market-market-curried-carrot-and-turnip-soup	643		Recipe and photography by Elise Copps-Smith, ArtSci '11. <i>Contributor</i>\r\n\r\nThe Kingston Farmers Market is a great place to start if youre looking for inspiration in the kitchen. Operating on Tuesdays and Saturdays in Kingstons Market Square, and on Wednesdays outside of Stauffer Library, the markets vendors offer fresh, seasonal produce. If youre intent on buying local, ask sellers about where they buy or grow their products. The majority are cultivated nearby, which allows for the freshest and most environmentally friendly ingredients. \r\n\r\n<p>Kingston Market Square</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/market-square.jpg" width="450" height="350" alt="Market Square">\r\n\r\nIn honour of fall, I decided to opt for some earthy root vegetables. As the weather gets cooler, beets, turnip, carrots, parsnips, yams and potatoes continue to thrive. All of these make great hearty soups like the one below. Soups are the perfect fall meal, and can be prepared ahead of time, stored and reheated easily. For the novice chef, they are also very forgiving and can be tweaked to suit your preferences. \r\n\r\n<p>Market Options</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/market-options.jpg" width="450" height="350" alt="Market Options">\r\n\r\n<b>Ingredients:</b>\r\n6 large carrots                                                                                                                                                                 \r\n1 large or 2 small turnip                                                                                                                                                \r\n1 large onion                                                                                                                                                                  \r\n3 tbsp olive oil                                                                                                                                                                \r\n2 tbsp curry powder                                                                                                                                                      \r\n1 tsp cumin                                                                                                                                                                     \r\n2 litres chicken stock                                                                                                                                                     \r\n2 cups buttermilk                                                                                                                                                         \r\nSalt and pepper to taste                                     \r\nSour cream (optional)      \r\n\r\n<p>Raw Ingredients</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/raw-ingredients-curried-carrot-and-turnip.jpg" width="450" height="350" alt="Raw Ingredients">  \r\n                                                  \r\n<b>Tools:</b>\r\n1 very large sharp knife                                           \r\n1 large bowl                                                                                                                                                                                                   1 large oven safe baking dish                                                                                                                                        \r\n1 large pot                                                                                                                                                                        \r\n1 ladle                                                                                                                                                                               \r\n2 large spoons                                                                                                                                                                Blender \r\n \r\n<b>Directions:</b>\r\n\r\n1. Preheat oven to 400F. Rinse carrots and roughly chop into 1 inch pieces. Since they will eventually be pureed, dont worry about how they look. Just make sure that they are equally sized so they cook evenly. \r\n\r\n2. Depending on the size of your turnip, this may be a challenge. Cut in in half, and remove the tough stubs from either end. You will see a thin ring around the outside of the turnip just under the skin. Carefully cut off this layer and discard. Roughly chop the remaining turnip into 1 inch chunks. \r\n\r\n3. Place your carrot and turnip pieces into a large bowl and drizzle with 2 tbsp of olive oil. Sprinkle with curry powder and cumin, and a little salt. Depending on what you have around, these spices can be substituted, but I suggest sticking with eastern flavours. Toss until the vegetables are evenly coated with the spice mixture and pour into a baking dish. Place in the middle rack of the oven. Allow to roast for roughly 40 minutes, tossing occasionally. Dont worry if the edges get a little dark, this will just add to the flavour of your soup. \r\n\r\n4. While your vegetables are roasting, pour 1 tbsp of olive oil into a large pot over medium high heat, and dice your onion into  inch pieces. Once the oil is heated, throw the onion into the pot, and stir intermittently until it has browned. Remove the pot from heat.\r\n\r\n<p>Roasted Vegetables</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/roasted-vegetables-curried-carrot-and-turnip-soup.jpg" width="450" height="350" alt="Roasted Vegetables">\r\n\r\n5. Once cooked, dump roasted vegetables into pot on top of your browned onion and place over medium low heat. Pour chicken stock over vegetables and stir. Vegetable stock can be substituted for a vegan/vegetarian version of this dish. Cover the pot with a lid and simmer for  an hour. \r\n\r\n6. This next part can get a little messy. Ladle the stock and vegetables into your blender. Only fill about 2/3 of the way and make sure that the stock almost covers the vegetables. Puree the mixture until smooth and pour it into a bowl. You will likely have to repeat this 3 or 4 times depending on the size of your blender. If you have one, a submersion blender can also be used. \r\n\r\n7. Once all of the soup is pureed, return it to the pot and add 2 cups of buttermilk. If you prefer it can be substituted for more stock, but I think that the sour flavour cuts the heat of the soup nicely. Give your soup a try and add more salt or spice to your taste. Ladle into bowls or Tupperware for storage and enjoy with a dollop of sour cream for a cool finish. \r\n\r\n<p>Finished Soup</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/finished-soup-carrot-and-turnip.jpg" width="450" height="350" alt="Finished Soup">	t	t	2012-05-15 09:14:44.633825-04	2010-10-25 19:14:08-04	2010-10-25 19:14:08-04	t
271	Just like home: bacon and chicken pot pie	42	bacon-and-chicken-pot-pie-recipe	718		Recipe and photography by Greg Kaladeen, ArtSci '12, <i>Contributor</i>\r\n\r\n\tFall is a perfect time to break out the pots and pans to cook something! Just touring the market floods you with inspiration; a colourful display of potatoes, apples, carrots and pears have me excited to heat up my kitchen. So do yourself a favour, toss out the Swanson dinner, and try something new and delicious!\r\n\r\nWith midterms over and most people having a bit of a lull before exams I thought Id share a recipe that really tastes like home. It's something you won't have to stress over and could have fun making or sharing with a group of friends. \r\n\r\nThe thing to remember for this recipe is to taste throughout cooking; if it's good going in, it will be good coming out!\r\n\r\nServes 4-8 people, leftovers the next day are delicious.\r\n\r\n<b>Caloric Breakdown</b>\r\nBased on a six serving recipe, there will be roughly 420 Calories per serving. \r\nVersus a Pepperidge Farm "Original Flaky Crust Roasted Chicken Pot Pie" which comes in at 1,020 calories for a roughly similar portion. \r\nA single serving should be an adequate dinner for one person.\r\n\r\n\r\n<b>Ingredients</b>\r\n\r\nFilling:\r\n3 Medium sized red-skin potatoes, peeled and cut into bite sized pieces\r\n2 Chicken breasts, cooked (leftovers are fine, bone in if possible)\r\n2 Carrots, peeled and cut into bite sized pieces\r\n5-10 White pearl onions, rinsed\r\n3 Teaspoons of sugar\r\n\r\n<p>Cooked Vegetables</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/raw-veggies.jpg" width="450" height="350" alt="Cooked Veggies">\r\n\r\nCream Sauce:\r\n1 Litre of low-sodium chicken stock (one good quality box if you can afford it)\r\n1/2 Cup of hard apple cider\r\n1 Cup heavy cream\r\n3 Tablespoons of butter\r\n3 Tablespoons of all purpose flour\r\nA few slices of peameal bacon, sliced into bite sized pieces\r\nA teaspoon each of rosemary, thyme and sage \r\nBlack Pepper\r\n\r\nCrust:\r\n1 Package of puff pastry (best quality you can find)-keep in freezer until a few hours before you begin making it\r\n1 Egg\r\nFlour for rolling\r\n\r\n\r\n<b>Directions</b>\r\n\r\nPrepare the Crust\r\n1. Take out Puff Pastry to thaw for 3 hours at room temperature before you plan on baking your pie.\r\n2. Once dough is soft enough to use, roll it out on a floured surface using an amount slightly larger than your pie dish and about 1/2 centimetres thick. \r\n\r\nPrepare the Filling (If making with friends some could start on the cream sauce now)\r\n3. About one and a half hours before you plan on baking gather all the filling ingredients.\r\n4. Put the carrots, potatoes and onions in their own pot-individually, fill with water so that they are all fully submerged. Sprinkle a teaspoon of salt and sugar into each pot and bring them to a simmer over medium-high heat. Cook until just tender, about 8-10 minutes for the carrots and onions, and a bit longer for the potatoes. Once cooked to satisfaction, drain and place in the pie dish. Skin and slice onions in half before adding them in also. \r\n5. Cut the chicken into bite sized pieces and mix in with vegetables (keep the bones in for the next step)- at this point make sure to taste each of the filling components and season them if necessary. Preheat oven to 375F.\r\n\r\nPrepare the Cream Sauce\r\n6. Pour the chicken stock into a pot and bring to a boil on high heat; add rosemary, thyme and sage (chicken bones also if you have them).\r\n7. In a medium sized pan combine the butter and flour on medium heat for 2-3 minutes then remove from heat.\r\n8. Once the chicken stock has reduced by about half (20-30 minutes), strain it into the butter flour mixture, add the peameal bacon and cream. Simmer for 5 minutes. Season to taste with salt and pepper and pour into pie dish.\r\n\r\n<p>Uncooked Pie</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/pre-oven-pie.jpg" width="450" height="350" alt="Uncooked Pie">\r\n\r\nFinish it Off\r\n9. Place pie shell onto your pie dish, make sure all the sides are well sealed by pinching and overlapping edges. Make a glaze with the egg yolk and a tablespoon of water; brush it over the entire shell of the pie. Use this as a kind of glue for the sides. \r\nPoke a hole in the centre of the pie (so that it doesn't explode) and place in the oven's bottom rack for roughly 25-40 minutes; or until crust is browned. Make sure to check on the pie regularly! Once the crust is flaky, the inside will be cooked. \r\n \r\n10. <b>Enjoy!</b>\r\n\r\n<p>Finished Pie</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/finished-pot-pie.JPG" width="450" height="350" alt="Finished Pie">\r\n\r\n<b>Ask Greg</b>: Have any suggestions or additions to this recipe? Need advice about getting started in the kitchen? Email me: QueensJournalfood@gmail.com	t	t	2012-05-15 09:15:52.82527-04	2010-11-16 16:59:58-05	2010-11-16 16:59:58-05	t
259	Fauxcoming 2010 Live Blog 	33	fauxcoming-2010-live-blog	413		<iframe src="http://www.coveritlive.com/index2.php/option=com_altcaster/task=viewaltcast/altcast_code=77afc4c27a/height=550/width=450" scrolling="no" height="550px" width="450px" frameBorder ="0" ><a href="http://www.coveritlive.com/mobile.php/option=com_mobile/task=viewaltcast/altcast_code=77afc4c27a" >Fauxcoming 2010 liveblog</a></iframe>\r\n\r\nCome back Saturday at 9 p.m. for updates from Aberdeen St.\r\n\r\nIn the meantime, fill yourself in on this year's Homecoming news. In chronological order:\r\n<ul>\r\n<li>Here's the <a href="http://www.queensjournal.ca/story/2009-09-27/"><em>Journal's</em> coverage from last year</a> with a <a href="http://www.queensjournal.ca/story/2009-09-27/news/aberdeen-street-live-blog-replay/">live blog</a> and <a href="http://www.queensjournal.ca/story/2009-09-27/news/overheard-aberdeen-2009/">overheards</a>.</li>\r\n\r\n<li>This <a href="http://www.thewhig.com/ArticleDisplay.aspx?e=2628827">Whig-Standard article</a> from June includes quotes Kingston Police Chief Stephen Tanner indicating that police presence on Aberdeen will be "the same as last year, if not even more."</li>\r\n\r\n<li>Last week the Globe and Mail published <a href="http://www.theglobeandmail.com/news/national/ontario/crackdown-on-partying-at-queens-threatens-universitys-raucus-reputation/article1712613/">this article</a> on Queen's partying reputation that touched on Aberdeen St and its yearly party. Campus-wide backlash ensued.</li>\r\n\r\n<li>Earlier this week an unknown person made <a href="http://www.facebook.com/event.php?eid=110535999005747&ref=mf">this Facebook event</a> instigating an alternative location for the street party, to be announced Saturday at 7 p.m. Currently there are over 5,400 people RVSP'd to attend.</li>\r\n\r\n<li>Thursday the Whig-Standard <a href="http://www.thewhig.com/ArticleDisplay.aspx?e=2770945&">reported that the police are aware of the event above</a> and that they are watching it closely.</li>\r\n\r\n<li>The <em>Journal</em> <a href="http://queensjournal.ca/story/2010-09-24/features/weekend-events-under-debate/">reported Friday</a> that the police are expecting to "respond in a manner that is appropriate to the situation."</li>\r\n\r\n<li>The AMS and OPRIG have released their <a href="http://www.myams.org/component/content/article/41-rotator-news/563-knowyourrights">"Know Your Rights" pamphlet</a>, a guide to students' rights on the street.</li>\r\n\r\n<li>The "Queen's Homecoming 2010" Facebook event announced Kingston Field as their location Saturday evening.</li>\r\n</ul>\r\n<em>Tyler Ball</em>\r\n\r\n	t	t	2011-04-03 17:00:54-04	2010-09-24 15:08:17-04	2010-09-24 15:08:17-04	t
260	New Blog on Campus 	32	new-blog-campus	643		The Queen's Journal is welcoming a new blog to the online hub, titled "Student Life".\r\n\r\nIn an effort to avoid clich description of a student's life, I will not attempt to summarize such. On a diverse campus such as our's, the life of a student varies so wildly that little can be said to describe it. This blog will be a place for writers to post about their own student life, draw connections with those who read it and begin a forum of discussion about day-to-day activity from Bader to Brock and beyond. \r\n\r\nAs students transition from home to life away, or simply another year in tricolour, many encounter spirituality in an array of forms. The influences of religion- thought by some to be an abrasive force and to others the bedrock of life- are well and alive on campus. For those students hoping to find their spiritual niche, the Queen's Chaplain's office will be writing a blog about religious life in a non-denominational school. Kara Braun will post under the blog "Safe Space". Here students can find information regarding local religious events and openly access discussion about spirituality on campus. \r\n\r\nWhile the second year of Queen's Fauxcoming draws to a close, a buzz is echoed on campus. Over the steady hum of street cleaners on Aberdeen, there is the solemn sound of discussion- one which, before the end of this calendar year, will generate a decision about next year's Fauxcoming/Homecoming plans. Look to Student Life for updates on this discussion and opinions from campus groups about the potential re-instation of Homecoming next fall.\r\n\r\nFinally, Student Life will be releasing a series of posts about the ever-scrutinized on-campus governance, the Alma Mater Society. Arguably the largest and most active student group on campus has come to be one of the least understood. We hope to remedy this with break downs of who's-who and what's-what in AMS offices. Here we'll be formally opening discussion on the Mater- put your tams on and tell Student Life, are they playing your song?\r\n	t	t	2011-04-14 10:43:26-04	2010-09-22 13:53:30-04	2010-09-22 13:53:30-04	t
257	You Say Goodbye	27	you-say-goodbye	456		<!--image:"c"-->\r\n\r\nI seem to have a knack for making depressing playlists. After my Anti-Valentines Day post I received a few concerned emails and phone calls. Thanks for reading friends, and yes, Im fine. Im leaving Kingston very soon and cannot stop feeling all sentimental and melancholy. I cant gush enough about my friends. My ugly apartment seems quite lovely these past few days. And I almost think Im going to miss essay-writing at 4 a.m. But just like my favourite Beatle George Harrison said, all things must passthis playlist is for goodbyes. And yes, there are some happy songs. \r\n\r\n1.\tBen KwellerWasted and Ready\r\n2.\tThe BicyclesGotta Get Out\r\n3.\tHead AutomaticaGraduation Day \r\n4.\tBob DylanForever Young\r\n5.\tBroken Social SceneFarwell To The Pressure Kids\r\n6.\tBruce SpringsteenBorn To Run\r\n7.\tThe ConcretesTomorrow \r\n8.\tThe YardbirdsFarwell \r\n9.\tThe ConstantinesYoung Lions\r\n10.\tThe JamWhen Youre Young\r\n11.\tJeff BuckleyLast Goodbye \r\n12.\tLykke LiIm Good, Im Gone\r\n13.\tDrive By TruckersDays of Graduation \r\n14.\tThe Magnetic FieldsHow To Say Goodbye\r\n15.\tMorriseyOne Day Goodbye Will Be Farwell\r\n16.\tMoot The HoopleAll The Young Dudes\r\n17.\tNew OrderDreams Never End\r\n18.\tLCD SoundsystemDrunk Girls\r\n19.\tThe ShinsGone For Good \r\n20.\tPlants and AnimalsBye, Bye, Bye \r\n21.\tVan MorrisonGoodbye Baby \r\n22.\tLanghorne SlimI Love You, But Goodbye\r\n23.\tJames BrownNever Can Say Goodbye\r\n24.\tBeckHey, Thats No Way To Say Goodbye (Leonard Cohen Cover) \r\n25.\tThink About LifeYoung Hearts \r\n26.\tPaul TiermanHow To Say Goodbye \r\n27.\tLCD SoundsystemBye, Bye Bayou \r\n28.\tTokyo Police ClubCitizen Of Tomorrow\r\n29.\tSondre LercheMaybe Youre Gone \r\n30.\tGeorge HarrisonAll Things Must Past (Jim James cover is good too!) \r\n\r\nPost more!	t	t	2011-04-03 17:04:07-04	2010-04-21 12:17:12-04	2010-04-21 12:17:12-04	t
246	Things In Kingston I Will Miss When Im Gone: Part One	27	things-about-kingston-i-will-miss-when-im-gone	456		<em>Coming to Kingston from a small town (and by small town I mean a population of about a thousand peopleso yeah, actually small) was a huge step for me. Four years ago, I was too afraid to move to Montreal or Toronto so Kingston was it. For many Queens students, Kingston is a downsizebut I hate that word. \r\n\r\nAfter a few years working at The Journal and being involved in Kingston arts and culture scene I know Im going to miss many of Kingstons smallbut totally mightylandmarks. So Ive decided to chronicle all of my favourite haunts, in a series of blog posts Im going to call Things In Kingston I Will Miss When Im Gone. Its a long title, I knowbut this might be an extensive list of places. Im feeling nostalgic and who knows where that could lead.</em> \r\n<!--image:"mf"-->\r\n\r\nFirst on my list is Kingstons artist-run center <a href="http://www.modernfuel.org/">Modern Fuel</a>. Today I was doing some very boring menial tasks downtown. It was rainy, cold and the wind was blowingand then I realized I was only a block away from Modern Fuel, a free and always engaging art gallery. Ive done <a href="http://www.queensjournal.ca/story/2008-10-21/arts-entertainment/hip-hoppin-and-anal-art/">anal art</a>, <a href="http://www.queensjournal.ca/story/2009-09-11/arts-entertainment/craigs-playlist/">danced</a>, <a href="http://img131.yfrog.com/i/modernfuel2.jpg/">drank</a> and been inspired at Modern Fuel. And today was no exception.\r\n\r\n<!--image:"mantra"-->\r\n\r\nCurrently in the main gallery is an exhibit by lne Tremblay called Trail Proofs. Simple and quiet, Tremblays work is almost haunting. Against a backdrop of various concrete urban landscapes, Tremblay photographs and takes video footage of people in various posesstanding, sitting, laying down and standing. Sitting alone in the quaint gallery, I lost track of time. \r\n\r\n<!--image:"sit"-->\r\n\r\nIn the side gallery, two BFA students and friends Carlyn Bezic and Cecily Taylor have a show entitled The Number of Days. Using a variety of materials, scrap paper, collage materials and what might be considered trash Bezic and Taylor create something beautiful and collaborative. \r\n\r\n<!--image:"number"-->\r\n\r\nThanks for four lovely years of art and offbeat parties Modern Fuel. Ill be back to visit. Im a sucker for free things. \r\n	t	t	2011-04-03 17:04:40-04	2010-03-24 14:51:56-04	2010-03-24 14:51:56-04	t
238	Artist in Profile with The Ascot Royals	27	artist-in-profile-with-the-ascot-royals	456		<!--image:"ascot"-->\r\n<strong>1. Who are you?</strong>\r\nWe are the Ascot Royals based out of the Hamilton/Brantford area.\r\n\r\n<strong>2. What do you do?</strong>\r\nThe Ascot Royals are an up and coming band that aspires to make people get up and dance.\r\n\r\n<strong>3. Where can someone find you?</strong>\r\nYou can find us at myspace.com/theascotroyals\r\n\r\n<strong>4. Where do you live and work and why?</strong>\r\nWe are spread across Brantford, Hamilton, all the way to Barrie. All working varying jobs to support our passion of making music.\r\n\r\n<strong>5. When did you start making music together?</strong>\r\nThe core of the band formed in the Fall of 2008, and has held its current roster since the early Spring of 2009.\r\n\r\n<strong>6. How would you describe your music?</strong>\r\nThe Ascot Royals are a dynamic fusion of Brit Indie Rock and Motown with explosive guitar leads, powerful and playful vocals, and a tight rhythm section to hold it all together.\r\n\r\n<strong>7. What inspires you?</strong>\r\nThe pure love of playing music in front of people.\r\n\r\n<strong>8. What's the nicest things someone has said you to after a show?</strong>\r\nJust that they truly enjoy our music is very rewarding for us to hear.\r\n\r\n<strong>9. What's the worst thing someone has said to you after a show?</strong>\r\n"If you got some tubes bra, it'd push harder" -Anonymous individual\r\n\r\n<strong>10. What are your current obsessions?</strong>\r\nOur one obsession is to achieve a point in our musical careers to make a living from it. There would be no better job on the planet than entertaining and playing music to people.\r\n\r\n<strong>11. When someone says "Kingston" you think...</strong>\r\nOur bass player grew up in the area so Kingston has like all our hometown gigs has an excitement and anxiety about putting on a good show.\r\n\r\n<strong>12. What are you currently working on?</strong>\r\nWe are currently working on some new material as well as finalizing plans for an Eastern Canadian tour in April.  \r\n\r\n<strong>The Ascot Royals play tonight at Clark Hall Pub!</strong>	t	t	2011-04-03 17:05:10-04	2010-02-11 10:56:39-05	2010-02-11 10:56:39-05	t
236	Epitaph for My Heart	27	epitaph-for-my-heart	456		<!--image:"anti"-->\r\nThis is not a factIm just guessingbut I think that there are probably more breaking-up songs in the universal songbook than getting-together songs. Im almost positive there are more fuck-you-asshole than Im-sure-Ill-love-you-forever tunes. Its just a hunch. Sadness has inspired some of the most beautiful art. Thank God for pain. Without out it we wouldnt have <a href="http://redfellow.files.wordpress.com/2009/10/tracey-emin-my-bed.jpg">Tracey Emins bed</a>. We wouldnt have <a href="http://www.youtube.com/watch?v=W-M3Q2zhGd4">Annie Hall</a>. We wouldnt have excuses to binge drink red wine and we wouldnt have Martha Wainwrights anthem Bloody Motherfucking Asshole. Here are some more songs, in case you are also protesting Valentines Day. \r\n\r\n1.\tBetty DavisAnti Love Song\r\n2.\tAmy WinehouseLove Is A Losing Game\r\n3.\tArt BrutPeople In Love\r\n4.\tJens LekmanIm Leaving You Because I Dont Love You\r\n5.\tMartha WainwrightBloody Motherfucking Asshole\r\n6.\tThe Velvet UndergroundWho Loves The Sun\r\n7.\tThe StreetsI Love You, More Than You Like Me\r\n8.\tHandsome FursIm Confused \r\n9.\tNew OrderBizarre Love Triangle \r\n10.\tBob DylanDont Think Twice\r\n11.\tDarondoDidnt I\r\n12.\tThe Magnetic FieldsI Dont Really Love You Anymore\r\n13.\tThe Magnetic FieldsI Dont Want To Get Over You\r\n14.\tJason CollettIm Not Over You\r\n15.\tBlack KidsLove Me Already\r\n16.\tPop LeviNever Never Love \r\n17.\tRufus WainwrightImaginary Love \r\n18.\tWilcoWere Just Friends\r\n19.\tBilly BraggValentines Day Is Over\r\n20.\tBruce SpringsteenValentines Day \r\n21.\tNeko CasePeople Got A Lot Of Nerve\r\n22.\tThe Hidden CamerasMusic Is My Boyfriend\r\n23.\tGod Help The GirlGod Help The Girl \r\n24.\tLou ReedSad Song\r\n25.\tJulian DoironConsolation Prize \r\n26.\tThe BicyclesI Know We Have To Apart\r\n27.\tMorrisseyThe More You Ignore Me, The Closer I Get\r\n28.\tSmokey RobinsonTracks Of My Tears\r\n29.\tJoan Jet and The Black HeartsI Hate Myself For Loving You\r\n30.\tLeonard CohenFamous Blue Raincoat\r\n\r\nPlease add more. I don't want to be alone. 	t	t	2011-04-03 17:05:15-04	2010-02-10 20:08:40-05	2010-02-10 20:08:40-05	t
231	Artist In Profile with METZ	27	artist-in-profile-with-metz	456		<!--image:"metz"-->\r\n\r\n<strong>\r\n1. Who are you?</strong>\r\nMETZ. \r\n<strong>\r\n2. What do you do?</strong>\r\nExplode basements.\r\n\r\n<strong>3. Where can someone find you?</strong>\r\nIn a basement. \r\n\r\n<strong>4. Where do you live and work and why?</strong>\r\nToronto because all of our stuff is there. \r\n<strong>\r\n5. When did you start making music together?</strong>\r\nRoughly 12,000 hours ago. \r\n\r\n<strong>6. How would you describe your music?</strong>\r\nObscurantism.\r\n\r\n<strong>7. What inspires you?</strong>\r\nVegetable korma roti. \r\n\r\n<strong>8. Whats the nicest things someone has said you to after a show?</strong>\r\nWhat is a good place to eat around here?\r\n<strong>\r\n9. Whats the worst thing someone has said to you after a show?</strong>\r\n"Meet me at the Equinox..."\r\n\r\n<strong>10. What are your current obsessions?</strong>\r\nFinding a good place to put the flux capacitor in my Deloreon. \r\n\r\n<strong>11. When someone says Kingston you think...</strong>\r\nBradsters. \r\n\r\n<strong>12. What are you currently working on?</strong>\r\nGoing grey. \r\n\r\n\t\r\n<strong>METZ play with False Face in Whine Cellar (The Mansion's Basement) this Saturday night.</strong>	t	t	2011-04-03 17:05:21-04	2010-01-21 15:58:50-05	2010-01-21 15:58:50-05	t
230	PS Pre-Pitchfork	27	ps-pre-pitchfork	456		<!--image:"ps"-->\r\n\r\nAs much as I love to make fun of Pitchfork, its readers and its sometimes convoluted reviewsI read it. Religiously. And you know what? Theyre usually right. Those cool kids over at Pitchfork have also made (and broke) many musicians. Their influence has become massive since their inception in 1995.\r\n\r\nCanadian outfit Broken Social Scene has cited Pitchfork as being one of the reasons they started selling out venues. Merge executive Martin Hall told the Chicago Tribune that Arcade Fires debut record Funeral was out of print for a week after it received a 9.7 from the online magazine. These are just a few examples. Pitchfork has been responsible for the success of many obscure bands and they deserve credit.  \r\n\r\nAnd now, Kingstons very own Paul Saulnier and Ben Nelsonmore commonly known on the Internet as PS I Love Youhave received an 8 out 10 (a pretty substantial number, considering the fact their critics sometimes give zeros) for their track Facelove on Pitchfork. You can read the review <a href="http://pitchfork.com/reviews/tracks/11709-facelove/">here</a>.\r\n\r\nBut, who would I be if I didnt plug The Queens Journal in all of this?  Before his Pitchfork shout out, Paul got one in The Journal. I interviewed Paul at a bowling alley in Kingston and it has been one of my favourite interviews to date. You can find that piece <a href="http://www.queensjournal.ca/story/2008-09-09/arts-entertainment/ps-kingston-i-love-you/">here</a>. This year Ben and Paul also did a short, but hilarious<a href="http://www.queensjournal.ca/story/2009-10-13/arts-entertainment/kingston-love/"> Artist In Profile</a> for The Journal. Its interesting to see how distinctly different the sentiments are in each of these pieces...Ever elusive, who knows what's next for Paul and Ben. \r\n\r\nMad props PS, you deserve itand dont forget us when you're famous.  \r\n	t	t	2011-04-03 17:05:27-04	2010-01-19 16:04:56-05	2010-01-19 16:04:56-05	t
229	New Year's Playlist 	27	next-year-in-zion	456		<!--image:"fireworks"-->\r\nIve never been one for New Years resolutions. All I can guarantee is a substantial hang-over come January 1stbut a New Year playlist? Now theres an idea I can get behind! Let these inspirational (and sometimes ironic) songs guide you into the New Year. \r\n\r\n1.\tChangesDavid Bowie \r\n2.\tA Change Is Gonna ComeSam Cooke  \r\n3.\tMondayThe Jam \r\n4.\tIm Gonna Change the WorldThe Animals\r\n5.\tDont Look Back In AngerOasis \r\n6.\tNext Year In ZionHerman Dne\r\n7.\tIm Gonna Make You Love MeStevie Wonder and Diana Ross \r\n8.\tThis Will Be Our YearThe Zombies  \r\n9.\tThats How It Should Be (Sha Sha)Ben Kweller \r\n10.\tBrand New StartPaul Weller \r\n11.\tRight Now Im A-RoamingNick Cave\r\n12.\tIn The New YearThe Walkmen \r\n13.\tNew Years ResolutionOtis Redding and Carla Thomas\r\n14.\tHarder Better Faster StrongerDaft Punk \r\n15.\tWharf RatThe Grateful Dead\r\n16.\tFeeling GoodNina Simone\r\n17.\tBox ElderPavement \r\n18.\tBetter ThingsThe Kinks \r\n19.\tMy Year in ListsLos Campesinos! \r\n20.\tJust Like Starting OverJohn Lennon \r\n21.\tNew Years ResolutionLootpack\r\n22.\tAnother DayJamie Lidell \r\n23.\tQuit Smoking SongPrincess Superstar\r\n24.\tI Wont Back DownTom Petty \r\n25.\tThe Wild RoverThe Pogues\r\n26.\tTrue Love Will Find You In The EndDaniel Johnston \r\n27.\tMaggies FarmBob Dylan \r\n28.\tPiss FactoryPatti Smith\r\n29.\tIm Gonna Get Me a GunCat Stevens\r\n30.\tIm Gonna Be A Wheel SomedayFats Domino\r\n\r\nIf you can think of other songs about resolutions or the New Year, post them!\r\n	t	t	2011-04-03 17:05:33-04	2009-12-15 14:42:31-05	2009-12-15 14:42:31-05	t
225	Artist in Profile with Moneen! 	27	artist-in-profile-with-moneen	456		<!--image:"moneen1"-->\r\n\r\n<strong>1. Who are you?</strong>\r\nKenny Bridges.\r\n\r\n<strong>2. What do you do?</strong>\r\nI sing and play guitar for Moneen.\r\n\r\n<strong>3. Where can someone find you?</strong>\r\nHopefully not in a ditch.\r\n\r\n<strong>4. Where do you live and work and why?</strong>\r\nI live in Brampton. I can't really call the band work. But if it were, then I work in a small van traveling around trying to make people smile. I travel with 3 other guys who also have the same mission. Why? Why not.\r\n\r\n<strong>5. When did you start making music together? </strong>\r\n10 years ago. Time flies.\r\n\r\n6. How would you describe your music?\r\nAggressive melodic pop, with a side of space.\r\n\r\n<strong>7. What inspires you?</strong>\r\nBeach boys, old jimmy eat world, failure, people who are extremely good at what they do and warm days.\r\n\r\n<strong>8. What's the nicest things someone has said you to after a show?</strong>\r\nI once told Walter from quicksand / rival schools how much his music meant to me and that it changed my life. He quickly replied, "you know what? One day someone is going to come up to you and say the same thing". I thought he was just being really nice. But one day someone did come up and say that to me. That's when I realized how truly powerful music can be.\r\n\r\n<strong>9. What's the worst thing someone has said to you after a show?</strong>\r\nThe other day a drunk girl told our tech that we were a great band, but sounded like shit.\r\n\r\n<strong>10. What are your current obsessions?</strong>\r\nLost.\r\n\r\n<strong>11. When someone says "Kingston" you think...</strong>\r\nUncle Doug.\r\n\r\n<strong>\r\n12. What are you currently working on?</strong>\r\nI am so close to finishing my home studio. Built it from scratch with our bass player Erik. We gutted the basement and framed it all, wired it all, dry-walled it all ourselves. The only thing left is windows and doors. So close! It will be great to be able to create music whenever we want.\r\n\r\n<strong>Moneen play The Mansion Dec. 11</strong>	t	t	2011-04-03 17:05:59-04	2009-12-09 13:04:29-05	2009-12-09 13:04:29-05	t
223	Local Talent	27	local-talent	579		<!--image:"crimes-in-paris"-->\r\n\r\nAfter local band Crimes in Paris rocked their mustaches and instruments for the Ale House Movember Party this past Saturday, I talked with their bassist Rudy Olsson about highlighting them on Limelight. Here's their lowdown: \r\n\r\n<strong>Band Members:\r\n</strong>Rayce Veitch: Vocals and Rhythm Guitar\r\nStuart Miller: Lead Guitar\r\nRudy Olsson: Bass\r\nZach Giannotti: Percussion\r\n\r\n<strong>What's the story behind your band's name?</strong>\r\n\r\nStolen from an Elvis Costello song (and tweaked to avoid any sort of conflict), Crimes in Paris sounded completely reasonable.\r\n\r\n<strong>Where and how did you originate?</strong>\r\n\r\nFrom Muskoka, Ontario, we came together in the eighth grade to play a talent show at our elementary school.  And after 10 years of playing talent shows, coffee houses, and totally devastating supernova sets in and around the Muskoka and Simcoe regions, we decided to relocate ourselves to Kingston.\r\n\r\n<strong>Are you all Queen's students?\r\n</strong>\r\nTwo of us have graduated from Queens with a Biology and LifeSci/Phe degree respectively.  Of the other two members, one is still attending Queens in music, and the other, just recently graduated from Guelph University with a business degree.\r\n\r\n<strong>What are some of your main influences?\r\n</strong>\r\nOur influences range anywhere from punk, to folk, electro/house and 60s brit-rock. The Beatles, Ben Folds, the Kooks, Sufjan Stevens, Radiohead, and Joe Jackson are pretty influential artists.\r\n\r\n<strong>How would you describe your sound?\r\n</strong>\r\nMelodically driven music, written acoustically and carefully molded into a full-band dynamic sound with the rare feeling of a well-written song.\r\n\r\n<strong>Do you have any bands that you'd like to promote, other than your own?\r\n</strong>\r\nWinhara is a band located in Toronto; theyre friends of ours from Muskoka, as well as Queens Alumni.  <a href="null">www.myspace.com/winhara</a>\r\n\r\n<strong>If Crimes In Paris could have any present, collectively, for Christmas, what would it be?\r\n</strong>\r\n$30,000 to pay for our upcoming album costs.\r\n\r\n<strong>Dream venue to play in?\r\n</strong>\r\nWembley Stadium in England, where many of our favourite artists have performed.\r\n\r\n<strong>What are your plans for a demo/record/performance schedule?\r\n</strong>\r\nWe have been recording at MetalWorks Studio in Mississauga since August, working on our debut album set for release in March 2010.  We have an upcoming show on Thursday, Dec. 3rd at Elixir nightclub, and our set starts at 10:30 PM.\r\n\r\n<strong>Can we expect you to pursue music post-grad?\r\n</strong>\r\nYes\r\n\r\n<em>Their Facebook</em>: <a href="http://">http://www.facebook.com/pages/CRIMES-IN-PARIS/118292194678?ref=search&sid=1657350051.1300878694..1</a>\r\n<em>Their MySpace</em>: <a href="http://">www.myspace.com/crimesinparis</a>\r\n\r\n<strong>Next Show: Thursday, Dec. 3 at Elixir</strong>	t	t	2011-04-03 17:38:34-04	2009-12-01 16:17:21-05	2009-12-01 16:17:21-05	t
222	A Very Indie Holiday Mix	27	a-very-indie-christmas	456		<!--image:"bob-dylan"-->\r\n\r\nPlease dont turn on your radio. You might be subjected to the terrible, terrible sounds of the Christmas carol. Take my advice, download these songs, make adorable personalized CDs and give them to your friendsI wouldnt lead you astray. These Christmas picks will allow you to be festive and alternative at the same time. Who could ask for anything more? \r\n\r\n1.\tRon Sexsmith  Maybe This Christmas\r\n2.\tBilly Bragg  Cold and Bitter Tears \r\n3.\tArcade Fire  Jingle Bell Rock\r\n4.\tYo La Tengo  Its Christmas Time\r\n5.\tThe Pogues  Fairytale of New York\r\n6.\tBob Dylan  Must Be Santa \r\n7.\tSufjan Stevens  Come On! Lets Boogey To The Elf Dance!\r\n8.\tRadiohead  Winter Wonderland\r\n9.\tDave n Megan  I Wanna Kiss You This Christmas \r\n10.\tBright Eyes  Blue Christmas\r\n11.\tFeist  Lo, How A Rose E're Blooming\r\n12.\tJason Collett  A Beguiled Christmas in Sales \r\n13.\tRufus Wainwright  Spotlight On Christmas\r\n14.\tThe Beatles  Christmastime (Is Here Again)\r\n15.\tBlitzen Trapper  Christmas Is Coming Soon\r\n16.\tLitterbug  Its Christmas Time \r\n17.\tBurquitlam Plaza  Christmas Wish\r\n18.\tDan Bryk  Love Me for Christmas\r\n19.\tPaper Moon  I Hope It's Something Good\r\n20.\tEels  Christmas is Going to the Dogs \r\n21.\tBelle and Sebastian  O Come, O Come Emmanuel\r\n22.\tRyan Adams  Hey Parker, Its Christmas \r\n23.\tTom Waits  Silent Night\r\n24.\tEvangelicals  The Last Christmas On Earth \r\n25.\tThe Walkmen  No Christmas While Im Talking\r\n26.\tWeezer  Christmas Song \r\n27.\tThe Black Halos  Homeless For Christmas \r\n28.\tHot Hot Heat  Christmas Day in the Sun \r\n29.\tYoung and Sexy  Santa Likes Rich Kids Better \r\n30.\tHawksley Workman  Merry Christmas, I love you! \r\n\r\nIf Ive forgotten any essentials, post them! \r\n	t	t	2011-04-03 17:43:45-04	2009-11-29 17:11:18-05	2009-11-29 17:11:18-05	t
220	Introducing Ellie Goulding	27	introducing-ellie-goulding	2		<!--image:"ellie-goulding"-->\r\n\r\nWhats this, a blonde synth-pop minstrel songstress? How\r\ninnovativehow original, you scoff. But wait friends, this ones got\r\nsomething special up her sleeve. Forget the fact her music has been\r\ndominating most music streaming blogs for the past few months, Wales\r\nnative Ellie Goulding has a one of a kind voice and a new take on a\r\ncrowded genre thats sure to make ears happy from bedrooms to\r\ndancefloors.\r\n\r\nFirst things first, shes not Lady Gaga, Lykki Li, Kate Nash, Little\r\nBoots, La Roux, Tracy Thorn, Imogen Heap or Bjork. Keep the\r\nmind-blowing tunes that hook you at first listen, save the theatrics,\r\ntorture device-esque costumes and public scandals and you may get a\r\nsense of where Gouldings genre lies. Shes just a girl with her\r\nguitarwith a twist.\r\n     \r\nIts no secret I have the hots for Gouldings harmonies. The first\r\ntime I came across her was by a lucky stroke of YouTube related video\r\nclicking fate. The folk meets dub synth Wish I Stayed melted me and\r\nI was devastated to discover only a few of her other tunes available\r\nfor listening on her myspace page. After a little investigation I\r\nlearned a handful of Gouldings tracks are produced by British\r\nelectro-pop commander Frankmusik and up-and-coming act Starsmith who\r\nsome may recognize as a source of a plethora of sick remixes floating\r\naround the web these days.\r\n\r\nLuckily, its true that good things come to those who wait because,\r\nalas, a few months have flown by and Ellie Gouldings track list has\r\ngrown into something resembling the compilation of an upcoming album\r\n(or so I hope). Her songs range from the soul shattering Fighter\r\nPlane, to body reverberating sexy dance numbers like Under the\r\nSheets, to tracks like Starry Eyed that make you feel a little bit\r\nin love. If your term has been lacking in goosebumps, listening to\r\nthis might just be the next best thing.\r\n\r\nSearch Ellie Goulding at hypem.com to hear her tunes.\r\n<em>\r\n-Ally Hall</em>	t	t	2009-11-26 16:49:32-05	2009-11-26 16:43:09-05	2009-11-26 16:43:09-05	t
218	Artist in Profile with Jon Amor 	27	artist-in-profile-with-jon-amor	456		<strong>Who are you?</strong>\r\nI'm Jon Amor, an indie-folk singer-songwriter, Queen's student and native of Ottawa, ON.\r\n<strong>\r\nWhat do you do?</strong>\r\nI resolve existential angst by day, write and perform songs about it by night.\r\n<strong>\r\nWhere can someone find you?</strong>\r\nIll be playing Thursday night at Clark Hall Pub at 9pm. I play there quite often.\r\nAlso, Online at www.jonamor.ca and Monday night CoGro Open Mics have been a tradition of mine since first year\r\n\r\n<strong>Where do you live and work and why?</strong>\r\n I live and work NOP because the rent was cheaper and Im generally a Skeleton Park fan.\r\n\r\n<strong>When did you start making music?</strong>\r\nI started writing songs with my gr. 9 band at Arts Canterbury High School in Ottawa , The Walkoffs, and wed play around school and at performance assemblies and stuff. However, the first few dozen songs were so awful and cheesy, they will never be heard again. I place the official start of my songwriting career 2 years ago when I wrote Side Porch.\r\n<strong>\r\nHow would you describe your music?</strong>\r\nGenuine, reflective and mainly concerned with manifesting subjective internal experience as completely as I possibly can, while rhyming. Hints of classic Jewish neuroticism. Good for long bus trips at night, Sunday afternoons, and cold winter walks to class. I aim for warmth.\r\n<!--image:"jonamor"-->\r\n<strong>What inspires you?</strong>\r\nMusically, Ive always been inspired by folk singer-songwriters like Paul Simon, Bob Dylan, Craig Cardiff, Jeff Tweedy from Wilco, Iron and Wine (Sam Beam), and Neil Young who put an emphasis on lyrical storytelling and deeply honest poetry. Im otherwise inspired by most of what I take in, weather, my dog Maggie, late-night conversations with friends, stories and philosophy that I read, the quiet, introspective hours before dawn (the gloaming), etc.\r\n\r\n<strong>Whats the nicest thing someone has said to you after a show?</strong>\r\nIt wasnt a real show, per se, but after busking in Ottawas Byward market a few summers back, I ended up hanging out with this Kerouac-type drifter who was traveling across the country because he had just lost his wife and wanted to commemorate their lives on the road together. After playing a few of my songs for him, the man started crying and told me that hearing my music at that point in time helped him bring a little comfort during his mourning. That was pretty affirming.\r\n\r\n<strong>Whats the worst thing someone has said to you after a show?</strong>\r\nIm really not musically significant enough yet for people to want to criticize me to my face. Anything nasty has probably been when I was well out of earshot.\r\n\r\n<strong>What are your current obsessions?</strong>\r\nIm been obsessively playing Dan Mangans new album Nice, Nice, Very Nice, Hey Rosettas Into You Lungs and Springsteens Nebraska. Otherwise, I just watched five seasons of Six Feet Under in about a month and a half. Thats a show that sticks with you - I cant seem to write about anything other than death now.\r\n\r\n<strong>When someone says Kingston you think </strong>\r\nThe last four years of my life, the people Ive met, Clark Hall Pub, the Grad Club, spontaneous jam sessions down by Lake Ontario, Weeping Tile (Basement Apartment and Room with the Sir John A View), Apple Crisp, Busking on Princess Street\r\n\r\n<strong>What are you currently working on?</strong>\r\nI finally think Ive got enough songs written that Im proud of to get started on recording my debut record. Ive managed to find a few musician friends to help out and it should be out sometime early in the New Year. \r\n\r\nJon Amor plays Clark Hall Pub this Thursday November 19th.  \r\n	t	t	2011-04-03 17:03:30-04	2009-11-19 19:46:20-05	2009-11-19 19:46:20-05	t
216	Twit Art	27	twit-art	456		Confession: I just got Twitter. At first I was afraid. But now Im fully embracing what the kids call "The Twitterati." The networking site has also helped me stay connected to the local culture in Kingston. Many local groups are embracing Twitterkeeping me in the know about whats hip-happenin around town. Here is a list of our favourite Twitter pages. If you have any other suggestions please post them! Well keep adding to this list when we find more groups worth following.\r\n\r\n<a href="http://twitter.com/applecrispmusic">@applecrispmusic</a> Information and musings from the Apple Crisp collective.\r\n<a href="http://twitter.com/Applecrispvideo">@Applecrispvideo</a> Fun music videos shot in Kingston! \r\n<a href="http://twitter.com/Artsking">@Artsking</a> The arts council for Kingston and a 100km radius around the city. An amazing place to find out about more obscure art events. \r\n<a href="http://http://twitter.com/CKWS_TV">@CKWS</a> TV I know that not many people watch the local news, but CKWS does their thang to promote lots of local events and update their twitter account regularly. \r\n<a href="http://twitter.com/CFRC">@CRFC</a> All the buzz from your signal, show dates and chart toppers. \r\n<a href="http://twitter.com/downtownktown">@downtownktown</a> A great place to find out whats happening in downtown Kingston.\r\n<a href="http://twitter.com/FlyingVirg">@FlyingVirg</a> Updates about concerts put on by Flying V productionsshows mostly at The Grad Club.\r\n<a href="http://twitter.com/Kingston_Grand">@Kingston_Grand</a> Find out whats happening at Kingstons newly renovated Grand Theatre. \r\n<a href="http://twitter.com/Kingston_Life">@Kingston_Life</a> A very random but always interesting listing of events. Lord of the Dance anyone? \r\n<a href="http://twitter.com/kingstonist">@kingstonist</a> Focusing on everything and anything going on in Kingston, ON.\r\n<a href="http://twitter.com/KingstonPunk">@KingstonPunk</a> Updates about concerts put on by Kingston Punk Productionsshows mostly at The Mansion and Time To Laugh. \r\n<a href="http://twitter.com/KingstonSymph">@KingstonSymph</a> Show dates and updates from the KSA. \r\n<a href="http://twitter.com/kingstonwriters">@kingstonwriters</a> Wordy tweets by the people who brought you the Kingston Writers Fest.  \r\n<a href="http://twitter.com/Krock1057">@Krock1057</a> Be the first to know when The Beatles play the K-Rock Centre! \r\n<a href="http://twitter.com/PartyInKingston">@PartyInKingston</a> It sounds trashy, I know, but Party In Kingston is an extremely comprehensive guide to whats happening around town. \r\n<a href="http://twitter.com/QueensTV">@QueensTV</a> Not too many updates, but Queens TV seems to be getting to hang out it with footage from Girl Talhttp://www.queensjournal.ca/media/content/2009/11/art.jpgk. \r\n<a href="http://twitter.com/Reelout">@Reelout</a> Kingstons only queer film and video festival is Reelout. Not too active now, but come February this thing will be buzzing. \r\n<a href="http://twitter.com/TourismKingston">@TourismKingston</a> Did you know Fort Henry was on Ghost Hunters?! I found this out from TourismKingston. Thank you. \r\n\r\nAlso, mad props to Tyler Ball for allowing me to steal his blog post Oil Tweet. You can find his post <a href="http://www.queensjournal.ca/blogs/campus-bytes/2009/10/oil-tweet/">here</a>.<!--image:"art"-->	t	t	2011-04-03 17:03:16-04	2009-11-16 19:37:31-05	2009-11-16 19:37:31-05	t
307	Sports - CIS Hockey Sunday	35	sports-cis-hockey-sunday	502	CIS, women's hockey, 2011 CIS championships, hockey	The 2011 CIS Women's Hockey Championships are over. The Gaels clinched the bronze medal in the dying minutes of the third period to win the final game of a season that has been called "miraculous" and a "Cinderella story."\r\n\r\nThe Queen's Journal has been proud to have witnessed many of these moments - from early season stumbles to a riveting OUA victory attended by many of you. We trudged through snow and ice to cover games at the Memorial Centre throughout the winter. We sat in sparsely populated stands and wondered about student turnout. We watched our bandwidth dwindle as the Gaels battled the Gryphons into a historic six-overtime victory in Guelph. \r\n\r\nAs with every Gaels team, we believed that our women's hockey team had it in them. And we felt that the student body deserved to see, read and hear about their dedication. That the student body deserved to be inspired. We traveled to Waterloo, Ontario with this in mind. \r\n\r\nThe following is my final compilation of images from the Waterloo Memorial Recreation Complex:\r\n\r\n<!--image:"gaelswhockey3-2"-->\r\n<!--image:"gaelswhockey3-3"-->\r\n\r\n<!--image:"gaelswhockey3-4"-->\r\n\r\n<!--image:"gaelswhockey3-5"-->\r\n\r\n<!--image:"gaelswhockey3-6"-->\r\n\r\n<!--image:"gaelswhockey3-7"-->\r\n\r\n<!--image:"gaelswhockey3-8"-->\r\n\r\n<!--image:"gaelswhockey3-9"-->\r\n\r\n<!--image:"gaelswhockey3-10"-->\r\n\r\nKate, Lauri and I hope that our reports and images, late nights and hours in frigid press boxes and rinks and tolerance of an extremely repetitive playlist (Sweet Caroline, Final Countdown, Sandstorm, Teenage Wasteland etc) have been informative and relevant to our student audience. Queen's students deserve the coverage, and so do our Gaels. \r\n\r\nCongratulations, ladies. 	t	t	2011-08-09 12:50:09.005157-04	2011-03-14 20:21:30-04	2011-03-14 20:21:30-04	t
1	Kingston antiquity	38	kingston-antiquity	528	Springer Market Square, downtown, antiques, market	Springer Market Square offers a quintessential Kingston experience when it turns into an Antique Market. Better known for its Farmers Market, on Sundays the square showcases an eclectic array of treasures and trinkets. Hours of searching for furniture, books, paintings, jewellery, clothes and statues barely scratches the surface of this treasure trove.\r\n\r\nThe market dates back to 1801 and is stocked full of Kingstons rich history. Items from early days at Queens and from the Canadian military are everywhere. It was in Springer Market Square that the Proclamation of Confederation was made on July 1, 1867, making it a fitting place for an antique market.\r\n\r\nVendors sell items from personal collections, flea markets, garage sales, estate sales and travels abroad. While the market allows vendors to display items they believe to be historically or culturally significant, some things are just randomly and inexplicably cool. For example, I was very close to buying a mini gargoyle. \r\n\r\nRuss Cassidy, owner of Rustique Antiques and frequent vendor at the market, said the age of an item doesnt necessarily mean its more valuable.\r\n\r\nNostalgia drives the prices. You can tell someones age by what they look at, he said.\r\n\r\nI was excited to find Disney-themed drinking glasses.\r\n\r\nAmong Cassidys items was a sextant. Its a navigational instrument from World War II and was on sale for $325. Hunting for antiques feels like  being in a museum where you can hold the artifacts. Other vendors sold old war medallions.\r\n\r\nLooking to spruce up your digs before the new school year? The many lamps, paintings and prints put Urban Outfitters homewares to shame. Plus, you cant beat the authenticity and amusement of a 1950s telephone that you can pretend once belonged to Lucille Ball.\r\n\r\nAfter seeing beautiful champagne glasses, martini mixer sets and crystal bottles, I imagined myself hosting glamorous cocktail parties for friends, while wearing gloves and fancy dresses. I then recalled that delicate glassware wouldnt last long in my student house. Nor do I own a pair of gloves.  \r\n\r\nAfter examining various trinkets, I discovered that its a good idea to verify the price of a piece with its vendor. Though I didnt see people haggling, it seems that some vendors are willing to sell items for cheaper than tagged.  \r\n\r\nThe Antique Market boasts an atmosphere of charismatic vendors sharing things theyre passionate about while engaged shoppers feed their nostalgia. Ask any vendor where an item originated and youre sure to get a detailed and enthusiastic response. Even if youre not in the market for a spinning wheel from the early 1900s, youll surely enjoy the novelty of the experience.\r\n\r\nThe Antique Market runs from April until the end of October on Sundays from 8 a.m. to 4 p.m.\r\n\r\nHere are some of my favourite items:\r\n\r\n<ul><li>Books: $2 to $20</li>\r\n<li>Table:$750</li>\r\n<li>Phone: $20</li>\r\n<li>Maple syrup holder:$8</li>\r\n<li>Round tins: $6 to $10</li>\r\n<li>Clock :$125</li>\r\n<li>Suitcase:$45</li>\r\n<li>Trunk:$145</li>\r\n<li>Bookshelf:$25</li>\r\n<li>Dresser:$15</li>\r\n<li>Cookbooks:$2</li>\r\n<li>Martini shaker and glasses:$20</li>\r\n<li>Gargoyles and Buddha statues: $25 to $125</li>\r\n<li>Rings:$8, 3 for $20</li>\r\n<li>Wedding dress: $35</li>\r\n<li>Bracelets:$4 to $5</li>\r\n<li>Harmonica: $6</li>\r\n<li>WWII navigating instrument: $325</li>\r\n<li>Old magazines:$5</li>\r\n<li>Cameras from the 30s:$20 to $40</li>\r\n<li>Knife set: $18</li>\r\n<li>Disney glasses:$2</li>\r\n<li>War medals:$25</li>\r\n<li>Spinning wheel:$175</li></ul>\r\n\r\n<em>With files from Kelly Loeper</em>	t	t	2011-08-14 15:42:27.780951-04	2011-08-14 16:25:41-04	2011-08-14 16:25:41-04	t
326	Keen on quinoa	41	keen-quinoa	528	Superfood, quinoa, grain	Quinoa is an ancient grain that has recently become a go-to food for healthy eaters everywhere.  Once referred to as the mother of all grains by the Incas, quinoa contains essential nutrients not found in other grains. Easy to prepare, quinoa has a light, fluffy texture and a slightly nutty flavour when cooked.\r\n\r\n<strong>Health benefits</strong> \r\n\r\n\tNot only is it very high in protein, its considered a complete protein which means it includes all nine amino acids.\r\n\r\n\tQuinoa contains lysine, an amino acid thats essential to tissue growth and repair.\r\n\r\n\tIts gluten-free for anyone who has gluten sensitivity.\r\n\r\n\tA high source of magnesium, quinoa contributes to overall cardiovascular health.\r\n\r\n\tIt contains riboflavin  a member of the vitamin B family that is said to help eliminate migraines.\r\n\r\n\tIts an excellent source of dietary fibre.\r\n\r\n<strong>Nutritional data</strong>\r\n\r\nOne cup, cooked: 254 calories, 46.8 g carbohydrate, 4 g fat, 4 g dietary fiber and 9 g protein.\r\n\r\n<strong>How to cook quinoa</strong>\r\n\r\nFor one cup:\t\r\n\r\n1.\tSoak quinoa for about five minutes. Most packaged quinoa has been soaked and rinsed already but this extra step ensures that quinoa is cooked evenly.\r\n\r\n2.\tRinse well in strainer.\r\n\r\n3.\tPut into pot with one and a half cups of water. Add salt if desired. Bring to a boil.\r\n\r\n4.\tCover, turn stove to simmer. Cook for 15 minutes.\r\n\r\n5.\tRemove from heat and let sit for five minutes. The cooked germ looks like a tiny curl.\r\n\r\n6.\tFluff with fork.\r\n\r\n7.\tAdd ingredients or enjoy as is!\r\n\r\n<strong>Meal ideas</strong>\r\n\r\nBreakfast\r\n\r\nCooked, quinoa can be eaten much like oatmeal, with honey, berries, and raisins. It can also be eaten raw with milk like corn flakes.\r\n\r\nLunch/Dinner\r\n\r\nModify your regular stir fry recipe by using quinoa instead of rice. Saut with veggies, chicken, tofu and sauces to create a well-balanced meal.\r\n\r\nPrepare a quinoa salad. Mix feta cheese, green onions, chicken, cherry tomatoes and dress with olive oil and lemon. Both options are easily modifiable to accommodate your favorite foods and or fridge contents.	t	t	2011-09-15 23:56:56.929179-04	2011-09-16 00:56:53-04	2011-09-16 00:56:53-04	t
351	Twenty-minute lentil soup	42	twenty-minute-lentil-soup	589	lentil soup, campus cooking, recipes	By Carolyn Flanagan\r\nAssistant Blogs Editor\r\n\r\nCrock pots and slow cookers arent necessary to make a delicious lentil soup. Featuring high fibre, protein-rich lentils and as many vegetables as your heart desires, this hearty dish is sure to keep you warm and nourished during winter.\r\n\r\n<strong>Ingredients</strong>\r\n\r\n\t1 tbsp  vegetable oil\r\n\r\n\t4 green onions, chopped\r\n\r\n\t3 carrots, chopped\r\n\r\n\t1 potato, peeled and chopped\r\n\r\n\t1 tbsp tomato paste\r\n\r\n\t2 tsp mild curry paste\r\n\r\n\t2 1/2 cups vegetable stock\r\n\r\n\t2 1/2 cups water\r\n\r\n\t1 cup  dried red lentils\r\n\r\n\t2 cups packed fresh baby spinach \r\n\r\n<strong>Preparation</strong>\r\n\r\nIn a large saucepan, heat oil over medium heat. Fry chopped green onions, carrots and potato, stirring occasionally until onions are softened. Stir in tomato paste and curry paste.\r\n\r\nAdd vegetable stock, water and lentils. Bring to a boil. Reduce heat, cover and simmer until lentils are tender. Stir in spinach.\r\n\r\nMakes four servings.\r\n\r\nServe with bread and enjoy!\r\n\r\n<!--image:"lentilsoup1"-->\r\n\r\n<!--image:"lentilsoup2"-->\r\n\r\n<!--image:"lentilsoup3"-->\r\n\r\n<!--image:"lentilsoup4"-->\r\n\r\n<strong>Other popular ingredients to add as you wish:</strong>\r\n\r\nSweet potato, onion, ginger, garlic, celery, mushrooms, sage, cumin, ham and grape tomatoes.\r\n\r\n<em>Source: canadianliving.com</em>\r\n\r\n	t	t	2012-02-14 00:20:00.329518-05	2012-02-14 00:19:55-05	2012-02-14 00:19:55-05	t
323	Trend Trial: OPI's Black Shatter	39	trend-trial-opis-black-shatter	680		Until you put on a coat of Black Shatter from Katy Perrys OPI nail polish collection, theres no indication of how the product is able to create its famed effect.\r\n\r\nAccording to the instructions, the first step is to put on a coat of a different nail polish .\r\n\r\nAfter it dries, top it off with a coat of Black Shatter .\r\n\r\nWhile it goes on like any other nail polish, black and smooth, it dries to create the shattered effectand quite quickly .\r\n\r\nAlthough it does have quick results, the polish is not completely foolprooffirst-time users should be aware that there seems to be an exact amount of polish to apply in order to achieve the shatter effect.\r\n\r\nThe first time I used it, I was warned a light hand would be best. Apparently I was too light, because the polish dried to black stripes. On my second hand, I used too much polish and my nails were too black to notice the shatter effect. Clearly this takes practice.\r\n\r\nI noticed that my nails tended to chip after only a few days, even when applying a top coat. This normally wouldnt bother me so much, but after shelling out $13 for the polish and having to reapply it a few times to get it right, I expected a little more longevity.\r\n\r\nDespite some of its shortcomings, I like how many different looks can be created with Black Shatter. Each undercoat has a different effect. Some of the best ways Ive seen Black Shatter used include pairing it with a metallic polish, a sparkly polish or a glossy black coat.\r\n\r\n	f	t	2012-05-21 17:40:49.584377-04	2011-09-12 12:47:42.08345-04	\N	f
327	Easy eating: making food in bulk	42	easy-eating-making-food-bulk	589	Campus cooking, vegetarian, video, student ghetto 	Between waiting in line to buy textbooks and balancing a social life with 8:30 a.m. classes, we already have enough on our minds during the first week back on campus. The last thing we want to worry about is a well-balanced meal.\r\n\r\nOne way to ease ourselves back into the kitchen is cooking in bulk cook. The leftovers can be frozen and eaten later on in the week.\r\n\r\nJournal staffers braved one of our student ghetto kitchens and attempted to chop, dice and saut our way through a vegetarian chilli recipe.  The Journals Justin Chin captured our efforts.\r\n\r\n<code>\r\n<iframe width="560" height="315" src="http://www.youtube.com/embed/bHFS-qluEwQ" frameborder="0" allowfullscreen></iframe>\r\n</code>\r\n\r\nThe recipe was easy. Prep took less than 15 minutes and cooking took 20 minutes. The meatless nature of the recipe cut down on the time and price but the chilli was still hearty enough for the most enthusiastic meat eaters.\r\n\r\n<em>Source:</em><a href="http://allrecipes.com/recipe/insanely-easy-vegetarian-chili/detail.aspx"> http://allrecipes.com/recipe/insanely-easy-vegetarian-chili/detail.aspx</a>\r\n\r\n- with files Carolyn Flanagan	t	t	2011-09-16 12:26:39.418125-04	2011-09-16 11:49:55-04	2011-09-16 11:49:55-04	t
