362	Irish Beef Stout Stew	42	irish-beef-stout-stew	589	St. Patrick's Day, recipes, stew	By Carolyn Flanagan \r\nAssistant Blogs Editor\r\n\r\nLooking to maximize your St. Patricks Day celebrations? Why not serve some traditional Irish farethis dish is quick to prepare but slow to cook, so it wont get in the way of any festivities.\r\n\r\n<!--image:"stew3"-->\r\n\r\n<strong>Ingredients</strong>\r\n\r\n1 kg stew meat\r\n\r\n cup all-purpose flour\r\n\r\n2 cans tomato paste\r\n\r\n1.25 kg new potatoes 2 medium onions, cut into 1-inch pieces\r\n\r\n750 ml low sodium beef broth\r\n\r\n1 can Irish Stout Beer\r\n\r\n10 garlic cloves, sliced\r\n\r\nCoarse salt and ground pepper\r\n\r\n2 boxes (10 oz each) of frozen peas\r\n\r\n<strong>Directions</strong>\r\n\r\n1.\tPreheat oven to 176 C (350 F). In a pot, toss beef with flour; stir in tomato paste. Add potatoes, onions, broth, beer and garlic; season with salt and pepper. Cover, and bring to a boil over medium heat, stirring occasionally.\r\n\r\n<!--image:"stew1"-->\r\n\r\n2.\tTransfer pot to oven, and cook, covered, until meat is fork-tender, 2 1/2 to 3 hours. Stir in peas, and season with salt and pepper. If your pot cannot go into the oven, transfer ingredients into a casserole dish to cook. Serves 10. \r\n\r\n<!--image:"stew2"-->\r\n\r\n<em>Source: yumsugar.com</em>\r\n\r\n<strong>Note:</strong> This dish can be frozen for up to three months.\r\n\r\n	t	t	2012-03-16 18:20:10.293588-04	2012-03-16 18:19:48-04	2012-03-16 18:19:48-04	t
352	Superfoods: Kale	41	superfoods-kale	589	healthy food, kale, superfoods, recipes	By Carolyn Flanagan\r\nAssistant Blogs Editor\r\n\r\nKale, along with broccoli, cabbage, brussel sprouts and cauliflower, belong to the cruciferous family of vegetables.  Many health-conscious dieters swear by this leafy green; it has more nutritional value for fewer calories than almost any other food.\r\n\r\n<!--image:"kale"-->\r\n\r\n<strong>Health benefits</strong>\r\n\r\n-Loaded with antioxidants\r\n\r\n-Has cholesterol-lowering capabilities, especially when steamed\r\n\r\n-Credited with providing comprehensive support to the body's detoxification system\r\n\r\n-An important anti-inflammatory\r\n\r\n-Rich in Vitamins A, B, C and K\r\n\r\n-Also rich in minerals such as calcium, manganese, copper and potassium\r\n\r\n<strong>How to prepare</strong>\r\n\r\nKale can be eaten raw, steamed, sauted or roasted.\r\n\r\n<strong>How to eat</strong>\r\n\r\n- Breakfast:  Add them to your regular smoothie recipe and you may not even notice it, but the benefits are substantial.\r\n\r\n - Lunch: Raw kale can be chopped up and served as a salad.\r\n\r\n - Dinner: Cook it into pastas and stir fries.\r\n\r\n - Snacks: Prepare kale chips by separating the leaves from the stems and ripping into bite size pieces. Drizzle with olive oil and seasonings as you wish. Bake at 350 F (175 C) until brown. It takes 10 to15 minutes.\r\n\r\n	t	t	2012-02-14 00:20:30.37195-05	2012-02-14 00:20:26-05	2012-02-14 00:20:26-05	t
324	Protein powder: necessity or gimmick?	41	protein-powder-necessity-or-gimmick	589		No matter how much were told that a proper diet and exercise are the ways to get fit, theres always something out there to confuse us\r\n\r\nOn a recent trip home, I was baffled when I witnessed my mother religiously drinking protein shakes every morning, claiming it helps her build muscle.\r\n\r\nAll this time I thought protein powder was just another unnecessary health trend that people were tricked into thinking they needed.\r\n\r\nDo we need to add protein powder to our drinks each day to see results in our workouts? Or should we leave the powder to the guys on Jersey Shore?\r\n\r\nAccording to Peer Health Outreach Coordinator Beth Doxsee, protein accounts for a small percentage of our daily required macronutrients.\r\n\r\nAbout 15 to 20 per cent of your diet should be protein, she said, adding that 55 to 60 per cent should be carbohydrates and the rest should be fats.\r\n\r\nCommon sources of protein in an everyday diet are red meat, chicken, fish, tofu, almonds, eggs and lentils.\r\n\r\nAlthough protein powders are marketed mostly towards men who are weight training, many different groups of people use it because of how easy it is to mix into a drink.\r\n\r\nWhile protein does play an essential role in cell growth, repair and maintenance, Doxsee said, many people overestimate how much they need. Movie stars, for example, who train for several hours a day to build muscle for a role consume more than the average amount of protein.\r\n\r\nTheir caloric intake has increased significantly. Most people in North America have enough protein in their diet, if not too much.\r\n\r\nAlthough protein is important for muscle repair when heavy weight training, its not the only thing that people should focus on consuming.\r\n\r\nIf someone is doing heavy weight training its really important to make sure you have a mini meal after, she said. Something that includes protein, carbohydrates and fats. For this reason, Doxsee said she prefers more natural sources of protein.\r\n\r\nYou should know the ingredients of foods youre consuming. Doxsee said she would recommend something as simple as having a piece of bread with peanut butter and banana for a good after-workout meal because it includes all three macronutrients and is less artificial.\r\n\r\nIn other words, stick to regular food and youll do just fine.	t	t	2011-09-19 15:25:18.253622-04	2011-09-19 15:25:18.24836-04	2011-09-19 15:25:18.24836-04	t
