330	The price of local produce	42	price-local-produce	528	Farmer's market, local produce	Every Wednesday the farmers market sets up shop between 9 a.m. and 4 p.m. in front of Stauffer Library, giving students unique access to locally grown produce. During the summer season, the market sets up every Tuesday, Thursday and Saturday. The <em><Journal></em> set out to break down the prices and origins of some in-season products found at the farmers market and compare them to options at Metro.\r\n<h4>\r\nFarmer's market</h4>\r\n\r\n- Blueberries: $3/pint, from Picton, Ont.\r\n\r\n<!--image:"blueberries1"-->\r\n\r\n- Cherries: $4/pint, from Niagara, Ont.\r\n\r\n- Raspberries: $5/500g, from Napanee, Ont.\r\n\r\n<!--image:"raspberries"-->\r\n\r\n- Lettuce: $3.50/head, from Battersea, Ont.\r\n\r\n<!--image:"lettuce"-->\r\n\r\n- Tomatoes: $3/lb, from Napanee, Ont.\r\n\r\n<!--image:"tomatoes"-->\r\n\r\n- Potatoes: $3.50/lb,  from Napanee, Ont.\r\n\r\n- Garlic cloves: $2.75/clove, from Odessa, Ont.\r\n\r\n<!--image:"garlic"-->\r\n\r\n- Onions: $0.75/onion, from Napanee, Ont.\r\n\r\n<!--image:"onions"-->\r\n\r\n- Loaf of whole-wheat bread: $4.75, from Wolfe Island, Ont.\r\n\r\n<!--image:"bread"-->\r\n\r\n- Nikita's raspberry jam (with vanilla): $6.95, from Kingston, Ont.\r\n\r\n<!--image:"jam"-->\r\n\r\n<h4>Metro</h4>\r\n\r\n- Blueberries: $4.99/pint, from USA\r\n\r\n- Cherries: $3.31/lb, from USA\r\n\r\n- Raspberries: $2.99/100g, from USA\r\n\r\n- Lettuce: $1.49/head, from Ont.\r\n\r\n- Tomatoes: $3.99/lb, from Mexico\r\n\r\n- Potatoes: $3.99/2lbs, from USA\r\n\r\n- Garlic cloves: $0.99/5 cloves, from Ont.\r\n\r\n- Onions: $1.49/lb, from Canada\r\n\r\n- Loaf of whole-wheat bread (Dempster's): $3.39, from Ont.\r\n\r\n- Raspberry jam (Kraft): $5.49, from Ont.\r\n\r\nEach shopping experience had its advantages. Overall, Metros prices were cheaper. However, they import products from other countries instead of offering locally grown options. Having personally taste-tested the food above I can say the farmers market produce proved fresher and more flavourful. There is also the added bonus of talking to vendors who personally grew or baked the products themselves. Plus, foods less travelled have significantly less of a carbon footprint.  \r\n\r\nWeigh these factors next time youre grocery shopping:\r\n\r\nShopping at the farmers market:\r\n\r\n\tVery fresh produce\r\n\r\n\tInteractive, community-oriented shopping experience\r\n\r\n\tSupports local farmers\r\n\r\n\tHigh quality and flavour\r\n\r\n\tOrganic\r\n\r\n\tCreative, personalized options (e.g. raspberry vanilla jam, vegan bread from Wolfe Island)\r\n\r\nShopping at Metro:\r\n\r\n\tCheaper prices\r\n\r\n\tVery convenient location and hours\r\n\r\n\tCan purchase out of season, imported produce (including bananas, pineapple)\r\n\r\n\tOne-stop shopping for the rest of the items on your grocery list	t	t	2011-10-03 23:43:33.412068-04	2011-10-03 23:43:33.406841-04	2011-10-03 23:43:33.406841-04	t
363	Bryan Adams in Kingston	27	bryan-adams-jumpstarts-summer-tunes	738	Summer concerts, Bryan Adams, K-Rock Centre	Last night the Limestone City got a taste of Bryan Adams as the K-Rock Centre housed over 5,000 screaming fans to a sold out show. The Kingston-born rocker returned to stage with his full band in tow. \r\n\r\nDecked out in black and playing to a crowd of young and old, the band kicked-off their night with  their 91 classic House Arrest from the album <em>Waking Up the Neighbours</em>. Fans not only jammed to their live tunes but took their love of the Canadian icon onto Twitter, using the hashtag #AdamsinKingston. \r\n\r\nTo show his hometown some love, he changed the lyrics of Thought Id Died and Gone to Heaven to Thought Id Died and Gone to Kingston. As the night continued, a lucky Queens engineering student sporting a leopard t-shirt was hand-picked by Adams to join him on stage for When Youre Gone. \r\n\r\nThe <em>Journals</em> Arts Editor Savoula Stylianou and Assistant Photo Editor Tiffany Lam were on-site for an Adams-experience. \r\n\r\n<!--image:"adams"-->\r\n\r\n<!--image:"crowd"-->\r\n\r\n<!--image:"screengood"-->	t	t	2012-05-04 11:08:37.336939-04	2012-05-04 11:02:58-04	2012-05-04 11:02:58-04	t
336	Conscious of the cure: breast cancer awareness	32	breast-cancer-awareness	589		By Beth Doxsee\r\nPeer Health Outreach Coordinator\r\n\r\nAlong with fall weather and midterms, October brought breast cancer into the forefront of peoples minds thanks to pink ribbon campaigns and events like Run for the Cure.  To give you an idea of the scope of this disease, in 2010 over 23,300 women and 180 men in Canada were diagnosed with breast cancer.  That means that approximately one in 9 women will be affected by it.  Although the survival rate has increased significantly from 1980, there is still no known cause or cure. Over 5,300 women and 50 men died as a result of their diagnosis in 2010.\r\n\r\nBecause the majority of breast cancer diagnoses occur in women aged 50-70 years, most people in their twenties think that its something they need not worry about until much later in life.  But what you do now can have a big impact on your breast health later in life. While there is no known cause of breast cancer, there are definitely things that put you at an increased risk.  Even though youre unable to change some risk factors (i.e., your gender, age and genetics), there are a lot of risk factors that you can change.\r\n\r\nSo, here are some of the modifiable risk factors:\r\n\r\n\tBody weight - Try to stay in the normal weight category for you height.\r\n\r\n\tPhysical activity  Aim to get 30 minutes of physical activity every day.\r\n\r\n\tDiet  Go for lots of fruits, vegetables and whole grains and avoid eating too many foods high in sugar and fat.\r\n\r\n\tAlcohol use  Have one drink or less a day. Increased alcohol use correlates to increased risk, regardless of whether youre drinking spirits, beer or wine.\r\n\r\n\tTobacco smoke  Avoid both first- and second-hand smoke especially during your adolescence when your breasts are developing.\r\n\r\nAnother thing you can start doing in your 20s is get to know your breasts on an intimate level.  Heres how you become breast aware through four simple steps:\r\n\r\n1. Know how each of your breasts normally look (i.e., size, shape, colour)\r\n\r\n2.  Know what changes to look for:\r\n\r\n\tUnusual, or persistent pain in your breast(s) or armpit\r\n\r\n\tSwelling under your armpit or collarbone\r\n\r\n\tNipple changes  shape, position, discharge or being pulled inward\r\n\r\n\tRedness, rash or other skin irritation\r\n\r\n\tLumps, thickening, dimples or puckering \r\n\r\n3.  Feel each whole breast, above and below plus under each arm.  \r\nNOTE: there is no right or wrong way to do this.  You can move your middle fingers in small circles around those areas or any other way that feels comfortable to you.\r\n\r\n4. Report any changes to your health care provider.\r\n\r\nEven though breast cancer tends to be a disease that affects older women, it can still be diagnosed in younger women.  For example, in 2008 actress Christina Applegate was diagnosed at the age of 36 and underwent a double mastectomy.  On Oct. 19, 37 year-old E! News correspondent Guiliana Rancic underwent a double lumpectomy to treat the early stages of breast cancer.\r\n\r\nSo, take control of the risk factors you can change and become breast aware! For more information visit: Canadian Breast Cancer Foundation www.cbcf.org 	t	t	2012-05-15 09:21:04.582822-04	2011-11-03 14:14:40-04	2011-11-03 14:14:40-04	t
