332	Mindful meditation	32	mindful-meditation	785	meditation relax stress health	Mediation offers the chance to de-stress and relax, focusing energy internally.\r\n\r\n We see the world as fragmented, meditation leader Rory Skelly said. Meditation is a quiet place where you try to allow all that to settle a bit. According to Skelly, our brains are hardwired to multi-task and focus on multiple things happening externally. Meditation allows us to become aware of whats within ourselves.\r\n\r\nParticipants are encouraged to accept both emotional and physical feelings as they arise and acknowledge them without judgment.\r\n\r\nI practiced Mindfulness Meditation where the primary goal is to achieve awareness of oneself and one's physical and mental presence.\r\n\r\nAfter the 45-minute silent session, I felt lighter and had a noticeably calmer attitude. Two fellow participants in the session said they felt the same results.\r\n\r\nSkelly often refers to Pema Choron, a Buddhist nun from Gampo Abbey in Nova Scotia who said, "Sitting meditation gives us a way to move closer to our thoughts and emotions and to get in touch with our bodies."\r\n\r\nAfter one experience I can understand this philosophy; it's now something that I hope to incorporate into my regular routine.\r\n\r\nAlthough I enjoyed meditation, sitting for 40 minutes without talking or moving may not be the right experience for everyone. Although Skelly and his students both suggest starting with a group class, because meditating with other people is motivating, its not necessary. You dont need a meditation leader or a yoga studio to take a deep breath and re-evaluate your mind and body.\r\n\r\n Skelly offered three important tips to try when practicing meditation at home:\r\n\r\n<strong>Attention</strong>\r\n\r\nTo meditate, its recommended to pay attention to one function of your body, such as the movement of your breath, an emotional thought, or a physical ailment.\r\n\r\n<strong>Curiosity</strong>\r\n\r\nSkelly said mindful meditation allows you to be curious about where your thoughts lead. If your thoughts stray, acknowledge the new thought without elaborating on it.\r\n\r\n<strong>Gentleness</strong>\r\n\r\nTo refocus your attention, do so gently. You should never criticize yourself; calmly bring your attention back to what you had decided to focus on in that session.\r\n<em>\r\nSkelly leads a silent meditation class every Tuesday at 5 p.m. at Feel Good Yoga Studio on Princess Street. It's free of charge and is open to everyone.</em>\r\n\r\n	t	t	2012-05-15 09:21:23.441756-04	2011-10-03 23:48:58-04	2011-10-03 23:48:58-04	t
