338	No bones about it	41	no-bones-about-it	528		Most calcium ads are targeted at women over the age of 40. Thats why its a surprise to most people that peak bone mass is actually reached between the ages of 25 and 30. It means our university years are crucial for bone development, says Peer Health Outreach co-ordinator Beth Doxsee.\r\n\r\nYou can do a lot now to help yourself later in life, Doxsee said, adding that a decline in bone mass usually starts after the age of 50.\r\n\r\nCalcium isnt only necessary for the bone health, but for proper muscle function, nerve conduction, enzyme activity and the formation of cell membrane.\r\n\r\nHowever, a high-calcium diet isnt always conducive with student living.\r\n\r\nWith students, dairy products can get warm and spoil more easily, Doxsee said.\r\n\r\nHigh-calcium foods you wouldnt expect:\r\n\r\n\tAlmonds and almond products\r\n\r\n\tFortified soy milk and soy products\r\n\r\n\tKale (as well as other dark greens) \tBroccoli\r\n\r\n\tSardines\r\n\r\nMany products also have calcium rich options, such as Asana yogurt or Tropicana orange juice with calcium. Fortified soy products and cereals are also available.\r\n\r\nPeople often associate calcium products with higher fat content, yet it doesnt have to be the case. Some of these foods are great examples, Doxsee said.\r\n\r\nIncreasing calcium intake can help prevent osteoporosis and breaking bones.\r\n\r\nWeight-bearing exercises also help build up bone density and strength, said Kathryn Humphries, health promotion co-ordinator at Queens Health, Counselling and Disability Services.  Factors such as family history and gender also play a role in the loss of bone density. Women lose bone mass at a greater rate than men, thus should pay particular attention to calcium consumption.  One should get about 2-3 servings of calcium throughout the day, totalling about 1,000 mg of calcium.\r\n\r\nFor example, one glass of milk contains 300 mg and one cup of almonds contains 250mg.\r\n\r\n	t	t	2011-11-03 14:13:05.691082-04	2011-11-03 14:13:05.685679-04	2011-11-03 14:13:05.685679-04	t
337	Delicious Spanish chicken	42	delicious-spanish-chicken	812		This recipe is super easy and it can feed your whole house or you can live off it for several days. It freezes well and tastes even better the next day, cold or hot.\r\n\r\n<strong> Ingredients:</strong>\r\n<!--image:"chicken1"-->\r\n\r\n- 2 chicken thighs. I prefer thighs because they have a stronger flavor. If youre not a fan of thighs you can use three medium-sized breasts,\r\n\r\n- 1 tbsp.  paprika\r\n\r\n-  cup olive oil\r\n\r\n- 1 tin of whole tomatoes or however you like them\r\n\r\n- 1 tsp. tomato paste\r\n\r\n- 1 onion, diced\r\n\r\n- 1 red pepper, diced\r\n\r\n- 1 handful of black olives\r\n\r\n- 1 handful of chopped flat leaf parsley (not necessary, but delicious!)\r\n\r\n- Salt and pepper to taste\r\n\r\n<strong>Equipment:</strong>\r\n\r\n- 1 wooden spoon\r\n\r\n- 1 large, fairly deep pan\r\n\r\n<strong>Directions:</strong>\r\n\r\n-If using chicken breast, cut the breast into large bite sized pieces. Leave thighs whole.\r\n\r\n-Fry both sides of the chicken in  of a cup of olive oil.\r\n\r\n<!--image:"chicken2"-->\r\n\r\n-Add the onion \r\n\r\n-Once the onion is soft add the paprika  itll smell strong and turn the chicken bright red.\r\n\r\n-When the chicken and onion are evenly covered in paprika, add the red pepper.\r\n\r\n-Stir well. Add tomatoes and tomato paste then cover with a lid and leave for 15 mins at least! Feel free to leave it for longer on a low heat, but if you are in a rush, 15 mins will help all the ingredients mix well.\r\n\r\n-Add the remaining olive oil, the black olives parsley. Cover and leave for a further 5 minutes.\r\n\r\n-Season with salt and pepper and serve immediately over rice, couscous, or pasta. If you used thighs pull the bone out of the chicken before serving.\r\n\r\n<!--image:"chicken3"-->\r\n\r\nIf you're making extra, Its even better the next day.  	t	t	2011-11-03 16:50:53.169071-04	2011-11-03 16:50:15-04	2011-11-03 16:50:15-04	t
343	Sushi roll how-to	42	sushi-roll-how-	682	video, Postscript, Cooking, Sushi, Japanese	<code>\r\n<iframe width="500" height="284" src="http://www.youtube.com/embed/1PO6ANsEhUE" frameborder="0" allowfullscreen></iframe>\r\n</code>\r\n\r\nJournal staff Terra Arnone and Justin Chin show you how to make sushi roll.\r\n\r\nServings: 50 pieces of sushi\r\nPreparation time: 30 minutes\r\n\r\nIngredients\r\n10 sheets of dried seaweed\r\n1 package of flaked crab meat\r\n2 avocados\r\n4 cups of short-grain rice\r\n cup Japanese rice vinegar\r\nSoya sauce\r\nWasabi\r\n\r\nEquipment\r\n\r\nBamboo sushi mat  available at Division Street Metro grocery store for about $3.\r\n\r\nTotal cost: under $25.\r\n\r\nMethod\r\n\r\nIn a rice cooker, use a one-to-one water to rice ratio for about 15 minutes. Peel and slice the crab and avocado into thin strips to prepare.\r\n\r\nWhile the rice is still warm, transfer it into a large bowl and mix in the vinegar. Make sure to taste test so the rice isnt overpowered by the vinegar. The rice is typically sweet but has a sharp, sour aftertaste.\r\n\r\nLine both sides of the bamboo sushi mat with plastic wrap and lay one sheet of dried seaweed, shiny side down. Line it with three heaping tablespoons of flattened sticky rice. The key here is to only line the sheet 3/4 full, leaving a gap on one edge of the seaweed sheet. It allows for the roll to tuck in properly.\r\n\r\nOn the rice, place two thin slices of crab and avocado and add pressure so the ingredients stick together.\r\n\r\nLine the seaweed sheet up with the edge of the bamboo mat, fold it over and roll.\r\n\r\nI was lucky to have Tomoya Tago, president of the Japanese Relations at Queens Club, instruct me in the art of sushi-making.\r\n\r\nWhile the first few attempts were ugly, sushi rolling became easier after a little practice. I quickly learned that adding sticky rice to the final fold would help keep the ingredients in place.\r\n\r\nCut the rolls into bite-sized pieces and serve with soya sauce and wasabi.\r\n\r\n Terra-Ann Arnone	t	t	2011-11-04 11:42:32.033394-04	2011-11-04 07:00:00-04	2011-11-04 07:00:00-04	t
342	Swedish invasion	39	swedish-invasion	528		Queens fashionistas rejoice as Swedish super-chain H&M comes to Kingston.  After taking over the space of six stores and a restaurant, H&M opened on Oct. 20 at Cataraqui Town Centre to 400 people already waiting in line.  H&M spokesperson Emily Scarlett said the decision to open a store in Kingston came after countless customer requests over email, Facebook and their website. We really like to listen to our customers, She said.\r\n\r\nShe said 2000 people were expected to have travelled through the store by the end of its opening day. By 1 p.m., determined shoppers waited in lines curving through the entire store.  The store has sections for women, men and children.\r\n\r\nCovering 8000 sq. ft. and two floors, the store was still spacious and easy to navigate despite the amount of patrons.  Like its other locations, it has a mix of trendy and traditional, formal and fun, laidback and luxurious.\r\n\r\nScarlett said the store was selling a lot of multipurpose items like as chunky knits, which she described as ideal for the Canadian customer.\r\n\r\nThey can be layered, accessorized, worn with jeans, leggings, she said.\r\n\r\nFaux fur was another popular item, featured on everything from jackets, scarves and bags.\r\n\r\nOther trends we noticed are sure to be seen on campus soon: elbow patches, tweed, and lots of leather.\r\n\r\nMany Queens students are excited for the addition to the Kingston fashion scene.\r\n\r\nIt fits the student budget, its trendy and theres more of a variety, said Athena Nicholas, ArtSci 12.  Everyone shops at the same stores. This just adds more diversity. Although there was a shuttle going from Queen's campus to the store on its opening day, Nicholas said the usual longer bus ride shouldnt be a problem.\r\n\r\nPeople will definitely be willing to take the bus. Its worth the trip.\r\n\r\n<!--image:"hm1"-->\r\n\r\n<!--image:"hm2"-->\r\n\r\n<!--image:"hm3"-->\r\n\r\n<!--image:"hm8"-->\r\n\r\n<!--image:"hm9"-->\r\n\r\nFall/winter trends we spotted:\r\n\r\n<!--image:"hm4"-->\r\n\r\n<!--image:"hm5"-->\r\n\r\n<!--image:"hm6"-->\r\n\r\n<!--image:"hm7"-->\r\n\r\n<!--image:"hm10"-->\r\n\r\n	t	t	2011-12-07 14:03:27.67627-05	2011-12-07 14:03:21-05	2011-12-07 14:03:21-05	t
340	Exploring the healthy side of Leonard cafeteria	41	exploring-healthy-side-leonard-cafeteria	528		Many first-year students learn the hard way that the Freshman Fifteen isnt just a myth. With a meal plan that presents unlimited junk food options, its no surprise the healthy eating habits of home fall by the wayside.\r\n\r\nPublic Health Dietician Heather McMillan accompanied me to Leonard Cafeteria to assess what was on the menu.\r\n\r\nAlways take a look all around the caf and see what you really want to eat instead of sampling, McMillan said.\r\n\r\nNot only does this prevent overconsumption, but it also avoids food waste. This is a good way to avoid loading your tray with dishes you will either eat or waste before you have seen all that is available.\r\n\r\nStudents should aim to cover three out of the four food groups with each meal and use the Canada Food Guide to balance their plates, McMillan said.\r\n\r\n Half a plate should be portioned for vegetables and fruit, one quarter for grains and one quarter for meat and alternatives. Round out the meal with a glass of milk.\r\n\r\nThe salad bar looked really good, McMillan said. If the salad is your meal, add one of the lean proteins. At Leonard, tofu, kidney beans and chick peas are offered at the salad bar. Opt for the vinaigrette-based dressings as the creamy ones usually contain more fat.\r\n\r\n<!--image:"leonard1"-->\r\n\r\nMcMillan also recommended the grain salads, like the Mediterranean couscous salad. They contain vegetables and are a convenient way to cover two food groups.\r\n\r\n<!--image:"leonard4"-->\r\n\r\nBurgers are not something you want to be eating every day, McMillan said at the grill section. If you are going to eat there, always ask for a whole wheat bun and add veggies from the salad bar to your burger.\r\n\r\nVeggie burgers can also be a lower fat alternative, McMillan said.\r\n\r\nWhen choosing a hot meal option, go for the meal with the most vegetables. I chose a vegetarian chilli that had lean proteins and a couple of servings of vegetables in the meal alone.\r\n\r\nMcMillan also recommended stir fries as a healthy and convenient option. They cover three food groups and include vegetables and lean proteins.\r\n\r\n<!--image:"leonard2"-->\r\n\r\nSandwiches are also great. There were whole wheat breads and pitas available, she said.\r\n\r\nI would suggest choosing one of the leaner meats, such as the turkey or tuna instead of the salami. Add vegetables to the sandwich, or round your meal out with a salad or a piece of fruit.\r\n\r\nDuring my first year, I definitely ended up eating a slice of pizza as an appetizer to most meals.  Pizza is not something you want to be eating every day, McMillan said. However, you can make it a better choice by selecting whole wheat crust and healthier toppings. For desserts, keep the portion sizes small. McMillan recommended the milk-based pudding as a good option.\r\n\r\n Don't try and swear off everything as ultimately you'll probably go for it anyways.\r\n\r\nThough fruit juices often count as a serving of fruit, only take a small cup and dilute with water. The milks are always a good choice, said McMillan, adding that drinking pop only contributes sugar to your diet.\r\n\r\nMcMillan also noted that as a stop on the way out of the cafeteria, the fruit bar offers a healthy snack option for the end of a meal or for later on in the day.\r\n\r\n<!--image:"leonard3"-->\r\n\r\n You want to make sure youre having a well-balanced meal if youre going to be in class for a few hours, McMillan said.\r\n\r\nTips to keep in mind while eating in Queens cafeterias:\r\n\r\n\tWhole wheat: Always select the whole wheat option. More fibre will keep you full longer and will help your digestive system stay moving.\r\n\r\n\tPortion control: Its better to take a smaller portion first. If youre still hungry afterwards, you can always grab more.\r\n\r\n\tFruits and vegetables: Always find ways to add them to your meals. Chances are youre not getting enough.\r\n\r\n\tVariety: This goes especially for meats and alternatives. Choose lean proteins when possible. Examples include skinless chicken, turkey, fish, tofu, beans and chick peas.\r\n\r\n<em>Anyone can call EatRight Ontario at 1-877-510-5102 with any questions about nutrition.</em>\r\n\r\n	t	t	2011-11-03 16:43:04.411597-04	2011-11-03 16:43:04.40563-04	2011-11-03 16:43:04.40563-04	t
341	Vintage Kingston	39	vintage-kingston	528		Princess Street is lined with charming, unique boutiques boasting fabulous merchandise. But many students target the same stores and its not unusual to see multiple ladies on campus wearing your latest purchase. One way to avoid it is to go vintage.\r\n\r\nDowntown Kingston boasts two stores dedicated to vintage clothing. Though there are other thrift stores, such as Phase 2, that sell used clothing, these places seek out vintage pieces. \r\n\r\nShopping vintage, you get something unique. Its not like shopping at Urban Outfitters where everyone will have the same thing, said Jo-Anne Brul, manager of Starling Vintage Lovelies at 316 Princess St.\r\n\r\nStarling buys most of its merchandise in Toronto.\r\n\r\nPeople like to shop vintage because its a fun way to shop, a fun business to work in, Brul said. Theres a great ambiance in the stores.\r\n\r\n<!--image:"vintage1"-->\r\n\r\nStarling has a cozy, intimate atmosphere. Sequins, lace, prints, furs, velvet and silks are in abundance.\r\n\r\n<!--image:"vintage2"-->\r\n\r\nBrul identifies a purple, 50s style velvet and silk cocktail dress with cuffs as her favourite item.\r\n\r\nShe features floor-length dresses, jackets, coats, blouses, shoes, purses, clutches, lingerie, knits and scarves, to name a few. I have had much luck in the past with their hats and costume jewellery.\r\n\r\n<!--image:"vintage3"-->\r\n\r\nGuys looking to try something vintage will find ties, suspenders, cuff links and plaid shirts.\r\n\r\nShoes go from $15 to$45, dresses from $20 to$60, costume jewellery is $5 each and boots from $25 to$50.\r\n\r\n<!--image:"vintage7"-->\r\n\r\nWhatll I Wear, located a few stores down is downtown Kingstons other vintage trove.\r\n\r\nOwner Janet Strong searches for her merchandise in estate sales and thrift shops in the small towns outside of Kingston.\r\n\r\n<!--image:"vintage8"-->\r\n\r\nStrong has been in the vintage business for 30 years and attributes the appeal of these clothes to their quality.\r\n\r\nClothing was better made a long time ago. Everything was very tailored and structured. I look for natural fibres and wool, Strong said.\r\n\r\n<!--image:"vintage4"-->\r\n\r\nMy favourite item was a fur evening stole hanging next to an equally exciting sequined bolero. The coat selection is incredible.\r\n\r\n<!--image:"vintage5"-->\r\n\r\nPrices range from $1 items in their loonie bin to $100 for more one-of-a-kind pieces.\r\n\r\nDuring the weeks leading up to Halloween, the store has been packed.\r\n\r\nYou can barely move in the store, Stong said.  Its not hard to imagine why. Aside from the potential costumes (Kimonos, leather jackets, tartans), Strong has wigs, coloured hair sprays, masks, tiaras, dramatic hats, boas and feathers. Its great for the creative Halloweener.\r\n\r\nWhatll I Wear is celebrating 16 years at its current location.\r\n\r\n<!--image:"vintage6"-->\r\n\r\nPickers World Market at 1473 Princess Street also has vintage clothes along with their antiques. Alley Cat Antiques at 207B Wellington Street is worth checking out as well.\r\n\r\nVintage shopping is fun even if youre not quite ready to buy an antique . Its a great way to browse for clothes without thinking about trends or whether or not someone else has it. But a little patience is required. Theres a lot to go through and sometimes sizes are small.  However, chances are youll walk out surprised at what you found.\r\n\r\n	t	t	2011-11-04 00:59:08.997947-04	2011-11-04 00:59:08.965704-04	2011-11-04 00:59:08.965704-04	t
339	Trend trial: feather hair extensions	39	trend-trial-feather-hair-extensions	589		Each season, new trends seem to spread like a virus  the sea of Canada Goose Jackets, crop tops and gladiator sandals across. This summer, everyone seemed to be trying out feather hair extensions. Most people I talk to either love or hate the trend with a passion.\r\n\r\nSome thought the look was edgy and different, while others thought it was silly to spend money and time to put feathers in their hair.\r\n\r\nStill undecided myself and curious about the hype, I tried a Do-it-Yourself approach. This seemed popular among other price-conscious followers of the trend.\r\n\r\nThere seemed to be such a variety of feathers to choose from, from fluorescent pink and peacock green to more neutral browns. I finally decided on some skinny black and white Rooster saddle feathers from online store Etsy; I figured they would be natural enough to blend in with my brown hair. According to the website, Rooster saddle feathers could be washed, heat-styled and last up to at least a few months.\r\n\r\n<strong>Materials:</strong>\r\n\r\n\tRooster saddle feathers (Etsy online store, $12 for five)\r\n\r\n\tCrimp beads (Michaels, $4)\r\n\r\n\tWire (Michaels, $4)\r\n\r\n\tPliers \r\n\r\n<!--image:"feathers1"-->\r\n\r\n<strong>The process:</strong>\r\n\r\n\tSection off a piece of hair that the feather will attach to.\r\n\r\n\tWrap the wire around the piece of hair and thread through the crimp bead.\r\n\r\n<!--image:"feathers2"-->\r\n\r\n\tTake the end of the feather and thread it through the crimp bead.\r\n\r\n<!--image:"feathers3"-->\r\n\r\n\tWith the pliers, clamp the crimp bead shut\r\n\r\n<!--image:"feathers4"-->\r\n\r\n<strong>The verdict:</strong>\r\n\r\nThe DIY version was much cheaper than getting it done at a salon (I found the process priced at around $40.00).\r\n\r\nThe materials werent hard to find, although having to order feathers online took about 10 days. The feathers themselves were good quality and were able to be washed, blow-dried, straightened and curled. I also didnt feel ridiculous wearing them because they blended fairly well into my hair when I wanted them to (I dont quite think I could pull off bright pink). I was also proud at my ability to save money and successfully put the extensions in myself. Its worth trying out.\r\n\r\n	t	t	2011-11-04 11:39:01.939607-04	2011-11-04 11:39:01.939591-04	2011-11-04 11:39:01.939591-04	t
345	How to work out at your desk	41	how-work-out-your-desk	528		Studying and schoolwork can no longer be an excuse for avoiding exercise. There are ways to incorporate bouts of exercise while working at a desk.\r\n\r\nLifestyle and Wellness Consultant Julianne Ryder said that todays sedentary society sees people sitting stagnantly for hours on end, including students.\r\n\r\nStudents spend so much of their day sitting, whether in a lecture, at their computers, in the library or on a bus, Ryder said. They can get caught up in their work, but in order to do well in our studies we need to be at our peak health.\r\n\r\nWe asked Ryder to share some of her fitness tips from her program Execucise. Its designed to keep executives active while working in an office but Ryder modified the exercises with students in mind. All of these exercises can be done in less than 10 minutes periodically throughout the day. Id say most are discreet enough for Stauffer Library.\r\n\r\n<strong>General tips</strong>\r\n\r\nMove around: Break up the stagnant sitting and ensure continuous blood flow by getting up and walking around the room on a study break.  Go up and down the stairs a couple of times, use the washroom on another floor, Ryder said.\r\n\r\nSit on an exercise ball: Sub your office chair at home with an exercise ball.\r\n\r\nSitting on it will strengthen your core. You can also roll it away from your desk and use it for crunches.\r\n\r\nFull body stretch: Complete whenever possible to avoid aches and cramps.\r\n\r\nTime management: Scheduling study breaks that incorporate activity can help with effective time management. Arrange to meet up with a friend and throw a ball around or walk around the block. Activity breaks help with concentration.\r\n\r\nRyder said activity does more than just maintain fitness levels.\r\n\r\nExercise contributes to de-stressing. Its equally as important to book in activity time to keep stress in check. \r\n\r\n<strong>Chair squats</strong>\r\n\r\nSlide your bottom out to the very edge of the chair and perch for a moment. Press up through the heels of the feet and come to a standing position. The goal is to repeat the standing/sitting motion without allowing your bottom to sit on the chair. This exercise works all of the muscles in the legs. Inhale as you squat down and exhale as you press up through your heels.\r\n\r\n<strong>Static lunges</strong>\r\n\r\nIn this version, youre just dropping your knee down rather than stepping forward or back. Feel free to hold wall or chair for balance if needed. One foot forward and one foot back, by about three feet. Bend back knee towards floor and make sure to keep front knee behind the toes. Keep torso straight and abs in as you push through the front heel. Do as many reps as desired and switch legs.\r\n\r\n<strong>Desk push ups</strong>\r\n\r\nYou can strengthen your chest and triceps without having to get down on the floor to complete this exercise. Place your hands shoulder-width apart on the edge of your desk. Bend the elbows and allow your chest to move towards the desk. Only move to the point where you have a 90 degree angle at the elbows, then push up and return to the starting position. Breathe out as you push your body away from the desk and inhale as you allow your body to return towards the desk.\r\n\r\n<h4>Stretches</h4>\r\n\r\n<strong>Shoulders</strong>\r\n\r\nClasp hands behind back (dont link fingers) and open up chest. This is an important stretch because youre leaning forward while sitting at a desk.\r\n\r\n<strong>Back</strong>\r\n\r\nLink hands in front of your chest as though youre hugging a barrel and open up shoulder blades.\r\n\r\n	t	t	2011-12-07 14:31:02.076593-05	2011-12-07 14:24:23-05	2011-12-07 14:24:23-05	t
344	Winter fashion picks	39	winter-fashion-picks	589		By Carolyn Flanagan and Kelly Loeper\r\nJournal Staff\r\n\r\nWith the recent snowfall, theres no denying that winter has arrived.  Fortunately, this seasons fashion trends are in favour of staying warm.\r\n\r\nWe visited some of Kingstons most popular boutiques to select our favourite winter essentials.\r\n\r\n<strong>Coats</strong>\r\n\r\n<!--image:"onlyyoyoparka"-->\r\n\r\n<em>Only Yo Yo Parka</em>\r\n\r\nThis jacket is practical and on trend with its large pockets, hood and military green colour.\r\n\r\nThree, $105.00\r\n\r\n<!--image:"diana-emackagedianacoat"-->\r\n\r\n<!--image:"diana-emackagedianacoatbuttons"-->\r\n\r\n<em>Diana-E Mackage Diana Coat</em>\r\n\r\nThis elegant and dramatic coat has amazing lines and gorgeous details (see buttons). Though expensive, this coat is timeless and unique due to its collar and shape.\r\n\r\nBlueprint, $590.00\r\n\r\n<!--image:"soiaandkyoclassicwoolcoat"-->\r\n\r\n<em>Soia and Kyo Classic Wool Coat</em>\r\n\r\nMade in Montreal, this coat stands out thanks to its zippers and neckline.  Plus, this colour is flattering on almost everyone.\r\n\r\nAgent 99, $390.00\r\n\r\n<!--image:"bbdakotagriffincoat"-->\r\n\r\n<em>BB Dakota Griffin Coat</em> (in red)\r\n\r\nA fun and trendy alternative to the ubiquitous pea coat, the toggle buttons and colourful print make this coat stand out. The fur-trimmed hood is on trend and warm.\r\n\r\nBlueprint, $151.00\r\n\r\n<!--image:"veromodapodblazer"-->\r\n\r\n<em>Vero Moda Pod Blazer</em>\r\n\r\nQuilted pattern, elbow patches and black trim are unique, trendy features of this blazer but give it a classic feel at the same time.  \r\n\r\nBlueprint, $59.99\r\n\r\n<strong>Sweaters</strong>\r\n\r\n<!--image:"roxyeskimokissessweater"-->\r\n\r\n<em>Roxy Eskimo Kisses Sweater</em>\r\n\r\nLike many this season, this knit sweater is cozy and oversized--perfect for throwing on before  heading to class on a snowy day.  \r\n\r\nThree, $95.00\r\n\r\n<!--image:"onlybrittafurvest"-->\r\n\r\n<em>Only Britta Fur Vest</em> (in dark grey)\r\n\r\nFur is everywhere this winter. This vest is a perfect way to experiment with this trend without going overboard. Its great for layering too.\r\n\r\nThree, $89.00\r\n\r\n<!--image:"lolasbeachroomelbowpatch"-->\r\n\r\n<em>Lolas Beach Room Elbow Patch</em> (in beach, also in dark grey)\r\n\r\nElbow patches are another popular feature seen in stores this winter. Its a great way to deviate from the standard cardigan.\r\n\r\nThree, $49.99\r\n\r\n<!--image:"lolasroomcropponcho"-->\r\n\r\n<em>Lolas Room Crop Poncho</em> (in white, also in tan)\r\n\r\nPonchos, fringe and native prints are gaining momentum as temperatures start to drop. Its easy to throw on and stand out.\r\n\r\nThree, $79.99\r\n\r\n<!--image:"dakotamardiwrap"-->\r\n\r\n<em>Dakota Mardi Wrap</em>\r\n\r\nYou dont get much cosier than this. The earthy tones go well with most colours.  \r\n\r\nBlueprint, $139.00, 40 per cent off\r\n\r\n<!--image:"freepeoplerepeattop"-->\r\n\r\n<em>Free People Repeat Top</em>\r\n\r\nThis top is stylish and classic, but the longer back gives it a bit of edge.\r\n\r\nBlueprint, $118.00, 40 per cent off\r\n\r\n<!--image:"minkpinkexcessiveshirt"-->\r\n\r\n<em>Mink Pink Excessive Shirt</em>\r\n\r\nIts title says it all; this bold-printed button is sure to mix up your wardrobe.\r\n\r\nAgent 99, $85.00\r\n\r\n<!--image:"onlychunkyknitcardigan"-->\r\n\r\n<em>Only Chunky Knit Cardigan</em>\r\n\r\nThis classic grey knit can be worn with anything. Wear over long sleeves to mix things up. \r\n\r\nAgent 99, $25.00 (on sale from $49.00) \r\n\r\n<!--image:"luucacoutureshortsleeve"-->\r\n\r\n<em>Luuca Couture Short Sleeve</em>\r\n\r\nAnother fun take on knits.\r\n\r\nAgent 99, $85.00\r\n\r\n<strong>Accessories</strong>\r\n\r\n<!--image:"onlylolaknitscarf"-->\r\n\r\n<em>Only Lola Knit Scarf (circle)</em>\t\r\n\r\nCircle scarves can double as a shawl while sitting class. We liked this one because of its print.\r\n\r\nAgent 99, $45.00\r\n\r\n<!--image:"onlylolaknithat"-->\r\n\r\n<em>Only Lola Knit Hat</em>\r\n\r\nMatch the scarf with the hat!\r\n\r\nAgent 99, $29.00\r\n\r\n<!--image:"knitbowheadbands"-->\r\n\r\n<em>Knit Bow Headbands</em>\r\n\r\nWarm, stylish and fun colours. Headbands seem to be making a big comeback.\r\n\r\nThree, $12.00\r\n\r\n<!--image:"knitmittens"-->\r\n\r\n<em>Knit Mittens</em>\r\n\r\nBecause everybody needs a pair.\r\n\r\nThree, $12.00\r\n\r\n	t	t	2011-12-11 22:49:39.476216-05	2011-12-11 22:49:27-05	2011-12-11 22:49:27-05	t
346	Prioritizing ourselves as well as our academics	32	prioritizing-ourselves-well-our-academics	528		Its the most wonderful time of the year ...  after we get through one of the worst.\r\n\r\nExam period can be an endless cycle of stress and anxiety that sees many of us prioritize academics over everything else. It might seem more productive to spend an extra hour at the library to cram rather than sleeping for an extra hour sleep or hitting the gym. But letting health and well-being fall to the wayside can actually prove detrimental to our academic performance during this hectic time of year.\r\n\r\nNot only do we increase our chances of becoming sick, we decrease our level of alertness and mental productivity when we ignore sleep, nutrition and exercise. There is also that unwelcome experience of entering the holiday season feeling like a zombie.\r\n\r\nWe asked Lifestyle Consultant and Personal Trainer Pam Fountas to share why its important to be mindful of our health decisions during exam period.\r\n\r\n<strong>Sleep</strong>\r\n\r\nFountas said we are actually decreasing our productivity when we try to get through exam period on little sleep.\r\n\r\nMental productivity and level of alertness are not nearly where they could be if we were getting enough sleep. We have to read and re-read paragraphs and chapters because our level of retention goes way down, affecting your academic performance.\r\n\r\nStudents may be able to pull off functioning on little sleep for a night or two, but it wont last the whole period. Also, coffee doesnt replace the necessity for sleep.\r\n\r\nBy making sure theyre getting enough sleep so that they feel rested, students will optimize their time and performance.\r\n\r\n<strong>Nutrition</strong>\r\n\r\nConvenience and long sessions at the library see people grabbing unhealthy snacks on the go that dont exactly complement a balanced diet.\r\n\r\nA big thing to be careful of, whether or not youre making poor choices, is the amount of food you consume. It can spike your blood sugar levels.\r\n\r\nWhen youre not eating a balanced diet, you will experience highs then lows in your energy levels, said Fountas.\r\n\r\nBy not making healthy choices, your energy and alertness will be negatively affected.\r\n\r\nFor snacks, Fountas recommended pairing a clean carbohydrate with a protein.\r\n\r\nExamples: Veggies and hummus, fruit with natural nuts, banana with peanut butter, whole grains. The pairing helps to balance energy levels because the protein takes longer to digest, keeping you full and nourished longer.\r\n\r\nRealistically, many of these options are available at food places on campus, so consider the benefits of grabbing the healthy snack next time youre at the vending machine.\r\n\r\n<strong>Exercise</strong>\r\n\r\nFountas said students who dont believe they have enough time to exercise during exams need to be honest with themselves about how they are budgeting their time. Students might be procrastinating in ways that they dont even realize.\r\n\r\nYou are actually buying yourself more time by making smart choices about your health. It can be as little as a 20-minute run, but you will actually feel that much better and put more time into your studies.\r\n\r\nFountas also said students should stay away from all-or-nothing thinking. Just because you may not be able to fulfill your regular exercise routine, doesnt mean you need to abandon it completely.\r\n\r\nThere are 24 hours in the day and it is up to us to choose how we want to spend them. Taking 30 minutes out of the day for yourself will serve you so much better in the long run.\r\n\r\n<strong>How to cope with stress</strong>\r\n\r\nIn the moment: One of the simplest things you can do is to bring awareness to your breath. Practice the technique of mindful breathing. Just take a few deep breaths in a moment of anxiety and you should feel yourself relax, Fountas said.\r\n\r\nBig picture: Fountas said students should be clear on what theyre expecting of themselves from their academics.\r\n\r\nMake an action, feel prepared and keep some perspective, Fountas said. To help keep stress in check, try and take 10 to 15 minutes out of each day to tap into the outside world. It can be exercise, a phone call home, or a walk downtown to remind yourself that there is a world bigger than exam period.\r\n\r\nSo by making wise health choices this exam period, we will maximize our potential for academic success. There is also the chance that we can emerge feeling like the healthy human beings we were before exams started.  	t	t	2012-05-15 09:20:43.245326-04	2011-12-07 14:31:17-05	2011-12-07 14:31:17-05	t
347	Low-fat vs. classic: carrot cake	42	low-fat-vs-classic-carrot-cake	589		By Carolyn Flanagan and Kelly Loeper\r\nJournal Staff\r\n\r\nWhether youre looking for something sweet to get you and your housemates through exams or to bring home to your family for the holidays, carrot cake is an easy and delicious dessert for the season.\r\n\r\nAs there are so many different recipes out there, we decided to try two variations: one with more traditional ingredients and another with healthier substitutions.\r\n\r\n<h4>Classic version</h4> \r\n\r\n<strong>Ingredients</strong> \r\n\r\n\t4 eggs\r\n\r\n\t1 1/4 cups vegetable oil\r\n\r\n\t2 cups white sugar\r\n\r\n\t2 teaspoons vanilla extract\r\n\r\n\t2 cups all-purpose flour\r\n\r\n\t2 teaspoons baking soda\r\n\r\n\t2 teaspoons baking powder\r\n\r\n\t1/2 teaspoon salt\r\n\r\n\t2 teaspoons ground cinnamon\r\n\r\n\t3 cups grated carrots\r\n\r\n\t1 cup chopped pecans\r\n\r\nFor the cream cheese frosting:\r\n\r\n\t1/2 cup butter, softened\r\n\r\n\t8 ounces cream cheese, softened\r\n\r\n\t4 cups confectioners' sugar\r\n\r\n\t1 teaspoon vanilla extract\r\n\r\n<strong>Directions</strong> \r\n\r\nPreheat oven to 350 F (175 degrees C). Grease and flour a 9" x 13" inch pan.\r\n\r\nIn a large bowl, beat together eggs, oil, white sugar and two teaspoons of vanilla. Mix in flour, baking soda, baking powder, salt and cinnamon. Stir in carrots. Fold in pecans. Pour into prepared pan.\r\n\r\nBake in the preheated oven for 40 to 50 minutes, or until a toothpick inserted into the center of the cake comes out clean. Let cool in pan for 10 minutes, then turn out onto a wire rack and cool completely.\r\n\r\nTo make frosting: In a medium bowl, combine butter, cream cheese, confectioners' sugar and one teaspoon vanilla. Beat until the mixture is smooth and creamy. Stir in chopped pecans. Frost the cooled cake.\r\n\r\n<em>Source: allrecipes.com</em>\r\n\r\n<h4>Low-fat version</h4>\r\n\r\n<strong>Ingredients</strong>\r\n\r\n<!--image:"carrotcake1"-->\r\n\r\n\t3/4 cup all-purpose flour\r\n\r\n\t3/4 cup whole wheat flour\r\n\r\n\t1 cup granulated sugar\r\n\r\n\t1/4 cup flaked sweetened coconut\r\n\r\n\t2 tsp baking soda\r\n\r\n\t1 tsp salt\r\n\r\n\t2 tsp ground cinnamon\r\n\r\n\t2 tbsp canola oil\r\n\r\n\t2 large eggs\r\n\r\n\t1 1/2 tsp vanilla\r\n\r\n\t2 cups grated carrots, peeled\r\n\r\n\t20 oz. can crushed pineapple in juice, drained \r\n\r\n\t1/4 cup chopped walnuts plus 1/4 cup for topping\r\n\r\nFor the cream cheese frosting:\r\n\r\n\t1 cup powdered sugar\r\n\r\n\t1 tsp vanilla extract\r\n\r\n\t1 cup low fat Philadelphia Cream Cheese\r\n\r\n<strong>Directions</strong>  \r\n\r\nPreheat oven to 350 F (175 C). In a large bowl, combine flour, sugar, coconut, baking soda, salt and spices. Stir well with a whisk.\r\n\r\nIn a medium bowl, combine oil, eggs and vanilla. Stir well. Add grated carrots and pineapple. Fold wet ingredients with the dry ingredients. Batter will be stiff and dry but keep folding it and it will all come together. Fold in 1/4 cup chopped nuts.\r\n\r\nSpoon batter into an 8" x 3" cake pan coated with cooking spray. Bake at 350 F (175 C) for about 40 to 50 minutes, depending on pan size or until a wooden toothpick inserted in the center comes out clean and cake is pulling away from sides of pan. Cool cake completely on a wire rack.\r\n\r\nTo prepare frosting, beat together cream cheese, powdered sugar and vanilla until smooth. Spread frosting over top of cake. Garnish with remaining chopped walnuts.\r\n\r\n<!--image:"carrotcake2"-->\r\n\r\n<em>Source: skinnytaste.com</em>\r\n\r\n\r\n<strong>Taste test</strong> \r\n\r\n<!--image:"carrotcake3"-->\r\n\r\nAfter tasting both versions, our fellow Journal staffers could all distinguish between which version was more traditional and which contained lower fat ingredients.\r\n\r\nThe traditional version tasted richer and the frosting was sweeter. The low-fat version tasted lighter, most likely due to the substitution of pineapple juice for oil. Although different, both versions were successful.\r\n\r\nPlaying around with substitutions is a great way to cater recipes to different tastes and preferences; experimenting in the kitchen also makes for a great study break!\r\n\r\n	t	t	2011-12-11 22:09:10.065319-05	2011-12-11 22:08:58-05	2011-12-11 22:08:58-05	t
348	Food culture on campus part 1: Three Sisters Feast	42	food-culture-campus-part-1-three-sisters-feast	528		Every Wednesday night from 5 to 7 p.m., Four Directions Aboriginal Student Centre hosts a free drop-in meal for students.\r\n\r\nIts for all students, staff, faculty and community members as well, said Laura Maracle, Aboriginal Advisor at the centre.\r\n\r\n<!--image:"threesistersfeast"-->\r\n\r\nThe feast serves a home-cooked meal prepared by staff or a guest chef in a setting meant to make students feel relaxed and welcome. It is named for the tale of the Three Sisters: the bean, the squash and the corn. In the tale and in nature, the bean leans against the corn and together they shade the squash, all supporting and ensuring each others growth and survival.\r\n\r\nWe all come together, we communicate, we hang out, she said.\r\n\r\nBefore the meal is served, the Centre honours a few Aboriginal traditions.\r\n\r\nFirst we prepare the meal. We acknowledge our ancestors and give thanks for everything we have today by leaving them a plate first, Maracle said.\r\n\r\nThen we smudge the whole house, she said.\r\n\r\nSmudging is a sacred ceremony meant to cleanse the space through the smoke of the four sacred medicines: cedar, sweet grass, sage and tobacco.\r\n\r\nWe strive to make it as inclusive as we can. In our culture, family is very important and that extends to the community as well, said Aboriginal Advisor Vanessa McCourt.\r\n\r\n<!--image:"threesistersfeast2"-->\r\n\r\n There are already so many academic spaces on campus, McCourt said. The Four Directions Aboriginal Centre offers a more casual environment that sees community members of all ages coming together.\r\n\r\nOur visit during the holiday season feeds us turkey, stuffing, roasted vegetables, salad and apple pie. The menu varies weekly and meals include spaghetti, pumpkin soup, stews, salads and desserts, to name a few. They oftentimes serve traditional items such as banic, a bread that is a staple in Aboriginal cuisine . There are always vegetarian and lactose-free options available as well.\r\n\r\n<!--image:"threesistersfeast3"-->\r\n\r\nStudents enjoy the feast because its a unique opportunity on campus.\r\n\r\nThe Three Sisters feast is a way for me to experience different meals with different people. The food is delicious, the people are very kind, and I even got a chance to eat in a real teepee once, Mike Cornacchia, ArtSci 12, said.\r\n\r\nNext time youre in line at the ARC on a Wednesday night, consider stopping by Four Directions Aboriginal Student Centre to experience a new campus food culture.\r\n\r\n	t	t	2011-12-13 14:10:39.192413-05	2011-12-13 14:01:59-05	2011-12-13 14:01:59-05	t
