355	A new Princess Street favourite: Spin Dessert Caf	42	new-princess-street-favourite-spin-dessert-cafe	589	dessert, reviews, downtown, restaurants	By Megan Cui\r\nContributor\r\n\r\nAlready a veteran of the dessert-caf game, Spin Dessert found a new home on 260 Princess St. for the delicious fare and urban chic aesthetics of its original Toronto venue. A little different from its neighbors traditional design scheme, Spins most attractive feature is its open concept design. The first level is split up by demi-stairs into levels. The elevated section in the back has a smattering of Parisian caf tables thats a nice alternative to the plushier, banquette seating arrangement at the front of the store. Take another look and youll notice theres an entire basement level thats visible from above through a transparent balcony. Exposed pipes cap off an atmosphere of cozy sophistication.\r\n\r\n<!--image:"spindessert1"-->\r\n\r\nI set my mind to eating the biggest, baddest thing on the menu and thought my larger-than-life appetite could handle it. It also doesnt hurt, certainly, that the workings of the bakery and espresso bar are on full exhibition and the selection of in-house cakes behind their shiny glass displays speak for themselves.  We ordered Baby Its Cold Outside, which is one of many tempting options amongst the January Red Velvet promotion. Its a red velvet cake smothered in red velvet ice cream, white chocolate shavings and whipped cream. I was worried the cake would drown in the ruby sea of liquid velvet but it held its ownsuper moist and unbelievably rich in cream cheese flavor.  Next up was the interesting On the Floor: pistachio ice cream on waffles might be intimidating to some, but it was something I needed to try.\r\n\r\n<!--image:"spindessert2"-->\r\n\r\n<!--image:"spindessert3"-->\r\n\r\n<!--image:"spindessert5"-->\r\n\r\nIt was unconventionally savory and I commend Spin Dessert for venturing outside of the box. Pistachio ice cream is great for having a salty bite that can pull ice creams usual sweetness into a new direction.  Unfortunately, Spin Desserts rendition fell a little short and offered an ice cream that didnt taste too different from a traditional vanilla-based ice cream. It was a little nuttier and still creamy with generous chunks of pistachio nuts.\r\n\r\nTo wash it all down, I ordered a chai latte but ended up clutching to my iced water for the most part to cope with so much ice cream.\r\n\r\nI have mixed emotions about Spin Dessert. The ingredients are amazing so all the waffles, ice creams and crepes taste flawless, yet theres something left to be desired in terms of originality and diversity of flavors to keep me coming back.  It would be more exciting to see less traditional desserts to match Spins modern aesthetic.\r\n\r\nSpin though does offer a savory crepe selection and an all day breakfast menu which I have yet to try.\r\n\r\nThe portions are a bit excessive so I recommend going to Spin Dessert with lots of company, a big appetite and a sweet tooth. For a moderate dessert lover like myself, it was a great day for new experiences, but Ill definitely prepare my stomach before my second visit.\r\n\r\n	t	t	2012-02-14 00:20:39.0231-05	2012-02-14 00:20:36-05	2012-02-14 00:20:36-05	t
358	Faculties offer alternative jackets 	39	faculties-offer-alternative-jackets	589	Arts and science, student life	By Carolyn Flanagan\r\nAssistant Blogs Editor\r\n\r\n<!--image:"veganjackets"-->\r\n\r\nOne of Queens most iconic symbols is getting a little sibling.\r\n\r\nThe Arts and Science Undergraduate Society (ASUS) is offering an alternative faculty jacket to students who either do not want to pay the high price of the traditional leather, or who want a more animal-friendly option.\r\n\r\nASUS is now offering a windbreaker modelled after an American Apparel design.\r\n\r\nKathleen Liu, services commissioner of ASUS, said the new style isnt meant to replace the original.\r\n\r\nWe kept the crest and colour, and students can till sew on the bars. The only difference is the material.\r\n\r\nAvailable for $100, the jacket is significantly cheaper than the $300 original. It also appeals to a new demographic.\r\n\r\nThe windbreaker is a great alternative for spring. Besides, not everyone feels that they can pull of the leather jacket, Liu said.\r\n\r\nThe custom-made jacket is currently available for ArtSci and CompSci students only.  The first 50 jackets, offered at a promotion rate of $80, sold out in one hour at the campus bookstore.   Jackets Director Alex Nicholson said there was demand for a vegan style since ASUS doesnt sell pleather jackets. We were asked a lot if there was a non-leather option for the jackets, so the response has been really positive.\r\n\r\nNicholson said they hope to make the windbreakers available to other faculties as well in the near future.\r\n\r\nJackets will be available for order at the campus bookstore until tomorrow.\r\n\r\n	t	t	2012-02-14 00:20:59.828363-05	2012-02-14 00:20:57-05	2012-02-14 00:20:57-05	t
359	Trend trial: tuxedo nails	39	trend-trial-tuxedo-nails	589	nails. trends, celebrities	By Katie Heffernan\r\nContributor\r\n\r\n\tWhat better way to celebrate a black tie affair than to arrive with tuxedo nails? Its a trend seen on celebreties like <em>New Girl</em> star Zooey Deschanel at this years Golden Globes. These nails are fun, creative and versatile and can make a great conversation starter at your next party.\r\n\r\n<!--image:"tuxedonails"-->\r\n\r\n<!--image:"tuxedonails2"-->\r\n\r\n<strong>The trial</strong>\r\n\r\n1)\tBegin by painting a thin base coat to strengthen nails and provide a solid foundation for the polish to stay.\r\n\r\n2)\tSelect a white nail polish. I recommend any French White found in a French manicure kit. Apply the polish and make sure to do two to three coats to achieve solid coverage.\r\n\r\n3)\tAfter letting the white colour dry, apply a clear top coat. This is important to seal in the polish for the next step.\r\n\r\n4)\tBefore painting the black strip on the tip of the nail, apply a small strip of scotch tape across the nail, leaving the tip exposed.\r\n\r\n5)\tSelect a black polish and paint only the exposed tip. The tape will help to create a barrier between the white and will also leave a clean line.\r\n\r\n6)\tAfter allowing the black tip to dry, the artistic portion begins. Carefully peel away the tape and begin the design. The easiest way to achieve the tuxedo look is to use a black nail art pen, available at any drug store. Simply make the two dots and draw a bow as you would using a pen on paper (you can also use a toothpick and simply dip it in the black polish to create your own paint tool).\r\n\r\n7)\tIts important to let the design dry completely before trying to add anything or apply another top coat. A different nail art pen or the dip of a toothpick in the white polish allows you to embellish the bows and add your own personal flair to the design.\r\n\r\n<!--image:"tuxedonails3"-->\r\n\r\n<strong>The verdict</strong>\r\n\r\nThe style looks professional, chic and fun at the same time. I would suggest getting a friend to help with the design on your opposite hand as the detail was difficult to accomplish alone. With so many different layers, the top coat was the most significant for making sure the polish from a previous step wouldnt peel off.  Although applying many coats of one colour can be tedious, the end result is worth the wait.\r\n\r\n	t	t	2012-02-14 00:21:06.789107-05	2012-02-14 00:21:03-05	2012-02-14 00:21:03-05	t
356	Valentines Day cupcakes: a new spin on a classic treat	42	valentines-day-cupcakes-new-spin-classic-treat	589	valentine's day, dessert, recipes	By Kelly Loeper\r\nBlogs Editor\r\n\r\nEvery Valentines Day, dessert recipes seem to be more creative than the year before. As a typical student baker, Im always on the hunt for something thats easy, fast and cheap to make. This recipe includes an interesting twist thats sure to impress everyone on Valentines Daywhether its a significant other, housemate, for a single-but-not-lonely girls party or if you just want to procrasti-bake.  \r\n\r\n<strong>Ingredients</strong>\r\n\r\n\t1 package white cake mix\r\n\r\n\t1 1/4 cups water\r\n\r\n\t1/3 cup vegetable oil\r\n\r\n\t3 egg whites\r\n\r\n\t8 drops red food coloring\r\n\r\n\t2 drops raspberry candy oil\r\n\r\n<strong>Directions</strong>\r\n\r\n1.\tPreheat an oven to 175 C (350 F). Line a standard muffin tin with paper cupcake liners.\r\n\r\n2.\tBeat the cake mix, water, vegetable oil and egg whites together on low speed for 30 seconds, then on medium for two minutes until smooth. Fill cupcake liners 1/3 full with white batter; set aside.\r\n\r\n3.\tStir four drops of red food coloring into the remaining bowl of batter to make the batter pink. Stir in the raspberry oil. Pour 1/3 of pink batter into a resealable plastic bag and set aside.\r\n\r\n4.\tMix more food coloring into the remaining bowl of pink batter until its an orange,red color and pour the batter into a resealable plastic bag. Cut a corner off the bag, stick the open tip into the center of each cup of white batter and squeeze in about two tablespoons of red batter.\r\n\r\n5.\tCut the corner off the bag with the pink batter, stick the open tip into the center of the red batter and squeeze about one tablespoon of pink batter into each cup.\r\n\r\n6.\tBake the layered cupcakes in the preheated oven until a toothpick inserted into the center comes out clean. It takes 15 to 20 minutes. Cool completely before frosting.\r\n\r\n <!--image:"cupcakes1"-->\r\n\r\n<strong>Verdict</strong>\r\n\r\nThe recipe was super easy to make. Although the lighter pink shade of the batter didnt show up well when baked, the different colours on the inside of the cupcake has a cool effect.\r\n\r\n<!--image:"cupcakes2"-->\r\n\r\nI ended up having lots of leftover dark pink batter, so I used it to make mini cupcakes.\r\n\r\nThe fact that I used a premade cake mix and icing went unknown to everyone who tried them; they were too impressed and surprised by the cherry flavour and colours in the centre. All in all, the recipe was a success. As the recipe suggested, this could also be fun to do for different occasions: green and mint flavour for St. Patricks Day or orange for Halloween.\r\n\r\n<em>Source: allrecipes.com</em>\r\n\r\n	t	t	2012-02-14 00:20:46.108745-05	2012-02-14 00:20:42-05	2012-02-14 00:20:42-05	t
364	Check back in September	44	check-back-september	615		This blog will launch in September. We're looking for regular contributors for our 'opinions' column. Got what it takes? Email journal_blogs@ams.queensu.ca for more details. 	t	f	2012-05-06 10:20:30.325425-04	2012-05-06 10:17:22-04	2012-05-06 10:17:22-04	t
354	Food culture on campus part two: Queens Hillel Shabbat dinner	42	food-culture-campus-part-two-queens-hillel-shabbat	589	food, culture, hillel	By Carolyn Flanagan\r\nAssistant Blogs Editor\r\n\r\nFour times a semester, Queens Hillel hosts a traditional Shabbat Dinner at the Hillel House, located at 124 Centre St.\r\n\r\n<!--image:"hillel1"-->\r\n\r\nAlex Lulka, Shabbat and Kashrut chair, begins preparing for the meal two days in advance.\r\n\r\nAll food is kosher, and the kitchen remains kosher at all times, she said.\r\n\r\nAbiding by rules of the Jewish Shabbat, everything is prepared before sunset on Friday evening.\r\n\r\nAt 7 p.m., between 60 and 120 students gather at the Hillel House to eat. Attendees included mostly Hillel members but non-members and guests as well.\r\n\r\n<!--image:"hillel2"-->\r\n\r\n<!--image:"hillel3"-->\r\n\r\nAfter a short blessing is said on the wine and challah, egg bread braided into a loaf, food is served.\r\n\r\n<!--image:"hillel4"-->\r\n\r\nThis past Fridays menu included meatballs, chicken, potatoes, chicken soup, cooked vegetables, pasta and quinoa salads. Traditional items included potato and noodle kugel, a casserole-type dish. Everything was delicious. A personal highlight was the noodle kugel, thanks to its use of cinnamon and raisin.\r\n\r\n<!--image:"hillel5"-->\r\n\r\n<!--image:"hillel6"-->\r\n\r\n<!--image:"hillel7"-->\r\n\r\nTheres food in abundance and second and third helpings are whole-heartedly encouraged. At the end of the night, aluminum foil is brought out for those who want leftovers.\r\n\r\nHillel Vice-President Naomi Rosenfeld said attending the Shabbat dinner can feel like a home away from home for students.\r\n\r\nMany people grew up sharing these traditions with their families; this is a chance to carry them on, she said.\r\n\r\nHillel Co-President Ashlee Woolfson said it also draws students who have never participated in a Shabbat dinner before. It is really for all students at Queens who want to come, she said. Everyone is welcome. She added that Hillel House aims to be pluralistic among the denominations of Judaism as well.\r\n\r\nDinner is free with Hillel membership which costs $35 per year, $20 per semester or $10 per meal.  The next Shabbat dinner is scheduled for March 16.\r\n\r\n	t	t	2012-02-15 10:55:25.911871-05	2012-02-14 00:20:08-05	2012-02-14 00:20:08-05	t
360	Eating disorders at university	32	eating-disorders-university	589	eating disorders, health, wellness	By Carolyn Flanagan\r\nAssistant Blogs Editor\r\n\r\nFebruary was National Eating Disorder Awareness Month.\r\n\r\nA highly complex mental health disorder, Mental Health First Aid Canada defines eating disorders as severe disturbances in eating habits (either eating too much or too little), or weight control behaviour.\r\n\r\nPrevalent among university students, the most common eating disorders for the age demographic are anorexia, bulimia and binge-eating.\r\n\r\nPeer Health Outreach Co-ordinator Beth Doxsee said eating disorders have many triggers. There can be a family linkbe it genetic or because of a role model, she said. There are social and cultural factors as well. We are constantly bombarded with messages and images about an ideal body type that may not be attainable.\r\n\r\nDoxsee said theres often an underlying mental health disorder, such as anxiety or depression.\r\n\r\nThe food restriction or consumption becomes a way to deal with other things going on. There is a need to feel control, she said.\r\n\r\nA university-wide survey conducted in 2008 by Student Affairs showed that 5 per cent of students had been diagnosed with an eating disorder. Almost 50 per cent of students surveyed said they were trying to lose weight, even though 60 per cent had a healthy Body Mass Index standing.\r\n\r\nStill a taboo subject in many circumstances, misconceptions persist about the disorder.\r\n\r\nEating disorders are often considered as only an issue in women, but rates of anorexia and bulimia are climbing in men.\r\n\r\nThere is also the misconception that it wont go away, Doxsee said. You can get better.  If youre in the middle of it, its hard to see the signs, said Doxsee. Reaching out to anyone, friends or family is an important step. Then get professional help as soon as possible.\r\n\r\nTheres no one-size-fits-all way of dealing with eating disorders. Next steps may involve seeing a counselor, eating disorder clinics, or eventually seeing a registered dietitian.  If you see the signs in a friend and want to help, Doxsee said its important to be patient and come from a place of concern.\r\n\r\nSay what you see, dont make any quick judgements, she said, adding that an example would be tocomment how they seem tired or have less energy.\r\n\r\nIf theyre not ready, always keep that door open so they know you can be someone they can approach.\r\n\r\nFor further advice, Doxsee recommends calling HCDS to speak to one of the counselors. You can also provide additional support by accompanying someone as they attend appointments.\r\n\r\nTheyre so common in this age range, if you can be that one person of support for someone, thats reason enough to learn about it.\r\n\r\nDoxsee said the more people know about eating disorders, the chances of people getting help are much greater.\r\n\r\nIt has such a high death rate, which may be something people forget, she said. Its complex, but important to talk about.  \r\n\r\n<strong>Warning signs to watch for, in yourself or in a friend</strong>\r\n\r\nAnorexia\r\n\r\n\tNot consuming food oftenskipping meals, avoiding mealtimes with friends\r\n\r\n\tDrastic loss of weight\r\n\r\n\tGet cold much easier due to lack of insulation in the body\r\n\r\n\tHair falls out from lack of nutrition\r\n\r\n\tFatigued, tired and weak\r\n\r\n\tVery rigid workout scheduleup to four hours a day, even if sick or have other things to do\r\n\r\n\tPreoccupied with food and calories from moment of waking up to moment of going to bed\r\n\r\nBulimia\r\n\r\n\tPreoccupied with food and calories\r\n\r\n\tMore likely to stay close to current weight\r\n\r\n\tExcuse themselves after meals\r\n\r\n\tMay smell of vomit, have laxatives around\r\n\r\n\tBloodshot eyes\r\n\r\n\tEnamel on the teeth begins to wear away\r\n\r\n\tScars on knuckles\r\n\r\n<strong>Tips on how to stay positive</strong>\r\n\r\nWith pressure from the media and our peers preoccupation with dieting, it can be difficult to maintain a healthy body image and healthy habits in todays society. Personal Trainer and Lifestyle Consultant Pam Fountas offered tips on how to keep ourselves in check when thinking about our bodies:\r\n\r\n\t<strong>Treat your body as an instrument, not an ornament</strong>- Value your body for what it can do, not just what it appears to be. Reflect on what your body does for you on a daily basis.\r\n\r\n\t<strong>Take care of your body</strong>- Learn about what your body really needs rather than the next new diet. Focus on being healthier rather than thinner.\r\n\r\n\t<strong>Challenge the values of todays society</strong>- Be aware of the culture at large that is trying to make us feel insecure so that we buy products so they can make money. Theres a social influence we need to be aware of.\r\n\r\n\t<strong>Set objective goals</strong>- Rather than setting goals about its external appearance, think about what your body could do. For example, try a new challenge like yoga.  \tBe realistic about your bodys genetics- Embrace your body as it is now.\r\n\r\n\t<strong>Think of time wasted and energy directed</strong>- Re-channel the energy you put into feeling about how you look and redirect it towards something positive.\r\n\r\n	t	t	2012-05-15 09:20:04.684194-04	2012-03-16 18:21:05-04	2012-03-16 18:21:05-04	t
