264	The Brew	42	thebrew	643		Allegedly discovered around 2700 B.C. in China, tea is the most popular prepared drink in the world. Sometimes said to be food for thought, tea has found itself warming the hands of every generationin contemplation, as part of social gathering or a staple in late night relaxation. Kingston has a number of locations that brew bagged n ready or loose leaf tea for students. \r\n\r\nTea is derived from the Camellia Sinensis or Thea Sinensis plant and classified as being either black, green, oolong or white.\r\nHerbal teas use dried fruits, flowers, roots and leaves to create a unique, decaffeinated blend.\r\n\r\nPersonally, I have yet to find a time where the diverse beverage is not a source of comfort and delight. Last winter, confined by the snowy weather, I found myself bored with my stocked tea shelf. In a half-ditch effort to evade studying and brew something new, I began mixing the leaves and creating unique favourites. Here I will be reviewing tea from local sources and posting directions to steep an easy blend of your own. \r\n\r\nThis weekend Ill be sampling some of falls flavours. Im searching for October's perfect brews: herbal tea to calm mid-term nerves and caffeinated blends for a morning boost.	t	t	2012-05-15 09:18:32.215132-04	2010-10-23 21:22:34-04	2010-10-23 21:22:34-04	t
265	Cran-Apple for Your Thoughts	42	cran-apple-your-thoughts	643		<p>Cranberry Apple (Tea Store; 241 Princess Street, Kingston)</p><img src="http://www.queensjournal.ca/media/stories/v138/i0/cranberry-apple.jpg" width="450" height="350" alt="Cranberry Apple">\r\n\r\nType: Herbal\r\nIngredients: Dried apple, hibiscus, rosehip and sweet orange peel.\r\n\r\nServing size: One tea spoon to one full mug of water.\r\n\r\nRaw aroma: Very sweet. Strong notes of apple, light cranberry and rosehip. \r\n\r\nBrewing aroma: Citrusy. Smells of cleaning product.\r\n\r\nSteeping time: 8 minutes (I steep between seven to ten minutes for a strong herbal). \r\n\r\nRemember: Dont steep tea with freshly boiled water. Instead, pour the desired amount into a cup and let it cool for a minute or so. Hot water can burn tea leaves and distort the taste; this is often to blame for herbal teas which come out bitter.\r\n\r\nMy first sip of the now cloudy purple/red cup was bland. The second instantly gave me a rush of citrus and went down tasting slightly of cider. A few gulps in and the flavour has settled into a cranberry orange blend with only a faint apple aftertaste. \r\n\r\nOverall, its a mediocre cup of tea. It certainly isnt awful but I wouldnt serve it to anyone with a fussy palate. Light and decaffeinated, I would probably drink this with a basic hummus-and-pita sort of lunch. Frankly, the brewing aroma was too reminiscent of Mr. Clean to make me comfortable with the first sip. \r\n\r\n<b>Verdict</b>: 3/10\r\n\r\nUpdate: I steeped my next cup for ten minutes and it improved the taste slightly. Much stronger notes of apple. <b>Verdict</b>: 4/10.	t	t	2012-05-15 09:19:09.588671-04	2010-10-23 21:29:05-04	2010-10-23 21:29:05-04	t
361	Water wellness	32	water-wellness	589	aqua fitness, student fitness, health, exercise	By Carolyn Flanagan\r\nAssistant Blogs Editor\r\n\r\nSadly misinterpreted as a seniors sport, most students overlook the water as a valuable way to get exercise. The Journal spoke to Tiffany Bambrick, co-ordinator of fitness and wellness at the ARC and a certified water fitness instructor, about the benefits of aquatic fitness.\r\n<!--image:"aquafitness"-->\r\n\r\n<strong>No impact</strong>- Exercising in the water does not create impact on your joints, unlike running or cross-training.\r\n\r\n<strong>Good for injury recovery</strong>-Because of its low impact on joints, swimming is an ideal workout if recovering from an injury. In fact, if you have been training, you can maintain your cardio-vascular capacity for up to four to six weeks if you continue to exercise in the water.\r\n\r\n<strong>Adds variety</strong>- Not everyone likes running, the gym or the bike. Variety is key to maintaining a healthy lifestyle. In the water, you can swim lengths, tread water, run, take a class or even do resistance training, to name a few.  Any activity can be adapted to the water.\r\n\r\n<strong>Use equipment</strong>-Flutter boards, pool noodles, water belts and dumb-bells (with foam core) can all be used in an aquatic workout. In addition, your own body and the properties of water can provide resistance on their own.\r\n\r\n<strong>Varsity athletes are also doing it</strong>- Cardio, flexibility, strength and conditioning and all other components of a regular work out can be found in an aqua fitness class. Contrary to popular belief, you can work up a sweat in a pool.\r\n\r\n<strong>You can make it your own</strong>- The ARC offers classes in aquatic fitness that you can modify to do on your own if the group setting isnt for you.\r\n\r\n<strong>Fun</strong>- If you enjoy the water, that is. You can be uninhibited and let loose in the water.\r\n\r\nCasual swim times at the ARC\r\n\r\n<em>Monday: 7:30 to 8:30 a.m., 11:30 a.m. to 1:30 p.m., 4 to 7 p.m. (Fridays until 8 p.m.)</em>\r\n\r\n<em>Saturday to Sunday: 11:30 a.m. to 2 p.m., 4 to 6 p.m., 9 to 10:30 p.m.</em>\r\n\r\nAquatic Fitness Plus Class\r\n\r\n<em>Tuesday/Thursday 4:30 to 5:15 p.m.</em>\r\n\r\n	t	t	2012-05-15 09:19:40.749144-04	2012-03-16 19:40:15-04	2012-03-16 19:40:15-04	t
357	Another year, another resolution	32	another-year-another-resolution	589	New year's resolutions, fitness, health	By Rachel Hunter\r\nContributor\r\n\r\nJanuary was the judgment month as New Years resolutions stayed at the forefront of everyones mind.  Its no surprise that many resolutions begin with goals towards a change in lifestyle, such as a change in diet or increasing exercise.\r\n\r\n<!--image:"fitness1"-->\r\n\r\nAs we move into the second month of resolutions, it can be easy to fall off track as the year gets busier and priorities change.\r\n\r\nAccording to Derek Wiggan, a fitness supervisor from Queens Athletics and Recreation, its never too late to turn around your fitness habits or get back on track. The key is in creating smart fitness goals.\r\n\r\n<strong>Starting out</strong>\r\n\r\nWhen creating realistic fitness goals there are a few important tips to remember.\r\n\r\n1)\tBe patient\r\n\r\nTreat it as a goal, not a race, Wiggan said.\r\n\r\nThe biggest problem when creating fitness goals is that people arent patient enough to see the results.  Make sure when youre looking at your current fitness level and comparing it to your ideal level you take into consideration the time and effort it takes to get there.\r\n\r\n2)\tStart off easy\r\n\r\nDont shock your body.\r\n\r\nPeople often go too hard and force themselves into a workout their body isnt ready for, Wiggan said. This just causes them to burn out faster and lose motivation.\r\n\r\n3)\tComfort is key\r\n\r\nThere are countless ways to begin achieving ones desired fitness level.\r\n\r\nIf you arent a treadmill person, dont force yourself on it, Wiggan said.\r\n\r\nStart with something you will feel good doing.\r\n\r\n4)\tLeave time for rest\r\n\r\nPace yourself. As important as it is to challenge yourself, you must be rested in order to achieve your maximum potential.\r\n\r\n<strong>Fitness at home</strong>\r\n\r\nThere are also countless opportunities around the house to keep you motivated.\r\n\r\n-\tPush- ups while watching TV. \r\n\r\nThis way you wont feel as bad about procrastinating.\r\n\r\n-\tUse music to motivate you.\r\n\r\nWhile exercising at home, listen to your iPod. It will help you to stay motivated and to keep on doing those crunches until the end of the song, Wiggan said.\r\n\r\n-\tInvest in affordable equipment.\r\n\r\nGo buy a bar you can mount to a door frame for chin ups. Its easy to do a few reps every time you walk through the door, Wiggan said. Skipping ropes are also very affordable and easy to do inside and out.\r\n\r\n-\tKeep things in your view.\r\n\r\nFor example, leave your shoes by your door or your yoga mat by your bed. By leaving these objects visually accessible you will be more inclined to use them.\r\n\r\n	t	t	2012-05-15 09:20:21.093446-04	2012-02-14 00:20:51-05	2012-02-14 00:20:51-05	t
367	Bold Bottoms	39	bold-bottoms	882	fashion, jeans, prints, 	Bold bottoms are one of the hottest trends for spring. With summer quickly knocking on our doors, we dont see this style slowing down anytime soon. Here are some ways you can rock these during day-to-day activities  whether youre shopping, working or grabbing a bite to eat. For a night out on the town, switch it up by pairing them with neutral classic pieces.\r\n\r\nThe Coloured Jean\r\n\r\nWhen it comes to bold bottoms, coloured jeans are the go-to option. From pastels to brights, the variety in colours gives a twist to the classic pair of jeans.\r\n\r\n<!--image:"fashion1"--> <!--image:"fashion2"--> <!--image:"fashion3"-->\r\n\r\n(Clockwise) Urban Outfitters. Citizens of Humanity.\r\n\r\n How To Wear It:\r\n\r\n       Pair bold opaque bottoms with a striped tee or sweater\r\n\r\n       Contrast bold colour with a lace or silk top\r\n\r\n      Dress up with a netrak or brown heel\r\n\r\n\tIf opting for pastel jeans (i.e. pink, mauve, baby blue), pair with a bold top in a darker shade of the same colour, or contrast with something edgy like a leather jacket or blazer\r\n\r\n      Keep it casual with a neutral top-sider or boot\r\n\r\n      Pair yellow with: navy, cream, black, turquoise, and lilac       Pair red with: navy, cream, grey, sea-foam green, sky blue, and brown\r\n\r\n \tTip: To maintain the vibrant colour, always wash in cold water\r\n\r\n Pair Yellow With: navy, cream, black, turquoise, lilac Pair Red With: navy, cream, grey, sea-foam green, sky blue, brown\r\n\r\nTip: To maintain the vibrant colour, always wash in cold water\r\n\r\nThe Printed Pant\r\n\r\nIf jeans arent your preferred choice for the summer, you can opt for a printed pant for a chic and comfortable look.\r\n\r\n<!--image:"fashion4"--> <!--image:"fashion5"--> <!--image:"fashion6"-->\r\n<!--image:"fashion-7"--> <!--image:"fashion7"--> <!--image:"fitness9"-->\r\n\r\n(Clockwise)  H&M. Zara\r\n\r\nHow To Wear It:\r\n\r\n        Keep things simple and neutral on top\r\n\r\n        Contrast with loose fitting knits\r\n\r\n       Dress up or down with heels and boots, likewise with a cozy sweater or feminine blouse\r\n\r\n       Pair with a cropped tank for day and silk blazer or cashmere sweater at night\r\n\r\nTip: Try playing up this years pastel trend by pairing a grey/brown leopard print with a soft pastels of blue, pink or beige\r\n\r\n	f	t	2012-05-27 11:13:59.065399-04	2012-05-27 11:13:59.057064-04	\N	f
368	The Hottest Movies of the Summer	27	hottest-movies-summer	882	Movies, summer, popular, comedy, romance, 	When we think of summer fun in the sun, staying inside is not necessarily what typically comes to mind. But on rainy days or sleepy afternoons, its a good idea to curl up on the couch with a bowl of popcorn and a summer flick. Here are our top five must-watch picks for this summer.  \r\n\r\n<!--image:"lime1"-->\r\n\r\n1.    Midnight in Paris: : The opening scene alone makes the film worth watching if you are looking for some European inspiration. The whimsical story is unexpected; the film has an imaginative and unique twist that left us in awe of the scenic summer Parisian nights, all the while laughing at Owen Wilsons comedic timing. A definite must see if you plan on travelling to France or are a Woody Allen fan.\r\n<a href="http://www.imdb.com/title/tt1605783/">Summary and Trailer </a>\r\n\r\n2.   We Bought A Zoo: Heart-warming and perfect for a summer movie night; it made us want to go outside and stargaze. Matt Damon plays a lovable Dad to one of the cutest little girls weve ever seen. The two have great chemistry in the film, and we really felt there was on-screen father-daughter connection between the two actors. The landscape, animals, and ever-present sunshine of the film are uplifting. A  perfect counterbalance to the emotional underlying storyline of the film.\r\n<a href="http://www.imdb.com/title/tt1389137/">Summary and Trailer </a>\r\n\r\n3.   Eat Pray Love:A unique story perfect for those needing some inspiration to get off the couch and see the world this summer, even if it means stepping out to your local gelato shop and pretending youre in Italy. Julia Roberts depicts a woman who is stifled by her marriage and busy North American lifestyle. Her solution? Travel to new and exotic places. Whether indulging in a pasta dish in Rome, or conversing with an ancient and eccentric medicine man, the movie is entertaining and reassuring that even when things get tough, there is always room for growth.\r\n<a href="http://www.imdb.com/title/tt0879870/">Summary and Trailer \r\n</a>\r\n\r\n4.   Project X: and ridiculous, yet so entertaining, the film follows a trio of awkward outcasts who are determined to gain social status, and attempt to do so by throwing a massive house party. You cant help but feel sorry for the main character, and yet you dont want the shenanigans to end. Though the handheld camera was dizzying at times, the movie made me feel like I was in the heart of the party, and the music was upbeat and energizing. It also made me nostalgic of my high school partying years  perfect to see with a bunch of friends on a lazy Sunday night (pizza and chips optional).\r\n<a href="http://www.imdb.com/title/tt1636826/">Summary and Trailer </a>\r\n\r\n5.   21 Jump Street: We cant get enough of Jonah Hill. In one of his best roles yet, he co-stars with Channing Tatum in a comedy about two mediocre police officers whose task is to act as undercover high school students. Equally enjoyed by guys and girls, finally a quality comedy that has quality humour, the dialogue between the two actors had us laughing from start to finish. A great movie choice for a summer date night. \r\n<a href="http://www.imdb.com/title/tt1232829/">Summary and Trailer </a>\r\n\r\n	f	t	2012-05-27 12:00:14.220133-04	2012-05-27 11:21:45.37086-04	\N	f
366	Steer Clear of the Summer 15	32	steer-clear-summer-15	883	Summer, fitness, weight loss, snacks, food,  	<!--image:"fitness11"-->\r\nSo you think you survived the Freshman 15? Well, meet its counterpart: the Summer 15. Though cafeteria food may be behind us, summertime has its fair share of indulgences. Be it BBQs, nightly ice-cream trips, camp food, or patio drinks (alcoholic or not), summer can be equally challenging for maintaining a healthy weight.  Follow these easy snack ideas to keep those pesky pounds at bay for beach season!\r\n\r\n1.\tIts all about the grazing. Rather than eating 3 heavy meals a day, try having small, healthy snacks spread throughout the day instead. Keep a bag of your favorite Kashi bars or a bag of almonds (best when toasted) at your convenience and snack on that whenever you are feeling a tad bit hungry. Even Sofia Vergara from the hit TV show Modern Family agrees that people should eat Not too much food . . . Everything in moderation. (Courtesy of: FitSugar.com http://www.fitsugar.com/Sofia-Vergara-Fitness-Diet-Routine-18374391)\r\n\r\n2.\t If you get the munchies. When you feel the need to keep your hands busy at your work place, try going to a specialty Tea Store and getting a flavour of tea that interests you. Feel free to experiment! Try the chocolate flavors, berry flavors, or green tea (I drink that twice a day!). This way you are getting what you crave without adding those pesky calories. You can also go for a latte (decaf optional); ask for skim milk and if available choose sugar-free syrups such as vanilla or hazelnut. The flavour will give you a pick-me-up, and the milk is satisfying and a great source of calcium. Whats more, we often mistake thirst for hunger, so sipping a tea or latte mid-afternoon may do the trick at easing those afternoon cravings.\r\n\r\n<!--image:"fitness2"--> <!--image:"fitness3"-->\r\n\r\n3.\tAvoid those starches. Muffins are just cupcakes with a healthier titledont be fooled by the whole grain title; often a small whole-wheat bagel with peanut butter and jam has fewer calories and more nutrients! Try avoiding white flour (which makes you feel bloated anyways) and reach for whole-wheat, whole foods such as pita and hummus and cook with whole-wheat pasta (we found it very palatable). If you want more of a crunch grab slices of cucumber and hummus, or try whole-wheat Wheat Thins for a movie snack rather than traditional potato chips.\r\n\r\n<!--image:"fitness5"-->\r\n\r\n4.\tEnjoy your sweets. If you deprive yourself of what you love, it will make bingeing virtually inevitable. Treats are perfectly fine as long as you watch your portions. Frozen yogurt is an excellent option to get hooked on for the summer, and with the new Froyo trend it wont be hard to come by. Want to make your own?  Use fat-free Greek yogurt with a fruit bottom and mix so the fruit is distributed. Put the yogurt in a Ziploc bag and cut a small corner off. Take a cookie sheet and place a piece of parchment or wax paper on it. Just like icing, make tiny little dots with the yogurt (about the size of a loony) and then freeze it. There you have it, the perfect snack!\r\n\r\n<!--image:"fitness6"-->\r\n\r\nAnd last but not least: \r\n5.\tStay Hydrated! Avoid those pesky sodas (It is essentially liquid sugar). Keep a large bottle of water with you at all times and drink, drink, drink! This will flush your system of toxins and also help with weight maintenance. If you find it challenging to drink the recommended 8 glasses of water per day, make it more appealing by adding lemon juice, or choose Perrier as your dock drink of choice, or if youre ordering at a restaurant.\r\n\r\n\r\nIf you follow these easy tips, you will feel healthy, satisfied, and happy, both inside and out!\r\n\r\n	t	t	2012-05-29 09:25:00.837668-04	2012-05-29 09:21:58-04	2012-05-29 09:21:58-04	t
369	You Only Live Once - Zoo Diaries	43	you-only-live-once-zoo-diaries	883	Zoo, Animals, expirence, summer, bored, 	YOLO\r\n\r\nThings to do because you only live once.\r\n\r\nEvery month Journal Blogs will be bringing you suggestions on what to do with your summer. \r\nThis will help you make the most of your summer and get amazing experience that you didn't even know was available to you! \r\n\r\nLet's get started: \r\n\r\n<!--image:"yolo4"-->\r\n\r\nEver wonder what it would be like to work up close and personal with animals?\r\n\r\nNot the average cat or dog, the exotic species.\r\n\r\nIf you volunteer at a zoo you get to spend the day outdoors with more species than you could probably count.\r\n\r\nIf you want more of a personalized experience, try finding a more privately owned zoo. Usually these zoos have a lower operating budget so they welcome volunteers. They may even offer employment by using your volunteer experience. Senior volunteers depending on their experience may have the opportunity to work side by with a keeper.\r\n\r\nThe staff will love the extra hands on deck and the work is fascinating because you get to learn so much about each animal while watching them closely. If you volunteer in the spring or summer time it will be more beneficial because most of the animals will be having their young (and nothing is cuter than a baby kangaroo or a baby Bengal tiger).\r\n\r\nHere are two zoos that offer a volunteer program:\r\n\r\n<a href="http://www.safariniagara.com/?page_id=30">Safari Niagara</a>  Stevensville (Close to Niagara Falls), ON (Privately owned)\r\n\r\n<a href="http://www.torontozoo.com/SupportTheZoo/BecomeAVolunteer.asp">Toronto Zoo</a>  Toronto, ON (Publically owned)\r\n\r\nBut dont stop here, if have a zoo close to where you live, drop them an email to see if they offer a chance for you to volunteer.\r\n\r\nTake it from me it, a summer at the zoo was the best summer of my life!\r\n\r\n<!--image:"yolo5"-->\r\n\r\n	f	t	2012-05-27 11:47:46.180358-04	2012-05-27 11:43:39.494254-04	\N	f
370	Summer in Kingston 	32	summer-kingston	891		The idea of spending a summer in Kingston is often met with dread. Surely, when students clear out the city we call home during the school year is a ghost town, right? Whether this is your first summer in the city or your fourth, the <em> Journals</em> here to prove that a quieter Kingston doesnt have to mean a more boring one.\r\n\r\n \r\n\r\nPlay\r\n\r\n      The club scene is a little different over the summer months, but Stages Beach Slam on Monday nights and the occasional summer Alfies are some of the most popular nights of the season.\r\n\r\n      Just because its summer doesnt mean classics such as Karaoke at Tir Nan Og arent a regular occurrence. Vocalize your chops as you get a chance to mingle with the locals and students in Kingston for summer.\r\n\r\n     If youre a sports fan, enjoy playoffs at bars around town such as The Ale House Canteen, The Brass, Fanatics, The Pilot House and many others.\r\n\r\n      Kingstons annual Buskers Festival attracts tourists from all across the province. Dont miss it this year  its happening from July 12-15.\r\n\r\n      Wolfe Island has a beach! Big Sandy Bay is just a 30-minute bike ride or a short drive away once you get off the ferry.\r\n\r\n     Also on Wolfe Island is the annual music festival. This year its Aug. 10-11. Check out <a href="http://www.wolfislandmusicfestival.com">wolfislandmusicfestival.com</a> for the lineup.\r\n\r\n     Drive-in theatres are not only things you see in movies. Impress your date or plan a night out with your friends at Kingstons very own Family Funworld. Check out: <a href="http://www.funworldpark.com/drive-in.php">funworldpark.com/drive-in.php</a> for movie times.\r\n\r\n Eat\r\n\r\n      Enjoy the sun as you indulge in summer treats in downtowns many restaurant patios and rooftops. Whether its season favourites such as Lonestars Margaritaville or the new Jack Astors (which opens in July), this summer essential is a cant-miss.\r\n\r\n     Kingstons recently seen an infiltration of frozen yogurt and ice-cream shops. Many of them lace around the lake, so stop by when you need to cool down. Some popular options are Menchies, Spin Desert Cafe, White Mountain, Mio Gelato, or the ever-convenient Metro gelateria.\r\n\r\n     During the summer months many popular restaurants take a hiatus. If one of your regulars have closed shop for the student drought, you can take on the art of cooking up a classic summer barbeque. Add in a couple of close friends and a dash of summer tunes and youve got a recipe for success.\r\n\r\n     If youre low on cash, pack a picnic basket and head to the lake for some old-fashioned delicious fun. Dont forget the apple pie!\r\n\r\n If you want to know more about Kingston in the summer, stay tuned for the next blog post on "Summer In Kingston" featuring the sections of Learn, and Breathe.\r\n\r\nSee you next week, I'm off to grab me some Menchies! 	f	t	2012-05-27 11:56:00.70595-04	2012-05-27 11:56:00.699428-04	\N	f
