COPY inlines_factbox (id, story_id, head, full_width, body, source) FROM stdin;
814	7782	What to do while you're apart	f	When you go weeks on end without seeing your significant other, these activities will help keep the romance alive. Try some out with your partner, whether its a summer separation or a lengthier long-distance.\r\n\r\n<strong>Synchtube</strong>\r\n\r\nSynchtube.com is just one site that helps people on separate computers watch videos at the same time. Now you can share the experience of watching cat videos while youre in different countries.\r\n\r\n<strong>Read a book</strong>\r\n\r\nPick a book and take turns reading it to each other over Skype or phone. This is ideal for people in different time zones  you can fall asleep to the sound of each others voice.\r\n\r\n<strong>Watch a movie</strong>\r\n\r\nDownload the same movie, start it at the same time and put Skype on its audio function. Now its like youre watching a movie in the same room  annoying questions and obnoxious laughter included.\r\n\r\n<strong>Send flowers</strong>\r\n\r\nFind a florist in your partners area that will let you order over the phone. You can set a time and date for the delivery just in time for a special day, like a birthday or anniversary.\r\n\r\n<strong>Mail a journal</strong>\r\n\r\nSend a notebook back and forth, filling it with notes or artwork. When you reunite, it can act as a record of your time apart.\r\n\r\n<strong>Get busy </strong>\r\n\r\nFact: some of us like sex. Dont lose out  just get creative with your voice and your long distance phone plan. If you dont want to leave things to your imagination, try Skype to skip the what are you wearing jargon.\r\n\r\n<em> Janina Enrile</em>	
815	7757	Inside the Human Media Lab	f	<strong>Blobjects:</strong> Objects shaped like pop cans, latex spheres and cardboard boxes are turned into an interactive display, capable of playing anything available on a conventional computer screen.\r\n\r\n<strong>Organic User Interfaces:</strong> Foldable paper computers that use hyper-thin film circuit boards to display information.\r\n\r\n<strong>Attentive User Interfaces:</strong> Detects what users are paying attention to when multiple applications are viewed on screen. The Human Media Lab is developing a high-resolution eye tracker to track user attention from over 10 metres away.\r\n\r\n<strong>Telehuman:</strong> Life-size hologram-like telepods that use a cylindrical display and multiple cameras to capture and track 3D video.\r\n\r\n<strong>Digitalized board games:</strong>Settlers of Catan is revolutionized by using projected images of characters to move on the board with a computer, infrared camera and overhead projector.\r\n\r\n<em> Source: Queens Human Media Lab</em>	
