7778	Travel treasures	Downtown store gets merchandise from annual global trips 	travel-treasures	3	325	\N	Modern Primitive isnt just another shop sprawled across the stretch of Princess St.  its a place that traces the travels of its storeowners.\r\n\r\nThe store has an array of jewellery and clothing for shoppers to browse, straying away from mass-produced items and opting for unique pieces from across the globe.\r\n\r\nDavid Parkinson co-owns the store with his wife Bonnie. Hes been in the jewellery buying and selling business for over 20 years and he said Modern Primitive started with an encounter in Spain.\r\n\r\nI met a guy from Argentina. We used to work on the same markets in Pamplona during big events like the running of the bulls, Parkinson said. The guy said to me: Ill give you the key to life if you want to travel. \r\n\r\nParkinson met his wife while in Spain and they began to sell jewellery together.\r\n\r\nAfter the couple traveled around for a few years in Europe, Parkinson said he and his wife decided to move to Canada because she was anxious to come back home.\r\n\r\nThe couple first opened a shop at 120 Princess St., later moving to their current location at 72 Princess St.\r\n\r\nWhen the shop first opened, most of their jewellery was from Mexico.\r\n\r\nTheres a huge market for jewellery in Mexico. Its very popular there, he said.\r\n\r\nAt first they only sold jewellery in the store, but later decided to expand into the back area and bring in apparel.\r\n\r\nIt was a normal progression, Parkinson said.\r\n\r\nMarkets in Thailand, Indonesia, Nepal and India are just a few of the places that Parkinson has traveled through to buy products to sell at the store.\r\n\r\nWhen I go there, I go to the market first to see whats going on. Markets arent like what they are here  markets are huge and they have a whole section of artisans, he said.\r\n\r\nIn order to decide what items to purchase, Parkinson said he simply takes a look around.\r\n\r\nI look at what the tourist girls are wearing because those are the kinds of things girls here would wear.\r\n\r\nParkinson added that even if there is a language barrier when he travels, everyone understands the language of buying and selling.\r\n\r\nPeople get the idea if I want to buy something from them, he said.\r\n\r\nOn average, trips last a couple of months and items are shipped to Canada after they are chosen.\r\n\r\nParkinson said half of the money is given immediately to pay for production costs while the shipper gets the rest of the money to give  to the merchants and artisans upon delivery of the finished items.\r\n\r\n He added that the most popular items in the store often vary.\r\n\r\nSome years you may get a hot item of jewellery that everybody wants, like feather earrings for example, and its always changing, he said.\r\n\r\nParkinson said they are planning to expand Modern Primitive with a location opening in Westport, a town one hour north of Kingston.  	Modern Primitive isnt just another shop sprawled across the stretch of Princess St.  its a place that traces the travels of its storeowners.	\N	t	f	Fashion, local business	t	2012-05-28 17:01:12-04	p	f	f
7766	Underwood to suit up for Canada	Former Gaels rugby coach leads charge in bid to bring international test match to Kingston	underwood-suit-canada	7	325	\N	Queens is set to host a major international rugby competition next month. Team Canada and Team U.S.A. will face off in a mens rugby test match at Richardson Stadium on June 9.\r\n\r\nGaels veteran Liam Underwood will dress for Team Canada. Its an honour hes earned after a steady progression up Canadas rugby ladder.\r\n\r\nThe Coach has seen me play from past tournaments, so were familiar, Underwood said.\r\n\r\nPart of Canadas under-20 team in 2010 and 2011, Underwoods jump to the senior roster partly came out of the blue. The opportunity arose after Team Canadas Connor Braid sustained an injury while playing for his club in B.C. Underwood plays the same two positions as Braid  fly half and fullback.\r\n\r\nI didnt really see it coming, Underwood said, adding that hes never played in front of thousands of fans before, despite previous international rugby experience.\r\n\r\nHead coach of the Gaels mens rugby team Peter Huigenbos is also video analyst for the Canadian mens team.\r\n\r\nIts a pleasure to work with Liam, Huigenbos said. Ill actually be spending much more time with Liam; its a 24/7 commitment, and hes ready for it.\r\n\r\nHuigenbos has coached Underwood since 2010, the year the Gaels won the OUA championship.\r\n\r\nHe was 18 years old, setting up three of our four tries to win the OUA, Huigenbos said. Hes a quiet leader ... who understands the game on another level.\r\n\r\nThe game at Richardson Stadium is a ten-minute walk from where Underwood plays each fall in a Queens uniform. Huigenbos said the local organizational committee deserves much credit.\r\n\r\nThe communitys support for this game has been phenomenal. he said.\r\n\r\nOn June 9, there will be more than just national pride at stake. Canada is ranked 13th in the world, while the U.S.A. is ranked 17th. Only the top 12 teams from the 2011 World Cup in New Zealand are automatic qualifiers for 2015. Huigenbos said these test matches affect those international rankings.\r\n\r\nFor [World Cup] 2015, unfortunately we still need to qualify. Despite beating Tonga [in New Zealand], they still finished ahead of us in our pool, claiming automatic qualification for the next world cup.\r\n\r\nOne of Kingstons most decorated rugby figures helped make the game happen.\r\n\r\nJohn Phelan, an associate professor at Queens School of Business, is a former captain of Canadas national rugby team. Hes also chair of the 15-person Local Organizing Committee that capitalized on a bid to bring the test match to Kingston. Consisting mainly of local business people, it was the same committee that brought the Barclays Churchill Cup pool games to Kingston in 2008.\r\n\r\nTeams have always liked playing here, Phelan said. We did a good job in 2008 hosting Canada, Ireland, Scotland, England, U.S.A. and Argentina, and if we do it well this time, theyll come back again.\r\n\r\nWhile Rugby Canada continues to use Richardson as a venue for international rugby competitions, the sport is also thriving in Kingston. Phelan said rugby is evolving more into the forefront of Kingston sports culture.\r\n\r\nKEDCO and Kingston tourism are some of the businesses behind us, he said. And Kingston truly is a rugby community.\r\n\r\nPhelan works with the Kingston Panthers rugby organization at the youth levels creating introductory programs for children as young as six years old.\r\n\r\nOne of my older mentors once told me you owe the game, and I agree because its given me that much in my life.\r\n\r\nFor [World Cup] 2015, unfortunately we still need to qualify. Despite beating Tonga [in New Zealand], they still finished ahead of us in our pool, claiming automatic qualification for the next world cup.\r\n	Queens is set to host a major international rugby competition next month. Team Canada and Team U.S.A. will face off in a mens rugby test match at Richardson Stadium on June 9.\r\n	\N	t	f	Rugby, Huigenbos	f	2012-05-28 15:24:12-04	p	t	t
7773	Men have right to safe space		right-safe-space	13	325	\N	The allocation of $30,000 of student funding to the creation of a mens centre at Simon Fraser University has been finalized after the Universitys Student Society Treasurer proposed the initiative.\r\n\r\nControversy has surrounded the opening of the centre, with doubts  raised about the intentions behind its creation and what purpose it may serve.\r\n\r\nAll in all, the idea of a mens centre isnt negative, so long as its implemented in a careful, well-thought out and sensitive fashion. Specifically, much concern has been raised about the potential that a mens centre could simply turn into a frat house  a place for men to make misogynistic jokes, play video games and watch sports.\r\n\r\nIts ultimately unfair to assume that this will happen  it creates negative stereotypes that deny the use  a mens centre could have on a university campus.\r\n\r\nMen, just as women, face countless gendered societal pressures. Much of machismo culture denies men the safe space to discuss their vulnerabilities and personal issues with one another. This has led to much higher suicide and alcoholism rates among men compared to women. Homosexual or transsexual men face societal stigmas on top of this.\r\n\r\nA mens centre can be used to create a safe space for men to discuss their problems, helping to fight the stigmas that they encounter on a day-to-day basis.\r\n\r\nBut, in order for such an environment to be created, a significant amount of oversight must be implemented by the students and university members involved in the centres creation.\r\n\r\nA clear mandate must be outlined for the centre, with an appropriate level of funding allocated  $30,000, which is the amount currently recommended, seems excessive for the proposed purposes of the centre.\r\n\r\nFurthermore, students and administrators must hold the centre to account, ensuring that its used as a safe space to discuss issues that men face. Otherwise it risks morphing into a boys club that only furthers patriarchal values and negative stereotypes.\r\n\r\nThe creation of a mens centre shouldnt stifle the prevalence or importance of womens issues, or issues facing other marginalized groups on campus. A dialogue about gender issues facilitated through the mens centre would add a positive element to its creation.\r\n\r\nFor equalitys sake, men, just as women, should have a safe space allocated to them to discuss and cope with the societal stigmas that they may face.\r\n\r\nIf the mens centre at Simon Fraser University can establish an environment that fits the above criteria, its creation and funding will be justifiable.\r\n\r\n<em> Journal Editorial Board  </em>	The allocation of $30,000 of student funding to the creation of a mens centre at Simon Fraser University has been finalized after the Universitys Student Society Treasurer proposed the initiative.	\N	t	f	Gender, Simon Fraser University 	f	2012-05-28 16:29:38-04	p	f	f
7751	News in brief		news-brief	1	\N	\N	<strong>Federal budget continues investment into research, while cutting youth program </strong>\r\n\r\nThe federal budget released on March 29 looks to invest in research at universities, but also cuts beneficial youth programs.\r\n\r\nSteven Liss, vice-principal of research, said the federal budget makes a strong statement about the governments confidence in universities.\r\n\r\nThere is certainly a strong statement on the prominence of basic foundational research and international world-class research, but at the same time the role that universities play in supporting innovation through partnerships, Liss said.\r\n\r\nThe $37 million in annual investments outlined in the federal budget will help to continue Queens research reputation.\r\n\r\nWe continue to do well and to focus our strengths and the diverse range of research in all areas including health, social sciences, humanities, the arts, sciences and engineering, Liss said.\r\n\r\nCuts to youth programs were also included in the budget.\r\n\r\nKatimavik  a youth volunteer service program started in 1977 and funded by the Canadian government  has been stopped immediately, meaning the 2012-13 program which was supposed to begin in September is cancelled.\r\n\r\nWithout a program like this, youth wont get exposed to critical thinking and given the hands-on experience and common sense learning that goes together with the knowledge that we learn in the classroom, former participant Alyssa Chin, ArtSci 12, said.\r\n\r\nOther cuts in the budget include an end to the penny, which is projected to save the government $11 million per year, and the laying off of 12,000 government employees over three years.\r\n\r\n<em>- Rosie Hales </em>\r\n\r\n<strong>House fire in Student Ghetto </strong>\r\n\r\nA Kingston Police report released on April 1 indicated that a house near Division and Earl Streets was set on fire around 2 a.m. on Saturday, March 3. Ted Posedowski, the fire inspector assigned to the case, said the fire was suspicious.\r\n\r\nThe five tenants of the 72 Division St. home said they were told by Posedowski that the fire started in the front door's mail-box slit. The fire damaged the front area of the house and caused smoke to rise to the second floor.  Posedowski said he couldnt confirm whether the fire was caused by arson.\r\n\r\nNone of the residents were home when the fire started. However, a cat was left in a second-floor bedroom and had to receive medical attention.\r\n\r\nAlmost everything in our rooms was covered in soot, Cindy Kwong, ArtSci 14, said. Our staircase leads to the front door where the fire started. If we were home we wouldnt have been able to get out.\r\n\r\nThe tenants werent allowed to re-enter their home until renovations were completed in late March. The tenants say they plan to take their landlord, Wayne Gollogly, to small-claims court over emotional damages. \r\n\r\nWe literally spent over $1,500 in hotel fees, moving all of our stuff, and replacing all our food, Kwong said.\r\n\r\nGollogly could not be reached for comment following the fire. \r\n\r\nThe fire is currently under investigation by Kingston Police.\r\n\r\nKingston Police is urging those who witnessed or have knowledge of the event to come forward and contact the department at 613-549-4660.\r\n\r\n <em>- Vincent Matak (with files from Clare Clancy)</em>\r\n\r\n<strong>Alumnus establishes endowment</strong>\r\n\r\nAn Engineering alumnus has established The Hazell Endowment in Chemical Design and Innovation, a fund that will go towards innovation and chemical design.\r\n\r\nEvan Hazell, Sci 81, is a petroleum engineer and an investment banker. Through his endowment fund, he wants to see a melding of the science and business worlds.\r\n\r\nDean of Engineering and Applied Science Kimberly Woodhouse said this donation will put graduates ahead of the curve.\r\n\r\nThe funding will go towards a research professorship as well new innovation programming.  \r\n\r\n<em>- Sean Renaud</em> \r\n\r\n<strong>New Masters program planned</strong>\r\n\r\nQueens has added a new graduate program to its course offerings for September.\r\n\r\nThe creation of a Master of Science in Health-care Quality, Risk and Safety program was passed at the March 27 Senate meeting.\r\n\r\nDr. Jennifer Medves, vice-dean of the School of Nursing said the program is fairly unique.\r\n\r\nWe want really good quality health care and we need to revolutionize how we give care and this is the kind of program that we hope is going to get the minds to be thinking together about how they can do things differently, Medves said.\r\n\r\nThe program is run through the School of Nursing and the department of anesthesiology.\r\n\r\nThis two-year graduate program is mostly completed online with the exception of one week on Queens campus in September and one week in January.\r\n\r\nThe real appeal for it is that this is a program that is interdisciplinary, inter-professional so students will learn from and will teach others about their own discipline or profession and theyll learn others disciplines and professions and they really will be looking and reading and writing about a topic that is dear to all of our hearts, Medves said.\r\n\r\nThe degree proposal was passed with a majority vote in Senate. Senators had five days to look over the proposal document. \r\n\r\n<em> - Rachel Herscovici</em>\r\n\r\n<strong>Student to bike 8,000 kilometers</strong>\r\n \r\nOn May 15, Ira Carson will fly to British Columbia with his brother and a friend to begin an 8,000-kilometre bike ride from Victoria to St. John's, N.L. in an effort to raise money for the Easter Seals Camp in Merrywood.\r\n\r\n"The actual distance isn't 8,000 kilometres, but we plan on cycling 8,000 kilometres because we want to stop and visit lots of small cool places but we're also going to get lost along the way," Carson, ArtSci' 12, said. \r\n\r\n8,000 kilometres for Easter Seals aims to cover the distance in 13 weeks and raise $8,000, a dollar for each kilometre travelled. All proceeds will be donated to the camp, in particular the accessible sailing program which uses specially-modified sailing boats for those otherwise unable to sail.\r\n\r\n<em>- Asad Chishti </em>	Updates on the Queen's community.	\N	t	f	News in brief	f	2012-04-13 14:46:28-04	p	t	t
7750	Law student wins Tricolour award	Erin Smith recognized for her contributions to equity on campus	law-student-solo-winner-tricolour-award	1	\N	\N	For the second time in its history, the Agnes Benidickson Tricolour Award has been given to one student.\r\n\r\nErin Smith, JD and MBA '12, will receive the award in a ceremony this spring.\r\n\r\nThe award is given annually to students who have made a significant contribution to the community in a non-athletic and non-academic way.\r\n\r\nThe first stand-alone winner of the Tricolour Award was Michele Romanow, Sci 07, who founded the Tea Room in her second year and received the award in her final year of study.\r\n\r\nThe award usually recognizes several students but this year the selection committee unanimously chose Smith because of her profound impact on equity at Queens.\r\n\r\n We were not under the impression that we had to give out a certain number of awards.  The bar is set really high for the award and she is the only one who reached that bar, Rector Nick Francis said.\r\n\r\nShe put in foundations that the [selection] committee felt would extend past her time at Queens.  Her work will benefit all students in the long run, its not just the law school, Francis said.\r\n\r\nThe Rector chairs the selection committee, which consists of 16 student representatives from all faculty societies. Smiths passion for equity issues led her to spearhead various campaigns that affect students across all faculties.\r\n\r\nShe said her most prominent contribution to equity at Queens is with her work under the Equity Committee under the Law Students Society. Smith is currently the third-year co-commissioner of the committee.\r\n\r\nIn this role, Smith has implemented Positive Space training and office hours, the Campus and Community Fair, the Equity Survey and the Sober Socializing Initiative.\r\n\r\nThe Sober Socializing Initiative started this year and was the idea of my co-commissioner.  Its for people who want to hold events that aren't alcohol-focused, she said.\r\n\r\nThe Equity Committee has teamed up with various groups on campus for this initiative, including the Human Rights Club to help with the logistics, promotion, and funding of events that do not revolve around alcohol.\r\n\r\nIn order to provide better service and respond better to the needs of the Queens law students, Smith created the Equity Survey, which will gauge what the main issues in the law school are and how students would like to improve them.  \r\n\r\nAfter completing her undergraduate degree at McGill University, Smith noticed a difference in campus culture upon arriving at Queens University for law school.\r\n\r\nI was struck by the less-open culture here than I found at McGill and surprised by, perhaps, the conservatism and attitudes that were present at Queens, particularly in the law school, Smith said.\r\n\r\n Its no secret that Queens has had some equity-related problems, Smith said.\r\n\r\nSmith said she took initiative to try and change things.\r\n\r\nEveryone should be comfortable being who they are and shouldnt be afraid to be who they.  We should try to create an environment where that is true.\r\n\r\nOriginally established as the Tricolour Award in 1939, the award was later renamed the Agnes Benidickson Tricolour Award after Dr. Agnes Benidickson, the first female chancellor of Queens University from 1980 to 1996.\r\n\r\n	For the second time in its history, the Agnes Benidickson Tricolour Award is given to only one student.	\N	t	f	Student life, Tricolour award	f	2012-04-13 14:44:09-04	p	t	t
7775	Student strikes raise concerns 	Rising tuition costs across the country need to be evaluated to ensure quality education	student-strikes-raise-concerns	4	325	\N	For over 100 days, students in Quebec have been marching, chanting and boycotting classes in protest of a $1,625 tuition increase spread over five years.\r\n\r\nStudent protesters have led peaceful demonstrations with thought-provoking and clearly-articulated talking points; theyve also rioted, broken windows and tossed smoke bombs into subway systems.\r\n\r\nNational and international media have been recycling and recreating exciting names for the movement. From the Toronto Star it is the Student Uprising, at Macleans it is the Maple Spring.\r\n\r\nTheres no question that post-secondary education for Quebec students is cheap  its one of the least expensive options in North America.\r\n\r\nToday, Quebecs average undergraduate tuition is $2,519 per year, in comparison Ontarios average is $6,640.\r\n\r\nQuebecs perspective on tuition cannot be isolated from its social and historical roots.  The unique socio-economic position of Quebec requires a nuanced understanding of a culture with a long standing, powerful youth and union movement as well as a philosophical alignment with more socialist education policies of France, Germany and Sweden.\r\n\r\nThe leaders of the largest student groups say that ideally, tuition in Quebec will reach the level promised during the Quiet Revolution in the 1960s  free.\r\n\r\nDespite cries of Solidarity!, student strikes remain incredibly divisive within their own communities. The discounted rates are not universal; only eligible to students born in Quebec or educated through their secondary school system receive lower tuition.\r\n\r\nAbout 30 per cent of Quebec students are striking; the rest have spent the past few months attending class, writing exams and strolling through campuses filled with pamphlets, protesters and riot police. The past few weeks have seen a transformation of the protests into a wider social movement, drawing upon longstanding social, political and economic concerns.\r\n\r\nSo what does this mean for us at Queens?\r\n\r\nThe reality is that tuition in Ontario has increased every year for the past five years and our tuition due on Sept. 1 will be increasing yet again. The Ontario government has extended the current tuition framework allowing schools to increase their tuition by an institutional maximum of five per cent. Some programs, such as Commerce, have increased by eight per cent.\r\n\r\nSince 2009, Ontario has held the dubious distinction of having the most expensive average tuition. Continually increasing tuition without developing metrics that guarantee quality is detrimental to the value of a post-secondary experience.\r\n\r\nThe governments of Ontario and Quebec argue that the current system is unsustainably expensive. New technology, new departments, new building projects, increased student support services, pension agreements and a booming number of students have led the costs associated with an undergraduate education to skyrocket in the past 30 years.\r\n\r\nThe rationale behind tuition increases remains that Ontario is currently experiencing concern over provincial debt.\r\n\r\nHowever, students remain highly sensitive to economic flux; unemployment among high-school students, post-secondary students and recent graduates remain incredibly high.\r\n\r\nThe governments cant deny affordable access to all students in a world which increasingly requires the technical and intellectual sophistication of a post-secondary education.\r\n\r\nReasonable increases in tuition, as measured using inflation should be allowed to ensure quality, but the Ontario government must recognize that students are currently graduating with more debt and fewer employment prospects than our predecessors.\r\n\r\nBoth the government and broader society reap the rewards of our post-secondary learning; Ontarians with degrees are more likely to live longer, be healthier, commit fewer crimes, vote in larger numbers, volunteer in their community and donate to charity.\r\n\r\nThere is a financial imperative to investing in post-secondary education, according to the Canadian Chamber of Commerce the 27 per cent of Ontarians with post-secondary education credentials contribute 50 per cent of the income tax.\r\n\r\nA cost-sharing model, one which equitably divides the contributions of the government and students can deliver affordable, quality education.\r\n\r\nThe AMS currently advocates a 70 per cent government, 30 per cent student split based on the average contributions of governments across Canada.  Presently, the Ontario split is 55 per cent government, 45 per cent student.\r\n\r\nGiant placards announcing Hey! The complicated mlange of global financial concerns, conflicting institutional perspectives and stagnant funding formulas have led my University and Government to increasingly look at my fourth-year history tuition as a revenue generator! arent nearly as eye-catching as strike tactics.\r\n\r\nUnfortunately, good politics and solid policy rarely grab as much attention.\r\n\r\nThe Quebec student strikes have highlighted important concerns about accessibility, affordability, and cost-sharing, situations relatable to Ontario students burdened by unfairly shifting costs.  Instead of dialogue equating the importance of a university education with its ultimate financial consequences, we also need to tailor our discussions on quality within the undergraduate context.\r\n\r\nThese concerns are not limited to students. Faculty and administration are hypersensitive to the changing field and nature of post-secondary education, but universities in Quebec have been quiet on the ongoing strike.\r\n\r\nDiscussions on tuition must include an understanding of the roles and responsibilities of all stakeholders: government, universities and students.\r\n\r\nI was born in Quebec City. If I had chosen to attend any university in Quebec, its possible that I would be paying less than half of my Queens tuition. The legacy of your Queens education cannot be simplified into a bottom line.  \r\n\r\nThe Quebec student strike has done a tremendous job of casting major attention on the financial cost of a Quebec education, but the pivotal issue that remains is how to measure exactly how much tuition we should be paying, and how we calculate if its worth the cost.\r\n\r\n<strong>Isabelle Duchaine is the AMS Academic Affairs Commissioner</strong>	The Quebec student strikes have highlighted important concerns about accessibility, affordability, and cost-sharing, situations relatable to Ontario students burdened by unfairly shifting costs.	\N	t	t	Tuition, student protests 	t	2012-05-28 16:35:09-04	p	f	f
7776	Creating a spectacle 	From billboards to tents, Art in Public Places Kingston includes six installations located around town 	creating-spectacle	3	325	\N	Ive walked past Bagot and Queen St. dozens of times in my four years at Queens, but when I saw a radically green living room set up, I had to do a double take.\r\n\r\nFor me the encounter wasnt accidental.\r\n\r\nEarlier in the day Id climbed aboard a school bus packed with artists and art lovers for the opening tour of a six piece curated art project titled <em>Art in Public Places Kingston.</em>\r\n\r\nThe public exhibits are part of a show put on by xcurated Cultural Collective, created to stimulate discussion about art by situating it in public places. The theme, appropriately titled Spectacle, presented a dual question to audiences  is public art a spectacle in itself or does it only depict the spectacle already inherent in society?\r\n\r\nWe first stopped by Catherine Toews billboard piece on Taylor Kidd Blvd. which showed three fashion magazine inspired images of women looking vulnerable and exposed.\r\n\r\nWe then arrived at Lemoine Point Conservation Area to view what appeared to be a simple red tent in the middle of a field.  As we headed down the trail, we were told that the tent was actually Robert Hengevelds <em>Into the Wild</em>.\r\n\r\nNo longer just a piece of camping gear, the interior had been spread with camouflage nylon and small pieces hung down like drying meat at a butchers shop.\r\n\r\nThe hung nylon alluded to an unsettling reality. Surrounded by the otherwise tranquil and natural lake, it was as if something dark was hiding in the shadows of the installation.  \r\n\r\nAs the bus veered back downtown, Michael Davidges <em>Pretty Vacancy </em>appeared from the bus window  a neon-lit sign which was a literal representation of the Sex Pistols 1977 hit Pretty Vacant melding with the stylistic design of a motels vacancy sign. The mundane and lazy manifestation of a curious phrase makes this one stop that can be avoided.\r\n\r\nLuckily, those without a car can view the best and most outlandish pieces of the collection within walking distance from campus. Inside a pit that will eventually be filled with condos lies <em>Greenroom</em>, a living room set partially cast out of hollow fibreglass.\r\n\r\nMillie Chen and Warren Quigleys piece was created to be a socially conscious satire on the corporate greening trend. The brown walls of the pit provided a contrasting landscape for the hues of green the work utilizes. Its proven its purpose by already making passersby stop and stare at the brilliantly thought-out juxtaposition between interior and exterior.\r\n\r\nSteven Lauries <em>Donut Machine </em>inside the Cataraqui Centre is also included in the collection but was not part of the tour.\r\n\r\nThe final stop of the tour took us to the tree in front of the Pump House Steam Museum to see Shayne Darks <em>Free Form in Blue</em>, a vibrant stack of cedar split rails covered in deep blue paint and nestled amongst the trees branches.\r\n\r\nDarks installation was the most simplistic of the project, but also the most overt example of the theme of spectacles  enabling viewers to stop and question what public art means.\r\n\r\n<strong>Art in Public Places Kingston runs until June 8.\r\n\r\nA roundtable discussing the importance of public art will be held on June 7 at 7 p.m. in Market Square.</strong>\r\n	Art in Public Places Kingston presents a dual question to audiences  is public art a spectacle in itself or does it only depict the spectacle already inherent in society?\r\n	\N	t	f	Art review, Art in Public Places	f	2012-05-28 16:47:09-04	p	f	f
7752	Leaving the wild	Wildlife lead singer recalls his musical days at Queen's	leaving-wild	3	\N	\N	Wildlife lead singer Dean Povinsky has moved on from his days of playing in grungy basements of the Queens Student Ghetto.\r\n\r\nThe ceilings werent tall enough and there was half a flood in the corner, Povinsky, BFA05, said. It was places where human beings werent supposed to be. After graduating from Queens, Povinsky and friend Darryl Smith moved to Glasgow where they formed Wildlife with Scottish drummer Peter Kelly and fellow Canadian Billy Holmes.\r\n\r\nThe group eventually decided to leave Glasgow and return to the more passionate fans in Toronto in 2006.\r\n\r\nPeople are generally more enthusiastic about everything in Canada than in the U.K., he said. The main difference for me was on a visceral level. [In Glasgow] its rainier and gets dark earlier and it can be sort of depressing.\r\n\r\nIn 2006 Wildlife underwent a massive line-up change to include guitarist Graham Plant, drummer Dwayne Christie, bassist Derek Bosomworth and synthesizer Julia Mensink. In 2009 Tim Daugulis replaced Mensink who left the band because she and Povinsky had broken up.\r\n\r\nWe were boyfriend and girlfriend, Povinsky said, There was a few reasons why she left, it wasnt creative differences.\r\n\r\nIt was less to do with the actual band.\r\n\r\nThe Toronto-based group is playing a show at the Mansion at the end of April and Povinsky said they couldnt be happier to be returning to Kingston after playing a show here last October.\r\n\r\nI always like going back to Kingston, he said. Its basically my favourite city ever.\r\n\r\nI used to stay during the summer instead of going home to Oshawa; it was so nice in the summertime.\r\n\r\nWildlifes sound has been compared to breakout Canadian group Arcade Fire. Povinsky said he doesnt mind the comparison at all.\r\n\r\nIt was hard for me to understand but what I came to the conclusion of was our songs fill the same emotional space for people as Arcade Fire and Wolf Parade -- bands were huge fans of, he said.\r\n\r\nPovinsky added that the comparisons could be worse.\r\n\r\nIf someone wants to call us a punkier Arcade Fire, by all means. Its definitely a lot better than getting compared to Staind or Three Days Grace.\r\n\r\n<strong>Wildlife plays the Mansion tonight at 9 p.m.</strong>\r\n\r\n	Interview with the band Wildlife.	\N	t	f	Interview, Wildlife, Kingston, Queen's University	f	2012-04-20 21:00:00-04	p	t	t
7780	Arts in brief		arts-brief	3	325	\N	<strong>Nude Stephen Harper portrait sold </strong>\r\n\r\nA nude portrait of Stephen Harper named Emperor Haute Couture that is on display at the Kingston Public Library on Johnson St. was sold for $5,000 on May 24.  \r\n\r\nArtist Margaret Sutherland painted the piece for the Kingston Arts Councils Juried Art Salon, an annual competition thats judged by three professional artists.\r\n\r\nThe oil painting depicts the Prime Minister lying on a recliner in the buff with a dog at his feet. Hes also being served a Tim Hortons coffee from a woman. The painting is meant to be a political satire of Harpers cuts to arts programs in the country.\r\n\r\nSutherlands body of work includes other nude portraits and more popularly, a demonic painting of Pope Benedicts face.\r\n\r\nThe painting will be on display at the library until the end of the month.\r\n\r\n<em> Savoula Stylianou</em>\r\n\r\n<strong>Awesome Kingston funds film project</strong>\r\n\r\nAwesome Kingston has given a $1,000 grant to a Kingston film project that intends to make one movie a week for 26 weeks.\r\n\r\nThe venture is called 26 Shorts and will involve asking a group of Kingston filmmakers to shoot one movie every week using a Kingston cast, crew and location.\r\n\r\nEric Ferguson came up with the idea when he realized that local filmmakers spend more time sitting at the pub than out making movies.\r\n\r\nA lot of pints get finished, but not a lot of films, Ferguson, ConEd 11, said.\r\n\r\nFerguson went to an Awesome Kingston meeting and had 90 seconds to pitch his idea to the panel of judges.\r\n\r\nThe idea is the antithesis of a normal grant procedure, he said. They gave me a paper bag filled with $1,000 cash and they dont check in afterwards.\r\n\r\nThe filmmakers are currently in the stages of scouting and planning the 26 short films that could range anywhere from one minute to 10 minutes.\r\n\r\nFerguson said hes planning to start the project in August and finish by early February next year. The project is aiming to screen some of the films at the Kingston Canadian Film Festival in March 2013.\r\n\r\n<em> Savoula Stylianou</em>\r\n\r\n	Arts in brief	\N	t	f	Arts in brief	f	2012-05-28 17:08:16-04	p	f	f
7781	What we're listening to 		what-were-listening	3	325	\N	1) <a href="http://www.youtube.com/watch?v=Et1hFMCWhmE">Some Nights</a> by Fun.\r\n\r\n2)<a href="http://www.youtube.com/watch?v=mIMMZQJ1H6E">Disparate Youth</a> by Santigold\r\n\r\n3) <a href="http://www.youtube.com/watch?v=kKJ3z9Pa7AU&ob=av2e">All of Me</a> by Tanlines\r\n\r\n4) <a href="http://www.youtube.com/watch?v=ZSJBtq5VQZA">Victory Lap</a> by Mackelmore and Ryan Lewis\r\n\r\n5) <a href="http://www.youtube.com/watch?v=y6W0TzNxE2A&ob=av2e">Take a Walk</a> by Passion Pit	The Journal brings you summer tunes to beat the heat waves.	\N	t	f	Music 	f	2012-05-28 17:09:15-04	p	t	t
7779	Youth connections	Blue Canoe productions puts on their second all high school show with 13	youth-connections	3	325	\N	Running in and out of the Baby Grand theatre during their dress rehearsal, the cast of 13 exchanged fist bumps of congratulations after a successful scene.\r\n\r\nCommunity theatre company Blue Canoe Productions prides itself on its commitment to involving people from various age groups in its shows.\r\n\r\nThe company is showcasing its second high school show with 13 the Musical.\r\n\r\nThe first time the group produced a show with all high school students in the cast was in 2009s Rent.\r\n\r\nQueens student Michael Sheppard founded Blue Canoe Productions in 2006 when he first came to Queens because he saw a need for more student-run productions open to both students and the community.\r\n\r\nSheppard said from 2007-2009 Blue Canoe was completely student-run and all profits made from ticket sales went directly to funding the group.\r\n\r\nBlue Canoe Productions became an AMS club in 2009.\r\n\r\nWe didnt get a student fee, but we got the ability to book space on campus for free and having a connection to the AMS made it easier to get students involved, Sheppard, ArtSci 12, said.\r\n\r\nIn January 2013, Blue Canoe Productions will become Blue Canoe Theatrical Productions Incorporated.\r\n\r\nThe group will become its own separate entity and will have access to apply for provincial grants, Sheppard said.\r\n\r\nIdeally there will be two co-presidents of Blue Canoe in the future, Sheppard said  one Queens student to run the university chapter and Sheppard representing the community side so he can stay with Blue Canoe in the long term.\r\n\r\nWhile the cast of <em>13</em> is all high school students, the crew is largely university students.\r\n\r\nAny sort of head position is a university student, Sheppard said. Weve always been a mix.\r\n\r\nProduction manager Molly Russell said 13 has more ConEd students in the crew than any other Blue Canoe show in the past.\r\n\r\nA lot of ConEd students were attracted to the project because it is working with high school students, Russell, ConEd 13 said.\r\n\r\nRussell has been with Blue Canoe Productions for two years and she said working with high school students is different than working with university students.\r\n\r\nWhat I find with high school students versus some university students is that theres no ego and theyre a lot more willing to learn. \r\n\r\n<em>13</em> is about the trials and tribulations of a group of thirteen-year olds who fit different middle school stereotypes like the vain cheerleader and the dumb jock.\r\n\r\nThe male lead of <em>13</em> is popular  guy Evan, who eventually falls for Patrice, the awkward girl in school.\r\n\r\nEvan is played by twelfth grade student Reid Cunningham from Loyalist Collegiate Vocational Institute.\r\n\r\nAt the beginning of rehearsals there was a divide with people from different high schools but when you start working together with people, you totally become a whole group, he said.\r\n\r\nThe cast rehearsed five days a week as opening night approached.\r\n\r\nIn school every day as well,  Cunningham said that this has given them limited time to hang out after rehearsal, but he added that he will absolutely be hanging out with his castmates after the musical is over.\r\n\r\n<strong><em>13 the Musical </em>runs until June 2 at the Baby Grand Theatre</strong>.\r\n\r\n	Running in and out of the Baby Grand theatre during their dress rehearsal, the cast of 13 exchanged fist bumps of congratulations after a successful scene.\r\n	\N	t	f	Theatre, Blue Canoe	f	2012-05-28 17:03:58-04	p	t	t
7753	11 participate in Queens Kony 2012		11-participate-in-queens-kony-2012	1	\N	\N	Over 1,100 people were confirmed as attending the Queens Does Kony 2012 event on Facebook, but only 11 people showed up on Friday night.\r\n\r\nStarting at 10 p.m. the group put up over 100 posters along Princess Street. By 2 a.m. many of the posters had been taken down or destroyed and only remnants were left.\r\n\r\nThe Queens event coincided with the worldwide Kony 2012 campaigns Cover the Night event  an attempt to raise awareness of the groups goal of capturing Lords Resistance Army (LRA) leader Joseph Kony.\r\n\r\nInvisible Children, the charity behind the Kony 2012 campaign to capture, offered activists around the world the opportunity to participate in the Cover the Night event by ordering an Action Kit containing posters, bracelets and other promotional material. \r\n\r\nWynne Baker, one of the Queens event organizers, said wasnt expecting a high turnout to the event in light of criticism the charity has received since their YouTube video garnered over 100 million views last month.\r\n\r\nBaker and her friends tried to differentiate themselves from Invisible Children by making their own posters and changing the event name to Queens Does Kony 2012 instead of  Cover the Night.\r\n\r\nI personally do not support Invisible Children, Baker, ArtSci 15, said. Personally I wouldnt give money to them so I didnt order [an action kit from Invisible Children].\r\n\r\nKonys rebel group, Lords Resistance Army (LRA), is believed to have abducted more than 30,000 children and turned them into soldiers or sex slaves.\r\n\r\nI dont care about the politics. I dont care about the budget. I dont care about all that. What we are here for is to bring awareness to 30,000 children who dont have a future. Thats all we care about. Baker said. You dont have to support the cause to support the idea. If you want to hate, thats great. That shows you dont care about children.\r\n\r\nBaker said the environmental impact of printing and putting up hundreds of posters couldve been another a factor for the low turn out.\r\n\r\nI think people will wake up tomorrow and get a nice shock seeing all the posters and hopefully they'll get on a computer and look up who Kony is, Baker said.\r\n\r\nKingston Police said they havent received calls in regards to the Kony 2012 Cover the Night event. However, it is a city bylaw violation to post on hydro poles and city properties.\r\n\r\nKONY was taped on the windows of Urban Outfitters on Princess Street, but by 2 a.m. only the letter O could be seen at the time.\r\n\r\nChris Le Feuvre, manager of Urban Outfitters on Princess St. said they didnt notice anything when the store opened.	Queens group puts up over 100 posters on Princess Street Friday night.	\N	t	f	Activism, Kony 2012, Uganda	f	2012-04-21 16:30:00-04	p	t	t
7754	Radio station's separation finalized 	Memorandum of Understanding signed by AMS and license holder	radio-stations-separation-finalized	1	\N	\N	Queens campus radio station, CFRC is looking to raise its student fee after beginning its gradual separation from the AMS yesterday.\r\n\r\nIf the $4.93 AMS student fee doesnt increase the station will go bankrupt, CFRC Operations Officer Kristiana Clemens said.\r\n\r\nThe only reason the station has existed this long is because the AMS has subsidized the deficit and made up for the shortfalls in that deficit, Clemens said.\r\n\r\nShe added that she expected the AMS to provide more financial support during its two-year transition from an AMS media service to a financially autonomous organization.  By May 2014, the service will no longer be under AMS control.\r\n\r\nA Memorandum of Understanding (MOU) between CFRC and the AMS was passed on April 25 by members of the stations license holder, Radio Queens University (RQU).\r\n\r\nThe MOU, which outlines the stations transition, passed unanimously with three abstentions.\r\n\r\nCFRC is budgeted to incur a $10,000 deficit this year, covered by the AMS.\r\n\r\nUnder the MOU, the AMS will provide CFRC with a $10,000 grant in 2013-14 and a $5,000 grant the following year. These grants are meant to help stabilize the stations deficit.\r\n\r\nClemens said these grants are less than the station received in previous transition periods.\r\n\r\nThe MOU states that a 2006 transfer agreement gave operational management of CFRC to the AMS from Queens.\r\n\r\nThe University paid the AMS an estimated $94,000 in grants during the transition, Clemens said. What the AMS is offering in terms of transition support will only be adequate if we increase our student fee.\r\n\r\nAs a result of the MOU, CFRC will no longer receive the mandatory AMS student fee in 2013. Instead, the fee which brings in 40 per cent of the stations revenue will be subject to triennial review.  \r\n\r\nWeve already maximized all other sources of revenue for the station, Clemens said. Without that extra money we hope to get by increasing our student fee, the station wont be able to continue to function.\r\n\r\nDiscussions for an MOU began in late March after the AMS Board of Directors proposed a management restructure for the station in October. The proposed plan was later found to be in violation of a Canadian Radio-television Communication (CRTC) legislation that required all campus community radio stations to be financially and managerially autonomous.\r\n\r\nDan Szczepanek, the 2011-12 AMS media services director, said the AMS plans to provide less grant money to the station than it was provided in 2003 due to its improved financial state.\r\n\r\nRight now, the service brings in about $75,000 a year compared to an average of $25,000 in 2003, Szczepanek, ArtSci 11 said. The MOU is to ensure that the AMS isnt leaving the station out in the cold during its transition.\r\n	Queens campus radio station, CFRC is looking to raise its student fee after beginning its gradual separation from the AMS yesterday.	\N	t	f	CFRC, AMS, CRTC	f	2012-05-02 21:40:35-04	p	t	t
7756	Majority of Council vote in favour of 2013 fall Homecoming	Principal Woolf says restoration is contingent on students' behaviour this fall	majority-council-vote-favour-2013-fall-homecoming	1	\N	\N	Queens is one step closer to having a fall Homecoming after a motion recommending the event be restored passed at University Council on Saturday.\r\n\r\nApproximately 130 Council members voted in favour of the motion to re-establish the event in 2013. Three opposed and seven abstained.\r\n\r\nAs a result of the motion passing, Principal Daniel Woolf said a comprehensive plan will be undertaken to look at bringing the celebration back to campus for 2013. Rebranding the event might be necessary, he added.\r\n\r\nIt may or may not be called Homecoming, he said. Its very clear that students and alumni want a fall reunion back of some sort. Weve already had the rector consulting with the AMS and Ill take his advice with regards to student consultation.\r\n\r\nOn May 2, the University announced Woolfs intention to create a dialogue between student leaders, city representatives and other members of the Queens community about remodeling alumni reunions.\r\n\r\nDespite the motion passing at University Council, Woolf said the decision to bring Homecoming back ultimately depends on students behaviour this upcoming fall.\r\n\r\nWe want to avoid the reputation of trouble that we had in 2005 and 2008, he said.\r\n\r\nDuring <a href="http://queensjournal.ca/story/2005-09-27/news/not-tradition/">Homecoming 2005</a>, over 5,000 partygoers were reported on Aberdeen Street, with a crowd later overturning a car and setting it on fire. By <a href="http://queensjournal.ca/story/2008-09-30/news/university-city-fall-short-homecoming-goals/">2008</a>, crowds of Homecoming revelers had spilled out of Aberdeen and into the neighbouring streets of Victoria, Johnson and University Avenue.\r\n\r\nObviously the thing that worries everyone is that sooner or later the unsafe circumstances of Aberdeen street parties will lead to a fatality, Woolf said.\r\n\r\nDespite this, he said he realizes how important bringing back Homecoming a year early is for increasing alumni networking and support.\r\n\r\nLets face it, alumni want to talk to current students and go to football games  so having a celebration in the fall, near the beginning of the year is very special.\r\n\r\nThe motion was brought forth by councillors Michael McNair, ArtSci 03, and Michael Kealy, Sci 98 and Law '01.\r\n\r\nIn 2008, Homecoming was suspended for two years. In fall 2010, Woolf announced that Homecoming would be suspended for an additional three years, until 2014.\r\n\r\nWhen asked about the return of Homecoming at past University Council meetings, Woolf stated that the Aberdeen street party must subside before hed consider bringing the event back.\r\n\r\nMcNair and former Rector Kealy said they thought Woolf's decision to extend the suspension of Homecoming negatively affected the Queens community and its alumni relations.\r\n\r\nEvery single year Queens doesnt have a Homecoming, you lose a five, a 10, a 15-year [class] reunion, Kealy said. That is the reason why we as concerned councillors have brought this motion forth.\r\n\r\n	Queens is one step closer to having a fall Homecoming after a motion recommending the event be restored passed at University Council on Saturday.\r\n	\N	t	f	Homecoming, University Council, Principal Woolf	f	2012-05-07 21:41:34-04	p	t	t
7755	Councillors want Homecoming back	A motion being brought to University Council tomorrow seeks to restore fall Homecoming by 2013	councillors-want-homecoming-back	1	\N	\N	Homecoming isnt scheduled to return until 2014, but two University councillors want to bring it back sooner.\r\n\r\nMichael McNair, ArtSci 03, and former Rector Michael Kealy, will present a motion to the University Council tomorrow to restore Homecoming by fall 2013.\r\n\r\nUniversity Council is one of three governing bodies of the University and the highest advisory body at Queens.\r\n\r\nIf the motion passes this weekend, University Council will recommend to Queens that they reinstate fall Homecoming by 2013. Queens must then inform the university community within six months of deciding to do so.  \r\n\r\nFall 2008 was the last time Homecoming was held. The two councillors have also created a Facebook group for supporters of their motion. At the time of this update, the group had over 3,200 members.\r\n\r\nWe have a new group of students whove never experienced Homecoming, so its a clean slate, McNair said.18 months is enough time to make it work ... the decision just keeps being deferred with no reason as to why its being deferred or what needs to be done to bring it back.\r\n\r\nFollowing Homecoming 2008, the administration announced at a press conference that the event would be cancelled for at least two years because of safety concerns the Aberdeen street party raised.\r\n\r\nIn Nov. 2010, Principal Daniel Woolf declared that Homecoming would be suspended for another three years, with a projected return in 2014.\r\n\r\nAt the time, Woolf said the Aberdeen street party was still too much of a safety and security concern to think about reinstating Homecoming.\r\n\r\nThe numbers have gone down but theyre not, in my judgment, where they need to be in order to restore Homecoming, Woolf  <a href="http://queensjournal.ca/story/2010-11-26/news/homecoming-hold/">told the <em>Journal</em></a> in Nov. 2010 Were we to put Homecoming back now, I think the inevitable consequence would be the numbers would spike up again.\r\n\r\nMichael Kealy said without a proper Homecoming, alumni are losing their connection to Queens. For them, Homecoming is more than just a party, he said.\r\n\r\nAs an alumnus sitting on University Council, Kealy said hes asked about Homecoming constantly by other alumni.\r\n\r\nI know [from] speaking with alumni that they felt that cancelation was too drastic, Kealy, Sci 98 and Law '01 said.\r\n\r\nKealy said he thinks the University Council meeting, which occurs every year in May, is the perfect platform for alumni to raise their concerns or questions about the University.\r\n\r\nAlthough he has brought up the question of when Homecoming will return at Council meetings in the past, he said the administration hasnt been committed to bringing it back.\r\n\r\nA commitment is what the motion is seeking  that there will be a plan to restore [Homecoming], he said.  \r\n\r\nOn Wednesday, Principal Woolf said in a Queens News Centre release that he understands that alumni value fall Homecoming.\r\n\r\nI also know that the Queens community shares my concerns regarding the safety of our students, alumni, and City residents, and also concerns about the reputation of Queens and the City, Woolf said in the release.\r\n\r\n<strong>See queensjournal.ca next week for an update on the motion to bring back Homecoming in 2013.</strong>	Homecoming isnt scheduled to return until 2014, but two University councillors want to bring it back sooner.	\N	t	f	Homecoming, University Council 	f	2012-05-04 13:58:37-04	p	t	t
7757	A futuristic playground	Human Media Lab unveils new workspace in Jackson Hall	futuristic-playground	16	325	\N	Queens is now home to the first-ever boutique laboratory, featuring innovations such as a videoconferencing pod and paper-thin phones.\r\n\r\nThe $1 million futuristic project was designed for Roel Vertegaal and his team of 12 to 14 computing and engineering graduate research students.   \r\n\r\nThe lab is hosted on the third floor of Jackson Hall and was unveiled to the public on May 12. Its use of visually stimulating patterns, shapes and colours combined with cutting-edge technology are meant to provide an interactive workspace for its students.\r\n\r\nThe Human Media Lab is one of several ubiquitous computing labs in Canada. Although they each possess different qualities, ubiquitous computing labs aim to integrate technology into everyday objects.\r\n\r\nVertegaal, director of the Human Media Lab and his team believe their technology will be viable in 10 to 20 years.  Goodwin Hall was the original home of the Human Media Lab, but despite its functional capacities it lacked inspiration, said Vertegaal.  \r\n\r\nWe dont like to think of our technology as 'devices.' They should be as organic and natural as if it were integrated seamlessly into our lives, he said.\r\n\r\nAfter securing the funding for the program from the Canada Foundation for Innovation and the Ontario Ministry of Research and Innovation, Vertegaal and Queens School of Computing Director, Selim Akl, set out on planning and securing construction rights.  \r\n\r\nFollowing the three-year blueprint process, Vertegaal said partnering with award-winning designer Karim Rashid was the obvious choice.\r\n\r\nThe lab offers an open space available for group work as well as individual work areas. Students may opt to work privately in their own focus pod, each of which is divided by opaque glass.\r\n\r\nNoise-cancelling headsets remove visual and auditory distractions in the pod. When students wish to communicate with one another from adjoining pods, they can do so with ease.\r\n\r\n We used geometric orientation and eye-tracking technology to recognize when students next door to each other are initiating contact. Then the glass panes respond by changing its opacity to become transparent, Vertegaal said.  \r\n\r\nAlex Mihailidis, director of the Intelligent Assistive Technology and Systems Lab at the University of Toronto said their university lab uses a combination of conventional and non-conventional lab environments.\r\n\r\nTheir goal is to create flexible adaptive technology that enables users with disabilities to better carry out physical tasks.\r\n\r\n We have the HomeLab, which is a fully functional house within our hospital so that we can easily configure different scenarios for testing, he said.\r\n\r\nMihailidis said the attractiveness of the Human Media Lab sets it apart from similar technology labs in the country.\r\n\r\nA space such as the Human Media Lab can definitely help to attract top students and trainees, he said.\r\n\r\nHarry Smoak is the founding research coordinator and graduate student for the Topological Media Lab at Concordia University.\r\n\r\nHe said a more finished space wouldnt work for his type of research because of their off-screen, hands-on approach.\r\n\r\nOur space is quite different, more like a cross between a workshop and theatre space with the kind of raw infrastructure where we can hang equipment from the ceiling and drill through the floors, he said.\r\n\r\nSmoak said the Topological Media Lab and the Human Media Lab both received funding from the Canada Foundation for Innovation.\r\n\r\nAlthough [the Canada Foundation for Innovations] projects are consistently geared towards the infrastructure side of research, the outcomes going to look different from project to project.\r\n\r\nLab designer Karim Rashid created the workspace by incorporating visual fluidity with curvilinear shapes. In the lab, right angles are rare, while curvy, cantilevered conference tables and pod-shaped chairs are the norm.\r\n\r\nIts important for a space like this, where people are innovative, to take away those harsh angles and conventional rectangles you see virtually everywhere else, Rashid said.\r\n\r\nFor Rashid, the shapes and lines hes incorporated represent freedom.\r\n\r\nThe designer said he wanted to create a sense of wonder and excitement in the laboratory, inspired by the experiments conducted in the Human Media Lab.\r\n\r\nRashid said he wanted to create a space that would outlive short-term design trends.\r\n\r\nI [tried] to make a space that will always be fresh, always be inspiring many years from now, he said. The key really, is to design with ideas like freedom and stimulation in mind, and not style. \r\n\r\nDavid Holman, PhD 12, is currently studying the use of Organic User Interfaces in the Human Media Lab.\r\n\r\nThe new lab is pretty exciting, he said. This is definitely a great development for the lab and students who might get to take advantage of it in the future. \r\n\r\nHolman is still uncertain as to how likely the lab will be able to concretely promote creativity.\r\n\r\nCreativity is such a difficult thing to grasp and its always brought out by a bunch of things working together, never just a single criteria. I think its going to be exciting to wait and tell. 	Queens is now home to the first-ever boutique laboratory, featuring innovations such as a videoconferencing pod and paper-thin phones.	\N	t	f	Technology, Human Media Lab, Roel Vertegaal	t	2012-05-28 12:52:32-04	p	f	f
7758	Campus Catchup		campus-catchup	1	325	\N	<strong>Computing students in BC reject mandatory gym class </strong>\r\n\r\nComputing students at the British Columbia Institute of Technology have started to rebel against mandatory gym classes they are required to attend.\r\n\r\nThe students are required to participate in one weekly 8:30 a.m. gym class in order to obtain their degree.\r\n\r\nThe mandatory gym classes have existed for several years, but students are only now beginning to voice their concerns with them.\r\n\r\nA petition has been signed by dozens of students and shows a wide opposition to these classes. A curriculum committee will decide on whether to keep the classes.\r\n\r\nComputing students are the only students on campus required to attend the 50-minute, uninstructed gym classes. According to an article in <em>Macleans</em>, many feel they are being unfairly picked on due to stereotypes that surround computing students.\r\n\r\nAssociate Dean of Computer Systems Technology, Brian Pidcock, insisted their intentions were good.\r\n\r\nIts not like we force them to play dodgeball. Its not like high-school P.E, he told <em>Macleans.</em>\r\n\r\n<em> Rosie Hales</em>\r\n\r\n<strong>Concordia to allow students to use chosen name</strong>\r\n\r\nAt Concordia University, transgender students will be able to use their chosen names on everything except their transcripts starting fall 2012.\r\n\r\nAfter two years of campaigning, students were granted the ability to make a written request to have only their chosen name on students IDs, class lists and exams, meaning that they dont have to risk being called by a name they dont identify with.\r\n\r\nThe University of Toronto has a similar policy.\r\n\r\nAt Queens, any requests to change a name must be accompanied by supporting documentation.\r\n\r\nBen Boudreau, a second-year student at Concordia, brought about this change after complaining about having to use his birth name. With help from Concordias 2110 Centre for Gender Advocacy, Boudreau staged a campaign which led to the University creating a working group to come up with the compromise.  \r\n\r\n<em> Rosie Hales</em>\r\n\r\n<strong>Study shows blended models are effective in universities</strong>\r\n\r\nA study by former Princeton University president William G. Bowen suggests blended learning may be more effective than traditional in-lecture learning.\r\n\r\nBlended learning is a combination of online and in-lecture learning.\r\n\r\nBowens study was conducted within six different public universities in the U.S. and involved 605 students. The students were placed in a statistics class that split them up in either a technology based or in-lecture class. The technology-based classes involved minimal lecture time.\r\n\r\nThe study concluded that students who took the technology based class performed just as well on the standardized tests as the other students and were able to learn the course material 25 per cent quicker.\r\n\r\nThe University of Manitoba recently implemented blended learning due to recent budget issues affecting the amount of available professors to teach introductory psychology courses.\r\n\r\nQueens has added blending learning to some of its classes in recent years, including PSYC 100.  \r\n\r\n<em> Rachel Herscovici</em>\r\n\r\n	Catching up on what's making headlines at universities across Canada. 	\N	t	f	Campus Catchup	f	2012-05-28 13:01:56-04	p	f	f
7759	Work begins on arts centre	Concert hall scheduled to be completed by fall 2013	work-begins-arts-centre	1	325	\N	Construction has begun on the Isabel Bader Centre for the Performing Arts, which is set to open its first stage in fall of 2013.\r\n\r\nIt will open in stages, Gordon Smith, associate dean of Arts and Science, said. Smith is the chair of the centres Operations and Planning Committee.\r\n\r\nThe concert hall will open first and we are hoping to have a series of concerts in the fall of 2013. The actual teaching in the facility will not happen until 2014, he said.\r\n\r\nA dozen workers are currently working at the site to break the limestone ground so a crane can move in during the first week of June to start digging the foundations.\r\n\r\nThe construction team for the centre is confident that work will be finished on schedule. The rest of the centre will open in summer 2014.\r\n\r\nIt will be fantastic for Queens students. Were going to have one of the best concert halls in eastern Canada for our music students, a black box theatre for drama students, Smith said, adding that there will also be a film screening room.\r\n\r\nThe facilities are really state of the art, he said.\r\n\r\nThe centre will be the new home of the Film and Media department faculty offices, as well as teaching spaces. The Music, Drama and Fine Arts departments will also use the centre for teaching and performances.\r\n\r\nSmith said the centre will definitely affect enrolment numbers for Arts programs at Queens, but there are currently no plans to increase enrolment in them.\r\n\r\nConstruction of the centre was supposed to begin in spring 2011, but the history and heritage of the site caused the two year delay.\r\n\r\nThe delay was a combination of things. This is a really complicated project because of the site. All of the heritage issues took a long time to work through, Smith said.\r\n\r\nIn 2010, members of the City of Kingstons heritage committee objected to plans to remove the windows and chimney on the Stella Buck Building, which were built in 1923.\r\n\r\nThe planning team ultimately decided to maintain the windows but not the chimney.\r\n\r\nThe Stella Buck building will be incorporated into the centre, forming the west side of the centre and including backstage areas and a film production studio.\r\n\r\nMembers of city council also objected to the shiny metallic siding the planning team originally planned to use, which they said would be a potential distraction to passing motorists. They have since chosen a less shiny siding.\r\n\r\nIt was a mutually agreeable decision, so there was no lingering animosity on those features at all. The city is really pleased with the universitys work on maintaining the heritage features.\r\n\r\nSmith said he hopes the centre will boost tourism in the area.\r\n\r\nWeve got some really exciting plans for festivals and other functions happening within the Bader Centre, Smith said\r\n\r\n<em> With files from Katherine Fernandez-Blance</em>	Construction has begun on the Isabel Bader Centre for the Performing Arts, which is set to open its first stage in fall of 2013.	\N	t	f	Isabel Bader Centre 	f	2012-05-28 13:47:57-04	p	f	f
7770	Kingston FC makes franchise debut	Local team hopes to establish ties across the Eastern Ontario region	kingston-fc-makes-franchise-debut	7	325	\N	The Queens Gaels soccer team no longer plays at the highest level in Kingston. That title now lies with Kingston Football Club (Kingston FC), which competes in the Canadian Soccer League (CSL) against teams from across Ontario, as well as Montreal.\r\n\r\nManagement operates out of the nations capital, and the team practices there.\r\n\r\nI understand its not ideal for the Kingston community or for me, said former Gaels midfielder Jordan Brooks, whos currently completing his masters in biology at Queens and training with the team year-round. I know it makes sense from a team and management perspective. Im fine with it.\r\n\r\nIts abnormal for any pro soccer team to practice two hours away from its home stadium, but Kingston FC is different.\r\n\r\nClub president and head coach Jimmy Hamrouni coached Ottawas Prospect FC from 2010 to 2011. Both Prospect FC and Ottawas Capital City FC, a first-division CSL team, folded in 2011. \r\n\r\nWithout an Ottawa team, Kingston was the next-best market  in Eastern Ontario. The construction of the Invista Centres artificial turf field coincided with Kingston FCs arrival.\r\n\r\nMany players from Ottawas former teams lined up for Kingston FC, which fields a team in both CSL divisions.\r\n\r\nThe club operates out of Ottawa under Hamrouni, due to his previous experience in the league. Nearly all of the clubs players are from the Ottawa-Gatineau region. Only a small handful  led by Brooks  are not.\r\n\r\nAfter completing his fifth season as a Gael, Brooks signed a pro contract with Kingston FC two weeks ago.\r\n\r\nAt the moment Im the only [Kingston native] on this team, but I think in the next few weeks that could easily change, Brooks said.\r\n\r\nTwo players from Gananoque and two from Belleville are currently on the reserve team. With Brooks, they travel a long distance for practices  costs which are covered by the club.\r\n\r\nWhile the club may attract more players from across Eastern Ontario, the supporters will largely hail from Kingston. There were 700 fans at the home opener to witness a 4-2 loss to Toronto FCs Academy. The following Saturday, 500 fans watched the team earn their first point in a 1-1 tie with the York Region Shooters.\r\n\r\nThe level of play is the third highest in Canada, behind the NASL and MLS, so this teams still just improving, Brooks said, adding the quality of play between the OUA and CSL is difficult to compare because its a different style of soccer.\r\n\r\n[The OUA]s not a technical league  its a physical, athletic one, not often pretty to watch, he said.\r\n\r\nChairman of the club Lorne Abugov said the team has long-term plans in place.\r\n\r\nWere looking to build this into more of a regional team, and affiliate ourselves with local clubs from all over, Abugov said. Across the region were building an informal soccer bridge.\r\n\r\nAbugov said expanding the region means there will be a greater quantity of higher-caliber players.\r\n\r\nIts our objective absolutely to find as many players from the area as we can, Abugov said.\r\n\r\nOften referred to as a hockey city, Kingstons soccer fans have thus far filled the bleachers at the Invista Centre.\r\n\r\nAbugov said the team has performed well for these crowds, but there is still much work to be done.\r\n\r\nKingston FC lost its third game 5-0 at home to the Windsor Stars and remains winless.\r\n\r\nRome wasnt built in a day, so you know it takes time.	The Queens Gaels soccer team no longer plays at the highest level in Kingston. That title now lies with Kingston FC, which competes in the Canadian Soccer League against teams from across Ontario, as well as Montreal.\r\n	\N	t	f	Soccer, Kingston FC	t	2012-05-28 15:44:49-04	p	t	t
7765	Senate approves first-year residence in JDUC	Grad student spaces will be relocated to Confederation Place Hotel to make room for 98 undergraduate students	senate-approves-first-year-residence-jduc	1	325	\N	As a result of increased undergraduate enrollment, 98 first-year students will move into the JDUC in September after plans to turn the buildings graduate spaces into undergraduate rooms were approved.\r\n\r\nIn April Senate recognized the two per cent increase in applications to Queens for September 2012. This information called for an increase in enrollment resulting in the recommendation to add 146 new undergraduate residence spaces.\r\n\r\nThe residence spaces in the John Deutsch University Centre (JDUC) are comprised mainly of single rooms.\r\n\r\nBruce Griffiths, director of Queens housing and hospitality services, said the decision was necessary to combat growing numbers of students.\r\n\r\nThere was the desire to have increased enrollment but we guarantee all first-year students residence, Griffiths said, adding that until the motion passed, the University was unsure if increased enrollment would be possible.\r\n\r\nThe remainder of the 146 new spaces will be in Waldron Tower, where 48 additional spaces have been created following an expansion project that began in March.\r\n\r\nThe spaces that were in the JDUC for graduate students are being moved to the Confederation Place Hotel. The hotel approached the University with the idea of housing students.\r\n\r\nThe hotel reached out to us some months ago. They were looking for a different business model, Griffiths said.\r\n\r\nThe Confederation Place Hotel previously offered overnight accommodations to grad students for several months at a time.  This arrangement was especially useful to students who needed to be in Kingston for a shorter time period than most leases allow, like four or five months, Griffiths said.  \r\n\r\nClaire Wenngren, MA 11 lived in the JDUC from Sept. 2009 to April 2011.\r\n\r\nAs far as convenience goes, the JDUC cant be beat, especially for people like me who want to use the athletic facilities without schlepping a lot of clothing and gear through the city, she told the <em>Journal </em>via email.Undergrads could probably also profit from living at the JDUC and being so close to these numerous facilities.\r\n\r\nWenngren said there were also disadvantages to living in the JDUC, including little ventilation in the rooms and the proximity to campus pubs.\r\n\r\nWhere I lived, it was generally quiet, but I know people who lived above the Queens Pub [and] complained about the smell.\r\n\r\n<em> With files from Holly Tousignant</em>\r\n\r\n	As a result of increased undergraduate enrollment, 98 first-year students will move into the JDUC in September after plans to turn the buildings graduate spaces into undergraduate rooms were approved.\r\n	\N	t	f	Residence, enrollment, JDUC	t	2012-05-28 14:51:04-04	p	t	t
7760	Possible fall 2013 reunion in the works 	University leaders will discuss remodelling alumni reunions, Woolf says 	possible-fall-2013-reunion-works	1	325	\N	Conversations about Homecomings future are in the works after University Council voted to recommend Principal Daniel Woolf reinstate the event next year.\r\n\r\nThe motion called for Woolf to restore Homecoming for fall 2013, rather than in 2014 as initially planned. The motion passed at University Council on May 5 with approximately 130 council members in favour, three against and seven abstentions.\r\n\r\nWith the return of the annual reunion in sight, students and Kingstonians have voiced differing views on how the University should handle the event.\r\n\r\nOn May 2, the University announced Woolfs intention to create a dialogue between student leaders, city representatives and other members of the Queens community about remodeling alumni reunions.\r\n\r\nWeve actually been working on this for some time, Woolf told the <em>Journal</em> earlier this month. Consultation has taken place at a preliminary level with [students] and weve touched base with the city.\r\n\r\nHe added that Homecoming could be rebranded if its to return in 2013. Woolf declined to comment on the details of the remodeling.\r\n\r\nUltimately this is not a University decision, he said. The decision rests with me as it did four years ago when the original decision was made and I would prefer some discretion on the subject.\r\n\r\nRector Nick Francis said discussions on developing a plan for a safe and fun fall reunion began in March at Presidents Caucus, which is comprised of the president of each faculty society.\r\n\r\nThese discussions were really just a sounding board for ideas, Francis, ArtSci13 said. I opened it up and asked them what they think needs to be addressed and how they think they should solve the issue of a massive street party that goes off the wire.\r\n\r\nFollowing Homecoming 2008, the event was cancelled for two years by then-Principal Tom Williams. In 2010, Woolf extended the cancellation for an additional three years until 2014.\r\n\r\nAccording to Francis, the faculty society presidents were wary of the Aberdeen street party returning if Homecoming were restored.\r\n\r\n[They] talked about how its not good for anybody, its not safe, specifically an unsupervised massive street party, he said.\r\n\r\nHe said the plan to reinstate a fall reunion is being taken seriously because of the strong alumni support for its return.\r\n\r\nThe whole tradition needs to be revitalized, he said. There are compromises that have to be made. In order to safely restore and revitalize it were going to have to do it differently.\r\n\r\nSave Our Neighbourhood Action Group (SONAG) creator Don Rogers said he thinks there needs to be stronger policing at the event in order to make it safe for students and alumni. SONAG is comprised of Kingston residents who are fed up with the unacceptable behaviour of many Queens students, according to their website.\r\n\r\nA large part of the responsibility lies with the police, Rogers said. If they are more consistent [than] they had been in past years by issuing tickets theyd be able to control the minority that push the limits\r\n\r\nRogers has lived in his Sydenham District home since 1979. He said Homecoming celebrations in the 1990s were calmer than it was in the 2000s, due to what he sees as greater control and organization.\r\n\r\nTo be able to get back to having a safe Homecoming we need to explore ways to control that small minority that causes these problems, he said.\r\n\r\nKingston Mayor Mark Gerretsen said hes spoken with Principal Woolf about making Homecoming a safer event in the future.\r\n\r\nWhat needs to happen is that the city and the police have to work collaboratively with the University so that we can minimize the impact that the Aberdeen situation has with the taxpayers.\r\n\r\nHe added that along with Queens alumni relations, the city of Kingston has suffered economically since Homecoming was banned in 2008.\r\n\r\nIts affected tourism into the city and with that comes effects on hotels, restaurants, businesses in the downtown area and the spin-off effects that all those have, he said. However, at the same time, weve benefited because we dont have to spend upward [of] $400,000 or $500,000 on having to police the event.\r\n\r\n	Conversations about Homecomings future are in the works after University Council voted to recommend Principal Daniel Woolf reinstate the event next year.	\N	t	f	Homecoming, Principal Woolf, Mark Gerretsen, SONAG	f	2012-05-28 13:51:48-04	p	f	f
7762	Students accuse public agency of misconduct	Queen's researchers allege agency published report they authored with unauthorized changes	students-accuse-public-agency-misconduct	1	325	\N	An Ontario government agency was accused of academic misconduct last month after two Queens graduate students claimed a report they authored appeared on the agencys website containing changes they hadnt agreed to.\r\n\r\nJennifer Massey and Sean Field filed a complaint with the Higher Education Quality Council of Ontario (HEQCO), the body that commissioned Queens to produce a report on the effectiveness of supplemental instruction, an academic support model that uses peer-assisted study meetings to improve learning.\r\n\r\nThe University hired former Queens PhD candidate Jennifer Massey as lead investigator on a $44,633 contract.  Fellow geography PhD student Sean Field and former MA candidate Jeff Burrow were brought on to assist Massey.\r\n\r\nHEQCO, an agency of the Ontario government, conducts and commissions research on issues relating to post-secondary education in the province.\r\n\r\nOn April 27, the Ontario Confederation of University Faculty Associations (OCUFA), a group that represents faculty and academic librarians across the province, released a statement on their website condemning HEQCOs actions. While not illegal, HEQCOs actions were unethical, the statement reads.\r\n\r\nQueens Senators Jordan Morelli, Terry Bridges and Mark Jones submitted three separate motions to Senate regarding the conflict. The motions called for Senate to endorse OCUFAs statements about the incident, among other things.  The Agenda Committee rejected the proposals to include the motions on the Senate agenda for May 22.\r\n\r\nAccording to the Queens Senate Faculty Caucus blog, the committee rejected the motions because they believed OCUFAs statements were not factually correct. \r\n\r\nMassey and Fields letters to HEQCO president Harvey Weingarten, which are available to view on the Canadian Federation of Students (CFS) website, outline their concerns with the published report. CFS aims to provide a voice to students and represent their interests to federal and provincial governments.\r\n\r\nIn their letters, they claim a section of their report, which was critical of supplemental instruction, was removed from the final report, and that text was added that was in opposition to their conclusions.\r\n\r\nThe authors had previously refused to add suggested changes which were later included in the final report. Both the original and the altered reports are available on OCUFAs website.\r\n\r\nThey also took issue with the published reports disclaimer, which stated that the report solely reflected that of its authors.\r\n\r\nWe realized that what was posted was different than what we had submitted, Field said.  \r\n\r\nMassey and Field requested the report be removed from the HEQCOs website and replaced with their original submission. They also requested an apology from HEQCO.\r\n\r\nThe report was due to HEQCO in June 2010 Jennifer Massey submitted the report in December of that year. Jennifer Massey sent a report to HEQCO in June 2011. The report had already been through several rounds of edits at that point.\r\n\r\nWeingarten said HEQCO made revisions to the report after failing to hear back from Massey.\r\n\r\nWe felt the June 2011 report needed some edits and needed some changes, he said.  By September we had not heard back from [Massey] and our attempts to deal with the principal investigator, well, we couldnt deal with her because she went AWOL. \r\n\r\nWeingarten said HEQCO then approached Queens Vice-Provost and Dean of Student Affairs Ann Tierney with two options: either Queens abandon the project and not receive their final payment of $22,500 or have other staff at Queens finish the report.\r\n\r\nThe University chose the second option, and Chris Conway, director of the Office of Institutional Research and Planning, submitted a final report in Dec. 2011.\r\n\r\nOCUFA president and Queens librarian Constance Adamson said she thinks Queens didnt protect the academic freedom of their researchers.\r\n\r\nThey probably should have done more to ensure that they understood what the terms of the contract meant, she said.\r\n\r\nAdamson said OCUFA has called for Queens to do an investigation and for the Government of Ontario to look at HEQCOs research practices. No such investigation has yet been announced.\r\n\r\nProvost Alan Harrison said he thinks it's unfortunate OCUFA didnt inform Queens what they were going to post online before they posted it.\r\n\r\nHad they done so, we would have pointed out some substantial factual inaccuracies, he said. One of those factual inaccuracies was characterizing Jennifer Massey as someone who was doing this work as a grad student, when in fact she was doing it as an employee of the University. \r\n\r\nHarrison declined to comment on Massey and Fields request for an apology from HEQCO.\r\n\r\nIts not anything to do with us, Harrison said. What they do or dont do is entirely up to HEQCO. 	An Ontario government agency was accused of academic misconduct last month after two Queens graduate students claimed a report they authored appeared on the agencys website containing changes they hadnt agreed to.	\N	t	f	Research, graduate students, misconduct 	f	2012-05-28 14:15:42-04	p	f	f
7763	News in Brief		news-brief	1	325	\N	<strong>Principal releases vision document</strong>\r\n\r\nOn May 11, Principal Daniel Woolf released a document <a href="http://www.queensu.ca/principal/speech/thirdjuncture/ThirdJuncture.pdf">detailing</a> his vision for the University over the next decade.\r\n\r\nThe <em>Third Juncture </em>is a sequel to Woolfs 2010 vision document <em>Whats Next </em>which also addressed the direction Queens is heading in the coming years.\r\n\r\nIn The <em>Third Juncture</em>, Woolf identified the present time as a pivotal period in the Universitys life.\r\n\r\nHe also discussed his vision of Queens in 2022, which includes less government funding and the development of other streams of revenue, with  a rise in international student enrolment and focus on international reputation.\r\n\r\nWoolfs vision of internationalization includes increased language and culture training. He also sees Queens becoming a leader in academic and non-academic support for at-risk students, such as those with mental illness or disabilities.\r\n\r\nIn the document, Woolf said he wants to see the division between main and West Campus erased as well as create new student residences and provide new forms of transportation like electric busses or trams to carry students between different areas of campus.\r\n\r\nFewer lecture hours and an increase in blended models of learning are also in Queens future, according to the document.\r\n\r\n<em> Holly Tousignant</em>\r\n\r\n<strong>SMART awarded contract with the City</strong>\r\n\r\n A newly created AMS team has been chosen by the City of Kingston as a property standards bylaw contractor.\r\n\r\nThe Student Maintenance and Resource Team (SMART), run out of the Municipal Affairs Commission will contract students to clean properties in the student housing area that dont meet city bylaw standards.\r\n\r\nThe city released a request for proposals (RFP) for contractors to cover property standards bylaws in the student neighborhood for a two-year term.\r\n\r\nSMART responded to the RFP, and the city chose them.\r\n\r\nThe city will direct SMART to clean properties when tenants have failed to respond appropriately to bylaw orders themselves.\r\n\r\nFees for the contracts will vary depending on the work performed.\r\n\r\nSMART students will also provide free clean-up and beautification services to students living near campus, as well as contract work for landlords.\r\n\r\n<em> Holly Tousignant</em>\r\n\r\n<strong>Charging station coming to Kingston</strong>\r\n\r\nKingston will soon have its first privately owned electric vehicle (EV) charging station, free of charge.\r\n\r\nThe Ambassador Conference Resort, located on 1550 Princess Street, has partnered up with Sun Country Highway, a company that creates electric-vehicle infrastructure, to set up the station.  It will be completely accessible to the public.\r\n\r\nAn EV charging station supplies electric energy to hybrid and battery electric cars. While electric cars can be charged through a regular wall socket, charging stations have use special sensors to disconnect power when the vehicle is fully charged and allow for multiple users to charge at once.\r\n\r\nThese stations have been growing in popularity internationally and in Canada in recent years, with Sun Country Highway being one of the only companies to set up these stations nationally.\r\n\r\nThis will be the only Electric Vehicle station in a 400 km radius of Kingston.\r\n\r\nIn light of this recent announcement, the City of Kingston is now also looking installing public charging stations in the coming year.\r\n\r\nEarlier this month, the City of Kingston passed a motion in city council to explore adding more stations in town.\r\n\r\n<em>- Joanna Plucinska</em>\r\n\r\n<strong>Bird droppings reveal effect of insecticide</strong>\r\n\r\nBird droppings collected in an unused chimney on campus have provided clues about the declining population of the North American chimney swift, a small bird, according to Canadian researchers.\r\n\r\nThe six-feet-deep collection of excrement represents 50 years of bird droppings. The chimney was covered with mesh in 1993 to relocate the 4,000 chimney swifts that lived there at the time.\r\n\r\nBy studying the droppings in the chimney of Fleming Hall, the researchers were able to discover a link between the use of the insecticide DDT and the decline of the insect-eating birds. \r\n\r\nThe research shows that the height of DDT use coincided with the swifts eating fewer DDT-susceptible beetles, and more lower-quality bugs.\r\n\r\nThe findings were published in the biological journal Proceedings of the Royal Society B.\r\n\r\n<em> Holly Tousignant</em>\r\n\r\n	News in brief. 	\N	t	f	News in brief. 	f	2012-05-28 14:43:04-04	p	f	f
7764	Dropboxes removed 		dropboxes-removed	1	325	\N	Civil engineering assignment drop boxes have been removed after a group of students in the Civil Engineering department were caught copying classmates assignments last semester.\r\n\r\nDr. Novakowski, head of the Civil Engineering department, said the incident involved students stealing other students assignments out of an assignment drop -box and copying answers.\r\n\r\nHe said the incident involved a fourth-year technical elective class, but declined to comment on further details.\r\n\r\nId really prefer to not state what happened other than that it was a breach of academic integrity involving those assignment drop boxes and as a result those drop boxes will be removed, he said.\r\n\r\nThe matter was dealt with according to academic policy. \r\n\r\nAccording to the Faculty of Engineering and Applied Science, punishment for academic integrity ranges from an oral or written warning to loss of percentage or total grade of the assignment or overall course.\r\n\r\nAccording to civil engineering student Alexandra Benko, Sci 13, a similar incident happened in a third-year engineering course she took last year. \r\n\r\nA student was caught cheating, and was unable to receive above a 55 per cent in the course. The professor announced the incident then held a talk about academic integrity in her class, she said.\r\n\r\nCheating like this usually happens once a year, she said. Usually a person gets caught, they basically fail the course, and everyone is scared out of it for the rest of the semester.\r\n	Civil engineering assignment drop boxes have been removed after a group of students in the Civil Engineering department were caught copying classmates assignments last semester.\r\n	\N	t	f	Academic dishonesty, Engineering, cheating 	f	2012-05-28 14:48:59-04	p	f	f
7772	Students deserve a genuine Homecoming		students-deserve-unaltered-return	13	325	\N	The University Councils recent decision to recommend the restoration of Homecoming is long overdue. It indicates an important shift in the Universitys treatment of its students.\r\n\r\nWoolfs decision to extend Homecomings cancellation until 2014 in 2010 set a patronizing tone, sending a message to students that they werent to be trusted. Instead of trying to negotiate with students and community members off the bat, the University acted like a parent punishing a naughty child by indefinitely lengthening the postponement without engaging in any sort of negotiation.\r\n\r\nIt now rests in the hands of senior administrators and Principal Woolf to give the final go-ahead and decide on what the new Homecoming might look like or whether it will return at all.\r\n\r\nThe Councils vote is a teaser to students who expect a return of the original Homecoming, but may instead get a rebranded, reworked and ultimately lacklustre version.\r\n\r\nRenaming the event Fall Reunion is unlikely to change the way its seen by alumni. But, if the universitys senior administrators take stronger measures to mitigate the street party and the revelry surrounding the event, they may risk altogether eliminating the essence of Homecoming that is so well-loved and missed by students and alumni.\r\n\r\nThe administration needs to trust that students and alumni alike will realize the consequences of their actions and behave in an appropriate fashion during future homecomings.\r\n\r\nStudents shouldnt have to be babied with a watered-down version of Homecoming  they deserve to have the most missed parts of the celebration such as the football game, the parade and the festivities surrounding the event restored.\r\n\r\nAlternatives to the street party, such as sanctioned events at Alfies, have the potential to be successful if marked appropriately. The University can also adopt previously used measures such as establishing safe drinking tents with volunteers on hand giving out water and red cups to prevent broken bottles to maintain a safe environment.\r\n\r\nIn deciding whether to follow the Councils recommendation, and potentially reinstitute Homecoming, senior administrators should be mindful of what Homecoming means to students and alumni.\r\n\r\nWell now encounter the first graduating class that has yet to experience a true homecoming. Weve already endured a five-year wait  lets make sure that the return of Homecoming means that the most important and beloved parts of the event arent forgotten.\r\n\r\n<em> Journal Editorial Board</em>	The University Councils recent decision to recommend the restoration of Homecoming is long overdue. It indicates an important shift in the Universitys treatment of its students.	\N	t	f	Homecoming 	t	2012-05-28 16:26:51-04	p	f	f
7782	Love from far away	Long-distance couples focus on communication	love-far-away	5	325	\N	There are few things as sweet as the airport reunion. With couples reuniting everywhere, one must remember that the long-distance relationship was around long before the first airplane was constructed.\r\n\r\nWhen Romantic era poet John Keats died of tuberculosis in 1821, he was over 1000 miles away from his lover and fiance Fanny Brawne. Forced apart for most of their relationship, the couple corresponded by letter.\r\n\r\nIn more recent times, soldiers stationed overseas use modern technology, like email or Skype, to stay in touch with their other halves.\r\n\r\nWith the onset of the summer months, Queens students will also forcibly succumb to months apart from their significant others.\r\n\r\nFor Hannah May and Aidan Payne, this past year may have been the last time they shared an area code.\r\n\r\nWhen the couple began dating in early 2011, it hadnt yet occurred to them that, the following summer, they might be trying a long distance relationship.\r\n\r\nYou have those love goggles where you dont see anything wrong [and] dont see that anything could [go] wrong, Payne, ArtSci 12, said. And then at some point Hannah turned to me in the car and said we need to talk about us not seeing each other for months on end.\r\n\r\nIt wasnt the last time the two would try long distance. Following Paynes graduation this past April, he will be moving back to Boston, MA indefinitely.\r\n\r\nMay said Paynes absence this year will bring changes to her day-to-day life.\r\n\r\nFor the past year and a half, hes been a major part of my life here at Queens, she said. Its going to be weird and definitely an adjustment to not have him there at school with me, and not nearby  Im just going to miss him.\r\n\r\nThe couple doesnt plan to break up anytime soon.\r\n\r\nHes the best boyfriend, May said. Hes so thoughtful  the craziest, the funniest. Im never bored.\r\n\r\nAlthough May, ArtSci 13 is remaining in Kingston come September, the couple doesnt yet know if their separation will be permanent.\r\n\r\nWeve talked about it, Payne said. Im working in the film industry and so I can go between the two, but Im not a citizen of Canada yet.\r\n\r\nWhile May is considering moving to the States in the future, she must endure the year without her boyfriend.\r\n\r\nI cant just up and move, she said. Obviously if I could, I would.\r\n\r\nPayne said he plans to visit Canada as much as possible in the coming year.\r\n\r\nIve been trying to get film shoots in the Toronto area so that I can come up here on business-related reasons and then hop over to Kingston on my way back home, he said. That way I could see her for a bit and not lose money in the process.\r\n\r\nTo compensate for time spent apart during the summer and school year, Payne and May said they will meet in New York City.\r\n\r\nFor most of the year, however, over 850 km will separate the couple. They plan to call and Skype as often as possible.\r\n\r\nSometimes the timing doesnt work out in the day, May said. But sometimes a short phone call or Skype call goes a long way.\r\n\r\nWe are getting an international texting plan, Payne added.\r\n\r\nThats romantic, May said. Thats like new media love.\r\n\r\nThe couple agree that the long distance effort will be worth it in the end.\r\n\r\nTheres no one quite like Hannah, Payne said. Ill go through whatever we need to go through in order to have her at the other side.\r\n\r\nTo help their love thrive, long  distance couples can take an extra step and try alternative forms of communication.\r\n\r\nEnglish professor Mark Jones said love letters are an old-fashioned but effective way of keeping the intimacy alive.\r\n\r\nWhen Keats was kept in isolation because of his illness, he and Brawne would exchange brief, undated letters from different sides of the duplex house where they lived. According to Jones, this was their version of todays modern forms of communication.\r\n\r\nThe same dynamics are going to apply, no matter what medium youve got, he said. Youre still going to have some form of communication that is  abridging distance.\r\n\r\nWhile love letters stand as a reminder of the distance between a couple, Jones said they also help bring them closer together.\r\n\r\nTheres incredible intimacy  maybe some things you cant tell someone face to face, he said.\r\n\r\nWhile letter-writing is effective in long-distance relationships, Jane Sherwood, a Kingston-based couples counsellor, said that prolonged time apart can bring on an unnaturally long honeymoon phase.\r\n\r\nShe said couples who spend the majority of their time apart risk remaining in this stage longer than normal.\r\n\r\n You never have to go through the drudgery of everyday life, like dividing household chores and paying bills, she said. They may always have a great time when theyre together and they visit and then they go home to face all those issues on their own.\r\n\r\nThe problem here, according to Sherwood, is that these couples may move too quickly into high-commitment situations like marriage.\r\n\r\nSo the problem is  jumping too far ahead in the relationship too quickly because everythings so rosy, she said.\r\n\r\nTake some time to maybe live together or do some counseling together to discover where youre at in terms of compatibility.\r\n\r\nCouples who are aware of an impending long-distance separation should come up with a plan, she said.\r\n\r\nIt should be tailor-made to each individual couple, she said. Each couple should sit down and communicate clearly what their expectations are.\r\n\r\nIn her own sessions, Sherwood said similar issues come up with long-distance couples.\r\n\r\nShe said that couples typically face issues around trust, expectations and a lack of communication, among other issues.\r\n\r\nAccording to her, students make up a high amount of long-distance relationships due to summer separation.\r\n\r\nSherwood said student couples who live apart, but attend the same school, dont have the same issues to worry about.\r\n\r\nTheyre involved in all the nitty gritty of each others lives, she said. If theyre in daily contact, then I think they would move out of the honeymoon phase.\r\n\r\nSo how do long-distance couples keep an intimate relationship together?\r\n\r\nI think visiting as often as possible definitely would be number one, she said, adding that telephone and Skype contact should be done as often as possible.\r\n\r\nIts important to know, however, that one half of the couple will occasionally put other commitments, like work, school and family ahead of their significant other, Sherwood said.\r\n\r\nDont expect perfection during distance with each other, Sherwood said. Expectations can get too high; I think you need to keep a perspective that this isnt going to be perfect. 	There are few things as sweet as the airport reunion.	\N	t	f	Relationships, long-distance	t	2012-05-28 21:37:14-04	p	f	f
7761	Faculty Board proposes accelerated medical school 	Program would be first of its kind in North America	faculty-board-proposed-accelerated-medical-school	1	325	\N	If a proposed new program passes at Senate, select students could proceed to medical school at Queens after only two years of undergraduate education.\r\n\r\nThe proposal for the accelerated program was approved by Arts and Science Faculty Board on May 4.\r\n\r\nThe program is the brainchild of Dr. Richard Reznick, dean of Health Sciences and director of the Queens School of Medicine.\r\n\r\nOne of our strategic priorities in the School of Medicine is to explore innovative models of medical education, Reznick told the <em>Journal </em>via email.\r\n\r\nThe proposal must pass through Senate before it can become official.\r\n\r\nThe next Senate meeting will be held on Sept. 25.\r\n\r\nUnder the proposal, 10 gifted high school students will be selected to take part in the Accelerated Pathway to Medical School at Queens each year. The program, which is slated to begin in 2013, will enable them to complete the degree requirements for a Doctor of Medicine, including undergraduate education, in six years, instead of the traditional eight.\r\n\r\nA review of the education of physicians in many other countries, including most of Europe and many parts of Asia suggested that a shorter time frame might be feasible, Reznick said.\r\n\r\nQueens will be the first university in Canada to implement such a program, Physiology professor Ken Rose said. Rose was responsible for proposing the motion at Faculty Board. \r\n\r\nIm really enamored with the idea of being the first, Rose said.\r\n\r\nThe program could also allow students to proceed to medical school without taking the Medical College Admission Test (MCAT.)\r\n\r\nMedical colleagues are becoming increasingly concerned about the closing of the socioeconomic gap of those taking the MCAT, Rose said, adding that the test itself costs around $300 to 400, not including preparation courses.\r\n\r\nTo be considered for the program, students must be competitive candidates for the Chancellors scholarship, awarded to 50 new Queens students each year with an annual value of $9,000. Students must have an average of 90 per cent or above to be considered for the Chancellors Scholarship. High schools can nominate one to three students depending on the school.\r\n\r\nAround 50 to 60 students from the Chancellor scholarship candidate pool will be invited to Queens for an interview. Following the interview process, offers will be made to ten students.\r\n\r\nStudents will be required to take the standard five courses during the first two years, including 21.00 credits worth of mandatory classes, including BIOL 102, MATH 121, ENGL 100 and STATS 263.\r\n\r\nThe students will also be required to take part in laboratory and clinical internships and learning modules.\r\n\r\nThe program also involves using first and second year medical students as mentors as a way to immerse the 10 younger students in the School of Medicine.\r\n\r\nThe medical class at Queens is extremely cohesive and the ten other students have to be assimilated, Rose said.\r\n\r\nJames Simpson, Aesculapian Society representative to the AMS, said he believes the program holds numerous pros and cons for students.\r\n\r\nOne of the most important features of Queens Medicine is the camaraderie within our class, Simpson, Meds 15, said. It certainly is possible that bringing in a special group of students through a separate stream will damage this camaraderie to some extent.\r\n\r\nSimpson said its important to note that accelerated systems have been successful in Europe, where students get into slightly longer medical programs straight out of high school, and in Quebec, where students can apply to enter medical school after two years in a public vocational college.\r\n\r\nAs far as Im aware, there isnt any evidence showing that these doctors are any worse than the rest of North American doctors, despite the fact that North American doctors probably have two to three years more undergraduate training on average, Simpson said. If this is true, then isnt our system wasting money?	If a proposed new program passes at Senate, select students could proceed to medical school at Queens after only two years of undergraduate education.	\N	t	f	Academics, medical school, Senate, Faculty Board	f	2012-05-28 13:57:40-04	p	t	t
7767	Sports in Brief		sports-brief	7	325	\N	<strong>Hopeful Olympian falls short</strong>\r\n\r\nKingston native Isolda Penney saw her Olympic rowing dreams come to an end at the U.S. National team selection regatta on April 12.\r\n\r\nThe 37-year-old finished in third place in the womens single event with a time of 7:47; she finished behind Genevra Stone (7:32) and Lindsay Meyer (7:36).\r\n\r\nIf she won the time trial, Penney would have needed to place in the top three in Lucerne, Switzerland at the end of May to qualify for the Olympics.\r\n\r\nAfter seeing the Canadian national team cancel the single boat program, Penney used her dual-citizenship to try out for the U.S. roster. Given her age, the third-place finish will bring a premature end to Penneys comeback to rowing, which began in 2008 after 11 years away from the sport.\r\n\r\n<em> Lauri Kytmaa</em>\r\n\r\n<strong>Brittany Moore earns All-Star game award</strong>\r\n\r\nBrittany Moore was named OUA East player of the game at the OUA All-Star Game in Waterloo on April 28.\r\n\r\nThe 56 point guard from Hannon, Ont. recently completed her fifth and final year of eligibility for the Queens womens basketball team.\r\n\r\nIn her five years with the Gaels, Moore established herself one of the OUAs top performers. Moore finished fourth in points per game during her final three OUA seasons  third overall behind the Ottawa Gee Gees Hannah Sunley-Paisley and the Windsor Lancers Jessica Clemmencon.\r\n\r\nShe averaged 16.5 points per game in those three seasons, finishing with a career high 17.1 in her final year as a Gael.\r\n\r\n<em> Peter Morrow</em>\r\n\r\n<strong>Pegg, Underwood, Kelly to represent Queens at World University 7s Championships</strong>\r\n\r\nThe Gaels Clara Pegg of Barrie, Ont. joined the Canadian womens roster set to play in the 2012 World University Rugby Sevens in Brive, France.\r\n\r\nPegg joins a Canadian team with considerable success in past tournaments, winning the tournament in Beijing 2004 and in Rome 2006.\r\n\r\nPegg heads into her third OUA season with international experience, as an athlete eligible to receive future bursary funding from Rugby Ontario.\r\n\r\nVarsity mens rugby players Liam Underwood and Matt Kelly of Toronto, Ont. will be representing Canadas mens team at the tournament. Both athletes represented Canada in 2010 and 2011 with the under-20 team. \r\n\r\nHeading into their fourth years as Gaels, Underwood and Kelly have both received Rugby Ontario funding. The tournament will also be held in July in Brive, France.\r\n\r\n<em> Peter Morrow</em>	Sports in brief.	\N	t	f	Sports in brief	f	2012-05-28 15:35:59-04	p	f	f
7768	Running back commits	Three former teammates also joining Gaels	running-back-commits	7	325	\N	Running back Stephen Trivieri will join the Queens football team in 2012, returning to Canada after spending his senior year of high school in the U.S.\r\n\r\nTrivieri, a Toronto native, moved to Ashburn, Virginia for his final high school season, scoring 23 touchdowns in 12 games with the Stone Bridge Bulldogs.\r\n\r\nA former member of the Toronto Jr. Argonauts of the Canadian Junior Football League, Trivieri attended Lawrence Park Collegiate Institute and St. Michaels College School in Toronto before transferring to Stone Bridge.\r\n\r\nAfter entertaining scholarship offers from several NCAA Division II schools, Trivieri ultimately committed to the Gaels.\r\n\r\nThere are a lot of St. Mikes boys playing there now. After evaluating all my options, I decided that [Queens] was a good fit, he said.\r\n\r\nTrivieris powerful running style and willingness to fight for extra yards should allow him to compete for a feature spot within a talented Queens backfield.\r\n\r\nLike all incoming rookies, Trivieri will be confronted by the faster pace and increased physicality of university football. Unlike most recruits, he will also have to readjust to the technical differences of the Canadian game following his season in Virginia.\r\n\r\nI just want to come in, learn the system and work hard, Trivieri said. I plan on giving everything on the football field, and hopefully it works out.\r\n\r\nThree of Trivieris former teammates at St. Michaels College School are also part of the Gaels 2012 recruiting class:\r\n\r\n<strong>Max Townsend</strong>\r\n\r\nQuarterback Max Townsend was a two-time captain and team MVP at St. Michaels. A three-sport athlete in high school, Townsend was the top-rated quarterback at the 2011 Queens Elite Passing Camp.\r\n\r\nOriginally from Halifax, Townsend will enter the Commerce program at Queens. Townsend will compete for a backup spot behind incumbent starter Billy McPhee in his rookie season.\r\n\r\n<strong>Peter Boivin</strong>\r\n\r\nOffensive lineman Peter Boivin won the Outstanding Lineman Award in his final season at St. Michaels. A conference All-Star and a member of Team Ontario East at the 2011 Canada Cup, Boivin will join a loaded offensive line recruiting class for Queens in 2012.\r\n\r\nBoivin will follow in the footsteps of his uncle, Michael OShaughnessy, who suited up for the Gaels in the early 1970s.\r\n\r\n<strong>Josh Jordan</strong>\r\n\r\nDefensive back Josh Jordan played alongside Boivin for Team Ontario East at the 2011 Canada Cup. A two-sport athlete at St. Michaels, Jordan was team captain of the Toronto Jr. Argonauts, Trivieris former club team.\r\n\r\nA prospective engineering student, Jordan will fight for playing time as a rookie in a defensive backfield full of returning veterans.	Running back Stephen Trivieri will join the Queens football team in 2012, returning to Canada after spending his senior year of high school in the U.S.	\N	t	f		f	2012-05-28 15:38:28-04	p	f	f
7769	Aprile to the Blue Bombers	Gaels receiver drafted 16th overall	aprile-blue-bombers	7	325	\N	Just six years after playing his first football game, Gaels wide receiver Giovanni Aprile could be on his way to the pros. \r\n\r\nEarlier this month, the Winnipeg Blue Bombers selected Aprile with the 16th overall pick in the 3rd round of the 2012 CFL Draft.\r\n\r\nOriginally from Toronto, with only two years of high school football at Senator OConnor College School behind him, Aprile suited up for one game in his first two seasons at Queens.\r\n\r\nHe secured a starting role in 2010, and enjoyed a stellar 2011 campaign that saw him emerge as a premier offensive threat in the CIS.\r\n\r\nI didnt really care where I went [in the draft], said Aprile, who was ranked 12th in the CFLs pre-draft rankings. If I was drafted in the sixth round, that would have been sick.\r\n\r\nAprile was the lone Gael chosen in the draft. Running back Ryan Granberg, offensive lineman Derek Morris and defensive lineman Frank Pankewich all attended the CFL evaluation camp in early March, but were not among the 45 players selected.\r\n\r\nThe Blue Bombers, who are coming off a 34-23 loss in the 2011 Grey Cup, expressed interest in shifting Aprile from receiver to safety, a position he hasnt played since high school. At 63 and 213 pounds, Aprile is significantly bigger than any current Winnipeg defensive back.\r\n\r\n[The Bombers] are going to try me out at a few different places because theyre looking for a more versatile player, Aprile said.\r\n\r\nIn addition to starting at receiver, Aprile dominated on special teams in 2011 as the Gaels primary kick returner, leading the CIS with 36.5 yards per return and two touchdowns.\r\n\r\nAlthough Gaels head coach Pat Sheahan believes Apriles versatility will be a terrific asset at the professional level, his ability to adapt will depend on where the Bombers choose to deploy him on the field.\r\n\r\nI believe this is kind of where potential meets opportunity, Sheahan said. Are they going to use him at [receiver]? If they do, then hes got good grounding in that position, but if they like him as an athlete and want to use him somewhere else, then there will be a pretty steep learning curve.\r\n\r\nAprile will attend training camp with the Bombers, which runs from the end of May until the start of the regular season on June 29. Players drafted to the CFL do not forego their CIS eligibility, so Aprile could return to Queens in 2012 in lieu of signing a professional contract.\r\n\r\nI suppose Queens fans would not be disappointed to see him back for a little bit of a refresher. But he may impress and stay, you never know, Sheahan said.\r\n\r\n	Just six years after playing his first football game, Gaels wide receiver Giovanni Aprile could be on his way to the pros. \r\n	\N	t	f	Football, Aprile, Blue Bombers	f	2012-05-28 15:42:34-04	p	f	f
7771	From the field to the Bachelor	Brad Smith and other former Gaels in the public sphere	field-bachelor	7	325	\N	Former Gaels wide receiver Brad Smith may be a free agent in the CFL, but if he plays his cards right, he wont be a free agent on the love market for much longer.\r\n\r\nSmith has been chosen to star on the first season of The Bachelor Canada, which will air this fall on CityTV. Without a CFL team to play for in 2012, hell instead spend his spring surrounded by 25 eligible bachelorettes, passing out roses rather than receiving passes.\r\n\r\nThe executives of the show are aiming to attract viewers through Smiths combination of charm and athleticism.\r\n\r\nOne of the top Gaels wide receivers of all-time, Smith graduated from Queens in 2007 after earning two CIS All-Canadian honours during his university career.\r\n\r\nHe was drafted 44th overall by the Toronto Argonauts in the 2007 CFL Draft, later playing for the Montreal Alouettes and the Edmonton Eskimos.\r\n\r\nWhile Smiths career path is unconventional for a former CIS athlete, its not uncommon for Queens athletes to experience fame following their Gaels careers.\r\n\r\nInspired by Smith, here are four former Queens Gaels in the public eye:\r\n\r\n<strong>Mike Schad </strong>\r\n\r\nAn ex-Gael offensive lineman who enjoyed the football spotlight in the U.S. rather than in Canada. The big man from Belleville, Ont. is the only player in CIS history to be selected in the first round of the NFL draft. Schad was selected 23rd overall by the L.A. Rams in 1986, where he played from 1987-88. He was then traded to the Philadelphia Eagles, where he retired in 1993. Over his career, Schad played in 62 NFL games for the Rams and Eagles.\r\n\r\n<strong>Rod Smith </strong>\r\n\r\nThe TSN sportscaster played offensive guard for the Queens football team in the late 1970s. The anchor of the weeknight edition of SportsCentre, Smith joined the Gaels in 1979, a year after Queens clinched its second Vanier Cup championship. Smith joined TSN in 1987 and has been a mainstay on SportsCentre since 1995, previously serving as a play-by-play announcer for the CFL on TSN and several CIS championship games.\r\n\r\n<strong>Jock Climie</strong>\r\n\r\nThe CFL on TSN studio analyst starred as a receiver for Queens in the late 1980s. In 1988, Climie set the CIS single-season record for receiving yards with 1,091. A member of the Queens Football Hall of Fame, Climie played 12 seasons in the CFL, earning his law degree from Queens over the course of six winter semesters and off-seasons. A practicing lawyer, Climie joined TSN as a football analyst following his retirement in 2001.\r\n\r\n<strong>Kate McKenna</strong>\r\n\r\nFormer Queens goalkeeper currently works for the CFL as an online host and content producer. McKenna played for the Gaels womens soccer team and graudated from Queens Concurrent Education program in 2008. She has previously worked for TSN, CBC Sports and the Hamilton Spectator. and served as the host of Ticats TV for the Hamilton Tiger-Cats during the 2010 CFL season.\r\n\r\n<em> Nick Faris and Peter Morrow</em>	Former Gaels wide receiver Brad Smith has been chosen to star on the first season of The Bachelor Canada. While Smiths career path is unconventional for a former CIS athlete, its not uncommon for Queens athletes to experience fame following their Gaels careers.\r\n	\N	t	f	Famous Gaels	f	2012-05-28 15:49:10-04	p	f	f
7774	More than money		more-money	13	325	\N	When fourth-year hit, I found some of my most intelligent and capable friends expressing increasing uncertainty about their futures. As the end of exams approached, they doubted whether their decision to write essays and read novels for four years as ArtSci 12s was indeed a sound one.\r\n\r\nWere bombarded with statistics about high unemployment rates for new graduates, especially for those equipped with Arts degrees, explaining my friends fears.\r\n\r\nAs recent articles in Macleans and Canadian Business magazines announced, the best jobs are to be found in the oil fields of Alberta. This is because, according to Canadian Business magazine, employment for oil engineers has increased by 85 per cent between 2006 and 2011, with some of the highest starting salaries in the country.\r\n\r\nWith students graduating with large debts and limited job prospects, guaranteed employment and large salaries are undeniably very attractive.\r\n\r\nBut can a good job really be defined solely by money and guarantee of work?\r\n\r\nId like to borrow an idea from David Ricardo's concept of comparative advantage, a theory that outlines how an economy should specialize in what they can produce most efficiently and cheaply.  Its an idea thats meant to increase productivity in an economy  an idea that should also be transferred to how young people pick careers and university degrees.\r\n\r\nThe reason I didnt pursue a degree in engineering was because Im no good with math, chemistry or physics and quite frankly, I have very little interest in the field. Even if I were to become an oil engineer, I probably wouldnt make a very good one and I certainly wouldnt enjoy going to work every day.\r\n\r\nPeople should be working in jobs that they have a comparative advantage in, meaning jobs that they are both good at and that they enjoy.\r\n\r\nTheres no way to define what the best job is, but, there is such a thing as the best job for you. Ultimately, people shouldnt sacrifice their talents and sanity for the sake of financial security.\r\n\r\nWhile this idea may seem idealistic, especially with the current economic climate, I still believe that people should find their economic niche in which they can capitalize on their talents, and thus, maximize what they give back to society.\r\n\r\n<strong>This editorial has been updated to reflect the following clarification: David Ricardo theorized the concept of comparative advantage. </strong>	Theres no way to define what the best job is, but, there is such a thing as the best job for you. Ultimately, people shouldnt sacrifice their talents and sanity for the sake of financial security.\r\n	\N	t	t	Signed editorial 	f	2012-05-28 16:32:14-04	p	t	t
7777	Sweet Jets take off 	Queen's garage pop trio releases first EP 'Noise Candy' 	sweet-jets-take	3	325	\N	When Kingstons Sweet Jets started out playing house parties, they had no idea they would be recording an EP just a year later.\r\n\r\nGuitarist and vocalist Colin Robinson, bassist James Gagne and drummer Paul Dyck released Noise Candy on April 1.\r\n\r\nAlthough theyve only been together for a short time, Dyck, ArtSci 13, recalls their misfortune while playing in a restaurant in Toronto, which had just been on the show <em>Restaurant Makeover</em>.\r\n\r\nA pipe exploded on the floor above us midway through our set and the ceiling just started dripping serious amounts of water all over the bar  it was pretty epic.\r\n\r\nThe band recorded the EP this spring in their friends basement.\r\n\r\nThey decided to make their album available online for free download.\r\n\r\nRight now were just trying to get exposure  wed rather have people download it now than have people not listen to it because they didnt have the money to pay.\r\n\r\nThe band originally started playing with only Paul on drums and Colin on guitar in January 2011, later adding bassist James in October.\r\n\r\nJames can lay down the groove with the bass and drive the song instead of just relying on fast guitar hooks, Dyck said.\r\n\r\nThe EP contains all original songs written by the band.\r\n\r\nOne of our most popular songs is Wish I. It was the dark horse of the album. We didnt think people would like it as much as they do. \r\n\r\nSweet Jets have played several shows at the Mansion and Clark Hall Pub in the past and have come a long way since their early days.\r\n\r\nWe played in my basement for a bit, and then we moved into James basement. Now weve moved up to the main floor in Colins house. This is actually a big step up, Dyck said.\r\n\r\nWhile the group is in the midst of balancing band activities with personal pursuits, they show no signs of slowing down.\r\n\r\nWere looking to record an A side/B side, duo release, just two songs, hopefully this month, and then work on new stuff for the rest of the summer, Dyck said.\r\n\r\n<em> With files from Savoula Stylianou</em>\r\n\r\n<strong>Sweet Jets debut EP is available for free download at sweetjets.bandcamp.com.</strong>\r\n\r\n	When Kingstons Sweet Jets started out playing house parties, they had no idea they would be recording an EP just a year later.	\N	t	f	Interview, Sweet Jets 	f	2012-05-28 16:55:14-04	p	t	t
