189	195	Letter of Apology	The purpose of this letter is to clarify the Journals position regarding the dart given on the editorials page of the Apr, 2 edition of the Journal to Stephanie St. Clair for her conduct at the John Orr dinner.  I would first like to apologize for perpetuating false accusations against Ms. St. Clair.  I had no proof she threw a glass of wine at an alumnus and printed the misinformation based on hearsay.  It was unacceptable and goes against this newspapers ongoing commitment to strong and accurate reporting.  For this I am truly sorry.<br>\r\nThe Journal stands by its criticism of Ms. St. Clairs behaviour at that event in dealing with a conflict between an alumni and a fellow AMS representative.  She acted unprofessionally and her conduct led to her being asked to leave the event.  This was a poor manner in which to represent Queens students.\r\n \r\nErin Flegg\r\nEditor in Chief, Vol. 136	85
